(1, 1, 1, 'Soundcore Select 4 Go Bluetooth Shower Speaker by Anker, IP67 Waterproof/Dustproof, Portable Speaker, Wireless, 20H Playtime, Floatable, Powerful Sound, Electronics for Outdoors/Home/Office/Travel', 'The video showcases the product in use.The video guides you through product setup.The video compares multiple products.The video shows the product being unpacked.   soundcore Select 4 Go $24.99 Price $79.99 Punchy Sound & Bass Sound Hi-Res Stereo Sound 5W Output Power 30W IP67 Water Resistance IPX7 20 Hours Playtime 13 Hours 265 g Weight 776 g 121 � 83 � 48.5 mm Dimensions 200 � 93 � 53 mm $24.99 Price $39.99 Punchy Sound & Bass Sound Punchy Sound & Bass 5W Output Power 20W IP67 Water Resistance IPX7 20 Hours Playtime 16 Hours 265 g Weight 559.5 g 121 � 83 � 48.5 mm Dimensions 184 � 63 � 53 mm  Motion 300 soundcore Select 2S  Learn More Learn More', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/61R16ML7VlL._AC_SL1084_.jpg', '[\"https://m.media-amazon.com/images/I/61R16ML7VlL._AC_SL1084_.jpg\",\"https://m.media-amazon.com/images/I/61c7p+-OMWL._AC_SL1125_.jpg\",\"https://m.media-amazon.com/images/I/51g1NNkrzJL._AC_SL1125_.jpg\",\"https://m.media-amazon.com/images/I/710ic6oG16L._AC_SL1125_.jpg\",\"https://m.media-amazon.com/images/I/61qFNO45KzL._AC_SL1125_.jpg\",\"https://m.media-amazon.com/images/I/61dv4Z0ooqL._AC_SL1125_.jpg\"]', '{"brand": "Soundcore", "category": "Electronics", "dimensions": "3.23\\\"D x 4.72\\\"W x 1.89\\\"H"}', '[\"IP67 Protection and Floats Waterproof speaker designed to withstand harsh outdoor conditions and can even float. The Speaker can even be immersed in up to 3.3 ft deep for 30 minutes, making it ideal for a variety of activities. Whether you\'re enjoying a shower, camping in the wilderness, having a beach picnic, or sailing on a lake, this speaker ensures your favorite tunes are always with you.\",\"20-Hour Playback Enjoy up to 20 hours of non-stop music on a single charge with this portable Bluetooth speaker, perfect for showers, extended outdoor adventures, all-day gatherings, hiking through the mountains, or lounging by the pool.\",\"Outdoor-Ready and Portable The lightweight design and included strap make this mini speaker portable enough to carry anywhere, whether you\'re showering, camping, hiking, or biking.\",\"Supports Wireless Stereo Pairing Enable True Wireless Stereo (TWS) pairing to wirelessly connect two speakers for richer, more immersive sound with stereo separation. To enable TWS pairing, connect one speaker to your smartphone, then press and hold the Bluetooth button on both speakers for 2 seconds.\",\"Surprisingly Punchy Sound Despite its compact size, this portable speaker delivers powerful and punchy sound with 5W output, ensuring clear and dynamic audio performance.\"]'),
(2, 2, 2, 'Vaydeer Metal Pen Holder Aluminum Pencil Holder for desk, Round Desktop Organizer and Black Pencil Cup for Office, School, Home and Stationary Supplies (3.15 x 3.15 x 3.94 Inches)', 'About this item Essential for Back-to-School Desk Organization: As the new semester approaches, organizing your study space has never been more important. The Vaydeer Pen Holder, with its modern and minimalist design, not only helps keep your desk tidy but also inspires learning and creativity. This pen holder is perfect for storing various study tools such as pens, scissors, and markers, making it an ideal desk organizer for students and teachers. Choose the Vaydeer Pen Holder to keep your study area orderly and embrace a school year full of challenges and opportunities. HIGH QUALITY METAL: Made of high quality metal and through hard oxidation, the net weight of VAYDEER aluminum pen holder is 0.42lb, sturdy and durable. Unlike other plastic/acrylic pencil cups on the current market, our metal pencil holder is not easy to break, and has a longer lifespan to use. No worries about anything, if you got any problems about the product, we promised to offer a 3-YEAR WARRANTY for every customers. LARGER CAPACITY DESKTOP ORGANIZER: The product dimension is 3.15 x 3.15 x 3.94 Inches, and the capacity is 0.55L. Furthermore, this metal desktop organizer is able to store more than 20 pencils at once. So there is large enough space to put a lot of office stationery, especially little things on your desktop. We no longer have to worry about the lack of space and the messy desktop! SLEEK & MODERN APPERRANCE: Designed with metal frosting skill and perfect polishing craftsmanship, our black pen holder looks completely sleek and cool. And thanks to the exquisite workmanship, the surface of this aluminum pencil holder is very smooth and silky. When you touch it, you would feel like touching a premium texture. NON-SLIP SILICONE BASE: The base of our metal pen holder is made with non-slip silicon