(5, 2, 5, 'STABILO Fineliner point 88 MINI - Wallet of 12 - Assorted Colors', 'Short and sweet, this pocket size version of the popular Point 88 pen is a perfect pen for writing, drawing and sketching on the go. This miniature version of STABILO\'s well-known fineliner features the same smudge-proof, brilliant ink and long-lasting color in a more compact pen.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/91hUqLtVVaL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/91hUqLtVVaL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/51rqmmXvx6L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/510ZG7nkgpL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/51L9LQTrr+L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/51gI3sCosTL._AC_.jpg\",\"https://m.media-amazon.com/images/I/51HoAfCygSL._AC_.jpg\",\"https://m.media-amazon.com/images/I/51C4l4sJdYL._AC_.jpg\",\"https://m.media-amazon.com/images/I/61mh5SMB8IL._AC_SL1500_.jpg\"]', '{"brand": "STABILO", "category": "Office Products", "dimensions": "4.9 x 4.45 x 0.6 inches"}', '[\"Mini version of STABILO fineliner\",\"Water-based ink in vibrant colors\",\"Metal encased tip is suitable for rulers and stencils\",\"Hexagon shape for no-roll confidence\",\"Dries quickly and non-smudging - ideal for left-handers\"]'),
(6, 2, 6, 'MUNBYN White Cash Drawer, 16\" Heavy Duty Cash Register for Point of Sale (POS) System, 5 Bill/5 Coin, Removable Coin Tray, RJ11/RJ12 Interface 2 Key-Lock, Works for Square Business, Money Drawer', 'Specification Parameter Length: 16.53\" = 42cm Width: 15.74\" = 40cm Height: 3.93\" = 10cm weight: 11.5 pounds = 5.2 kg Worry about missing your keys? Make copies at your local hardware store or key store after receiving the cash drawer, which would be much more convenient and cost less. 16\" Automatic POS Cash Drawer Keep your earnings secure in MUNBYN Heavy Duty Secure Lockable White Metal Cash Register Drawer! RJ11 Interfaces When your money box is connected to the POS machine with RJ11 Interface, you don\'t need a key to open the lock. The computer can control the money box to open automatically.High compatibility and convenience operationDrawer interface: Standard RJ11 connection 3 Main Advantages of this Cash Drawer 1. Two Ways to Open the Cash Drawer When the money box is hooked up to the receipt printer, the machine can control the money box to open automatically and then close manually.When the power is turned off, use the key to open the lock and push the drawer of the money box with your hand. 2. Stainless Steel Clip The heavy-duty clip ensures longer serving time, convenient to take out / put in cash (2 keys included)5 bill slots with wire metal grippers and 5 coin slots, the coin tray is removable 3. Lock Positions Manual open which means turning the key to this position will open the drawer.The electronically online position means the drawer is controlled by the printer.Locked open/closed means the drawer can�t be opened/closed without a key.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/61ilLw3PfML._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/61ilLw3PfML._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/719bvHRhxUL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61y+L0QFWkL._AC_SL1000_.jpg\",\"https://m.media-amazon.com/images/I/61G1Ykw+h0L._AC_SL1000_.jpg\",\"https://m.media-amazon.com/images/I/51OC8bzsz2L._AC_SL1000_.jpg\",\"https://m.media-amazon.com/images/I/718yC6eCLPL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61k8tVkcRBL._AC_SL1000_.jpg\",\"https://m.media-amazon.com/images/I/41XSy7nEkGL._AC_SL1500_.jpg\"]', '{"brand": "MUNBYN", "category": "Office Products", "dimensions": "19.49\\\"D x 18.7\\\"W x 6.69\\\"H"}', '[\"[Specification] Dimensions?16.53\" x 15.74\" x 3.93\". Weight 11.46 lbs. Currency USD. Steel Stainless & Heavy duty. Trays 5 bills trays, 5 coins trays(2 of them can be used as larger miscellaneous trays).\",\"[Modern] Cash drawer, with a modern appearance and commercial level design, has maximized its inner space to make it more suitable for markets, retail stores, coffee houses, and some other commercial settings.\",\"[Reliable Security] Cash register drawer, with 2 key-lock designs, can be online & manual opened. This reliable-quality money drawer will always protect your cash.\",\"[Easy to Use] 1.You can slip checks or notes through the front panel slot without opening the drawer. 2.When the money drawer is connected to the POS terminal, it can be open through the POS terminal. And when it doesn\'t, you can manual open the cash drawer with its key.\",\"[Professional] The cash drawer is made of strong stainless steel. It is stable and not easily damaged. Not a push-on drawer.\"]'),
