(19, 3, 19, 'SABANI Portable Charger 35000mAh Power Bank - Portable Battery with 4 Built in Cables, 22.5W Fast Charging Battery Pack Compatible with iPhone 16 15 14 13 Samsung Android Phone etc (1 Pack, Black)', 'SABANI Portable Charger 35000mAh Power Bank with 4 Built-in Cables 35000mAh Huge Capacity + 4 Built in Cables + 6 outputs and 2 inputs + Fast and Efficient Charging + Accurate Percentage of Remaining Juice! Everything Built-in, No Need to Carry Extra Cords!   Widely compatible with iPhone16 15 14 13 12 11 8 7 Series, XR, XS Max, Samsung S23 S22, S21, S20, A52, A32, Z fold series, Z flip series, and Google Pixel series, OnePlus series, Realme series, Oppo series, Xiaomi, Redmi, Vivo, LG, and other android USB C or Micro USB phones, tablets, etc... Charge Your Phone up to 50% in 30 Mins With the upgraded 22.5W output plus the latest PD 3.0 fast-charge technology, your phone can be charged at 50% in just 30 minutes. Built-in 4 cables, 2 USB A ports and 1 USB C port for charging up to 6 devices simultaneously. (USB-A built-in cable is for recharging itself only.) Built-in Multiple Cables and Ports Warm Tips: 1.When using it for the first time, please recharge the power bank to full uninterruptedly after the remaining power is depleted to reactivate the display. 2.Please clean the built-in cable\'s tip regularly to prevent bad contact due to stains or oxidation reactions. USB C in & Out Power Bank Please notice: The input port and input USB-A built-in cable may not be used at the same time. The USB-A built-in cable has no output function. Portable Charger for Multiple Devices Warm Tips: If the low-current device (earbuds, smartwatches, etc.) is about to be fully charged (the power is above 85%), its input current will become 30-40mA, while the output current of the power bank is at least 60mA, so the power bank will automatically power off. Travel Essentials Using the new high-density polymer battery, it has a larger capacity under the same volume. Let you get rid of the anxiety about the battery level of your mobile device anytime, anywhere!   Whats in the box? 1*Power Bank with Built-in Cables; 1*Type C Charging Cable (for charging power bank); 1* User Manual', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/71RX2h6DJlL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/71RX2h6DJlL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/618QSeI85kL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71Sgco-rlDL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71cdr9HF-8L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71cCQ0dTd9L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61IxPieO8WL._AC_SL1500_.jpg\"]', '{"brand": "SABANI", "category": "Cell Phones & Accessories", "dimensions": "5.95 x 2.87 x 0.79 inches"}', '[\"Widely Compatibility Power Bank with Built-in Cables N6 USB C portable charger has 4 built-in cables (iOS, Type C, USB A, Micro) and 3 Charging ports (USB A 1/2, Type C), compatible with almost all types smart devices on market such as iPhone 16 15 14 13 12 11 Series, XR, XS Max, Samsung S24, S23, S22, S21, S20, A52, A32, Z fold series, Z flip series, and Google Pixel series, and other Android phones, iPad, tablets, etc...\",\"All in One Portable Charger Portable powerbank has 6 outputs and 2 inputs, you may charge 6 devices max at the same time and recharge battery pack easily with 2 options (USB A cable, USB C port), which is great for multi electronic devices users. The Upgrade USB C interface serves as both input and output, perfectly fit your new iPhone, iPad and all upcoming USB C devices. No longer need to carry a variety of cables on the road, say goodbye to the trouble of messy charging cables!\",\"35,000mAh Huge Capacity with Remarkable Compact Design Must the high-capacity charger be big and heavy? No, N6 subverts your imagination! Using the new high-density polymer battery, it has a larger capacity under the same volume. Our 35000mAh portable battery is 151*73*20mm (5.95*2.87*0.79in), and weighs 335g (11.8oz), close to the size of the iPhone 15. The super compact and portable design allows you to easily place it in your backpack, handbag, or pocket. Ideal for those who need quick and reliable charging on- the-go.\",\"3X Faster 22.5W PD Fast Charging Output The N6 portable battery supports 22.5W PD fast charging, allowing your iPhone 15 to fully charge 50% in 30 minutes, nearly 3x faster than other traditional chargers, greatly reducing your charging time. Minimalist and elegant LED digital screen displays the battery power even accurately to 1%. Provide you with stable and reliable charging service anytime and anywhere, never have to worry about your phone dying again!\",\"Safe and Reliable Battery Pack SABANI portable battery has 10 layers of multiple system protection, built-in low-temperature IC ice core, intelligent monitoring of voltage and current, actively avoid over-charge, over-discharge, short circuit, high temperature and a series of potential dangers, creating a safe charging environment for you. What You Get 1*35000mAh Portable Charger with 4 built-in Cables and 3 Ports, 1*USB C Cable for Recharging Portable Charger, 1*User Manual.\"]'),
