(32, 2, 31, 'ChicWrap Professional Grade Plastic Wrap Extra Large Refill Roll - 12 Inch X 750 Feet - For Shiplap Dispenser Only - BPA Free and Kosher Certified - Reduces Waste & Saves Money', 'The Allen Reed Company has been immersed in the world of Plastic wrap for more than 23 years. We have always dreamed of taking our institutional knowledge and building better products for the consumer housewares market. The Allen Reed Company has already left its innovative stamp on the housewares market with the introduction of ChicWrap, The Plastic Wrap & Dispenser, in 2013. The Company has introduced two exciting new line extension products, ChicWrap Foil and ChicWrap Parchment. We believe there is tremendous opportunity to redesign everyday products for the home that significantly improve on their functionality while making a dramatic visual statement with the packaging. The Company has several other innovative consumer products that will be launched in the near future. In 1994, the Allen Reed Company invented the first-ever safe metal cutting blade for commercial Plastic wrap boxes. Each year, the Company sells more than 10 million these patented cutting blades to the largest Plastic wrap manufacturers in the US. In addition to the Company\'s patented metal cutting blade business, the Allen Reed Company also invented and won patents in the US, Canada and Australia for the ZipSafe Slide Cutter, once again changing the way the food service industry cuts Plastic wrap. ZipSafe provided users with complete safety and ease of use when cutting Plastic wrap. ZipSafe quickly became a \"must have\" product for professional chefs worldwide. Using our ZipSafe Slide Cutter along with our extensive knowledge and experience in the world of Plastic wrap, we created ChicWrap. We used the finest, most durable materials available to create a very easy-to-use dispenser with unique and appealing packaging graphics that have broad consumer appeal. ChicWrap has become a very recognized and widely accepted brand that not only represents high quality, but unmatched functionality. Consumers have expressed amazement at how quick and easy it is to cut a piece of Plastic wrap to wrap food or cover a bowl. Shiplap Plastic Wrap Our over-sized 12 \" x 750� Professional Grade Plastic Wrap for use in the �Shiplap \" and Big Chef Dispensers is used by professional chefs in commercial kitchens everywhere. Our Professional Grade Plastic Wrap is FDA approved, BPA free, Kosher and Halal certified, and microwave safe. Height: 3.00Width: 12.00Depth: 3.00 *Designed for use with Shiplap Plastic Wrap Dispenser Only', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/61rJ4YyD90L._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/61rJ4YyD90L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71AdYCGnIfL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61PuF00jblL._AC_SL1280_.jpg\",\"https://m.media-amazon.com/images/I/612fmcMSDTL._AC_SL1500_.jpg\"]', '{"brand": "ChicWrap", "category": "Office Products", "dimensions": "9000\\\"L x 12\\\"W"}', '[\"Professional Grade Plastic Wrap Includes one roll of ChicWrap Professional Plastic Wrap, measuring 12 inches by 750 feet. This refill roll offers superior cling, stretch, and strength, making it a favorite among gourmet chefs in commercial kitchens.\",\"Creates an Airtight Seal ChicWrap plastic wrap creates an airtight seal, locking in freshness and flavor while eliminating food odors in your refrigerator. Ideal for maintaining the quality and taste of your stored food.\",\"BPA-Free and Our plastic wrap is BPA-free, , and kosher-certified, ensuring it is safe for all your food storage needs. Enjoy peace of mind with this high-quality, professional-grade wrap.\",\"Compatible with Shiplap Dispenser Designed for use with the 12\" ChicWrap Shiplap Dispenser (sold separately), this refill roll ensures seamless integration and continued use of your favorite dispensing system.\",\"Reduces Waste and Saves Money Using ChicWrap professional plastic wrap helps reduce waste and save money. The 750-foot roll provides ample wrap for multiple uses, making it an economical choice for both home and professional kitchens.\"]'),
