(39, 2, 38, 'Magnetic Board for Wall for Magnets, Refrigerator, Cubicle, Cabinet. 17.7\" x 11.8\" Magnetic Bulletin Board for Displaying Notes, Photos, Poetry, Magnetic Letters Numbers Animal, Spice Jars (White)', 'The video showcases the product in use.The video guides you through product setup.The video compares multiple products.The video shows the product being unpacked.   1 Desk Wall 2 Bedroom 3 Bathroom 4 Kitchen tools 5 Magnetic Spice Tins   1 Magnetic U.S. Map 2 Magnetic Poetry 3 Magnetic Lettrs 4 Educational 5 Magnetic arithmetic The magnetic bulletin board only has 4 mounting holes, why is it equipped with 5 wall-hanging stickers and screws? To prevent damage during transportation or installation, we have prepared one extra wall-hanging stickers and one spare screw for you. Is the handwriting easy to erase? Sure,Its easy to erase,you only need to understand longterm writing can be erased with wet tissue or wet cloth,shorterm writing can be erased with soft wipe rag. Is the surface prone to scratches? The surface of the metal plate is specially treated. Anti-scratch, anti-rust, anti-deformation. How sticky is the self-adhesive? We have prepared 5 super sticky Wall-hanging stickers, support up to 20 lbs on smooth surfaces, That can meet your needs. Will it be too small and heavy for wall mounting? No, it won\'t be. Our dimensions are: 17.7 x 11.8 x 0.31 inches. Weight is approximately: 30 ounces.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/71dfDcXSaxL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/71dfDcXSaxL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81tdT3oF49L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81wjVWurVYL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71-dL2JaxjL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81o5G089F8L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81jNhBtT2QL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61+Dluh1hEL._AC_SL1500_.jpg\"]', '{"brand": "POPLOPP", "category": "Office Products", "dimensions": "17.5 x 11.8 x 0.2 inches"}', '[\"?Metal Sheet for Magnets? The magnetic board itself does not have any magnetism, but use this magnetic metal board to display anything magnetic - keepsake magnets, magnetic spice jars, magnetic alphabet animals and more.\",\"?Save 50% of space and plan your life easily?Once your magnetic board is installed, use it to get organized. Great for hanging calendars, sticky notes, reminders, and whatever you may need to help keep things in order.\",\"?Premium & Durable Material? Our magnetic board is constructed of heavy-duty steel and features a powder coat and gloss finish. It is resistant to scratches, chips, deformation and rust. The decorative magnetic wall board makes a great alternative to heavy and clunky cork bulletin boards!\",\"?Strong Adhesive & Easy to install? The metal magnet bulletin board is equipped with 5 hooks heavy duty (support up to 20 Lb) and 5 screws for vertical or horizontal installation. If you choose to hang magnetic containers to store items, we recommend drilling holes, while for a stylish display, you can opt for adhesive hooks.\",\"?Perfect for Any Space? The magnetic memo board is sure to make a great addition to your office cubicle, home, dorm room, kitchen, laundry room, or classroom; great for parents, teachers, and students to organize notes and to-do lists.\"]'),
(40, 2, 39, 'Saunders Metal Clipboard with Storage, Letter Size Heavy Duty Contractor Grade Clipboard, Dual Storage Form Holder with High Capacity Clip Made in USA', 'Declutter your desk at office or home with the help of high quality Saunders Aluminum Cruiser-Mate Storage Clipboard. The durable quality of paper board comes from recycled aluminum material. Use of 60% post-consumer waste in the manufacturing of this clipboard offers longevity without wastage. This storage clipboard comes with dual storage trays that help in sorting the important documents for the entire day. The compact storage tray provides ample of space for keeping the stationary at one place. Two storage compartments offer a total of 1\" capacity, upper storage tray holds 7/16\" capacity and the strong clip holds 1\" of paper with ease. Stationary clipboard provides smooth surface for easy scribbling. Aluminum clipboard is ideal for use in�industrial, transportation, medical, public safety, and government office professionals.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/71b1Ld9AG0L._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/71b1Ld9AG0L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61HRUy8v2vL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/615JcxRvTbL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61R+c5LrzBL._AC_SL1500_.jpg\"]', '{"brand": "Saunders", "category": "Office Products", "dimensions": "3.25 x 10 x 14.75 inches"}', '[\"High capacity steel clip with self-locking latch and credit card/ID holder can securely hold up to 150 sheets of 20lb paper; stay organized so you can get work done\",\"Top-open dual tray design with 1. 5\" internal storage capacity; light-weight aluminum base provides a sturdy writing surface while on the go or away from a desk\",\"Storage compartment keeps sensitive information protected from prying eyes; use this clipboard to compliment your HIPAA privacy program\",\"Made from 89% recycled aluminum with a minimum of 30% post-consumer recycled content; assembled in America from domestic and globally sourced components\",\"Clipboard measures 14 in. x 9 in. x 2. 75 in. (L x W x H) when laid flat on table; can fit documents and forms up to 8. 5 x 11 inches in size\"]'),
(41, 7, 40, 'Quick Dam - QD1224-6 Water Activated Flood Bags 1ft x 2ft, 6-Pack', 'Product Description Quick Dam Flood BagsWater Activated Flood Bags absorb, control, & divert flood waterProduct DescriptionProtect your home or property in times of flooding with Quick Dam sandless sandbags. They are ready to use. Just lie in place and let the water do the rest. Quick Dams expand and activate on contact with water. Growing in size to absorb, contain and divert problem water. Light weight and easy to use. Place in the path of problem water and prevent the water from entering your property. Stack multiple bags to increase wall height. Keep on hand for emergency situations.Protect Against:Storm surges & water main breaksOverflowing appliances & equipmentLeaking equipment & water tanksBroken sprinkler headsA/C condensation overflowSpills, leaks, floods, drips & moreFlood Bags:Water Activated Flood Bags (Sandless Sandbags) - Just get them wetFlood Bags grow to 12in x 24in x 3.5in highNo need for sand or labor, filling sandbagsAbsorbs 4 gallons of water & grows to full size of 3.5in high in 10 minutesSwelled bags contain, control, & divert flood waterStack multiple bags in brick formation to increase wall heightHow to UsePlace the Bags in the path of oncoming flood water.As they come in contact with water, it will absorb through material & start to swell.Bags reach their full height of 3.5in in 10 mins if enough water is present.If a rush of water is expected or you need to stack them, pre-soaking them is recommended.Not for use with Salt water.Note: For a solid base, bags should be stacked in a 1:3 ratio. For every 1ft of height needed, extend the base by 3ftTips & TricksDuring first activation, we recommend checking on them to make sure they are directing water as desired. Adjustments may be necessary as landscaping can alter water flow.Bags & Barriers should be stacked higher than water level for stability and to prevent them from floating away.Barriers are flexible and can be curved or wrapped.Barriers have a dual chamber, place wider edge towards water & smaller wedge away from water to prevent rolling out of position.Pre-Soaking is recommended prior to stacking or if heavy rain or water flow is expected.Staining may occur in instances where the surface is porous or unfinished cement is present. Remove from area when no longer needed.Porous surfaces like unfinished cement cause excessive seepage, since they are both trying to absorb water. Plastic barrier film in between, may help.For use in the winter/snow months, make sure they are fully activated before freezing temperatures occur to assure maximum protection when the snow is melting. We do not recommend moving them while frozen to prevent any tearing of the outer material. Also, salt on the roads should not come in contact with Quick Dams. To help, pre-activate Quick Dams with water & then wrap plastic under & over the top to prevent the salt from making contact.Do NOT use around salt water, lime or calcium. These will cause the inner absorbent to release the water & deflate the product making it useless.Flood Bags & Barriers will not fully activate unless enough water is present.Once activated by water they can be used as a barrier against other oils & chemicals.Leave in place for 3-6 months of ongoing protection. Shrinking will occur as they dry out, but they will swell again once re-exposed to water.Length of time to dry out varies on climate. Average is about 3 months as higher humidity levels tend to take longer.Once completely dry, they will feel crunchy and ready for reactivation. Smooth the contents to evenly distribute the super absorbent polymers.Direct sunlight causes the product to degrade at a rapid pace, which will result in the product feeling slimy.Do NOT cut. The inner contents will be exposed and will make the product unusable. Storage & Shelf LifeBags unused, have a 5+ year shelf life.Store in sealed bag for maximum term.Keep on hand for immediate deployment.How to DisposeThrow away in trash.Quick Dams are safe: Pet friendlyNon-toxicEnvironmentally SafeOptional- great soil additive to help retain moisture- cut open & spread/ blend contents on lawn or garden (NOTE- will be VERY slippery until it degrades & disappears) From the Manufacturer Protect your home or property in times of flooding with quick dam sand less sandbags. They are ready to use. Just lie in place and let the water do the rest. Quick dams expand and activate on contact with water. Growing in size to absorb, contain and divert problem water. Light weight and easy to use. Place in the path of problem water and prevent the water from entering your property. Stack multiple bags to increase wall height. Keep on hand for emergency situations.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/716Xaftjh1L._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/716Xaftjh1L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71n+IwjH3EL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61I3mg7o9vL._AC_SL1200_.jpg\",\"https://m.media-amazon.com/images/I/614r+hor18L._AC_SL1000_.jpg\",\"https://m.media-amazon.com/images/I/719JgdKJ75L._AC_SL1200_.jpg\",\"https://m.media-amazon.com/images/I/61IoaCbMPdL._AC_SL1200_.jpg\",\"https://m.media-amazon.com/images/I/91Y+XRbE1SL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71397wDrtnL._AC_SL1000_.jpg\",\"https://m.media-amazon.com/images/I/51FaXVTNkEL._AC_SL1000_.jpg\",\"https://m.media-amazon.com/images/I/41RMSBhie1L._AC_SL1000_.jpg\"]', '{"brand": "Quick Dam", "category": "Tools & Home Improvement", "dimensions": "8 x 4 x 8 inches"}', '[\"Water Activated Flood Bags, Rated #1 in Flood Control\",\"Grows to 3.5in high in minutes, just get them wet\",\"Use to control, contain & divert flood water\",\"Ready to use, no sand or labor needed\",\"Compact & Lightweight, stores away until needed\",\"Use to protect doorways, garages, erosion control & more\",\"Use indoors or out\",\"Be Prepared & Be Protected- Keep Quick Dams on hand\",\"Units grow to 12in width x 24in long x 3.5in tall\",\"Do NOT use with salt water, chemical reaction causes deflation\"]'),
