 to almost any surface. It can be written with ballpoint pen.\",\"Easy to Use You can use scissors to cut the length at will. Concise and lightweight, easy to carry. The transparent design allows you to see the texts under the tape. Help you mark highlights when reading, studying and working. Enjoy safe and simple use at home, work, or school.\",\"Wide Application The highlighter tape can be used for different purposes including home decoration, DIY crafts, gift wrapping, scrapbooking, planners, cards, postcards, envelopes, calendars, stationery decoration, computer and so much more. Cute and beautiful tapes for teens, girls, women.\"]'),
