d optimized for Dolby Atmos head tracking for an enhanced listening experience.\",\"FHD Display & Touch Controls Enjoy effortless operation with an intuitive FHD Display for Dolby Sound Effects, EQ settings and etc. Keep your open ear earbuds sanitized with UV sterilization that activates when the smart case lid is closed, ensuring your open earbuds are clean and ready for use.\",\"Auto Volume Controlled Open Ear Earbuds Automatically adjusts audio based on your surroundings for consistent listening, delivers crystal-clear voice for calls, and enables hands-free operation with head gesture commands.\",\"IPX7 Waterproof & Durable Built to endure intense workouts and outdoor adventures, these open ear headphones are fully waterproof, resistant to sweat, rain and accidental splashes.\",\"Extended Battery Life Enjoy up to 50 hours of battery life with ARC3 open ear headphones wireless Bluetooth. Benefit from 10 hours of playtime on a single charge, plus an extra 40 hours with the wireless charging case for continuous, long-lasting performance.\",\"Multi-point Connection with Advanced Bluetooth 5.4 Technology Seamlessly pair with two devices simultaneously using the ARC3 open ear Bluetooth headphones. Benefit from the latest Bluetooth 5.4, offering enhanced range for more reliable and stable connectivity.\"]'),
