(50, 1, 49, 'JBL Tune 720BT - Wireless Over-Ear Headphones with JBL Pure Bass Sound, Bluetooth 5.3, Up to 76H Battery Life and Speed Charge, Lightweight, Comfortable and Foldable Design (Black)', 'The JBL Tune 720BT headphones stream powerful JBL Pure Bass sound thanks to the latest 5.3 BT technology. Easy to use, these headphones provide up to 76 hours of pure pleasure and an extra 3 hours of battery with just 5 minutes of charge. Download the free JBL Headphones App and customize your sound through the EQ, while Voice Prompts guide you through the headphones features. Manage calls, sound and volume from the earcup, thanks to the convenient button controls. If a call comes in while you are watching a video on another device, the JBL Tune 720BT seamlessly switches to your mobile device, so you never miss a call. lightweight and comfortable even after hours of listening, the JBL Tune 720BT headphones fold flat in your backpack to follow you everywhere.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/61EL2AKKcBL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/61EL2AKKcBL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71ulFcBztEL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/51hrTx-nCdL._AC_SL1250_.jpg\",\"https://m.media-amazon.com/images/I/61gYzMtc5GL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/811cIDicYtL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81UjHwARYJL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71duQeC+HQL._AC_SL1500_.jpg\"]', '{"brand": "JBL", "category": "Electronics", "dimensions": "8.07 x 2.87 x 8.78 inches"}', '[\"JBL Pure Bass Sound The JBL Tune 720BT features the renowned JBL Pure Bass sound, the same technology that powers the most famous venues all around the world.\",\"Wireless Bluetooth 5.3 technology Wirelessly stream high-quality sound from your smartphone without messy cords with the help of the latest Bluetooth technology.\",\"Customize your listening experience Download the free JBL Headphones App to tailor the sound to your taste with the EQ. Voice prompts in your desired language guide you through the Tune 720BT features.\",\"Customize your listening experience Download the free JBL Headphones App to tailor the sound to your taste by choosing one of the pre-set EQ modes or adjusting the EQ curve according to your content, your style, your taste.\",\"Hands-free calls with Voice Aware Easily control your sound and manage your calls from your headphones with the convenient buttons on the ear-cup. Hear your voice while talking, with the help of Voice Aware.\"]'),
(51, 2, 50, 'DIGITNOW 35mm Slide Viewer, 3X Magnification and Desk Top LED Lighted Illuminated Viewing and Battery Operation-for 35mm Slides & Positive Film Negatives 4AA Batteries Included', 'Open the Memory Box! There are always good past events that we ignore! And because of all kinds of life reasons, we may be busy with our own study, or busy with our own career, put them in a forgotten corner, come on, let us revisit these times that still make us tears .Our DIGITNOW 35mm Portable LED Negative and Slide Viewer allows you to recall the precious time in your memories from your 35mm slides and similar film negatives.you can just insert optional DC 6V 500mA adapter or 4*AA Batteries and behold your pictures in bright, vivid color ! After that the images can be lighted and tripled the size . The good memories are opened like this! 3X magnification The bad with old slides is too small,taking in the place of squinting ,users take a look at the projected images with 3X magnification because of an integrated lens.All different kinds of photos can be viewed as bigger without losing important sharpness or key detail.Most Slides & Films are Super Small, Our Built-In Magnifier Lens Enlarges Images by 3X Without Distortion, Blurriness or Loss of Detail. Easy to Use You can view some vacation photos, family portraits or birthday snaps in an instant by loading them one by one via slide slot or a film feeder , and you can press releasing button and drop slide into tray , so that you can change . Specifications: 1. Super Bright: Fits 2X2\" mounted slides and 35mm film strips and negatives. 2.3x Magnified Glass Screen: Bright and Even Lighting, No Color Cast, Cool White LED Illumination. 3.Convenient: Desk Top Portable Viewer, Have Eject Button and Slide Tray. 4.Power Supply: Optional DC 6V 500mA adapter Or 4*AA Batteries (Included). 5.Note: the slide need to insert on the back of the viewer. Portable view It is very portable. You can view your old slides or negatives anywhere on the desktop. Fit \"2X2\" Slides Many people have a lot of old \"2X2\" slides at home. Do you want to sort them quickly? Come give it a try! Fit 35mm Film Strips and Negatives It is suitable for 35mm film stripsand negatives. Convenient battery operation allows you to view old slides anywhere in the world. Built-in LED Light Box Behind the huge glass viewing area are daylight bright LED bulbs ,those can illuminate soft images with maximum clarity and contrast.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/71D7nf9qx3L._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/71D7nf9qx3L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61l2emujraL._AC_SL1437_.jpg\",\"https://m.media-amazon.com/images/I/61X4SZkXqFL._AC_SL1460_.jpg\",\"https://m.media-amazon.com/images/I/61Rk0K28G5L._AC_SL1440_.jpg\",\"https://m.media-amazon.com/images/I/71kXfJ4EcEL._AC_SL1481_.jpg\",\"https://m.media-amazon.com/images/I/71tr3MBLdIL._AC_SL1411_.jpg\"]', '{"brand": "DIGITNOW", "category": "Office Products", "dimensions": "6.5 x 3 x 6 inches"}', '[\"REAPPEAR OLD MEMORIES --The personal slide viewer allows everyone to Memory the Past by Enlarging and Lighting 35mm slides, Films and Negatives.\",\"EASY TO USE -- Desktop Portable Viewer with eject button and sliding tray for easy use in the studio or at home.\",\"ULTRA-BRIGHT BACKLIT LIGHT BOX --Large field of view, ultra-bright Daylight LED Lighting, presents images in vivid, crystal-clear details.\",\"3X MAGINIFICATION GLASS SCREEN --Most slides and films are ultra-small, our Built-in Magnifier can magnify the image 3 times without Distortion, Blurriness or Loss of details, also Bright and Uniform Lighting, no color cast.\",\"PORTABLE --Suitable for 2x2\" mounted slides (need to be inserted into the back of the viewer) and 35mm film and negatives. Convenient battery operation allows you to view old slides anywhere.(USB Cable power can also be used, USB cable is included)\"]'),
(52, 2, 51, 'Knock Knock All Out Of Grocery List Note Pad, 6 x 9-inches (Blue)', 'Knock Knock\'s All Out Of Pad is the miracle of checking off depleted items as you go! This grocery shopping list will help you stock your pantry and fridge with the staples you need. Because who hasn�t wandered blindly at the grocery store, trying to remember what to buy? Knock Knock\'s All Out Of Pad lets you check off food items as you run out, then shop with ease and certainty when you visit the market. We are Knock Knock, independent makers of clever gifts, books, and whatever else we can think up. Our mission is to bring humor, creativity, and smarts to everyday life. Put the fun in functional with Knock Knock stuff!', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/81ByaXDTX0L._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/81ByaXDTX0L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/91wEXJ7FzbL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/91b6qsAitDL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81P8pdSRMSL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/91Tt9gWFOeL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/91+08bO-b4L._AC_SL1500_.jpg\"]', '{"brand": "Knock Knock", "category": "Office Products", "dimensions": "9 x 0.25 x 6 inches"}', '[\"Stick This Bestselling Magnetic Shopping List Notepad On Your Fridge And Check Off Depleted Items As You Run Out, Then Replenish With Ease And Certainty When Next You Shop\",\"6 X 9-Inch, 60 Sheet Notepad With Magnet On Back\",\"Country Of Origin China\",\"Never Forget The Milk Again With The Perfect Grocery List Pad\"]'),
