corations and more.\",\"STORAGE AND DISPLAY Two large open cubby areas on either side hold bigger items, and a pair of smaller spaces in the middle are perfect for storing important documents and work-in-progress.\",\"SHOW OFF YOUR STYLE Mission-inspired vertical wood accents and decorative detailing in your choice of several attractive finish options create a look that works well with farmhouse styling.\",\"A TOTAL SOLUTION The Salinas Collection includes an array of home office furnishings to build the workspace of your dreams. Get to work with a coordinating desk, file cabinet, bookshelf, and more.\",\"TESTING AND WARRANTY This 60-inch Desk Hutch has been meticulously tested to meet or exceed ANSI/SOHO quality standards for safety, durability, and performance and is backed by the Bush Furniture 1 Year Manufacturer�s Warranty.\"]'),
