(68, 2, 47, 'Scotch Cushion Lock Protective Wrap PCW-1250, 12 in x 50 ft (304 mm x 15.2 m) - Each', 'Now you can package your items with the confidence of protection, without the guilt of plastic. Scotch�Cushion Lock is an expanding paper wrap made with 100% recycled paper that delivers proven protection,�using up to 60% less vs. plastic bubble* to fill a box. How? One 30-ft roll expands to do the work of 75-ft of�plastic bubble* - just stretch, wrap in 360�, and pack in nested protection. With its proprietary self-locking�design, you don�t need tape to secure or scissors to cut. Once delivered, just recycle with ease.�� * to fill a cubic foot box vs. standard 3/16\" plastic bubble.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/81ERRgZeDsL._SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/81ERRgZeDsL._SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71TBcgNReCL._SL1280_.jpg\",\"https://m.media-amazon.com/images/I/818QH9Z7mDL._SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81-vqqGDjHL._SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81yUJOnxsML._SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71XZIpJmMmL._SL1280_.jpg\",\"https://m.media-amazon.com/images/I/81WaF0rAzcL._SL1280_.jpg\",\"https://m.media-amazon.com/images/I/810bWkmSS+L._SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81EZJeRiLvL._SL1500_.jpg\",\"https://m.media-amazon.com/images/I/610WlxD+OgL._SL1500_.jpg\"]', '{"brand": "Scotch", "category": "Office Products", "dimensions": "600 x 12 x 0.1 inches; 1.3 Pounds"}', '[\"USE IN PLACE OF PLASTIC BUBBLE - Expands to fill a box using up to 60% less vs. plastic bubble (* to fill a cubic foot box vs. standard 3/16\" plastic bubble)\",\"EASY TO USE - Just stretch, wrap, protect. No scissors or tape needed\",\"MORE PACKING POWER - One 30-foot roll starts flat and expands to do the work of 75-ft of standard plastic bubble (1,000 feet expands to equate to 2,500-feet of standard plastic bubble)\",\"NESTED