nishes. Use on vehicles, RVs, boats, vinyl, metal, concrete, fiberglass, and more.\",\"EASY CLEANUP Lift Off Adhesive Remover works its way under the sticky adhesive and lifts away from the surface to break the bond allowing tape, labels, and residues to be removed and disposed of easily.\",\"SAFER ALTERNATIVE TO HARSH CHEMICALS Using Lift Off Adhesive Remover is safer than using harsh chemicals like Methylene Chloride and NMP.\",\"MADE IN THE USA Not only are Lift Off products made in the USA, they are safer and simply work better.\"]'),
