(85, 2, 81, 'Seloom PC Stand Computer Tower Stand, Adjustable Mobile CPU Stand, Heavy-Duty PC Tower Stand with Rolling Caster Wheels, Steel Desktop Stand, PC Riser Fits Most PC Gaming Desk Accessories', 'DESKTOP STAND PC STAND The video showcases the product in use.The video guides you through product setup.The video compares multiple products.The video shows the product being unpacked. Cold-rolled Steel Material Load-bearing stability to withstand both small or large heavy duty PC tower/PC case. Breathable Heat Holes Diamond-shaped heat holes provide breathable heat dissipation while the tower case is running, extending the life of the CPU. Expandable Width Adjustment Adjustable to the width of heavy duty PC tower for flexibility. Universal Rolling Casters Each set has four universal wheels, two of them with brake fixed latch, the installation is recommended to be placed in the same front and rear. YOU WILL GET How do I install the computer tower stand? How are the accessories used? We\'ve included an additional installation instruction sheet as well as a replacement larger installation wrench for you to use if you experience inconvenience with manual installation of the wheels. The video showcases the product in use.The video guides you through product setup.The video compares multiple products.The video shows the product being unpacked.  Adjustable Width Designed to support and protect the gaming pc case full tower for ease of use. The adjustable size fits most heavy-duty computer tower on the market. Learn More High Load-bearing Capacity High-strength load-bearing and edge protection keep your console securely supported on floor with carpet or gaming desktop. Learn More Easy to Mobile The computer tower stand can be moved in all directions to be placed where you want, allowing you to use it freely at home and in the office. Learn More Cable Management 39.4in cable sleeve and Cable management clips. We have details on how to use it in the video. Learn More High strength cold-rolled Steel Sturdy computer tower stand made of high-grade steel materials.Standing the test of time. Learn More Easy to Assemble We do step-by-step installation diagrams as well as installation videos on the product detail page, including a installation instruction schematic in the package. Learn More  How many pounds does it support? Not sure if the maximum weight it supports but, at least 60LB. 10 inches wide and heavy and it supports it with no problems. What is height of the horizontal platform (not the edge lip) above the floor when assembled with casters? 2.5 inches. And the side edges/lips is 2.3cm/0.94in. Are the wheels easy to install? Can I replace this myself with other wheels? We adjusted the screw holes corresponding to the wheel mounting and gave a wrench. The wheels are removable and you can replace the wheels according to the diameter of the screw holes and bolts.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/71-87RbuhdL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/71-87RbuhdL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/812jZ-KoSyL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71zJSb5VQkL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71fYPf-2OeL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71cdAflymgL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71R8JQgfwYL._AC_SL1500_.jpg\"]', '{"brand": "Seloom", "category": "Office Products", "dimensions": "20 x 6 x 2.8 inches"}', '[\"FITS YOUR PC TOWER The computer tower stand is designed to support and protect the gaming pc case full tower for ease of use. The PC stand also provides additional surface clearance for better ventilation and cooling of the chassis with the power supply installed at the bottom.Protect your computer from wear and tear with a PC stand. The adjustable size fits most heavy-duty computer tower on the market\",\"EASY TO MOBILE The PC computer stand can be moved in all directions to be placed where you want, allowing you to use it freely at home and in the office. And it is suggested that the two lockable casters be mounted on the same side of the front. When you need it, it can easily go under your computer desk or printer stand and stay in place. PC accessories gaming,computer stand for desktop tower\",\"MAKE YOUR LIFE SIMPLE It gives you very easy access to the back of the PC tower when needed. Make it easier to move the computer tower when you want to plug the cable or do other works. Perfect for any surface even on floor carpet. If you needed something that could raise your gaming accessories for pc setup to keep it away from the floor or rug and to be able to easily move it, this is it\",\"EASY TO ASSEMBLE The mobile CPU stand provides a efficient way to move and store the computer tower, withstands moderate forces (60 LBS) and allows you to assemble it in the shortest possible time with tools. Sturdy computer tower stand made of high-grade steel materials. [INCLUDED]39.4in cable sleeve and Cable management clips\",\"SELOOM COMPUTER TOWER STAND Seloom hopes to keep going with a PC Stand that meet the needs of our customers for a variety of PC case. We can provide you with details on different types, designs, and where you can find them. Computer holder,pc holder, pc stand for carpet, pc holder under desk,computer tower stand floor\"]'),
(86, 2, 82, 'PrintWorks Professional Pre-Perforated Paper for Invoices, Statements, Gift Certificates & More', 'Whether you work at home, in an office or for a large corporation, PrintWorks Professional preperforated papers are perfect for your presentation and accounting needs. Simply create and print professional, high-quality documents in minutes. Whether you are printing booklets, manuals, statements, gift certificates, etc. PrintWorks has you covered with a full line of single, multiple or a combination of vertical and horizontal perforations.Our perforated papers have clean micro perfs that tear easily and the sheets lay flat allowing them to run jam-free on both laser and inkjet desktop and high-volume production printers and copiers.PrintWorks Professional perf papers are available in 8.5 x 11, 8.5 x 14 and 11 x 17 formats - both 20 lb. and 24 lb - so you can tailor your paper to your need and printing/copier equipment.PrintWorks Professional is a brand of Paris Corporation. Since 1964 we have been the experts on manufacturing quality forms and specialty paper for use in homes, offices and high-volume production facilities. Our products range from preperforated and prepunched papers to secure prescription and check blanks to colored paper/cardstocks, labels and t-shirt transfers. We source our paper from North American mills that actively work to sustain our environment. When you buy PrintWorks products, you are helping to preserve the environment - for every tree that is harvested to make our paper, many more are planted in its place. You can print responsibly knowing PrintWorks Professional perforated paper is good for the environment.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/51zPthfg2BL._AC_SL1000_.jpg', '[\"https://m.media-amazon.com/images/I/51zPthfg2BL._AC_SL1000_.jpg\",\"https://m.media-amazon.com/images/I/51ViwcpkhKL._AC_SL1000_.jpg\",\"https://m.media-amazon.com/images/I/51iwX+IgA2L._AC_SL1000_.jpg\",\"https://m.media-amazon.com/images/I/61bvhYGQleL._AC_SL1000_.jpg\",\"https://m.media-amazon.com/images/I/41NnootSjGL._AC_SL1000_.jpg\",\"https://m.media-amazon.com/images/I/51KG+4DAeDL._AC_SL1000_.jpg\",\"https://m.media-amazon.com/images/I/61yu3N1zYwL._AC_SL1000_.jpg\",\"https://m.media-amazon.com/images/I/51YXA3JD30L._AC_.jpg\"]', '{"brand": "PrintWorks", "category": "Office Products", "dimensions": "11 x 8.5 x 2.1 inches"}', '[\"PrintWorks Professional high-quality preperforated paper is a cost-effective solution for any office or organization that wants to print professional statements, invoices, notices, direct mail, gift certificates, coupons and more.\",\"PrintWorks 04124 perf paper has a clean, horizontal microperf 3 2/3\" (3.66\") from the bottom edge of the sheet allowing your customers to easily tear and remit payment and/or information.\",\"Perforated statement paper makes processing your paperwork simple and easy - it is compatible with most business and accounting software that supports templates.\",\"Premium PrintWorks quality since 1964. Made in the USA from domestically sourced, environmentally friendly paper. 500 sheets per ream, 8.5 x 11, white, 20 lb., packaged in an easy-open poly wrap.\"]'),
(87, 8, 23, 'Alpine Corporation MAZ254 Outdoor Floor Tiered Vintage Water Fountain w/ 6 Hanging Cups, Soothing Tier Waterfall, 38\", Bronze', 'Bring calming ambiance to your space with the Alpine Corporation Hanging 6-Cup Tiered Floor Fountain. Set the mood for meditation or romance with this remarkable six-tier fountain. As water cascades from one cup to the next, it makes soft sounds to help you relax. The fountain is made of durable iron with a bronze finish to provide an attractive rustic look to your yard. To use, simply plug into an outlet, fill lower basin with water, and watch as the interior pump creates a lovely water flow. With a 2-year warranty, you can be confident in the quality of your purchase. Fountain measures 10\"L x 11\"W x 38\"H for a perfect fit in your office, bedroom, living room, hall, kitchen, and more. Alpine Corporation is one of America\'s leading designers, importers, and distributors of superior quality home and garden decor products. Alpine Corporation\'s award winning in-house design team continuously develops new and innovative \"statement pieces\" for your home and garden. Your indoor and outdoor living spaces will be the envy of the neighborhood with our wide assortment of fresh, fashionable and contemporary products, from beautifully crafted solar garden stakes featuring patented motion and fiber optic lighting technology to beautiful fountains and delightful bird baths and feeders.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/616ZCu734iL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/616ZCu734iL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/A11faiw9LEL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/718TqRSSf1L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/91bxA57dt4L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/816yjLJzZNL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71kCpK73vWL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/91yjPgDhl3L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81BXPrwwwpL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61vhTCN8YiL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61MRQyXXq9L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/716bSXEXGjL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/91JvnLH7b6L._AC_SL1500_.jpg\"]', '{"brand": "Alpine Corporation", "category": "Home & Kitchen", "dimensions": "11\\\"L x 10\\\"W x 38\\\"H"}', '[\"HANGING CUPS TIER FOUNTAIN 6-cup tier outdoor fountain is the perfect addition to your decor, and features an interior pump that keeps the water flowing - just plug it in!\",\"RELAXING WATER FLOW Water trickles down through cups to mimic the sounds of a real waterfall, adding peaceful ambiance to your home or yard\",\"BEAUTIFUL DESIGN Rustic dark bronze and green color scheme offers vintage accents for a stylish antique look\",\"DURABLE Iron construction is rust- and weather-resistant to keep your outdoor fountain looking new over time\",\"IDEAL SIZE Water fountain measures 10\"L x 11\"W x 38\"H, the perfect size for your yard, and includes a two-year manufacturer\'s warranty from date of purchase\"]'),
(88, 7, 83, 'READYWISE - 30 Day, Emergency Food Supply, 298 Servings, 2 Buckets, Freeze-Dried, MRE, Camping, Hiking, Survival, Adventure Meal, 25-Year Shelf Life', 'The video showcases the product in use.The video guides you through product setup.The video compares multiple products.The video shows the product being unpacked. The video showcases the product in use.The video guides you through product setup.The video compares multiple products.The video shows the product being unpacked.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/71ulzesZn5L._SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/71ulzesZn5L._SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81yZsgV1gZL._SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81c-nYWIOBL._SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81kcauexLhL._SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81KZ7PCdjhL._SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81iitaFR-4L._SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81grdHFJ-NL._SL1500_.jpg\"]', '{"brand": "ReadyWise", "category": "Tools & Home Improvement", "dimensions": "20.94 x 16.61 x 12.48 inches; 1.76 ounces"}', '[\"COMPREHENSIVE 30-DAY EMERGENCY FOOD SUPPLY Ensure your family\'s safety with our ReadyWise 30-Day food kit. Packed with 298 servings, it\'s perfect for emergency preparedness, providing essential nutrition during unforeseen disasters.\",\"25-YEAR SHELF LIFE Our freeze-dried food supply is designed to last. With a remarkable 25-year shelf life, you can trust that your emergency food will be ready whenever you need it, no matter the circumstances.\",\"DELICIOUS VARIETY FOR EVERY PLATE From hearty soups to tasty oatmeal and more, our food buckets offer a diverse range of 10 mouthwatering meal options. Enjoy great-tasting, real ingredients even in emergency situations.\",\"EASY-TO-PREPARE & READY IN MINUTES When the unexpected strikes, our food is your ally. Simply add water, stir, and cover � in just 15 minutes, you\'ll have a hot, satisfying meal ready to eat. No hassle, no worries.\",\"PERFECT FOR ADVENTURE & SURVIVAL Whether you\'re camping, hiking, or prepping for doomsday scenarios, our survival food is a must-have. Lightweight, compact, and individually packaged, it\'s easy to take on any adventure.\",\"PEACE OF MIND FOR YOUR FAMILY With this family-sized emergency food supply, you\'re providing security for your loved ones. Be it for disaster preparedness or long-term storage, ReadyWise has you covered with high-quality, nutritious food that\'s there when you need it most.\"]'),
