(92, 2, 86, 'Avery File Folder Labels with TrueBlock Technology, Permanent Adhesive, 2/3\" x 3-7/16\", Laser/Inkjet, 150 Labels (08593)', 'Make organizing your files, documents and binders a breeze with professional Avery 08593 White 2/3\" x 3-7/16\" File Folder Labels. Created with TrueBlock label material, these filing labels will completely hide everything underneath so that you can cover older information and reuse folders. Lifting and curling are not a problem thanks to Avery permanent adhesive which sticks securely to smooth surfaces like paper, cardboard and plastic. Write directly on the tab folder labels or print at home in minutes using your laser or inkjet printer. The bright white background of these file folder labels are perfect for quick file identification, allowing your text, symbols and images to stand out. Proprietary Avery Sure Feed label technology helps deliver a more reliable feed through your printer to prevent print misalignments and paper jams. Find free templates and designs to create your own personalized labels by visiting the Avery site to customize your labels.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/71il6Tz+6TL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/71il6Tz+6TL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81yByq8siQL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81PGbZ9hCDL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/812ei2XtnaL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61SBlvZv8HL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81byntk-ilL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71OHoegVB4L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71sFe-7zTbL._AC_SL1500_.jpg\"]', '{"brand": "AVERY", "category": "Office Products", "dimensions": "12.09 x 9.44 x 0.11 inches"}', '[\"Manage files efficiently with a uniform, organized look with classic white file folder labels that allow text to stand out\",\