(93, 6, 87, 'Neosporin Original Antibiotic Ointment, 24-Hour Infection Prevention for Minor Wound, 1 oz', 'Neosporin Original First Aid Antibiotic Ointment provides long-lasting infection protection and minimizes the appearance of scars. Made with bacitracin zinc, this first aid antibiotic ointment helps prevent infection in minor cuts, scrapes, and burns and helps minimize the appearance of scars. From the #1 doctor-recommended brand, this antibiotic wound care ointment contains a unique HeliDerm Technology that provides a nourishing environment for skin to heal. To treat minor wounds, simply apply a small amount of the 24-hour infection protection antibiotic ointment and scar minimizer on the affected area one to three times daily and enjoy healthy healing with less visible scars.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/81QNmWFHdBL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/81QNmWFHdBL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/817dOCwm7dL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/711rf7BInbL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/711ak5Kv0mL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81vwD1dzKOL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81bZDi548wL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81sqsZIatQL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81-qfGFVYfL._AC_SL1500_.jpg\"]', '{"brand": "Neosporin", "category": "Health & Household", "dimensions": "6 x 5 x 4 inches; 1 ounces"}', '[\"1-ounce of Neosporin Original Topical Antibiotic Ointment for treating minor cuts, scrapes and burns\",\"Wound care ointment is formulated with neomycin sulfate, bacitracin zinc and polymyxin B antibiotic ingredients to provide 24-hour infection protection for minor wounds\",\"Topical first-aid ointment nourishes skin to minimize the appearance of scars after healing\",\"Contains HeliDerm Technology that provides a nourishing environment for skin to heal, resulting in healthier looking skin after use\",\"To use, apply a small amount of the first-aid antibiotic ointment to the affected area one to three times daily; Cover the wound with a Band-Aid Brand Adhesive Bandage for extra protection\"]'),
