ionary 4-in-1 gimbal seamlessly integrates a gimbal stabilizer, extendable selfie stick, desktop stand and tripod functionality. This design caters to diverse shooting requirements, unlocking endless possibilities for creating professional-grade videos and photos. Transition effortlessly between modes with intuitive controls. Our face tracking gimbal effortlessly aligns with your creative vision, delivering the adaptability essential for every scenario\",\"Unlock Your Photography Potential M1 Pro phone gimbal features a built-in 19 inches aluminum alloy extension rod, extending the overall height of the gimbal to an impressive 34 inches. This innovative design allows for flexible adjustment of shooting height and angles, providing the perfect solution for capturing flattering selfies and effortlessly handling group photos. No more hassle with additional accessories or complicated setups � the extension pole smoothly deploys, enabling you to adapt swiftly to various shooting scenarios, elevate your photography experience\",\"Brilliant Illumination on the Go The face tracking gimbal supports the attachment of three magnetic fill lights, allowing for versatile front and rear lighting. The magnetic fill light features adjustable brightness settings, tailor the lighting to your needs giving you control over the ambiance of your shots. Easily snap it onto the phone gimbal for perfectly lit photos and videos, even in low-light conditions\"]'),
