(116, 2, 106, 'Bostitch Office Impulse Heavy Duty Electric Stapler Value Pack, 45 Sheet Capacity, Includes 5,000 Staples & Staple Remover, No-Jam, Faster Stapling, Black', 'The B8 Impulse 45 Electric Stapler is the ultimate supply for those who expect nothing but the best. It offers a unique blend of superior performance and sophisticated design, suitable for any office. If you have a high volume of stapling work and limited time, then you will love the Impulse Drive technology. It delivers 3x faster* stapling speeds, making you work go faster. This heavy duty electric stapler features a high performance drive system to stapler up to 45 sheets easily and consistently. Our innovative No-Jam technology puts an end to frustrating, document damaging staple jams. A refill alert light provides a bright visual indicator when it�s time to reload, and a push-button FastLoad magazine makes reloading faster. The integrated suction cup feet make for easy mounting and ultimate stability. No longer will your stapler move around during use! Plus, each of these Bostitch electric staplers comes ready for immediate use with 5000 B8 PowerCrown � Premium Staples. These fastens are extra strong and feature a slightly crowned head shape that allows it to slice through 45 sheets of paper without breaking or buckling. If you\'re looking for a heavy duty electric stapler with a high sheet capacity, then this is for you!', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/712yKtfRdPS._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/712yKtfRdPS._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61tA0MqcY4S._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61btik3TMOS._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61tGN8tkvhS._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61yecUPF-GS._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61tpksMAmcS._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61AE-d2KX7S._AC_SL