(126, 2, 115, 'Case-it The Dual 2.0 Zipper Binder - Two 2 Inch D-Rings - 5 Subject File Folder - Multiple Pockets - 800 Sheet Capacity - Comes with Shoulder Strap - Black Dual-301', 'The Case-it Dual-301 is a unique binder that features two sets of D-rings, each of 2\" capacity, making it easy to organize multiple subjects into one handy binder. Each set of rings has hold-down pages with Velcro dividers to secure contents on both sides, while allowing for easy retrieval of material. One hold-down page comes with pockets for pens, pencils, and other small classroom accessories. The other hold down page is our ACC-21, a 5-color tabbed, 6-pocket expanding file folder, which allows easy organization of all important documents and papers. This binder has a gusseted zipper that allows access to the file folder without opening the whole binder. The Dual-301 also features a large interior mesh pocket, as well as a zippered exterior pocket. This binder has a patented angled zipper that keeps the gusset out of the way when writing. The handle and shoulder strap allow for easy transportation of materials. Each binder gusset is made of Rip stop material that prevents tearing. Each binder is constructed of sturdy Kraft Board, which is strong enough to last the school year and prevent warping. Case-it produces quality binders offering unique organizational tools for school or home use.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/A1kzI8KvdYL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/A1kzI8KvdYL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/714YdSlG9UL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71FJKcx851L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71Kci3G6m6L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71o5h0Nt0xL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81jSC1xDXQL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81qofCkGmDL._AC_SL1500_.jpg\",\"https://m.