(135, 2, 124, 'Smead Poly Expanding File Jacket, Straight-Cut Tab, 1� Expansion, Letter Size, Assorted Colors, 10 per Pack (89610)', 'See your papers at a glance and keep project pieces together. Smead�s Poly Expanding File Jackets are designed to help you keep projects organized and contents easy to see. These jackets in assorted colors have a full-length gusset to keep contents secured. Includes 10 letter size (11-3/4� W x 9-1/2� H) translucent file jackets in assorted colors, with 2 each of green, purple, yellow, red and dark blue. Pockets expand to 1� for greater storage capacity. Durable poly jackets are excellent for storing charts, photos and bulky documents that do not fit in traditional file folders. Straight-cut tabs are easy to spot in horizontal files. Use these jackets for receipts, class syllabus, important documents and travel details. Tear and water resistant, these jackets are easy to reuse. Poly is sturdy enough to keep papers neat in a messenger bag, backpack or briefcase. Make work flow easier when you can file and hand off your documents in a tidy sleeve. A simple change can boost your productivity and improve your organization.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/61prjMq68WL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/61prjMq68WL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71GamkhAuGL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/41qBbZuSIHS._AC_SL1005_.jpg\"]', '{"brand": "SMEAD", "category": "Office Products", "dimensions": "1.5 x 9.5 x 11.75 inches"}', '[\"Includes 10 letter size (11-3/4� W x 9-1/2� H) translucent expanding file jackets in assorted colors that allow you to view the folder contents at a glance\",\"Durable poly material is tear and water resistant, protecting contents from dirt and moisture, and easy to clean\",\"Straight-cut tab is perfect for drawer filing, and full-height gusset is great for toting documents to and from the office while keeping them organized\",\"Sturdy expanding file jackets are great for organizing projects at a glance, and 1� expansion allows for greater storage capacity\",\"Acid free and PVC free project jackets feature sealed sides and bottom to keep your documents safe and flat\"]'),
(136, 2, 125, 'Pentel� Hi-Polymer Lead Refills, 0.5 mm, HB Hardness, Tube Of 30 Refills', 'The #1 selling lead in the world. Smoother and stronger than the competition and resists breaking. HB lead is equivalent to a #2 pencil.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/61kf2w42BIL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/61kf2w42BIL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/31N38PpGKjL._AC_.jpg\",\"https://m.media-amazon.com/images/I/31N38PpGKjL._AC_.jpg\",\"https://m.media-amazon.com/images/I/31N38PpGKjL._AC_.jpg\",\"https://m.media-amazon.com/images/I/31N38PpGKjL._AC_.jpg\",\"https://m.media-amazon.com/images/I/31N38PpGKjL._AC_.jpg\",\"https://m.media-amazon.com/images/I/31N38PpGKjL._AC_.jpg\",\"https://m.media-amazon.com/images/I/31N38PpGKjL._AC_.jpg\"]', '{"brand": "Pentel", "category": "Office Products", "dimensions": "7.3 x 2 x 0.5 inches"}', '[\"For consistently smooth writing, fill your 0.5 mm mechanical pencil with these lead refills. Thanks to the HB hardness, your pencil lead will produce dark lines while minimizing the chance of breakage.\",\"HB hardness creates dark solid lines.\",\"Equivalent to a grade 32 wooden pencil. Lead resists breaking for lasting use.\",\"Fits most brands of 0.5 mm mechanical pencils.\",\"Designed to show up on test and document scans.\"]'),
(137, 4, 23, 'Alpine Corporation 35\"H Outdoor Rattan Holiday Reindeer Lawn Decoration with White Lights , Christmas Decoration', 'Upgrade your holiday d�cor with Alpine Corporation\'s 35\"H Rattan Reindeer Lawn Decoration with Lights! This reindeer features a robust metal wire frame dedicated to keeping it standing upright, making it the perfect Christmas decoration for your garden or yard. It includes 50 UL listed white lights to brighten your lawn. Simply plug the pre-lit reindeer into the nearest outlet using the 5 ft. cord for a festive display for your outdoor landscape! The reindeer comes with 4 black-colored ground stakes to provide stability and make set up easy. You\'ll love coming home each night to a beautiful sight and a touch of Christmas in your yard. At almost 3 ft. tall, the Alpine Corporation Rattan Reindeer measures 20\"L x 7\"W x 35\"W, perfect for your holiday display. Alpine Corporation is one of America\'s leading designers, importers, and distributors of superior quality home and garden decor products. Alpine Corporation\'s award winning in-house design team continuously develops new and innovative \"statement pieces\" for your home and garden. Your indoor and outdoor living spaces will be the envy of the neighborhood with our wide assortment of fresh, fashionable and contemporary products, from beautifully crafted solar garden stakes featuring patented motion and fiber optic lighting technology to beautiful fountains and delightful bird baths and feeders.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/81MNzFZISnL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/81MNzFZISnL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81BvBf11qxL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81S5jhUnAnL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81Y8fMRnd+L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/815sdAQ2PrL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/