(138, 5, 126, 'Springhill 015101 Digital Index White Card Stock 90 lb 8 1/2 x 11 250 Sheets/Pack (SGH015101)', 'When you need a premium lightweight cardstock paper, this Springhill white cardstock is the go-to-choice. With a 92 bright-white shade and a smooth paper finish, this 90lb index cardstock is designed for bleed-free, dual-sided print and copy use on all copiers, laser printers and inkjet printers that accept this cover cardstock weight. Consult your home printer manual before ordering to make sure it can handle this text weight or cover weight white paper you have selected. Use this smooth cardstock paper for any project in your home, business, or classroom that requires a strong, printable cardstock paper that can be die-cut, stamped or folded. It�s ideal for black and white printing, color printing, greeting cards, report covers, direct mail, brochures, flyers, scrapbooking, and many other applications. The smooth paper surface results in crisp, vibrant prints and minimal show-through whether you�re printing personal or commercial print projects. 90lb index meets USPS regulations, so you can use it for mailings. Plus, this acid-free cardstock prevents your documents from yellowing over time. Springhill is 100% made in the USA and Sustainable Forestry Initiative (SFI) certified which means when you buy Springhill paper, you\'re purchasing a renewable resource. At Sylvamo we\'re committed to helping replant forests, sustain forestlands, and contribute to healthy forest ecosystems. Choose Springhill Cardstock - the perfect choice medium for printer ink, colored pencils, markers, crayons, watercolors, and more.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/71+GHPQsWwL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/71+GHPQsWwL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/31ugFSn1qiS._AC_.jpg\",\"https://m.media-amazon.com/images/I/31+V21IuieS._AC_.jpg\",\"https://m.media-amazon.com/images/I/61G74pWPN