(163, 3, 147, 'Phone Armband for Running 3D Design Cell Phone Armband with Zipper Pocket for Earbuds Car Keys, Water Resistant Sport Arm Band for iPhone 14 13 12 11 Pro Galaxy S20 S30 Fit Up to 6.9\'\' with Phone Case', 'Streamline Your Workout with Our 6.9 Inch Running Phone Armband - Stay Connected and Focused! Earphone Pocket: to put down your airpods or car keys without having to worry about where to put the charging case.3 Headphone jack holes: We have built in three headphone jacks built into the bottom of the armband. No matter where your phone\'s headphone jack is, you can use your headphones with this armband!Whether your headphones are wireless or wired, you can use your headphones to listen to music with this armband while running.Comfortable & Non-slip: We use high quality breathable Lycra material to maximize comfort and a silicone dot matrix on the back to keep the armband from slipping off even when sweating.Adjustable Sizing: The elastic strap can fit any arm with a circumference of 10.2-16.5 inches (26-42 cm) Fits Any Phones Up to 6.9 Inches, Compatible Model: - iPhone 14 / 14 Pro / 13 / 13 Pro / 12 mini / 12 Pro / 11 / 11 Pro / 11 Pro Max / X / XR / XS / XS Max / SE 2 / 8 / 8 Plus / 7 / 7 Plus - Samsung Galaxy S20/ S10/ S9/ S7 Edge / S8/ S8 Plus/ Note 10 / Note 9 / Note 8 / A60 / Galaxy A 50 - LG: LG V10 / LG G Vista 2 / LG G Flex 2 / LG G Stylo / LG Stylus 2 E520 / Stylo 2 LS775 / LG G3; - Motorola: Moto X/G, Droid Turbo 2 / Droid Maxx 2, X Pure Edition? - Sony: Xperia C5 Ultra, Xperia Z5 Premium; - HTC One/ Desire; Nexus 5/5P/6P; - Oneplus 1/2/3/3T; Please note: Please remove your phone case for the phone over 6.4 inches, and then put in the armband. Sweatproof and Water Resistant Made of high quality Lycra fabric, making our armbands extra strong and durable while being soft and comfortable on the skin. There is also a layer of premium waterproof and splash-proof material to protect your phone, headphones, cash from the effects of light rain and sweat. Anti-slip Design The strap of armband is made of high-elastic material, providing a snug and comfortable fit for your arm during workouts. The reflective material used for the anti-slip buckle at the end ensures safety and visibility while exercising. More Space for Storage The small back pocket is more convenient for your credit cards, cash and other pieces. Anti-slip silicone makes the arm band more firmly stayed in the position during running, even when sweating.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/71y8l2Jb5sL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/71y8l2Jb5sL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81rcEPlFYOL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71d1jQObB1L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81pSJK5xm9L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71aawJRfmGL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71fTqt3Sn3L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71WpXMQQSBL._AC_SL1500_.jpg\"]', '{"brand": "TDLIRH", "category": "Cell Phones & Accessories", "dimensions": "5.6 x 3.4 x 0.46 inches"}', '[\"Armband With Airpods Bag - The Running Armband has a small zippered pocket on the right side. The unique zipper pocket design is not only beautiful but also practical, allowing users to store their earphones, car keys, and other small items. Additionally, A small pocket located at the back of the armband provides space for storing credit cards, cash or keys, keeping your valuables safe and secure while on the move\",\"Perfect fit Phone up to 6.9\'\' - Our running armband is suitable for phones up to 6.7 inches, and its 3D design provides a smooth and easy way to access and store your phone while you exercise. It is compatible with iPhone 14, 14 Pro, 14 Plus, 13, 13 Pro12, 13 Pro Max, 12 Pro, 12 mini, iPhone 11, 11 Pro, XS, XR, X, iPhone 8, 8 Plus, 7, 7 Plus, 6s Plus, Samsung S21, S21+, S20, S10, Google Pi