(165, 2, 149, 'Office Chair Mat for Hardwood Floor: 63 x 51 inches Black Computer Chair Mat Easy Glide Easy Clean Anti-Slip No Curling - Desk Chair Mat Hard Floors for Home/Office', 'for Office Areas for Dining Areas for Children\'s Play Areas for Pet Activity Areas', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/81uV6N-czrL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/81uV6N-czrL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71Id--Oa2HL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/816xsl5AqCL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81ifYh6RJcL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/91U9kbeVzhL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81I9js+SKGL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81FABq2s3eL._AC_SL1500_.jpg\"]', '{"brand": "Soanufa", "category": "Office Products", "dimensions": "63\\\"L x 51\\\"W x 0.05\\\"Th"}', '[\"Floor Protection When chairs slide on hardwood or tile floors, they can easily cause wear and noise. Chair mats prevent wheels or floors from wearing out, extending their lifespan. Enhance the tranquility and comfort of your home or office space. Whether you\'re working, gaming, or relaxing, you can enjoy this comfort and protection.\",\"Easy Cleaning, Long-lasting Freshness Our office chair mat is designed for easy cleaning, with a smooth surface that effortlessly wipes away spills and stains. Simply use a damp cloth or mild cleaner to gently wipe, keeping the chair mat looking like new for a long time.\",\"Innovative Design, Easy Mobility Office chair mat features a clever design with a smooth side and a textured side. Place the smooth side down to securely anchor the mat in place. The textured side allows the chair to glide effortlessly while providing reliable anti-slip traction, ensuring smooth and worry-free work experiences.\",\"Environmentally Friendly Fire Protection Our office chair mat is non-toxic, eco-friendly, suitable for everyday use, and odorless. It boasts excellent fire resistance, ensuring effective prevention of flame spread even if a cigarette is accidentally dropped on it, providing safety protection for you and your family members.\",\"Versatile Use, Precision Fit Our office chair mat is suitable for hardwood, vinyl, laminate, stone, tile, and concrete floors. It can be precisely cut to ensure a perfect fit in various settings such as offices, hallways, living rooms, and studies. Not suitable for carpeted floors.\"]'),
