g it the perfect choice for photos, signs and posters\",\"STURDY PROTECTION Choose the right film for your job; The 1;5 mil thickness provides protection while retaining flexibility; Each roll is 25\" x 500\' and is wound on a 1\" core; Pack includes 2 rolls\",\"ULTIMA AND PINNACLE COMPATIBLE Compatible only with GBC Ultima 65 and Pinnacle 27 EZLoad Laminators, which have gray saddles; NAP I film is the most common film and is great for everyday projects\"]'),
