r supports StandBy to style your iPhone as you\'d like, allowing Apple users to mount their phone and enjoy StandBy features when this charger is in stand form. View the time in the office, bedroom, and more.\",\"36W PSU and USB-C CABLE INCLUDED This Belkin BoostCharge 3-in-1 Charger comes with a 36-watt power supply and 5-foot USB-C to USB-C cable, so you can begin immediately charging right out of the box without the need to make any additional purchases.\",\"CASE COMPATIBLE UP TO 3MM THICK + SAFE CHARGING Rounds of rigorous testing ensure this magnetic charger meets our Premium Safety Standard. Plus, your phone will still receive a safe charge � even when your MagSafe-compatible phone case is on (up to 3mm).\",\"SUSTAINABLY MADE W/ 2-YEAR WARRANTY This BoostCharge charging pad\'s housing is responsibly made with up to 75% post-consumer recycled content? and 100% plastic-free packaging.\"]'),
