(200, 2, 94, 'HP OfficeJet Pro 9730e Wide Format Wireless All-in-One Color Inkjet Printer, Print, scan, Copy up to 11x17\', ADF, Duplex Printing Best for Office, 3 Months of Instant Ink Included (537P6A)', 'The HP OfficeJet Pro 9730e delivers fast color printing, 500-sheet paper capacity, and handles files up to 11x17\". It includes wireless and printer security capabilities to keep your multifunction printer up to date and secure, and is the world\'s only wide-format printer with P3 Color.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/51zRpeXCCNL._AC_SL1200_.jpg', '[\"https://m.media-amazon.com/images/I/51zRpeXCCNL._AC_SL1200_.jpg\",\"https://m.media-amazon.com/images/I/71pdYRpkoOL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71xztdNZOrL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/51dp4l2NF9L._AC_SL1200_.jpg\",\"https://m.media-amazon.com/images/I/61Zrmg1VPDL._AC_SL1200_.jpg\",\"https://m.media-amazon.com/images/I/61AscRkP-CL._AC_SL1200_.jpg\",\"https://m.media-amazon.com/images/I/71RjNUpyoKL._AC_SL1200_.jpg\",\"https://m.media-amazon.com/images/I/71K6aRi1hSL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81Pk8SKBqfL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/715UGVfIfUL._AC_SL1200_.jpg\",\"https://m.media-amazon.com/images/I/71uPTAhWLDL._AC_SL1200_.jpg\",\"https://m.media-amazon.com/images/I/61VKFjOXCEL._AC_SL1200_.jpg\",\"https://m.media-amazon.com/images/I/61so8agnA2L._AC_SL1200_.jpg\",\"https://m.media-amazon.com/images/I/71QLbr0w0DL._AC_SL1200_.jpg\",\"https://m.media-amazon.com/images/I/51J49yRbivL._AC_SL1200_.jpg\"]', '{"brand": "HP", "category": "Office Products", "dimensions": "23\\\"D x 15.1\\\"W x 18.38\\\"H"}', '[\"SCREEN-ACCURATE PRINTS UP TO 11X17\" � This wide-format printer creates vibrant prints with enhanced color accuracy from P3 technology that uses a wider color gamut vs. sRGB\",\"3 MONTHS OF INK WITH HP+ ACTIVATION � Subscribe to Instant Ink delivery service to get ink delivered directly to your door before you run out. After 3 months, monthly fee applies unless cancelled, and you save up to 50%.\",\"UPGRADED FEATURES � Fast color printing, copy, auto 2-sided printing, auto document feeder, and two 250-sheet input trays.\",\"FROM AMERICA\'S MOST TRUSTED PRINTER BRAND � The OfficeJet Pro 9730e is perfect for offices printing professional-quality color documents like floorplans, mood boards and spreadsheets. Print speeds up to 18 ppm color, 22 ppm black.\",\"WIRELESS PRINTING � Stay connected with our most reliable dual-band Wi-Fi, which automatically detects and resolves connection issues.\",\"PROTECTS YOUR DATA � Built-in HP Wolf Pro Security uses a powerful suite of customizable tools that boosts security and helps keep networks protected against cyber threats and malware.\",\"HP APP � Print, scan, copy, or fax right from your smartphone with the easiest-to-use print app.\",\"4.3-INCH TOUCHSCREEN � Quickly navigate your printer with a large color touchscreen and a phone-like user interface.\",\"SUSTAINABLE DESIGN � Made with more than 30% recycled plastic.\",\"This printer is intended to work only with cartridges with original HP chips or circuitry and will block cartridges using non-HP chips or circuitry. Periodic firmware updates will maintain the effectiveness of these measures.\"]'),
(201, 2, 86, 'Avery File Folder Labels on 4\" x 6\" Sheets, Easy Peel, White/Purple, Print or Write, 2/3\" x 3-7/16\", 252 Labels (5204)', 'Easily organize your important files and documents with Avery Permanent File Folder Labels. These white file folder labels with a purple strip across the top make it even easier to find just the folder you\'re looking for and works well for color coding. Perfect for situations that only need a few labels at a time, each sheet of FSC certified paper comes with 7 labels designed for fast and easy peeling. The Easy Peel design with Pop Up Edge guarantees fast application of file folder labels. Bend back the label sheet to expose the label�s edge, peel off your label and apply. The permanent file folder labels self-adhesive is sure to stick and stay on most surfaces without lifting or curling. Produce labels quickly by writing on the tab folder labels by hand or use the free templates and designs available on the Avery site for a more polished finish. Adjust your laser or inkjet printer to fit the smaller 4� x 6� sheets and print at home with ease.�Create professional looking custom labels that make file identification quick and easy. This item comes with 36 sheets with a total of 252 white/purple 2/3� x 3-7/16� labels.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/71kjKJMXhML._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/71kjKJMXhML._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71FWGVrgLuL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/51LOsfRPP2L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/51XmQbM6c+L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/7188ozP2S1L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61xDxTKA6yL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81p+MF5VvKL._AC_SL1500_.jpg\"]', '{"brand": "AVERY", "category": "Office Products", "dimensions": "0.6 x 4.6 x 4.57 inches"}', '[\"Manage and identify files efficiently; an eye-catching purple bar over the white label surface allows for effective color coding and organizing labels for home, office, or school\",\"Ideal for when you only need a few file folder labels at a time; each 4\" x 6\" sheet contains 7 Easy Peel labels for faster peeling\",\"No need to worry about labels curling or falling off; permanent adhesive ensures file labels stick and stay to smooth surfaces including paper, cardboard, plastic, wood, glass, metal and more\",\"Create handwritten file label stickers with ease or use your personal laser or inkjet printers for a more polished finish; not recommended for use with color laser printers\",\"Design and print custom labels with free templates on the Avery site for a more professional look\"]'),
(202, 2, 180, 'Disney Stitch Desk Mat Large Mouse Mat 80 x 36 cm Baby Yoda Desk Protector Mat PC Laptop Keyboard Stitch Gifts (Blue Stitch)', 'Disney presents the perfect solution for all your gaming and work needs. Unleash the fun with this spacious computer mat, measuring 31.2 x 13.9\". Designed to provide you with ample room for your mouse, keyboard, and other essentials, this desk cover ensures you never run out of space again. Say goodbye to accidental slips, missed clicks, and messy setups! There\'s a range of stylish designs to choose from, featuring popular Disney characters like Stitch Disney and Baby Yoda. See images for more details.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/91mXk8m+mTL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/91mXk8m+mTL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/91D5RVblDnL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/913RJTvj-vL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/91jqBeCW8NL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/91LhYWZc3lL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/91B9TATuAgL._AC_SL1500_.jpg\"]', '{"brand": "Disney", "category": "Office Products", "dimensions": "31.3 x 14.17 x 0.01 inches"}', '[\"Looking for accessories to brighten up your workspace? Say hello to our Disney range of desk mats, large enough for a keyboard and mouse and perfect for adding some fun to your office space. Choose from a range of designs, including Stitch and The Mandalorian!\",\"Large Desk Pad Mat - Large desk protector mat with a non-slip rubber base suitable for PC�s, laptops, keyboards, mice and accessories. Measures 31.2 x 13.9\"\",\"Working from Home Essentials - This large mouse and keyboard pad is perfect for protecting your desk, it�s also waterproof and easy to wipe clean. See images for more details\",\"Looking for cool office gadgets or fun home office essentials? Don�t miss out on this computer desk mat from Disney. It�s perfect for adding a touch of fun to your work day!\",\"Disney Gifts - Our large computer pad is officially licensed Disney merchandise and makes the ideal gift for fans at Christmas, birthdays or for special occasions!\"]'),
