enough, pls charge it in time.?This phone holder does not charge phone\",\"??Stunning Suction Performance?Vacuum suction magnetic phone holders has no ragged edges. The vacuum suction phone car holder combines a more intelligent vacuum technology and stronger magnetic attraction.you\'ll be quite pleased with its performance, as it offers a lot of convenient features that have made your work and entertainment experiences more seamless and enjoyable\",\"??Wide Compatibility?Car magnetic suction phone holder is universal and works well with all kinds of brands and smartphones models. And we offer a magnetic metal ring for non-magnetic phones and cases, the phone stand suits for any scene, such as the dashboard, windshield, and any smooth flat surface\",\"??Warm Tips?1.When using the magnetic suction car phone holder mount for the first time, please use an adapter below 15W to charge the device fully. 2. If the vacuum exhaust sound is weak or the vacuum suction is not enough, please charge it in time.?NotesThis magnetic car phone holder does not charge phone\"]'),
(210, 10, 188, 'Super Glue for Plastic 100g, Heavy Duty Plastic Glue Model Kit for Legos and Miniature, Strongest Plastic Adhesive Bonder for PLA, 3D Print, Car, ABS, PVC, Acrylic, Craft, Best Plastic Glue', 'In the heart of every craftsperson, DIY hobbyist lies a desire for perfection. Our brand\'s journey began with a simple need � a superior adhesive that truly bonds and lasts. Inspired by this quest, our founders set out to create Plastic Glue, a product that not only meets the highest standards of quality but also caters to the intricate needs of our diverse user base. From securing model airplanes to repairing household items, Plastic Glue stands as a testament to reliability and innovation. Heavy Duty Plastic Glue for PLA, 3D Print, Car, ABS, PVC, Acrylic, Craft ALL-PURPOSE PLASTIC ADHESIVE: Perfect for PVC, ABS, acrylic, and more � Plastic Glue handles all your plastic repair needs with ease. LONG-LASTING BOND: Our advanced formula provides a strong, durable bond for projects big and small, from model airplanes to household items. QUICK SETTING: No more waiting around � Plastic Glue dries in seconds, making your repairs fast and efficient. SAFE & ODORLESS: Enjoy a safe, non-toxic, and odor-free application that leaves a clear, clean finish with no residual marks. PRECISION APPLICATION: The included precision tip ensures accurate glue placement for intricate repairs and professional results every time. Easy To Use Clean and dry surfacess sand glossy areas lightly Apply a small amount of glue using the precision nozzle. Press surfaces together for at least 5 minutes; Wipe the nozzle after use.Let the glue cure for 24 hours Before Vs After', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/71sk2Al3ilL._SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/71sk2Al3ilL._SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81Dl0GxivpL._SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81JduFneByL._SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71fy2bEuvgL._SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71PiKjFUkHL._SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71bBhxsv2kL._SL1500_.jpg\"]', '{"brand": "Meuvcol", "category": "Industrial & Scientific", "dimensions": "5.2 x 2.56 x 1.97 inches; 8.15 ounces"}', '[\"ULTIMATE PLASTIC REPAIR SOLUTION Meuvcol Plastic Glue is the perfect solution for all your plastic repair needs around the home, office, or workshop. Designed for a broad spectrum of plastics including PVC, ABS, Acrylic, 3D Print, Car, Craft and more, this powerful pla glue ensures a strong, lasting bond to tackle any project\",\"SUPERIOR DURABILITY Engineered with a cutting-edge formula, our plastic model glue kit offers incredible strength and durability. Whether repairing model airplanes or everyday household items, you can be sure of a long-lasting connection that withstands the test of time\",\"FAST BONDING TECHNOLOGY Save time and effort with our quick-drying Plastic miniature glue. The advanced formula sets within seconds, allowing you to speed through projects without waiting. Ideal for detailed craft work or urgent repairs, our glue ensures a rapid and reliable fix\",\"SAFE AND ODORLESS Ensuring your safety and satisfaction, our Plastic Adhesive is both odorless and non-toxic. It provides a clean application process with no harmful fumes, and dries clear to preserve the original look of your items. Perfect for use in any environment without concerns for residual marks or smells\",\"PRECISION APPLICATOR Make intricate repairs effortlessly with the precision applicator included with every bottle of our weld plastic bonding glue. Designed for accurate application, it allows you to apply the exact amount needed in just the right spot. Ideal for complex models and everyday soft plastic repairs, ensuring professional results every time\"]'),
(211, 2, 132, 'Fellowes Office Suites Underdesk Keyboard Drawer, Black/Silver (9140305)', 'Product Description The height adjustable Fellowes Office Suites Underdesk Keyboard Drawer converts a conventional desk to an ergonomic workstation! Moves keyboard and mouse off the desktop to save workspace. Unit is easy to install and offers three different height adjustments to suit preferred work position. �Mouse tray mounts on right or left side of keyboard tray or stows underneath keyboard tray when not in use. From the Manufacturer Reduce desktop clutter with the Fellowes Office Suites Underdesk Keyboard Drawer. Constructed from 100 percent recycled materials, this sturdy, impact-resistant drawer lets you move your keyboard and mouse off your desk to give you plenty of room to work. Easy to install, the drawer can be adjusted to three different heights and fits standard keyboards.Features 3 height adjustments to fit your preferred work position. View larger.Adjustable Keyboard Drawer with Glide TrackThe Office Suites Underdesk Keyboard Drawer lets you easily place your keyboard in your ideal position with your choice of three heights (2-1/2, 2-1/8, or 1-3/4 inches below track). A keyboard stopper holds the keyboard securely in place while you work, while ball-bearing glide tracks ensure the drawer slides smoothly back and forth.Stowaway Mouse Platform Mounts on Either SideThe keyboard drawer includes a separate mouse platform that lets you mount your mouse on the left or right side of your keyboard--wherever it\'s most convenient for you. In addition, the mouse platform stows underneath the keyboard tray to save space when not in use.Fits Standard KeyboardsThe keyboard drawer\'s sturdy, impact-resistant tray fits standard keyboards and is constructed from 100 percent recycled materials.What\'s in the BoxFellowes Office Suites Underdesk Keyboard Drawer with mouse platform, glide tracks, hardware, and easy installation guide.Office SuitesUnderdesk Keyboard DrawerAt a Glance:Keyboard drawer with adjustable height stores keyboard and mouse under deskBall-bearing glide tracks ensure smooth operation of drawerMouse platform mounts left or right and stows underneath keyboardFits standard keyboardsMade from 100 percent recycled materialsRecommended Companion Products and AccessoriesFellowes Lumbar Back Support (9190701)Fellowes Standard Footrest (48121)Fellowes Standard Monitor Riser (91712)Low-profile design for maximum lumbar supportSupports lower back during extended periods of sittingHigh-density foam promotes neutral postureOffers dual-position height adjustmentFree-floating platform stretches legs for increased circulationInnovative stacking columns raise monitor to eye level to help prevent neck strainFeatures 3 different height adjustments from 2\" to 4\"Main Product Benefit', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/619w02f9UQL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/619w02f9UQL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81eDnNWAQeL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71qCoar6RML._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/819ClQ2bJ6L._AC_SL1500_.jpg\"]', '{"brand": "Fellowes", "category": "Office Products", "dimensions": "11.63 x 22.37 x 2.25 inches"}', '[\"Height adjustable unit features 3 height adjustments to suit preferred work position and moves keyboard and mouse off the desktop to save workspace\",\"Mouse tray mounts to right or left side of keyboard tray or stows underneath\",\"Sturdy, impact-resistant tray fits standard keyboards\",\"23.5� wide space required for installation\",\"Track Length10 - 10-1/2 inches\"]'),
(212, 2, 86, 'Avery Matte White Round Labels, Sure Feed Technology, Permanent Adhesive, 1-1/2\", 400 Labels (8293)', 'Versatile labels provide the freedom needed for nearly any project. Design and print engaging round labels for your project with Avery Matte White Labels. The multipurpose labels can grip and stick to nearly any surface with the permanent adhesive hold. Create and personalize professional-looking, printable labels with the thousands of free designs and templates at avery.com/templates. Printable labels feature patented Sure Feed(R) technology grip strip designed to help alignment and reduce paper jams. Attention-grabbing labels often need more than a catchy phrase or design. The attractive white matte finish helps you create those eye-catching round labels needed for any project. Customize the versatile circle stickers and create popsocket stickers, envelope labels, mailing labels, gift labels, and jar labels. The round labels are sized at 1-1/2\" in diameter. The pack includes 400 individual circle sticker labels. The label sheets are measured at 8-1/2\" x 11\".', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/81G62RfXljL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/81G62RfXljL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81v53PgpWTL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/41lKCZAR8-L._AC_.jpg\",\"https://m.media-amazon.com/images/I/81m5AptoLpL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81fsM7oxM6L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81MfvNncOCL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71m0QXwn6SL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81LF9y+W62L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/812h7G8NMtL._AC_SL1500_.jpg\"]', '{"brand": "AVERY", "category": "Office Products", "dimensions": "12.09 x 9.44 x 0.22 inches"}', '[\"Avery 8293 Labels feature patented Sure Feed(R) Technology grip strip designed to help alignment and reduce printer jams.\",\"Create customized labels in minutes by adding logos and images using free templates at the Avery site\",\"Compatible with inkjet printers\",\"The round white stickers are sized 1-1/2\" in diameter\",\"Each pack includes 400 white circle stickers\"]'),
(213, 2, 132, 'Fellowes AutoMax Micro-Cut 100M Commercial Office Auto Feed 2-in-1 Paper Shredder with 100-Sheet Capacity', 'The Fellowes AutoMax 100M Micro-Cut Paper Shredder combines the best of manual and automatic shredding with design-forward features to make shredding productive and frustration-free. Adaptive to your specific needs, the 100M lets you choose between manually shredding 10 sheets at a time for quick, smaller jobs, or simply leaving up to 100 sheets in the document feed to be shredded automatically and hands-free. Combining versatility with superior security, the AutoMax 100M shreds more than paper � the powerful blades can also shred credit cards, staples and paper clips into 5/32� x 25/64� micro-cut particles. Your workday shouldn�t be interrupted by jams or noise, which is why the intuitive Auto Reverse feature detects when a jam is occurring, then automatically stops and reverses the paper flow. SilentShred delivers ultra-quiet performance, so shredding in shared workspaces doesn�t cause disruptions. And to boost shredding productivity even further, you can shred continuously for up to 15 minutes. The AutoMax 100M even has an LED indicator, which quickly tells you when it is time to empty the 6-gallon pull-out bin. Designed for long-term reliability in demanding office environments, the AutoMax 100M Micro-Cut Auto Feed shredder is backed with a 2-year product warranty, plus a 7-year cutter warranty.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/61eopEBybZS._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/61eopEBybZS._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61RsgU3+aNL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61M31alYyPL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71Ytna6cXvL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71g5kpVuJsL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/615N6IrUfjL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61UJdNI6d6L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61b7rrtWCqL._AC_SL1500_.jpg\"]', '{"brand": "Fellowes", "category": "Office Products", "dimensions": "18.44 x 15.38 x 26.38 inches"}', '[\"Shredding options for every job) The AutoMax Micro Cut 100M Paper Shredder is equipped with both manual and automatic feed, each designed to meet the heavy duty shredding needs of your office\",\"Use manual feed for quick, smaller jobs up to 10 sheets, or use automatic feed to load up 100 sheets and walk away while the 100M Micro-Cut Auto Feed handles the shredding\",\"Secure sensitive information with micro-cut AutoMax 100M shreds documents into 5/32� x 25/64� micro-cut particles for superior security of confidential documents\",\"Shred more than paper In addition to document shredding, the AutoMax 100M also shreds paper clips, staples and credit cards\",\"Stop jams before they start Auto Reverse detects when a paper jam is forming, and automatically stops and reverses the paper feed\",\"Easily contain and dispose shredded particles The 100M Micro-Cut Auto Feed paper shredder includes a spacious, 6-gallon pull-out bin along with a LED indicator that signifies when the bin is full\"]'),
