(226, 2, 201, 'Brother MFC-J1205W INKvestment -Tank Wireless Multi-Function Color Inkjet Printer with Up to 1-Year in Box, White', 'Get ready for a productive day with help from this Brother printer. The wireless printer offers easy mobile printing options, a Hi-Speed USB 2.0 interface and web-based printing for versatility. The color printer features a 150-sheet input tray to help your team print big jobs without having to constantly refill it. NO INK REPLACEMENT FOR UP TO 1-YEAR(1): Experience truly uninterrupted printing, exceptional savings and super convenience with up to 1-year of ink using only the four cartridges provided in-box.(1) PUT THE POWER OF PRINTING AT YOUR FINGERTIPS: The simple to use Brother Mobile Connect(2) App delivers easy onscreen menu navigation for printing, copying, scanning and printer management from your mobile device. BROTHER REVOLUTIONARY INKVESTMENT TANK SYSTEM: Brother INKvestment Tank printers feature reengineered ink cartridges that hold more ink than traditional cartridges and deliver a continuous ink supply for truly convenient, uninterrupted printing. ELIMINATE INK REPLACEMENT GUESSWORK: Print with confidence using the Brother Page Gauge,(3) a visual, numerical way to know the amount of ink used and the amount of ink remaining to help take the guesswork out of when to replace ink. USE BROTHER GENUINE INK: Engineered to work with INKvestment Tank inkjet printers, a full range of INKvestment Tank cartridges is available that deliver high quality prints and reliable page yields: LC404BK, LC404C, LC404M, LC404Y and LC404 3PK. BROTHER AT YOUR SIDE. Brother offers a 2-Year Limited Warranty and At Your Side support for the life of your printer. REFRESH: Buy Genuine Brother Ink Cartridges. When you do need to replace your ink supply, choose Brother Genuine LC404 inks. To avoid worrying about running out of ink again, get started with Refresh EZ Print Subscription service and save up to 50% on ink(5). DISCLAIMERS: (1)Based on average m