(228, 2, 202, 'U Brands Fine Tip Dry Erase Markers with Eraser, Magnetic Double Ended Whiteboard Markers, Low Odor, Assorted Bright Colors, Set of 6', 'Make your dry erase writing experience better with our Low-Odor Magnetic Double-Ended Dry Erase Markers with built-in erasers in assorted colors. These markers are the perfect companion for any dry erase board surface, offering vibrant colors and quick-drying, low-odor ink. With 12 essential colors to choose from, including black, red, blues, greens, and more, you\'ll have a wide range of options for your creative endeavors. The bullet (3 mm) tip ensures precise and bold writing, while the built-in felt erasers on the magnetic caps make corrections a breeze. Designed with a contoured cap shape, these markers stay put and won\'t roll off any surface. Whether you\'re in the classroom, office, or at home, these magnetic double-ended markers.�Explore our stylish and fashion-forward product lines, including stationery, journals, writing tools, presentation boards, and desk organization solutions for your home, school, or office.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/71msFVcU+AL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/71msFVcU+AL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71ygIEOJXQL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71OiuIgzHaL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61FY6eafNVL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71zeNA+J4sL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71KRTwxvpnL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81yImUYeRrL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71gDlLc6IJL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71n4mWq3pLL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71exknUHvEL._AC_SL1500_.jpg\"]', '{"brand": "U Brands", "category": "Office Products", "dimensions": "7 x 0.63 x 7.5 inches"}', '[\"VIBRANT COLORS Set of 6 magnetic, double-ended white board markers with 3 mm bullet point tips in 12 assorted low odor colors; bold color laydown, perfect fine point dry erase markers for kids, home, office, or classroom use\",\"MAGNETIC CONVENIENCE The magnetic cap keeps the magnetic dry erase markers securely attached to any magnetic dry erase board, making it easily accessible whenever you need it; no more searching for misplaced markers\",\"QUICK CORRECTION CAP Make corrections a breeze with the built-in felt erasers on the caps that allow for clean erasing without residue; featuring a contoured anti-roll cap shape, which prevents the markers from rolling off any flat surface or tray\",\"VERSATILE AND RELIABLE Designed for use on a variety of dry erase boards; from white boards to glass boards these thin dry erase markers provide the perfect tool for interactive learning and brainstorming\",\"12 COLORS Use these whiteboard dry erase markers to create impactful presentations using different shades of Black, Blue, Pink, Red, Green, Orange, Brown, and Yellow\"]'),
