r Sport Camera Compatible for GoPro Hero 12 11 10 9 8 7 Black compatible for Insta360 X4 X3 GO3 Ace Pro compatible for Osmo Action 4 3 2 Pocket 3, and compatible for AKASO Brave 4, etc.\"]'),
(241, 7, 212, 'SentrySafe Black Fireproof Safe with Digital Push Button Keypad, Home Safe For Money, Documents, and other Valuables, 1.23 Cubic Feet, SF123ES', 'Keep your valuables protected with the SentrySafe Fireproof Money Safe. Measuring 17.8 x 16.3 x 19.3 inches, this black safe is perfect for keeping important documents, money, and small items secure in your home or office. The fireproof design ensures that your belongings stay safe even in the event of a disaster. This lock box features a shelf for easy organization and access to your items. It also comes with a key lock to provide added security and peace of mind. Whether you need a safe for money, documents, or other small valuables, this fireproof safe box is an ideal solution. This Fireproof safe is UL Classified to endure 1 hour at 1700�F and keep the interior temperatures safe for irreplaceable documents, valuables, DVDs, and USBs or other valuables. Its compact size makes it easy to fit in any space while still providing ample room for your essentials. SentrySafe is known for its reliable and durable safes for home use, and this fireproof document box is no exception. This safe will meet all of your security needs.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/61IFGhdN7gL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/61IFGhdN7gL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/51vXwQUidGL._AC_SL1000_.jpg\",\"https://m.media-amazon.com/images/I/614x1eKHI0L._AC_SL1000_.jpg\",\"https://m.media-amazon.com/images/I/51nUa7bO+JL._AC_SL1000_.jpg\",\"https://m.media-amazon.com/images/I/61wWfUokZPL._AC_SL1000_.jpg\",\"https://m.media-amazon.com/images/I/51QklM3AioL._AC_SL1086_.jpg\",\"https://m.media-amazon.com/images/I/61YtzZ075VL._AC_SL1500_.jpg\"]', '{"brand": "SentrySafe", "category": "Tools & Home Improvement", "dimensions": "19.3\\\"D x 16.3\\\"W x 17.8\\\"H"}', '[\"FIREPROOF Safe is UL Classified to endure 1 hour at 1700�F and keep the interior temperatures safe for irreplaceable documents, valuables, DVDs, and USBs\",\"CUSTOMIZABLE COMBINATION The fireproof safe box allows you to set your own combination on the keypad\",\"COLOR The document safe has a black exterior finish\",\"MEASUREMENTS Exterior is 16.3 W x 19.3 D x 17.8 inches H and Interior 12.6 W x 11.9 D x 13.8 inches H, Large 1.23 cubic foot capacity safe weighs 85 pounds\",\"DURABILITY Safe�s solid construction includes 4 live-locking blots, a pry-resistant hinge bar, and bolt-down hardware\",\"STAY ORGANIZED Home safe includes shelf and door pocket to customize organization and storage of valuables\"]'),
(242, 1, 213, 'onelinkmore Headphone Splitter, 5-Jack 3.5 mm Audio Headphone Splitter Stereo Audio Headset Adapter, Audio Earbuds Earphones Plug 5 Way 1 Male to 4 Female Splitter with 3.5mm Stereo Cable', 'The video showcases the product in use.The video guides you through product setup.The video compares multiple products.The video shows the product being unpacked. 5-Jack Audio Headphone Splitter Simply plug the splitter into any device with a 3.5mm auxiliary port, connect up to five headphones to one device for sharing music without being noisy in any places,each port can be output end or input end, mixing and fade-ins controlled,The splitter works with any device equipped with a 3.5-millimeter auxiliary port including smartphones, tablets, laptops, and more. 5 Way - Multi Headphone Splitter The installation is very simple, you only need to put the audio output port of MP3, CD, MD, he inserts, computer, and the speaker or Headset are respectively connected into the two output interface can be. Compatible with iPhone,iPod,iPad,Samsung,Blackberry,Tablets,mp3,laptops or other portable DVD players Multiple Headphone Audio Adapter for Classroom and Travel It\'s a perfect traveling companion for long road trips and plane rides. Parents can enjoy a peaceful drive while their kids listen to music, watch a movie, or listen to an audiobook. It also makes an effective learning tool, up to five students can listen to the same audiobook or podcast at a time.Earphone splitter is made of ABS plastic material,with compact portable size.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/51nvESwXdyS._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/51nvESwXdyS._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71xKmcs4iRS._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61V6MSDV2zS._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71xqbyY5x2S._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61VczHzBXrS._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/41quFu44NRL._AC_.jpg\",\"https://m.media-amazon.com/images/I/61eZ2bR3WTS._AC_SL1500_.jpg\"]', '{"brand": "onelinkmore", "category": "Electronics", "dimensions": "4.41 x 3.74 x 0.75 inches"}', '[\"SHARE MUSIC - Share up to 5 audio outputs at the same time;with the AUX Headphone splitter,allow to share music,movies,games with kids or friends,The only thing better than listening to your favorite song or watching your favorite show or movie is sharing the experience with your friends and family. Just plug in any mobile device with music or movies on it -- such as your iPad, phone or tablet -- connect up to five headphones, and start sharing. It works with an auxiliary port.\",\"COMPATIABLE - Support any audio player or devices with 3.5 mm connectors,3.5mm headphone adapter splits line into five 3.5mm ports. Allows you to connect 5W headphones or speakers simultaneously,such for Mp3 Player,Mobile Phone,Laptop,PC,Headphones,Speakers,iPhone 6, iPod,Classroom and Travel\",\"HEADPHONE SPLITTER - Use like a simple splitter(1 audio input and up to 5 audio outputs,Made of ABS plastic with a PVC cable);You and your friends can become the DJs when you connect more than one device to RockStar. Let everyone listen to their new musical creations together. It also gives the capability to split speakers. You and your band can play instruments without giving everyone in the house an unexpected late-night concert.\",\"STEREO CABLE - Splitter 3.5mm Audio 5 way 6 port Male to Male plug Stereo Audio Cable is included(Five AUX ports for attaching headphones or auxiliary cables,One hard-wired auxiliary cable for connecting to devices)\",\"ENJOY SOUND - This is the good way to share your favourite voice with your friends,enjoy the sound together with multi headphone audio splitter (this is 3.5-millimeter auxiliary port, Only works for 3.5mm auxiliary port,Does NOT work with lightning port or type C port).\"]'),
(243, 2, 214, 'Smart Weigh Digital Shipping and Postal Weight Scale, 110 lbs x 0.1 oz, UPS USPS Post Office Scale', 'The Smart Weigh Digital Shipping and Postal Scale is the perfect compact home and office solution for weighing parcels and mail-sized packages. With precise readings, a backlit LCD display, and multiple unit options, it ensures efficient weighing for all your shipping needs.  It has a capacity of 100 lbs (50 kgs), making it ideal for weighing large parcels and packages. It features a sleek design that can be mounted on the wall, saving space in your workspace.  1 Durable & Smart Function 2 110lbs 50KG Capacity 3 Can be Wall Mounted Crafted with precision, this scale boasts a sleek, durable design and smart functions, perfect for home or office parcel weighing. Its tare weighing feature lets you easily subtract container weight for precise measurements, ensuring accuracy with every use. This scale is ideal for home, commercial, shipping, and office use, ensuring accurate weight measurements for all your needs. Its sleek design features a tare weighing function for convenient packaging, making it perfect for parcels of any size while maintaining high accuracy and durability.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/71unsNfayuL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/71unsNfayuL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/7134IYKqq7L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81blTF2Y5cL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71xfropFRSL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/912cs6necuL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71hsANlQEBL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71Htn1z9IlL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/91QlTDKncGL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81-LPrupWyL._AC_SL1500_.jpg\"]', '{"brand": "Smart Weigh", "category": "Office Products", "dimensions": "8 x 8 x 1.8 inches"}', '[\"SMART DESIGN � Professional Postal Scale with wide platform to easily weigh a variety of package and mail sizes. Weight reading is displayed on an easy to read, backlit LCD display. Display unit has a long extendable cord that can be easily mounted on the wall. Perfect for a home, office or professional business. AC Adapter included, View the video under the additional photos for complete features.\",\"HELPFUL FEATURES � Digital scale comes with a number of features to make shipping and mailing simple. Tare weighing function allows user to weigh an empty box or container for net weight determination. Hold button displays and locks the stabilized weight.\",\"ADVANCED WEIGHING � High precision sensors gives the most accurate weight readings, while auto calibration option ensures package weight readings remain accurate and consistent.\",\"MULTIPLE MODES � Useful for a variety of weighing purposes, electronic postal scale displays readings in g, kg, lb and lboz. Scale has a high capacity up to 110lbs / 50kg and minimum capacity 0.1oz / 2g. USPS postal gives instant, accurate readings, sure to match up with the post office.\"]'),
