\" W x 10-1/4\" H) premium poly expanding file wallet with a single pocket that has a full expansion of 5-1/4\" to contain your tabbed folders for portability\",\"Additional width allows top tab file folders to fit inside, while top flap with an elastic cord keeps documents contained as contents are added to full expansion\",\"Made of extra heavy materials with a black rubber gusset sewn in with full perimeter black webbing reinforcements for ultimate strength\",\"Extra width wallet with accordion style sides holds standard top tab folders without bulging the sides; Includes clear pocket on front with index card insert for labeling contents\",\"Made of durable, tear and water resistant poly material that protects contents from dirt and moisture; Easy to clean and wipe away fingerprints and debris\"]'),
