mething you can\'t wait to give it a try, the mute button is conveniently placed on the tip of the microphone boom, away from other buttons on the earcup, so there\'s no fumbling or confusion about which button to press, it also virtually eliminates the prospect of accidentally clicking other buttons when trying to mute. The wireless headset for pc also clearly tells you \"Mute on\" and \"Mute off\" when you press the mute button\",\"Pair with Multiple Devices Some Bluetooth headsets may support a phone and computer connection only, while the M98B office headset with mic can connect to two devices � including cell phone, laptop, tablet, and iPad at once with multipoint pairing, allowing you to move freely between music, videos, calls, and more without skipping a beat. While listening to music or watching a movie on one of the connected devices, you can observe all the device\'s ongoing rings of calls or texts from platforms like Teams, Mail, etc., without having to peek at the screen. If your phone rings while you\'re in a video call on your computer, your connection will switch so you can take the call on your phone\",\"Total Hands-free Control When you need your hands to do your job, simply press and hold the MFB button of the headset with mic bluetooth for 1s and you can activate your phone assistant like Siri or Google Assistant to answer calls, make calls, send texts and emails, skip tracks, get directions, get recommendations and more for total hands-free control - all without ever touching your phone\",\"Powering Your Long Shifts. Clutter-Free Effortless Charging Take on any challenge with peace of mind your battery won\'t run out of juice during a shift. Laptop headset with microphone lasts up to 20h of music time or 14h of talk time on a single 2h charge. PC headset with mic wireless also comes with a charging stand. Simply rest the Teams headset on the base, and it charges it right away, so you\'re always ready for the next use. The dock is weighted so that it won�t slide around on your desk. Compact and unintrusive, the stand takes up very little space. You\'ll like the way the headset stands up during charging. You can charge the iPhone headset on the stand or plug the cord in directly\",\"What You Get M98B computer wireless headset with microphone, charging base, Type-C charging cable, user guide\"]'),
