tures like setting rest times and automatic report scheduling. Can I Check In on One Device and Check Out on Another? Yes, you can. Simply select multiple devices when configuring the employee�s shift to enable check-ins on one device and check-outs on another. What Should I Do If I Forget My Account and Cannot Unbind the Device? If you forget your account information, provide the device�s SN (serial number) to our client support team. They will assist in unbinding the device for you. How Do I Download Time Reports? You can download time reports directly from the cloud software. The reports will automatically calculate and summarize clock-in hours. What Does �Punch Interval� Mean? Defines the minimum time between successive clock-ins. For example, with a 5-minute punch interval, if multiple punches occur within 5 minutes, only the first punch will be recorded, and subsequent punches within that interval will be ignored.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/61H7dLnCLqL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/61H7dLnCLqL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71dbbxghvjL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/811O8nA1jUL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61tUgK3kaBL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61DFW8LTW2L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/611uQR9zmvL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/711G2XZg65L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71DKYcRgDIL._AC_SL1500_.jpg\"]', '{"brand": "NGTeco", "category": "Office Products", "dimensions": "1.5\\\"W x 6\\\"H"}', '[\"Free Cloud Service The TC1 Cloud-Connect time clock, powered by NGTeco Office software and app, allows you to access real-time punch data from anywhere. Benefit from accurate hour calculations and automatic report generation through any web browser.\",\"No Monthly Subscription This time clock operates right out of the box with no monthly fees. The NGTeco Office Cloud service is free and caters to all time management needs for various businesses, including companies, offices, factories, hotels, schools, and restaurants.\",\"Confidentiality Technology Upgrade The TC1 is powered by Amazon Web Services (AWS), ensuring robust network security with TLS 1.2 and AES 256 encryption for all data and communications.\",\"Multi-Device Data Synchronization Network multiple TC1 devices to synchronize data across locations. Employees can clock in and out from different sites, with data updated seamlessly when the network connection is restored.\",\"Multi-Language Support NGTeco Office software supports multiple languages including English, Italian, Spanish, Latin American Spanish, German, French, and Japanese, allowing flexible interface language options.\",\"Large Storage Capacity With a capacity for 200 users and 30,000 logs, the TC1 is ideal for small and mid-sized businesses. It connects via LAN or 2.4 GHz Wi-Fi, continuing to capture punches even if the network is down, syncing data to the cloud once reconnected.\"]'),
