(262, 1, 231, 'JSAUX USB C to 3.5mm Headphone and Charger Adapter, 2-in-1 AUX Mic Jack with PD 60W Fast Charging,Compatible for Earphones iPhone 16 Pro/16 Pro Max/16/16 Plus/15 Pro Max,Samsung S24/S24+/S23,iPad Pro', '1 Play game while charging 2 Watch film while charging 3 Listen to music Innovative engineering ensures durability and a long life span. Special strain relif design can bear 15000+ bends in strict laboratory tests. Adds strong military fiber extend cable life effectively. Why will my music stop when I unplug the power after charging? It\'s normal because the main control chip will be restarted if the power supply of the main board system is changed. Please set play music again. What devices is this adapter compatible with? This adapter is compatible with almost any device with one USB-C port, but Not compatible with all models of OnePlus/ Pixel. Can I use the volume buttons/call controls on my earphone cable with this adapter? Yes, the adapter fully supports inline headphone controls. Note: Adapter does not support inline volume control on Apple�s earPods. Why doesn\'t his charging port work? The power of the wall charger used is low, please use a wall charger with PD20W or above or use the original charger of the device. Why is there no music going out for recording? Headphones that can only support the 4-pole TRRS 3.5mm port recording function.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/61ooA4TJLTL._SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/61ooA4TJLTL._SL1500_.jpg\",\"https://m.media-amazon.com/images/I/9180hvNtWkL._SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71I-5zr6gqL._SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81A2oBvSekL._SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71z0SxkpknL._SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71HYip6RPmL._SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71HYip6RPmL._SL1500_.jpg\"]', '{"brand": "JSAUX", "category": "Electronics", "dimensions": "11 x 0.15 x 0.15 inches; 0.35 ounces"}', '[\"?USB-C to 3.5mm & Charging? Splits USB-C into a PD-compatible port and a 3.5mm jack, allowing music, games, calls, and video while fast-charging. *Note Does not support Apple headphone line control.\",\"?Supports Fast Charging? Up to PD 60W charging; for faster speeds, use a PD20W or higher wall charger, as QC may not be supported on some phones\",\"?Hi-Fi Audio Playback? DAC supports 24bit/96kHz or 16bit/48kHz; ADC supports 16bit/48kHz, providing stable, high-quality audio without current noise; 3.5mm port compatible with CTIA, TRRS. Only TRRS headphones have microphone support,TS and TRS do not\",\"?Wide Compatibility? Works with most USB-C devices including iPhone 16 Pro/16 Pro Max/16/16 Plus, iPhone 15 series, Samsung Galaxy S20/S21/S22/S24, Note 8/9/10/20, iPad Pro, Huawei Mate 10/20/30, P20/P30; NoteCannot charge all models of OnePlus and Pixel.\",\"?Ultra-Portable? No drivers needed; slim design for easy connectivity anywhere\"]'),
