(268, 3, 235, 'PUBG Mobile Triggers 13 in 1 Combo, 4 Gaming Triggers Mobile Phone Game Controller for PUBG/Knives Out/Call of Duty/Rules of Survival, Aim & Fire Trigger for iPhone & Android Phone (Boy)', 'New Release! 13 in 1 Mobile Gaming Combo Kits for PUBG/Call of Duty/Fortnite/Knives out 13 in 1 Cell Phone Gaming Triggers Combo Kits! It is a nice cute mobile phone gaming combo kits with a small black storage case which can let you bring all these gaming kits with you and enjoy mobile phone gaming everyday and everywhere. All this combo components was strictly selected by our QC and QA team. So we have 100% confidence with our quality. Hope this combo kits can let you play game as an expert and win the games all the way. Good Luck and win the games! Super Sensitivewith Real Mouse Click Switch inside! Real Mouse Micro Switch inside 1. Super Sensitive 2. Click fast as real mouse 3. Nice Clicking Sound 4. Play like an expert Newest Back Clip Design 1. Easy to mount on your phone tightly 2. Maximum Thickness: 13mm 3. can fit almost all kinds of phones 4. No need to remove your phone case Professional 4 Triggers Operation 1. Let you play like an expert shooter 2. Easily set your game configuration 3. Put touch points at your familiar position 4. Small cover area on your phone 11 Gaming Accessories for all your shooting games need! 9pcs Micro Copper Fiber Gaming Finger Sleeves Silicone PUBG Key Ring Mini Storage Case to put all your needs in This combo kits can fit most of shooting games in the market! If your game can configure the shooting and aiming touch points, this controller can fit your games for sure.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/61xwIjxZIwL._SL1031_.jpg', '[\"https://m.media-amazon.com/images/I/61xwIjxZIwL._SL1031_.jpg\",\"https://m.media-amazon.com/images/I/618R7TYYFRL._SL1000_.jpg\",\"https://m.media-amazon.com/images/I/71O2eitKfAL._SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71BZiFKOqWL._SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71ZiOD4MkEL._SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71ldjZWg0yL._SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71AtMZVUoyL._SL1500_.jpg\",\"https://m.media-amazon.com/images/I/41qF6t6o-uL.jpg\",\"https://m.media-amazon.com/images/I/61BeQYAnNPL._SL1076_.jpg\"]', '{"brand": "Mikirini", "category": "Cell Phones & Accessories", "dimensions": "3.31 x 3.27 x 1.65 inches; 2.47 ounces"}', '[\"??Using Tips?These Mobile Game controllers are using the sensitive real mouse micro switch inside. So there are several phones which have the electromagnetic problems. This will cause the triggers touch the screen automatically. Please do not worry about this and you just need to turn off the screen for 10 seconds and turn on the screen again. This issue will solved right away.\",\"??Perfect Compatibility?These Mobile Game controllers are compatible with iPhone, iPad and most Android Phones, without even remove your case.(The thickness of the compatible mobile phone should be not more than 13mm.) These 6-fingers-operation mobile game controllers are suitable for a variety of shooting games, including PUBG, Call of Duty, Fortnite, Knives Out, Rules of Survival, Survivor Royale, Critical Ops etc. As long as the game allows customizing and draging the keys.\",\"??Small and Lightweight?The PUBG game triggers are portable and tiny for you to put them into your pocket, and have them for gaming when in office, school, trip, camping and play games anywhere and anytime. With the 6 trigger PUBG mobile controller, you can simultaneously move, turn, aim and shoot by using the index fingers to press the buttons, which can eliminate the trouble that use thumbs only to make all operations.\",\"??Mechanical Touch?4 triggers PUBG mobile controller designed for longevity with greater durability and responsiveness, more than 2 million click. Fast mechanical keys with medium resistance, precise actuation, audible click sound, and tactile bump feedback. Easy To Use, High Sensitive, Physical Button Feedback. Using this PUBG mobile game controller, you can move, angle adjust, aim and shoot at the same time with the thumbs and index fingers of the left and right hand.\",\"??Super Gaming Experience?This PUBG game triggers is made of ABS and alloy, durable and ergonomic. 6 trigger PUBG mobile controller electroplated alloy materials, mouse buttons, smooth touch, six-finger linkage, auxiliary pressure grab, one-second burst, dominate the game battlefield, and enjoy the ultimate gaming experience. Call of Duty mobile controller are sensitive to shoot and aim, no Power supply and driver needed, easy to use and high precision, increase your game score!\",\"??What is in your package??1Pair PUBG L2R2 Game Triggers, 9pcs finger sleeves for gaming, 1pc boy Silicone keyring and 1pc storage case.\"]'),
