(274, 2, 240, 'Office Chair Mat for Hard Wood Floors, 36 x 48 inches Clear Floor Mat for for Rolling Chairs, Heavy Duty Wood/Tile Floor Protectors for Home Office, Anti-Slip, Easy to Clean', 'Introductions:LeapYouth Office Chair Mat is made of top-grade PVC and free of the BPA.Our office floor mat is good for hardwood floors, tile, laminate, vinyl, concrete, and linoleum. It is ergonomically designed to allow effortless movement of office chair wheels, and provide good protection to your hard floor. Features:The floor mat is Odorless, no BPA, does not contain volatile odor for a healthy indoor environment. Dull polish makes the scuffing less visibleSmooth surface allows your desk chair to glide easily over the matGive your floor and furniture the best protectionReduce friction between chair and the floor, protecting floor from frequent scratch Transparent surface with special treatment, uneasy to slip Warm Tips1. Keep away from fire or extreme heat. 2.These mats may be rolled when packaged. In such cases, the PVC material may take a few hours to return to its original shape once unpacked.3.The mat should be placed smooth side down (facing the floor), textured side up.Please follow below steps:1. Spread chair mat, begin to roll back from the front direction, put a night,it will naturally flat out.2.Or get some warm water to make it soften, spread it to the opposite direction down. Specifications:1. Material:PVC2. Dimensions: (48 x 36 x 1/16)\" (122 x 92 x 0.15) cm (L x W x H)3. Weight: 4 pounds4. Color: clearPackage Includes:1 x Office Desk Chair Mat', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/817egxEJD7L._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/817egxEJD7L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71I9MJkv50L._AC_SL1100_.jpg\",\"https://m.media-amazon.com/images/I/71wnO3lJxSL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81fkh4QXYhL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images