ound & Vibration Set Scan the setup code on page 28 of the manual to turn on and off the sound/vibration and adjust the volume. Power on/off Button With a separate physical switch button, you can turn it off at any time to reduce the loss of power.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/61o9viHjVeL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/61o9viHjVeL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81N+hPRb6aL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/612Iw0SlhBL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71Dd3tpy-ZL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61wEgI03F7L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61lwrkQHkRL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61vMsIIZ2oL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71HcnzhslYL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61v4Nxtzz4L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61c1U0Sv3BL._AC_SL1280_.jpg\",\"https://m.media-amazon.com/images/I/71bgaPD3PEL._AC_SL1280_.jpg\",\"https://m.media-amazon.com/images/I/61NORVeWxlL._AC_SL1280_.jpg\",\"https://m.media-amazon.com/images/I/51NAuftk74L._AC_SL1280_.jpg\",\"https://m.media-amazon.com/images/I/51Q9XIWXBXL._AC_SL1280_.jpg\",\"https://m.media-amazon.com/images/I/71lhxzpuvaL._AC_SL1280_.jpg\"]', '{"brand": "Eyoyo", "category": "Office Products", "dimensions": "0.98 x 1.65 x 4.13 inches"}', '[\"Convenient Clip-on & Pocket Design At office or on the go The Eyoyo mini portable barcode scanner with a clip so you can use it anywhere. Pocket size design allows you to easily put it in your pocket. If you don�t have a pocket or the pocket is full of things, it doesn�t matter, This Eyoyo scanner is equipped with a clip on the back, you can clip it to any place that can be clipped, such as shirts, jeans, or your belt\",\"2000mAh Huge Battery with Battery Indicators Eyoyo is the one to design huge battery 