(284, 2, 86, 'Avery Matte White Round Labels with Sure Feed, 2\" Diameter, 300 Matte White Printable Labels', 'Matte white Avery labels are the perfect choice for any project. The smooth, matte white finish is a great fit whether you\'re designing product labels, shipping packages for work, making party favors or adding a creative touch to personal crafts or school projects. Each sheet of labels features Sure Feed technology which helps deliver a more reliable feed through your printer to prevent print misalignments and paper jams. The print-to-the-edge feature makes it easy to print beautiful designs that can reach the edges of the label without a border or outline. Quickly apply these labels with our patented Easy Peel label sheets with Pop-up Edge. Simply fold the sheet back to display the label edges for convenient and fast peeling. A strong permanent adhesive is used to ensure that these labels stick and stay to paper, cardboard, plastic, glass, metal and more without curling or falling off. The versatile label shape can adapt to almost any use, just create your design with our free software and print. Avery Design & Print makes it easy to create customized labels from your own home or business so that you can print professional designs with your laser or inkjet printer. Our free browser-based software includes predesigned templates as well as tools for editing text and images so that you can create soap labels, candle labels, branding labels, food labels and more. Try it out today by searching for Avery template Presta 94501 on the Avery site.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/71+cMk64JVL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/71+cMk64JVL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71iNe+FQpkL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71LlnBOmlYS._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71NoONW97iS._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61XY9ViI32L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71I5sQI7wCL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71Do3SwJ4ZS._AC_SL1500_.jpg\"]', '{"brand": "AVERY", "category": "Office Products", "dimensions": "12.09 x 9.44 x 0.25 inches"}', '[\"Create your own custom designs with Avery label template Presta 94501\",\"Versatile Avery round labels let you personalize soap labels, candle labels, branding labels, food labels and more with your own logo, unique images and text with Avery Design & Print Online\",\"Avery white labels with proprietary Sure Feed technology provide a more reliable feed through your printer, preventing misalignments and jams\",\"Permanent label adhesive ensures that labels stick and stay to a variety of surfaces without peeling, curling or falling off\",\"Print round stickers with beautiful full-bleed designs that fill the entire label with the print-to-the-edge feature\"]'),
(285, 1, 143, 'SanDisk 128GB Extreme microSDXC UHS-I Memory Card with Adapter - Up to 160MB/s, C10, U3, V30, 4K, A2, Micro SD - SDSQXA1-128G-GN6MA', 'With the SanDisk Extreme 128GB microSD UHS-I Memory Card get extreme speeds for faster transfer, app performance, and 4K UHD video. (2) Ideal for your Android smartphone, action cameras or drones, this high-performance microSD card handles 4K UHD video recording, Full HD video and high-resolution photos. The super-fast SanDisk Extreme microSDXC memory card reads up to 160MB/s and writes up to 90MB/s. Plus, it�s A2-rated, so you can get fast application performance for an exceptional smartphone experience. Not all devices support microSD memory card formats. Check with your device manufacturer for more details. For 128GB-400GB: Up to 160MB/s read speeds, engineered with proprietary technology to reach speeds beyond UHS-I 104MB/s, requires compatible devices capable of reaching such speeds. Up to 90MB/s write speeds. 1MB=1,000,000 bytes. (1) 1GB=1,000,000,000 bytes. Actual user storage less. (2) Compatible device required. Full HD (1920x1080) and 4K UHD (3840 x 2160) support may vary based upon host device, file attributes and other factors. (3) Download and installation required. (4) Card only. See SanDisk website for additional information and limitations. (5) UHS Speed Class 3 (U3) designates a performance option designed to support real-time video recording with UHS-enabled host devices. Video Speed Class 30 (V30), sustained video capture rate of 30MB/s, designates a performance option designed to support real-time video recording with UHS-enabled host devices. (6) Registration required; terms and conditions apply. (7) For 64GB-400GB: A2 performance is 4000 read IOPS, 2000 write IOPS. Results may vary based on host device, app type and other factors. (8) Read only; Based on internal testing. Results may vary based on host device, file attributions and other factors.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'ht