(292, 1, 254, 'FiiO JadeAudio KA1 Headphone Amps Tiny Amplifier USB DAC High Resolution Lossless for Smartphones/PC/Laptop/Players(Lightning, Black)', 'FiiO\'s New Released Dongle is here for you Compact portable DAC and amplifier Convenient, portable and useful You would get many fun from this tiny amplifier High Performance ES9281AC PRO DAC Employed in the KA1 amplifier is the ES9281AC PRO chip, which combines USB audio interface, DAC, and amplifier into one package. When combined with the multi-layered HDI gold-plated PCB it is on, the result is lower crosstalk, higher efficiency through lower power consumption, and ultimately high quality pure sound. Support MQA rendering The KA1 dongle has been officially certified by MQA to be truly capable of MQA rendering! *The KA1 tiny usb dac includes MQA Renderer technology, which can connect to an MQA Core signal (from TIDAL streaming service, FiiO Music App or any other MQA enabled music services or media players) and complete the final unfold of an MQA file. Supports 32bit/384kHz lossless audio With support up to 32bit/384kHz PCM and DSD256, you will surely be able to hear even the finest details within your music! PS: DoP mode supports up to DSD128, Native mode supports up to DSD256 Specifications of KA1 mini USB DAC (1)Output: 3.5mm headphone jack (2)Output power: 45mW (3)SNR: 114dB (4)THD+N: 0.0005% High Performance ES9281AC PRO DAC Support MQA rendering Supports DSD256 KA1 Specifications Play with your earphones Simply and convenient to be played with your standard 3.5mm headphone jack earphones, you could be easy to get a lossless sound for listening music or playing game and so on. Connect with your smartphone You would be enjoyed to connect with your smartphones playing high resolution music. Compatible with Android/iOS/Windows/Mac... Connect with your PC/laptop Easily connect with your computer when you are playing game or on a meeting. Listening music/Playing game You also could use it with your portable player/tablet and so on. You could use it when you are commuting or gaming at home or office. Connect with your earbuds With your smartphone With your computer multi playing ways Lightweight and mini size (1)Body dimensions: About 40x15x8mm (2)Cable length: About 70mm (3)Weight: Only 10g USB type c or lightning interface Two options for you, you could choose USB Type C or lightning interface to compatiable with your needs. RGB status indicator The RGB status indicator not only features captivating looks, but also conveniently displays the current audio format and sampling rate. (1)Blue light: 48kHz or below sampling rate (2)Yellow light: Greater than 48kHz sampling rate (3)Green light: DSD (4)Magenta light: MQA rendering Accessories included 1. KA1 tiny dongle*1 2. USB Type C to USB A cable*1 3. Manual*1 Lightweight and mini size USB type c or lightning interface RGB status indicator Accessories included FAQ for KA1 mini headphone amp Q1. How to use the KA1 with mobile phones? (1)[Android-based mobile phones/tablets]: The KA1 has two editions, Android (USB Type C) and iOS(Lightning). The Type-C edition can be directly connected to Android mobile phones or tablets. Play music to enjoy high-quality music. (2)[iPhones/iPads]: The Lightning edition can be directly connected to iPhones or iPads. NOTE: A. Only iOS10.0.2 and above are supported. Apple devices below this version cannot be supported because of the iOS itself. B. How to download lossless music files to the FiiO Music App (iOS)? Q2. How to connect the KA1 to computers? (1)[Windows computers]: KA1 can be used driver-free with computers of Windows 10 and above, other version please go to our website to check and download the USB DAC driver. (2)[Mac]: KA1 runs driver-free on macOS. Q3. Does the KA1 support in-line control and answering phone calls? (1)There is no physical button on the KA1, so in-line control will not be supported. (2)Since different smartphones vary in USB phone call permissions, the in-line control and phone call functions of the KA1 are temporally unavailable. (3)An incoming call will be passed out through the speaker and microphone of the mobile phone. So you can pick up the phone to answer the call without unplugging the KA1. Q4. When connecting the KA1 to my computer, the indicator light is on, but the computer cannot recognize the KA1. What happened? (1)The KA1 can detect if there are headphones connected to it. Only when it is connected to headphones will it turn on and automatically match the headphone impedance. (2)Why is the indicator light not turning to magenta when playing an MQA track? --First, please make sure the sound source is MQA format. Second, make sure if the playing device supports MQA decoding. (3)What can be done when the KA1 is connected to a computer for DSD256 decoding, but the volume cannot be adjusted? --When it is playing Native DSD, the volume cannot be adjusted through the software. Please adjust the volume on the FiiO driver panel. Q5. If you need to download the Quick start guide, Windows USB DAC driver, please go to our official website to check it out.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/81i9VVZc8dL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/81i9VVZc8dL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61RBIVVOP+L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61SH4SZ8lNL._AC_SL1200_.jpg\",\"https://m.media-amazon.com/images/I/71UPCBQqWjL._AC_SL1200_.jpg\",\"https://m.media-amazon.com/images/I/71rYMiRyB9L._AC_SL1200_.jpg\"]', '{"brand": "FiiO", "category": "Electronics", "dimensions": "1.69\\\"L x 0.59\\\"W"}', '[\"[Supports high resolution sound] KA1 mini headphone amp supports up to 32bit/384kHz PCM and DSD512 high-end decoding.\",\"[Compatible with Android/Windows] KA1 tiny amplifier can support multi-devices, supports smartphone/portable player/tablet/computer.\",\"[Supports MQA 8x rendering] KA1 portable dongle supports MQA rendering. You could get a lossless sound when you listening music or others.\",\"[Lightweight but useful and powerful] The tiny USB DAC KA1\'s body size is only 43x15x8mm, and it is just about 10g. It is convenient and portable for you to take it anywhere.\",\"[Multi-playing ways and portable] KA1 amplifier with a USB Type-C connector, you could use it to get a high resolution sound for listening music,playing game,doing chatting,doing living when you are at home or at office.\"]'),
