(309, 2, 86, 'Avery Mini Ultra Tabs, 1\" x 1.5\", 2-Side Writable, White, 40 Repositionable Tabs (74788)', 'Avery Mini Ultra Tabs are durable tabs that make indexing, flagging and referencing quick and easy with a smaller size so you can fit more tabs in your books, notes and planners. The sturdy tabs are writable on both sides and the adhesive body is clear so you can still see the text underneath. Enjoy crisp, smudge free* writing on page tabs with most pens, pencils, markers and highlighters. The repositionable tabs stick securely and are strong enough to turn pages, yet remove easily without leaving residue or lifting ink. Perfect for home organization; use these sticky tabs as page flags in magazines, bible tabs for passages or recipe index tabs in cookbooks. Students, teachers and administrators will find it easy to highlight textbooks and notes without marking the pages. At the office, make quick and easy sticky notes in your weekly or monthly planner and mark items in a report or presentation for referencing, follow up or signatures.*Ink dry times may vary. Tab may lift some inks. Test before applying. The pack includes 40 white mini Ultra Tabs.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/71c85PJ5p6S._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/71c85PJ5p6S._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71+NMYUFSMS._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71s2+Sqs5jS._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/718Tp8W95nS._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81p4RKqbCnS._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71IPNP9hrOS._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/51mhakAyG2S._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81qQdfhJo2S._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/715gCVs8OyL._AC_SL1500_.jpg\"]', '{"brand": "AVERY", "category": "Office Products", "dimensions": "3 x 0.39 x 5.5 inches"}', '[\"Get more out of indexing, referencing and organizing with white mini tabs; the smaller size allows you to fit more tabs in your books, planners and notes\",\"Easily view underneath the clear page tabs body as you mark books, flag important documents, index records and more\",\"Stick securely to any page or document; the durable and repositionable tab is strong enough to turn a page, but removes easily for quick and clean changes\",\"Get crisp and clear writing on both sides of the smudge-resistant tab when using most pens, pencils, markers and highlighters (due to varied ink dry times and possible ink lifting, test ink before application)\",\"Organize with style when you create bible tabs, bullet journal tabs, index tabs, planner tabs and more with the pack 40 of white mini tabs\"]'),
(310, 5, 270, '3 Pack Printmaking Brayers - Premium Brayer Rollers for Crafting, Hard Rubber Roller Brayers, Vinyl Roller Ink Paint Brush for Wallpapers Stamping Gluing Application (2.4��, 4��, 7.9��) (Black)', 'With the large size of the rubber roller, you can easily use it in craft projects, printmaking, painting, inking blocks, stamping tools, carved surfaces, scrapbooks, etc. It�s an inexpensive tool that you can afford and also makes a good gift option. Distribute Evenly This vinyl rubber roller is good for distributing ink or glue evenly to finish printing and stamping smoothly and cleanly; Also good for inking blocks and carved surfaces. Flat and Smooth The cylinder of the roller is flat and smooth, the color is even when in use, the small plastic is pressed into a shape, light and firm, the plastic handle is comfortable, easy to disassemble, and easy to clean. Easy to Use The ink painting brayer moves with ease and no need to press hard or work hard for the roller to move; Can give you comfortable press feel and pleasant using experience. Premium Quality The rubber brayer roller is made of rubber in a cylindrical shape, good elasticity and toughness which is flat with the layout and fits tightly. Advantages: 1. The brayer moves with ease and no need to press hard or work hard for the roller to move. 2. Can give you comfortable press feel and pleasant using experience. Specifications: Color: Black Material: rubber, stainless steel and plastic Size: 2.4��, 4��, 7.9�� Roller diameter: 1.1 inch Handle length: 4.5 inch Package Contents: 3 x Rubber Brayer Rollers for Crafting Printmaking', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/51db4nRZaVL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/51db4nRZaVL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61vM6vAkLdL._AC_SL1200_.jpg\",\"https://m.media-amazon.com/images/I/61gV3juii8L._AC_SL1200_.jpg\",\"https://m.media-amazon.com/images/I/61cI5CNh3rL._AC_SL1200_.