(311, 2, 271, 'GOLD SEAL Vinyl Record Outer Sleeves for 12\" LPs, 3 mils Thick, Premium Heavyweight Record Cover Protectors, High-Density Diamond Clear Polypropylene, 12.75\" x 12.75\",(25 Pack)', 'Only Gold Seal offers Black Label Virgin Poly LP Cover Sleeves. With a thickness of 3 mils, they provide heavy-duty protection for your valued album collection. They are designed to fit standard 12\" LP album covers securely, providing an extra layer of defense against dust, scratches, scuffs, and moisture, helping to maintain the condition of your album covers over time. The dimensions of the sleeves are 12.75\" x 12.75\", which make them suitable for both single and double LPs. And Diamond Clear polypropylene offers excellent visibility, allowing the LPs\' cover artwork to be easily seen while providing reliable protection. Showcase your prized LPs with protective sleeves from Gold Seal, a leader in the industry.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/81rudbeDhVL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/81rudbeDhVL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81vtsaYwgjL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/A1zZ1FgA6dL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/91PzFVe6r+L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/91iJ-pUQ-rL._AC_SL1500_.jpg\"]', '{"brand": "GOLD SEAL", "category": "Office Products", "dimensions": "13.13 x 13 x 0.2 inches"}', '[\"BEST PROTECTION - Gold Seal high-density polypropylene provides superior protection vs. other sleeves made of polyethylene (PE) which is known to take on a dingy appearance over time\",\"DIAMOND CLEAR - Gold Seal\'s signature Diamond Clear polypropylene offers excellent visibility, allowing the LPs\' cover artwork to be easily seen while providing reliable protection.\",\"BLACK LABEL VIRGIN POLY - Only Gold Seal offers these top of the line 12.75\" x 12.75\" polypropylene sleeves to provide utmost protection\"