(314, 7, 273, 'Floor Lamp for Living Room, 75.5 Inch Tall Standing Lamp for Bedroom with 2 312� Rotatable Ring Lights, 36W Bright Stepless Dimmable LED Floor Light with Remote Control for Office Dining Room', 'The Epabina tall living room floor lamp offers a bright and versatile illumination solution for reading room and bedrooms. It features 2 rotatable C-shaped light source design, both adjustable in angles, brightness and color temperature, allowing for freely horizontal and vertical adjustment and catering to various task and ambiance needs. Ambient Floor Lamps: Rotate the floor lamps up, and adjust the color temperture to 2700K warm leisure mode, these lamps spread a pleasant and inviting light that illuminates your bedroom. Reading Task Lamps: Rotate the floor lamps down, and choose 6500K office mode, these lamps provides directed, focused and bright daylight for illuminating your working space. The lamp comes disassembled but it is easy to set up within seconds. With both a remote control and touch control, you can adjust the light settings of the office floor lamp right from your couch or bed.Each light has its own controls for color temperature and brightness, allowing for precise light customization.And there are 3 preset lighting modes for quick adjustment. Timing function is available in 10 minutes and 30 minutes.Stepless dimming of color temperature and brightness, adjustable from 10% to 100% and 1900k to 6500k. The 2000 lumens and 36W LED beads work in harmony to ensure that your space is bathed in bright, even illumination. The 2000 lumens and 36W LED beads work in harmony to ensure that your space is bathed in bright, even illumination. The magnetic remote can attached to the lamp itself for convenience. 10 inch metal base keeps the floor lamp stable and steady. Freely adjust the lighting directions.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/713uPZ1Tz8L._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/713uPZ1Tz8L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/610uovCAE4L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71UfElDms9L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71htXv5zrWL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71mGLjh31ZL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71ChXsKQTCL._AC_SL1500_.jpg\"]', '{"brand": "EPABINA", "category": "Tools & Home Improvement", "dimensions": "10\\\"D x 10\\\"W x 75.5\\\"H"}', '[\"?Dual C Shaped Rotatable Standing Light? Epabina led floor lamps for living room features 2 rotatable C shaped light source design. The outer light and inner light can rotate 312 degrees vertically and 330 degrees horizontally to freely adjust the lighting directions. You can turn the outer light up to create a visually comfortable atmosphere for your bedroom, or you can turn both lights down to create a super bright lighting area for reading, working. Position the standing floor lamp exactly where you need it, whether for focused task lighting or ambient room illumination.\",\"?36W Super Bright Bedroom Floor Lamps? The 2000 lumens and 36W LED beads work in harmony to ensure that your space is bathed in bright, even illumination. Standing at 75.5 inches tall, this tall floor lamp fits perfectly in any corner with it\'s 10 inches stable base and sleek stand, providing glare-free, flicker-free, and color-accurate lighting for your living rooms, ensuring your eyes are always comfortable and protected.\",\"?Contemporary Design Adds Elegance To Your Room? Epabina modern floor lamp is more than a versatile lamp, the double C-shaped light and the sleek metal stem seamlessly blends with any decor style, and enhances the ambiance of your room. Its flexibility in lighting direction, brightness and color temperature makes it a suitable choice for those who need soft atmosphere lighting for relaxing or reading as well as bright lighting for studying or working.\",\"?7 Levels of Color Temperature Modes? Achieve the perfect level of brightness and color temperature with stepless dimmable functionality. Epabina lighting solution offers a wide range of brightness adjustments from a subtle 10% to a bright 100% and color temperature adjustments from 1900K warm white to 6500K cold daylight, allowing you to customize the illumination for any activity. Each light has its own controls for temperature and brightness.\",\"?Magnetic Remote Control with Preset Lighting Modes? With both a remote control and touch control, you can adjust the light settings of the stand up lamp right from your couch or bed. And there are 3 preset lighting modes for quick adjustment 2700K cozy warm leisure mode for relaxing, 4000K bright reading mode and 6500K cold daylight office mode for read documents or working.\"]'),
