(322, 10, 201, 'Brother PT-E560BTVP P-Touch Edge Handheld Industrial Label Printer with Bluetooth and Dual auto-Cutter (up to 24mm Labels)', 'Designed to support contractors in large project applications, the P-Touch EDGE 560BT is loaded with features to streamline labeling for techs. Format laminated labels and heat shrink tubes up to 24mm for your applications in fewer steps using the included ruler and quick application keys. Store your databases and templates, intuitively serialize and create QR codes and linear barcodes straight on the printer itself to cut out wasted time from repetitive tasks. Rather work on your phone or computer? Get the job done from your mobile device thanks to Bluetooth� wireless connectivity and the Pro Label tool app. Or, connect and charge from your PC with a common USB-C� cable and print from the P-Touch Editor software. Then, watch the auto-cutter print a strip of labels with half-cuts to make peeling and applying labels a cinch. Add in a secure hand strap to help prevent drops and a long-lasting battery and the PT-E560BT is the go-to tool for crushing tasks with the precision and efficiency of a seasoned pro.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/61h2WIg199L._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/61h2WIg199L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71vPbwrWTzL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61z8VWW9kEL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/510P8R5zasL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61Lme0ILDsL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71z1Iag8GgL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71vGXl8tQnL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81huNUW64kL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71J92FrKpCL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71CbswGt-6L._AC_SL1500_.jpg\"]', '{"brand": "Brother", "category": "Industrial & Scientific", "dimensions": "3.15 x 9.3 x 5.2 inches"}', '[\"Label large industrial projects with laminated labels & heat shrink tubes from 3.5mm to 24mm\",\"Create labels faster with quick application keys for cable wrap, cable flag, patch panel, punch block and faceplate labels plus add QR codes & linear barcodes and store your databases and templates to print quickly from existing work\",\"Print a strip of half-cut labels with the dual auto-cutter to make peel-and-apply easy\",\"Design labels from your mobile device on the Pro Label Tool app and print labels wirelessly with convenient Bluetooth connectivity. Charge the printer and connect to your PC with USB-C to design and print from P-touch Editor label design software.\",\"Ambidextrous hand strap and utility ring provides added drop-protection and convenience\"]'),
