(325, 2, 124, 'Smead File Pocket, Straight-Cut Tab, 3-1/2\" Expansion, Letter Size, Redrope, 25 per Box (73224)', 'Smead File Pockets help keep large amounts of paperwork neatly organized and secure. Great for desk, drawer, shelf and on-the-go storage. Also ideal for use with storage boxes. Accordion style sides expand 3-1/2\" and hold up to 400 sheets. File pockets take up minimal space, expanding only when extra storage capacity is needed. Top of the gusset is reinforced with tear resistant material for extra strength and durability. Straight-cut tab provides a large visible labeling area. Includes 25 letter size (11-3/4\" W x 9-1/2\" H) file pockets with 3-1/2\" expansion. Color assortment includes 5 each blue, green, red, yellow and redrope. Contains 30% recycled content, 30% post-consumer material and is SFI Sourcing Certified.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/61JQyoMKbdL._AC_SL1000_.jpg', '[\"https://m.media-amazon.com/images/I/61JQyoMKbdL._AC_SL1000_.jpg\",\"https://m.media-amazon.com/images/I/81JM8Kx7b6L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/817I8oukdnL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71VM3GpRSsL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61ZcGg5+tmL._AC_SL1000_.jpg\",\"https://m.media-amazon.com/images/I/615s8N8ETdL._AC_SL1000_.jpg\",\"https://m.media-amazon.com/images/I/51aMp2UQUxL._AC_SL1000_.jpg\"]', '{"brand": "SMEAD", "category": "Office Products", "dimensions": "12.25 x 10.31 x 5.94 inches"}', '[\"Manage bulky records with sturdy file pockets\",\"Expands to 3-1/2\" to hold up to 400 sheets\",\"Rollover Tyvek-reinforced gusset provides extra strength at critical points\",\"Straight cut tab provides large labeling area\",\"Enclosed sides keep materials secure\",\"Contains 30% recycled content, 30% post-consumer material\"]'),
