(328, 5, 284, 'Bsrezn 300g UV Cure Resin Hard, Upgraded Crystal Clear Premixed Resin for Jewelry Making and Craft Decoration(3 x 100g)', 'Essential Insights: From Beginner to Pro Long Press to Watch How to make a uv resin necklace? Mix the Resin: Pour UV resin into a mixing container and add your desired pigments.Create the First Layer: Pour a thin layer of resin into the mold and cure it under UV resin light.Add Decorations: Arrange small items like flowers, glitter, or beads into the mold.Pour the Resin: Carefully pour resin over the decorations, filling the mold. Place the mold under the UV resin light and cure for the recommended time. The video showcases the product in use.The video guides you through product setup.The video compares multiple products.The video shows the product being unpacked. Long Press to Watch Why is the uv resin not cured completely? Opt for Shallow, Simple Molds: Choose molds that are shallow and uncomplicated to ensure even curing.Mix Pigments Before Pouring: Always mix your pigments thoroughly before adding them to the resin to avoid uneven coloring.Cure Both Sides: Make sure to cure both sides of the resin to ensure it hardens completely. The video showcases the product in use.The video guides you through product setup.The video compares multiple products.The video shows the product being unpacked. Long Press to Watch How to get rid of bubbles? Warm and Invert the Resin Bottle: Gently warm the resin and store the resin bottle upside down before use to minimize air bubbles.Use a Toothpick: After pouring the resin, use a toothpick to gently pop any surface bubbles.Apply Heat with a Hairdryer: Use a hairdryer on a low setting to lightly heat the resin and release trapped bubbles.Fix Post-Cure Bubbles: If bubbles appear after curing, add a small amount of fresh resin to fill in the gaps. The video showcases the product in use.The video guides you through product setup.The video compares multiple products.The video shows the product being u