(336, 2, 292, 'ScanSnap iX1600 Receipt Edition Color Duplex Invoice Document Scanner for Mac and PC Works with QuickBooks Online, Black', 'Optimized for bookkeepers in the home or office, the iX1600 Receipt Edition brings the power of ScanSnap to QuickBooks Online. Exclusive invoice and receipt processing features capture important data and transmit it to QuickBooks Online. ScanSnap�s legendary accuracy and amazing speed mean you�ll spend less time processing documents and get more done.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/61rmdbu7H5L._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/61rmdbu7H5L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71fxR5xsseL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71a3h7bMOZL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/715UBDWiVbL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61Z-wyzeG0L._AC_SL1500_.jpg\"]', '{"brand": "ScanSnap", "category": "Office Products", "dimensions": "11.5 x 6 x 6.3 inches"}', '[\"Simplify business finance management Scan important Invoices and Receipts into QuickBooks Online right from the preconfigured touch panel\",\"Increase efficiency and accuracy Intelligent Invoice and Receipt processing features automatically extract data into reviewable and editable fields\",\"Optimized user experience ScanSnap iX1600 features an intuitive 4.3 inch touch screen for complete end-to-end scanning and data utilization\",\"Customize your preference The scanner supports up to 30 customizable profiles; Customize the profile on the touch screen based on your scanning needs and personalize scanning icons using color, icons or letters\",\"Scan anywhere you want, whenever you want Wi-Fi compatibility allows you to directly connect to your smart devices or cloud services without a PC, and allows for flexible placement wherever it\'s convenient\"]'),
(337, 2, 293, 'Dahle 552 Professional Rotary Trimmer, 20\" Cut Length, 20 Sheet Capacity, Self-Sharpening, Dual Guide Bar, Automatic Clamp, German Engineered Paper Cutter', 'The Dahle 552 Professional Rotary Trimmer with a 20\" cut length is designed for precision and accuracy. It features a ground self-sharpening blade that cuts in both directions, a dual-barrel guide bar for strength, and an automatic clamp to prevent shifting. This German engineered cutter is ultra-precise and ideal for trimming paper, photos, and cardstock.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/81uqr87iUHL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/81uqr87iUHL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81mgWU3cZTL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71-0zF--uaL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81YfgI9-zWL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81kcTh3q82L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/815tHvjhK4L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71Os+7X2AOL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81jYYrBqiZL._AC_SL1500_.jpg\"]', '{"brand": "Dahle", "category": "Office Products", "dimensions": "18.9\\\"D x 30.71\\\"W x 5.91\\\"H"}', '[\"SELF-SHARPENING maintains a perfectly sharp edge for materials such as paper\",\"ENCASED PROTECTION the ground steel blade is encased for safety\",\"AUTOMATIC CLAMP holds work securely and prevents uneven cutting\",\"STURDY METAL BASE provides a solid surface with accurate format guides\",\"EU PRODUCTION A3 cutter manufactured in Europe\"]'),
