quick-drying formula works on a variety of surfaces such as coffee mugs, wine glasses, tumblers, and more - making this a must-have product for all your arts and crafts.\",\"EASY TO CLEAN UP � Clean up is easy with Mod Podge. When you�re finished with your decoupage project, simply clean up any extra with soap and water\",\"MANUFACTURING � We proudly create Mod Podge in the USA.\"]'),
