(347, 2, 301, 'Print Pod Mini Printer T02, Sticker Printer with 3 Paper Rolls, Bluetooth Thermal Printer, Inkless Sticker Maker Machine for Birthday Giftware, Journal, Note, Plan, Early Education', 'Our T02 sticker printer supports black and white printing and good for decorating stuff, text, notes, and journaling! The package comes with 3 rolls of sticker paper (2 rolls with adhesive backing + 1 roll regular thermal paper), more sticker paper, don\'t worry about running out quickly.   If you have children who are in the pre-school stage, you can print numbers, letters, animals, or print them out and colour them in with our mini printer print pod to improve child\'s cognition and creativity. There is also a dedicated early education section in the app, which is a handy helper! About Replacement Paper Roll Size PokeLabel T02 print pod mini printer is compatible with paper widths of 50/53mm. Type-c rechargeable mini printer with battery capacity 1000mAh, and when fully charged will last approximately a week.Includes a paper holder for smoother printing without paper jams The sticker printer machine weighs only 0.33lb, very lightweight and can be taken to company/school/travelling to print any stickers, to do lists, notes you want to print.   1 Cell phone/tablet 2 Replacement Steps  Very helpful for school or daily life and you can just print the knowledge points, to do lists.  1 Add Fun 2 Improve Efficiency', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/710kFoclaFL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/710kFoclaFL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71vYHIBbUqL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/817jnAX3vNL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71D29myVmwL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81B6P1WLxBL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81ydoP1XlkL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71O7J9rn