(353, 6, 306, 'Benefiber Chewable Prebiotic Fiber Supplement Tablets for Digestive Health, Assorted Fruit Flavors - 100 Count', 'Benefiber Chewable Prebiotic Fiber Supplement Tablets are designed to strengthen and nourish the good bacteria, helping support your digestive health (1). A source of daily fiber, this Benefiber fiber supplement contains the plant-based fiber wheat dextrin to help nourish the good bacteria in your digestive system (1)(2). These assorted prebiotic fiber tablets are sugar free and gluten-free, supporting your digestive health with prebiotics that are convenient, easy to take and great tasting (1). For ages 12 and above, chew 3 Benefiber prebiotic tablets up to 3 times daily. For ages 6 to 11, use 1 1/2 sugar free fiber tablets up to 3 times daily. Benefiber makes taking fiber easier. (1) These statements have not been evaluated by the Food and Drug Administration. This product is not intended to diagnose, treat, cure or prevent any disease. (2) The wheat has been processed to allow this food to meet the Food and Drug Administration (FDA) requirements for gluten-free foods. Use as directed.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/71ctdnWjDTL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/71ctdnWjDTL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/91OmT8pfrpL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81yzjCQRouL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/91XdrF+1TsL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81hmx2B9LXL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/819h4WdDjRL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81x-RLN4fkL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81yL3SS3M4L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61ApAhoJU4L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61kTj4uQRYL._AC_SL1500_.jpg\"]', '{"brand": "Benefiber", "category": "Health & Household", "dimension