(367, 2, 86, 'Avery Self-Adhesive Hole Reinforcement Stickers, 1/4\" Diameter Hole Punch Reinforcement Labels, Clear, Non-Printable, 1,000 Labels Total (5722)', 'Product Description Find the strength your papers need to carry on. These Reinforcement Labels are designed to strengthen and repair punched holes. The labels come packaged in a handy dispenser that peels each self-adhesive reinforcement off the roll one by one. Apply the reinforcements to your standard-size punched holes to provide a durable border that resists tearing. The clear labels virtually disappear onto your pages for a sharp, clean look that won\'t conceal important information. Your punched holes will be stronger for the experience. From the Manufacturer Super-thin, reinforcement label rings are ideal for reinforcing or repairing punched holes in binder paper. Self-adhesive clear rings reinforce without covering up information and are permanent. Handy dispenser peels each self-adhesive reinforcement off the roll, one by one. Apply the reinforcements to your standard-size, punched holes to provide a durable border that resists tearing. Reinforcement labels offer 1/4\" diameter holes.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/71EVNgGdgUL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/71EVNgGdgUL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/91w5hWbrP6L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71AOfC852FL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81ZjmHDov4L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81fnkpQfxXL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/51Rg7mG9s5L._AC_SL1500_.jpg\"]', '{"brand": "AVERY", "category": "Office Products", "dimensions": "3 x 0.76 x 3.63 inches"}', '[\"Extend the life of your 3-hole punched pages with durable poly-vinyl hole reinforcement labels designed to strengthen and repair standard-size punched holes\",\"Maintain a clean look with clear page reinforcement stickers that reinforce and repair without covering up any important information\",\"Get enduring reinforcement from these small round sticker labels with permanent self-adhesive that keeps labels in place\",\"Access labels quickly and easily with the handy dispenser that peels each reinforcement sticker off the label roll one by one\",\"Small round labels are perfect for school and office use, as well as crafting projects, planner stickers, art projects, behavior charts and even DIY manicure stickers\"]'),
(368, 2, 318, 'Safco Products 3116BL Five Section Adjustable Bookrack, Black', 'Sturdy steel is a smart solution. All steel organizing accessories are extra sturdy and useful. The Five Section Adjustable Steel Bookrack is easily customized to change compartment sizes to hold books, manuals or directories. Simply slide the dividers into the desired position for an instant bookrack. Includes four adjustable and removable dividers to form up to five sections. Attractive contemporary design elements keep your office snazzy. Rubber feet included to protect work surface.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/714Eg6-zgmL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/714Eg6-zgmL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61WjcRhcwlL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/714Eg6-zgmL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61WjcRhcwlL._AC_SL1500_.jpg\"]', '{"brand": "Safco", "category": "Office Products", "dimensions": "9 x 15.5 x 9.25 inches"}', '[\"Adjustable sliding dividers create an instant book or file rack\",\"Steel construction with durable powder coat finish\",\"Rubber feet included to protect work surface\"]'),
(369, 2, 319, 'Sharpie S-Gel, Gel Pens, Ultra Fine Point (0.38mm), Black, 4 Count', 'The power of Sharpie is now in a gel pen with the Sharpie S-Gel. With no smear, no bleed technology and bold, best-in-class ink, this Sharpie pen delivers always-vivid writing. It�s a high-performance gel pen with a sleek, professional look that makes it a writing instrument you won\'t want to loan out. And the contoured rubber grip makes for comfortable writing during any task. Available in multiple point sizes, barrel finishes and gel ink colors, Sharpie S-Gel offers a smooth writing experience perfect for homes, schools, or offices.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/81BVO1JCPxL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/81BVO1JCPxL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81pXf+JSaDL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71aYPDX8t1L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/91bEFsCyG3L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/9143yQg65IL._AC_SL1500_.jpg\"]', '{"brand": "SHARPIE", "category": "Office Products", "dimensions": "7.63 x 3.25 x 0.6 inches"}', '[\"Gel pen ink refills with no smear, no bleed technology\",\"Intensely bold gel ink colors offer always vivid writing\",\"Perfect for home, office, and school\",\"Ultra Fine Point (0.38 mm)\",\"Includes 4 black gel ink pens\"]'),
