(376, 2, 86, 'Avery A-Z Tab Dividers for 3 Ring Binders, Customizable Table of Contents, Multicolor Tabs, 1 Set (11125)', 'Organize your projects in seconds with this set of Avery Ready Index A-Z Dividers. Each tab is uniquely color coded and preprinted to present a professional look. Print customized section titles and images onto the table of contents sheet without worrying about inserts or labels. Whether you�re hosting a meeting or creating binders for classes, these dividers are perfect for getting things sorted. 26 alphabet dividers are included with each sheet measuring 8-1/2�x11�. The 3 ring binder holes are reinforced on both sides of the heavyweight sheet to prevent tearing. The divider tabs also includes additional reinforcement along the edge of the sheet to distribute stress and resist creasing. The table of contents sheet is also compatible with both laser and inkjet printers. This sheet can be printed in either portrait or landscape so that projects can be organized in any orientation. Just flip the sheet over to view the other layout. Check out the free templates for these dividers and try out the Avery Design & Print software today on the Avery sites', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/81e3sflPCXL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/81e3sflPCXL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71XHB8Wa9WL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/613pRJmy2NL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71Wo09I96fL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81BDAqvn6+L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/716MNl-rs1L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71ijmLK-quL._AC_SL1500_.jpg\"]', '{"brand": "AVERY", "category": "Office Products", "dimensions": "11 x 8.25 x 0.1 inches"}', '[\"Organize tab dividers quickly with the printable table of contents sheet\",\"Easily add custom titles, graphics, and a logo to the table of contents page of your binder dividers with the free templates provided on the Avery site\",\"Divider are paper with durable hole and tab reinforcements on both sides\",\"Flexible design works in either portrait or landscape orientation and is great for training manuals and project binders\",\"Multicolor alphabet divider tabs are preprinted and don\'t require labels or inserts\"]'),
(377, 2, 319, 'Sharpie Tank Highlighters, Fluorescent And Pastel Highlighters, Chisel Tip Highlighter Markers Set, Teacher And Office Supplies, School Supplies, Assorted Color, Value Pack, 36 Count', 'Perfect for when info is high priority and precision is a must, Sharpie Highlighters make everything highly visible with brilliant colors in transparent, smooth, and quick-drying ink. These wide-barreled tank highlighters feature a large ink supply for dependable and long-lasting use and an easy gliding chisel tip that highlights and underlines both wide and narrow lines of text. The quick-drying ink resists smearing many pen or marker inks. And with an array of brilliant colors, Sharpie highlighters make your most important thoughts and notes jump off the page. It�s no wonder why Sharpie is the got-to-have highlighter for life�s major high points.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/8104IvYOdpL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/8104IvYOdpL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71YgLAI-XSL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71U7pYMwahL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/610qy0zcgdL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81zoAdc97ML._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/812S+CS1xXL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71ye8B41RrL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81zZAXwW2-L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81hqIhqpkeL._AC_SL1500_.jpg\"]', '{"brand": "SHARPIE", "category": "Office Products", "dimensions": "4.44 x 4.44 x 5 inches"}', '[\"Sharpie Tank Highlighters with wide barrel and large ink supply that delivers dependable highlighting\",\"Bright ink stands out on the page\",\"Versatile chisel tip great for highlighting, underlining, and writing notes\",\"Resists smearing (let ink dry before highlighting)\",\"Includes 36 highlighters in asso