(388, 2, 86, 'Avery Heavy Duty View 3 Ring Binder, 4\" One Touch Slant Ring, Holds 8.5\" x 11\" Paper, 1 White Binder (79704)', 'This Heavy-Duty View Binder with One Touch slant rings is perfect for extended use. From everyday referencing to classroom notes and home business use, this binder\'s strong enough to handle them all. The DuraHinge design is stronger, lasts longer and resists tearing, while the DuraEdge feature makes the sides and top more pliable to resist splitting. Our deep texture film offers a smoother finish and features a linen pattern for high quality look and feel. Just pull the lever to open the rings for adding, replacing and removing pages. Then push to secure the rings in place. Even when filled to its 760-page capacity, this binder still has four stacked pockets for a bit of extra space inside. Customize the cover with free, easy-to-use templates and designs on the Avery site.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/61PwWQZmFpL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/61PwWQZmFpL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61Ei1RHOCjL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/617BjJ8OA9L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71z+KUlnhbL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71ByATXt3dL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71xaroP2NzL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71iIVZpFSlL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71pwd9UYMML._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81ASd2U9tCL._AC_SL1500_.jpg\"]', '{"brand": "AVERY", "category": "Office Products", "dimensions": "12.38 x 3.8 x 11.75 inches"}', '[\"Heavy-Duty binders have a DuraHinge design that\'s stronger, lasts longer and resists tearing, while the DuraEdge feature makes the sides and top more pliable to resist splitting\",\"Deep texture film offers a smoother finish and features a linen pattern for high-quality look and feel.\",\"4 inch One Touch slant rings open with ease and keep pages secure; Holds up to 760 sheets\",\"Wide front and back binder panels fully cover standard dividers and sheet protectors. Organize and secure paper with four stacked pockets.\",\"Pages lie flat with back-mounted rings.\"]'),
