ator that lets you know when your baby�s diaper is ready to be changed\",\"Our disposable diapers feature Disney designs as cute as your baby\",\"Huggies Little Snugglers packaging may vary\"]'),
(391, 3, 335, 'Portable-Charger-Power-Bank Travel Essentials Battery Pack USB C 10000mAh Built in Cable 22.5W Phone Fast Charging Powerbank Compatible with iPhone 16 15 14 13 12 11 iPad Samsung Google (Black)', '1 Cure Your Battery Anxiety 2 Allowed in Your Carry on 3 Built in 4 Cables 4 Anytime, Anywhere', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/81MLvf0iwnL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/81MLvf0iwnL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81UdexCWL2L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71ZfMu-r3kL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71DCBlC2V5L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71TOq1skntL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/711JdcZM9wL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71fG1RlpGGL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71yRFb5mbEL._AC_SL1500_.jpg\"]', '{"brand": "JOYFAR", "category": "Cell Phones & Accessories", "dimensions": "5.7 x 2.7 x 0.8 inches"}', '[\"?Built-in Cables for Ultimate Convenience?Our portable charger includes 4 cables (Lightning, Type-C, Micro, USB-A), 3 ports, and 2 flashlights. These cables are durable, withstanding over 10,000 bends. Compatible with nearly all electronics including iPhone 16 Models/iPhone 14 Plus/iPhone 12 Mini/Samsung Galaxy/Google Pixel/Motorola/Android Cell Phone/Flip Phone/Tablet/Apple Pencil/Small Fan and more multiple devices\",\"?Max 22.5W Super Fast Charging?Our power bank delivers a 5A current, charging your phone up to 50% in just 24 minutes�2.6 times faster than a standard bank. Compatible with PD, QC, FCP, AFC, and SSCP protocols, it offers versatile charging options, including a trickle-charging mode for low-power devices. USB-C two-way charging (IN&OUT) and LED digital display eliminate power anxiety, ensuring the best experience during your vacation\",\"?Five Devices, One Charge?With a real 10000mAh capacity, our banks can offer 2.3 charges for the iPhone 15, 1.9 charges for the Samsung S24, and 1.1 charges for the iPad Pro. Charge 5 devices max at once, it\'s a must in accessories for a power outage, hurricane preparedness, and emergency. Perfect for a cruise ship travel/road trip/airplane traveling/car journey/hiking/camping/summer day at the beach/college dorm room\",\"?Slim & Compact?Easily slip it into your backpack, pocket, or bag and carry it anywhere! This lightweight external battery pack size is 5.7 x 2.7 x 0.8 inches and weighs just 8.2 oz�comparable to the iPhone 15 Pro Max. It lasts over 600 cycles, without battery deterioration over three years, features an excellent tactile feel and scratch resistance, and is an ideal choice for backup power for international business travel�airline flying approved\",\"?17-Layer Safety Protection?Latest upgraded AI smart chip and NTC temperature control technology minimize real-time power loss. Prevents devices from overcharging, overcurrent, overvoltage, and short circuits in multi-protect systems. 200 per second temperature checks, can reduce overheating risks by 97%, which are family picnic essentials. The packs maintain over 98% health even after three months of charge-discharge cycles and supply lasting safety\",\"?Reliable After-Sales Service?The JOYFAR portable charger is backed by UL, UN, FCC, TUV, MSDS, and RoHS certifications. Enjoy peace of mind with 36 months, 24/7 professional customer support, and easy replacements on Amazon. We are dedicated to providing satisfactory solutions for any issues you may encounter. What You Get�1 x JOYFAR power bank, 1 x user manual, 1 x 0.85 ft USB-A to USB-C charging cord (wall charger block not included)\"]'),
(392, 1, 49, 'JBL Go 4 - Ultra-Portable, Waterproof and Dustproof Bluetooth Speaker, Big Pro Sound with Punchy bass, 7-Hour Built-in Battery, Made in Part with Recycled Materials (White)', 'Take big JBL Pro sound wherever you go. The bold, colorful JBL Go 4 ultra-portable Bluetooth speaker fits in the palm of your hand, delivering clear, loud JBL Pro Sound with rich, punchy bass. Its newly redesigned integrated loop makes it easy to bring anywhere, and the variety of colorways means you can choose one that fits your vibe. Plus it\'s waterproof and dustproof, so it loves to go outside. And up to 7 hours of playtime mean it will keep the good times rolling throughout a fun day trip or an evening chilling under the stars. Pair two Go 4s for stereo sound, or wirelessly connect multiple JBL Auracast-enabled speakers for even bigger sound. Crank it up and let your music take you anywhere.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/71h64dYqkgL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/71h64dYqkgL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/611vB09eAAL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/515pJiJKBqL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61Sy+7LX0fL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/91DLpiI1C+L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/91jLGZtfBBL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/91xujygYPQL._AC_SL1500_.jpg\"]', '{"brand": "JBL", "category": "Electronics", "dimensions": "3.7\\\"D x 1.7\\\"W x 3\\\"H"}', '[\"Ultra-portable JBL Pro Sound with punchier bass Don\'t let its little size fool you. The JBL Go 4 packs a serious musical punch. Your friends won\'t believe how much great JBL Pro Sound comes out of such a small speaker.\",\"Up to 7 hours of playtime plus 2 hours with Playtime Boost Don\'t sweat the small stuff like charging your battery. JBL Go 4 gives you up to 7 hours of playtime on a single charge. Tap Playtime Boost to add up to 2 more hours to your battery life.\",\"Waterproof and dustproof The JBL Go 4\'s IP67 waterproof and dustproof rating ensures this portable speaker can handle almost any environment, from a poolside party to a seaside picnic.\",\"Multi-speaker connection by Auracast Want even bigger JBL Pro Sound? Pair two Go4s for stereo sound, or wirelessly connect multiple JBL Auracast-enabled speakers using Auracast for even bigger sound.\",\"Made in part with recycled materials The JBL Go 4 incorporates post-consumer recycled plastic and fabric for the speaker grille. It\'s also packaged in FSC-certified paper printed with soy ink.\"]'),
(393, 2, 336, 'Glossy Sticker Paper Printable Vinyl for Inkjet Printer Adhesive White Decals Waterproof Quick Drying Tear Resistance Labels Letter Size 8.5x11 in for Craft,Scrapbook', 'Enjoy Life and Create Beauty cutting mat for cricut Add to Cart clear sticker paper Buying Options translucent sticker paper Buying Options transparency film Add to Cart transparency paper Buying Options Customer Reviews 4.7 out of 5 stars 616 4.3 out of 5 stars 228 4.3 out of 5 stars 228 4.6 out of 5 stars 291 4.3 out of 5 stars 45 Price $16.99$16.99 � � $6.99$6.99 � Brand Colemoly Colemoly Colemoly Colemoly Colemoly Surface adhesive transparent translucent clear clear Quantity 9 packs 40 sheets 40 sheets 30 sheets 45 sheets Size 12.99x13.99in 8.5x11in 8.5x11in 8.5x11in 8.5x11in Waterproof ? ? ? ? ?', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/71vSzZX2aeL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/71vSzZX2aeL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71SgXKRU2tL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71yZ9YSmy8L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71YMDRNREQL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61xH3zj+bPL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71X21F22s6L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71UM-G7YSyL._AC_SL1500_.jpg\"]', '{"brand": "Colemoly", "category": "Office Products", "dimensions": "11 x 8.5 x 0.04 inches"}', '[\"?25 glossy papers for cricut?Colemoly high quality printable vinyl sticker paper is perfect for all your creative printing needs! Can be applied to different projects such as notebook stickers, coffee stickers, photo stickers, vinyl lettering, custom decals and labels. Our sticker papers are specially designed for use with inkjet printers, ensuring that your designs will appear crisp, colorful, vibrant and smudge-free.\",\"?High quality material?Colemoly paper stickers are made of durable vinyl material that is water and scratch resistant and tear resistant, making them very durable. The smooth surface makes the pattern shiny, and the colors last and do not fade, making it very bright in projects.\",\"?Increased water resistance?Colemoly decals are waterproof and will not smear. Suitable for indoor and outdoor projects, we recommend printing with the original ink when printing, and after waiting for it to dry, you can simply seal the stickers with UV resistant sealing spray to increase the water resistance while increasing their lifespan.\",\"?Easy to use?Compatible with most inkjet printers, it is recommended to select \"BEST print mode + PHOTO PAPER\" mode when printing. Colemoly vinyl sitkcer papers are easy to cut by hand and are suitable for cutting machines. They do not blister easily and are smooth and flat when cut.\",\"?Application on smooth surfaces?Our premium stickers have a unique backing that peels off easily. It needs to be applied to clean and smooth object surfaces, and can be peeled off and put right again the first time it is applied crookedly, and the adhesion increases the longer it is applied. When peeling off the surface of the object, easy to peel off, no glue residue. What are you waiting for, come and buy it!\",\"?Attention? As glossy stickers may reflective, if they cannot be scanned by the cricut machine, it is recommended to use transparent matte tape and stick the black positioning line so that they can be positioned and continue scanning.\"]'),
