(402, 3, 343, 'XL Large Waterproof Cell Phone Pouch - 2 Pack Underwater Clear Phone Holder Protector - Universal Water Proof Dry Bag Case with Neck Lanyard for iPhone, Samsung Galaxy, Beach, Swimming Pool', 'About this item Value in Bulk - Save more with our 2 pack of Black waterproof phone pouches. Protect your valuables and smartphone from water in any situation, whether you\'re traveling or enjoying outdoor activities like skiing, surfing, or relaxing on the beach. Ideal for various outdoor adventures like fishing, swimming, boating, kayaking, snorkeling, diving, camping, and more. Universal Design - Our 10.5\" large waterproof phone bag features a clear front and back cover, accommodating smartphones up to 10\" in size. It\'s compatible with a wide range of devices, including Apple iPhones (15 14 13 12 11 Pro Max Plus Mini SE Xs Xr X promax) and Samsung Galaxy (FE S23 Ultra S22 S21+ S21 S20+ S10+ S9+ S21 S20 Note 20 Edge Mate), as well as Android phones. IPX8 Certified Waterproof - Our pouch is professionally certified waterproof, passing around 1000 tests with no leakage or water damage up to 30 meters (100 feet) deep underwater. Dual plastic swivel locks tightly seal your cellphone against water, sand, snow, dust, dirt, sunscreen, shock, and more while maintaining full touch screen functionality. Super Sensitive Touch - Made with transparent PVC material, our pouch offers a crystal-clear display for excellent touch screen performance. You can text, call, watch videos, use face recognition, and take selfies without removing your phone from the pouch. For operation in water, we recommend using the mobile hot key or Volume Buttons. The ABS materials snap and lock ensure durability with scratch resistance and wear resistance. (Note: Does not support Touch ID). Convenient Features - Our pouch comes with a detachable lanyard, ensuring it never falls off as you move around. The head rotation design prevents the lanyard from winding around your neck. Before first use,