k with this add-on storage shelf for office, gaming, and sit stand desks. Add a convenient, hidden under shelf drawer that doesn\'t take up precious desktop space.\",\"Two quick and simple installation methods Mount the under desk organizer with the included VHB adhesive strips or four wood mounting screws. Includes no complicated or heavy hardware like a full under desk drawer.\",\"Cable management Two clips are included to keep wires neat and tidy under your desk. The under desk tray features a back cutout to route cords through to keep them out of sight. It\'s an ideal spot to charge your phone and prevent distractions.\",\"Premium materials Made from durable and long-lasting plastic. Add a pencil drawer under desk to keep your office accessories organized.\",\"Dimensions Under table storage drawers interior space measures 8.4 inches deep, 7.6 inches wide, and 2.8 inches tall. The under desk storage drawers adhesive offers great space for storing stationery supplies\"]'),
