(424, 2, 358, 'Daily Schedule Pocket Chart, Class Schedule with 7 Clear Pockets Plus 3 Over Door Hangers for Classroom Home School Schedule Organization & Time Management-Fits 3.5� Sentence Strips & Word Cards', 'About this item 7 Clear pockets: It comes with one schedule pocket chart and 3 metal hangers. The pocket chart features 7 long transparent slot pockets for cards displaying. The chart measures 28� x 28�, big enough for classroom and home use. You can put some first word cards in each clear pocket to make short phrases or make some DIY cards in it. It fits standard 3.5� sentence strips and word cards, just choose the size you need and design your display. Sturdy and Durable: Each pocket is made from transparent PVC film, not easy to damage. The pocket chart is made of premium nylon fabric, sturdy and durable. Industrial-grade stitching work ensures fine workmanship. Grommets are made of stainless steel solid and sturdy. Time-table Setup: This Daily Schedule Pocket Chart is perfect for creating a visual time-table. With its spacious pockets, users can easily insert and switch out custom cards to establish and display their daily schedule. Whether it\'s for a classroom, home, or office setting, this product makes setting up a daily time-table simple, interactive, and efficient. Mounting Ready: Comes with 3 stylish over-door hangers, fit most common household doors, hook the hanger to chart grommets, then put it over the door. DONE!!! Come and design your special pocket chart. Multiple Usages: Ideal for using in a classroom, dorm room, office, business or home schooling. Suitable for language experience, vocabulary introduction, math concepts, and story telling. It is also used for executing your to-do list throughout the day, displaying your daily schedule, a practical helper indeed. � See more product details', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/81SQZ7Ss+aL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images