 and design your special pocket chart.\",\"Multiple Usages Ideal for using in a classroom, dorm room, office, business or home schooling. Suitable for language experience, vocabulary introduction, math concepts, and story telling. It is also used for executing your to-do list throughout the day, displaying your daily schedule, a practical helper indeed.\"]'),
(425, 2, 359, 'Automatic Ribbon Cutting Machine,2024 Upgraded Automatic Tape Ribbon Dispenser,Intelligent Auto Tape Cutter,Commercial Grade Tape Cutting Machine for Gift Wrapping,Home Use,Warehouse', 'Time and labor saving \"Packing tape dispenser has bunch of presets and great news is you can change length of the preset and it actually remembers it after you power cycle the unit.\" �Tara J \" It�ll accommodate most types of standard use tapes and adapts easily and quickly. \" �David H. Applicable Tape Width: 6-60 mm (1/4� to 2 4/11�) Tape Length Setting Range: 5-999 mm (1/5� to 39 1/3�) Max. Outside Diameter of Roll: 300 mm (11 4/5�) Feeding Speed: 200 mm/sec(using craft tape) Voltage: AC 110-220 Volt, 60 Hz Power: 25 Watt Know more about Nextlifei Automatic Tape Dispenser ! Details for this Electric Tape Cutting Machine Important Tips: please avoid fluorescent lamp or cellphone lamp light the sensor directly with long time,or will affect the Auto Mode temporarily. Counting Function A signal will be shown based on your selected quantity of pieces and it will all cut out.If you set 100 pieces, the machine will count numbers backwards, from 100 to 0. A buzzer will has sound when the program is finished. Continuous Cutting The machine will cut out the pieces based on your selected quantities then it will stop. +button -button: Used to adjust tape length in mm or set your needed number of quantity SELECT button: Set cut length and number of cut pieces. Also used to operate the P mode and L mode. AUTO/MANUAL button: Changes the operating mode from Auto to Manual FWD button: Feeds tape forward REV button: Pull the tape backward START button: Feeds tape and cuts automatically during manual operation Install the suitable Adhesive or Non-adhesive tape Press FWD button to make tape output Set suitable length and press START to cut tape Choose AUTO/MANUAL mode for your packing task', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/71pTu-nsFjL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/71pTu-nsFjL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61v262YQ0IL._AC_SL1200_.jpg\",\"https://m.media-amazon.com/images/I/71ps5gI9a8L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71-NU2vRZSL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71ftpBizWfL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71sukkyglHL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71XIHm9dGzL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81Yu2ecA34L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81gzd-q5NUL._AC_SL1500_.jpg\"]', '{"brand": "nextlifei", "category": "Office Products", "dimensions": "8.1 x 4.5 x 5.5 inches"}', '[\"?Efficient & Fast Cutting? This automatic tape dispenser is equipped with a high-speed cutting mechanism, cutting at a rate of 200mm per second, saving valuable time in gift wrapping, office use, and factory production lines. Whether you\'re handling small batches or large-volume tasks, it maintains high performance.\",\"?Dual Mode Flexibility? Seamlessly switch between automatic mode and manual mode for maximum convenience. Ideal for a variety of applications, whether it\'s for personal DIY projects, home crafting, or precision cutting for business packaging and retail displays, this versatile ribbon cutting machine meets all your needs.\",\"?OCustomizable Cutting Length & Width? Adjust the cutting length (5-999mm) and cutting width (6-60mm) to suit different tasks. Perfect for creating ribbons for birthday parties and holiday celebrations, or for gift wrapping, crafting, and office use, ensuring consistent, customized cuts every time.\",\"?Memory & Auto Counting Features? The memory function remembers your previous settings, and the auto counting feature helps you track the number of cuts made, making it ideal for consistent cutting and efficient workflows in commercial settings. For example, in large-scale office gift wrapping or retail displays, these features improve productivity and reduce errors.\",\"?Clean & Precise Cuts Every Time? This automatic tape dispenser ensures smooth, clean, and precise cuts with no fraying or tearing. Whether you\'re using ribbons for wedding decorations, birthday parties, or festive events, or tape for product packaging or office document organization, you�ll achieve accurate, flawless cuts, elevating the professionalism and appearance of your projects\"]'),
(426, 2, 319, 'Sharpie Clear View Highlighter Sticks, Chisel Tip, Assorted Fluorescent, 8 Count', 'Bring clarity and precision to your written text with the Sharpie Clear View Stick Highlighter. With the ability to create both wide and narrow lines, these highlighters are perfect for use in offices, schools, and Bible studies alike. Capture your reader\'s attention with ultra-vivid, smear-resistant ink that pops off the page. Designed for uninterrupted clarity, the clear, chisel tip allows you to continue highlighting with confidence and finesse. This pack contains eight assorted colors to diversify and enhance your marking experience.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/812SV-LMAeL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/812SV-LMAeL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71KSi3BOL0L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71TyJ5rPvIL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81Pjh49JqrL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71X5XgDhbqL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71ubqU4yOkL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61ti6-GIaiL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61gSZJHsK2L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61q7cMg34sL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61KxDFkUKQL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61r0+reve1L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61ZaazMx9lL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61MwGxzp4dL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/610sV+GKh+L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61n123VtUNL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81Iy6CsCgEL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81tWzvKKEsL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81+IFODa3HL._AC_SL1500_.jpg\",\"https://m.med