(428, 4, 23, 'Alpine Corporation 12\" Tall Outdoor Garden Gnome with Bird Yard Statue Decoration, Multicolor', 'Add a touch of playful magic to your outdoor space with the Alpine Corporation Garden Gnome Holding Bird Statue. This stunning statue is constructed of durable polyresin with a colorful finish to suit any outdoor space. The statue is weatherproof, rust-resistant, and durable for years of quality use. With a playful look, intricate details, and portrayal of a friendly gnome, this Alpine Corporation statue is sure to bring a sense of playfulness and tranquility to your home! The statue is perfect for your garden, patio, deck, porch, or yard space. With a 1-year warranty, you can be confident in the quality of your purchase. Statue measures 5\"L x 5\"W x 12\"H for use in yards of any size. Alpine Corporation is one of America\'s leading designers, importers, and distributors of superior quality home and garden decor products. Alpine Corporation\'s award winning in-house design team continuously develops new and innovative \"statement pieces\" for your home and garden. Your indoor and outdoor living spaces will be the envy of the neighborhood with our wide assortment of fresh, fashionable and contemporary products, from beautifully crafted solar garden stakes featuring patented motion and fiber optic lighting technology to beautiful fountains and delightful bird baths and feeders.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/71oF1vP4WrL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/71oF1vP4WrL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81FCrRisQwL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81tY836IwAL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81jWLFbnDAL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81EXBUwXjOL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/91Qxq1EVHFL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/91ueINjCoML._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71CoQ6DuU5L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71+Xbiu8KtL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71sz25VKwbL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71vcBvzNacL._AC_SL1500_.jpg\"]', '{"brand": "Alpine Corporation", "category": "Patio, Lawn & Garden", "dimensions": "5\\\"D x 5\\\"W x 12\\\"H"}', '[\"OUTDOOR STATUE Whimsical garden gnone holding a bird looks great in your yard or garden, or placed on your deck or porch\",\"TIMELESS LOOK Colorful design on a classic yard decoration creates a nostalgic and fun atmosphere in your yard\",\"PLAYFUL DESIGN Fun design adds a playful look while bringing a little bit of magic and joy to your home or garden\",\"DURABLE Polyresin construction is rust- and weather-resistant to keep your outdoor statue looking new over time\",\"IDEAL SIZE Statue measures 5\"L x 5\"W x 12\"H, the perfect size for your yard, and includes a one-year manufacturer\'s warranty from date of purchase\"]'),
(429, 1, 361, 'Behringer HA8000 V2 8-Ch Headphone Mixing Distribution Amplifier', 'Product Description An articulate headphone mix can make all the difference in the outcome of a recording session. The 8-channel POWERPLAY HA8000 V2 features superior performance, routing and mixing functions to accommodate even the most discerning set of ears. Two independent stereo main inputs, along with a dedicated direct input on each channel allows individual performers to obtain a more customized monitoring mix. When optimized mixes have to reach multiple listeners, each with their own specific requirements, the HA8000 V2 delivers high-quality headphone mixing � in a class all its own! Manufacturer Contact Information https://www.behringer.com/', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/51Lbm7I7auL._AC_SL1200_.jpg', '[\"https://m.media-amazon.com/images/I/51Lbm7I7auL._AC_SL1200_.jpg\",\"https://m.media-amazon.com/images/I/51DntPUsv3L._AC_SL1200_.jpg\",\"https://m.media-amazon.com/images/I/51mOWZV7o7L._AC_SL1200_.jpg\",\"https://m.media-amazon.com/images/I/51PM6qWJ0wL._AC_SL1200_.jpg\"]', '{"brand": "Behringer", "category": "Electronics", "dimensions": "19.02 x 5.87 x 1.73 inches"}', '[\"Professional, multi-purpose headphones amplifier system for stage and studio applications\",\"Highest sonic quality with virtually all types of headphones even at maximum volume\",\"Product TypeSound And Recording Equipment\"]'),
(430, 2, 362, 'Globe-Weis PFXR217MHD /Pendaflex Heavy-Duty Expanding File, Open Top, 12 Pockets, Monthly Index, Letter Size, Brown (R217MHD)', 'Expanding files with divided pockets are great for organizing projects, managing daily priorities or sorting paperwork. Customize the blank tabs with your own titles, or use the pre-printed tabs. Suitable for desktop or inside file drawers.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/814h0Ie4ZML._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/814h0Ie4ZML._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71VrncvohQL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71-6FijsQdL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/716rYGFDZKL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71azYqCWoAL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71HPEA5OXmL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71bU8NdkhcL._AC_SL1200_.jpg\"]', '{"brand": "Globe-Weis", "category": "Office Products", "dimensions": "10 x 12 x 1.5 inches"}', '[\"Heavyweight cover\",\"Features one row of pre-printed monthly tabs and one row of blank tabs to customize\",\"Open-top for easy access to filing\",\"Expanding sides include Tyvek reinforced top edge\",\"Letter sized with 12 pockets\",\"Heavy-duty Accordion open top file with 80-pt. soil-resistant Letha Tone covers and rip-proof Tyvek reinforcement at top and bottom of the gusset.\",\"Built to last with extra-thick, 80-pt. soil-resistant Letha Tone covers and rip-proof Tyvek reinforcement at top and bottom of the gusset.\",\"Index has extra-large, 1/3 cut double top tabs.\"]'),
