eometry, trigonometry, calculus, and physics problems. Besides, it is suitable for technical drawing, mapping, planning, blueprints, engineering and technical applications. Essential for artists, architects, engineers and students.\",\"?Perfect Choice? You will get 8 pieces of cross section pads, each has 50 sheets, totally 400 sheets. Sufficient quantity will meet your using needs, and you can share them with your family. Large graph paper 8.5 x 11 can be practical product for students, colleagues and friends. They are grid ruled pages suitable for anyone and for many purposes. 8-1/2 x 11 notepads is the first choice. The perfect product for Birthdays, Christmas, New Year�s, Anniversaries, and more.\"]'),
(473, 2, 125, 'Pentel EnerGel Retractable Liquid Gel Pens, Medium Point, 0.7 mm, Silver Barrel, 12 Black Ink pens, the Ultimate writing pens, the Best Writing Pens for office, school and journaling, Pack of 12', 'Pen comes with black, red, blue, green, or violet ink. EnerGel RTX Liquid Gel Pen The EnerGel family of liquid gel pens offers a variety of choices from retractable to capped, fine point to bold, several barrel styles, and a wide selection of vibrant ink colors. With so many options, you\'re sure to find an EnerGel pen that matches your style. EnerGel RTX pens come with either black, red, blue, green, or violet ink. However, they can be refilled with any EnerGel refill available in a variety of other vibrant colors to match your mood and keep your writing instrument unique to you. Quick Drying Ink EnerGel ink dries super fast, which is why left-handed writers love EnerGel -- No Smears, No Smudges, No Globs. High-Tech Smoothness EnerGel liquid gel ink is a high performance ink technology that combines the best qualities of liquid and gel ink for a super smooth writing experience. Liquid ink characteristics provide an easy flowing ink supply, while gel ink characteristics include smoothness of writing, vibrant colors and fast-drying capability. Refillable Don\'t toss out your pens! Did you know that over 90% of EnerGel products are refillable? Why throw away your pen and contribute to landfills when you can replace your depleted ink cartridge with any size and/or color EnerGel refill. Help the environment while saving money! Be Bold . .. or Medium, or Fine Fine line widths are achieved with our 0.5mm needle tip pens Medium lines are achieved with our 0.7mm needle and 0.7mm metal tip pens Bold lines are achieved with our 1.0mm metal tip pens Recycology Pentel has been committed to protecting the environment for over 40 years. We developed the Pentel Recycology program to further our efforts to minimize our carbon footprint and help save the planet. Over 75% of our products use recycled content, including factory recycled materials and post-consumer waste. Become a \"Recycologist\" and together we can reduce our impact on the environment and build a better, cleaner future. Compare Products EnerGel Alloy EnerGel Pearl EnerGel RTX EnerGel-X EnerGel NV Retractable ? ? ? ? Capped ? Tip Size: 0.5mm (fine) ? ? ? Tip Size: 0.7mm (medium) ? ? ? ? ? Tip Size: 1.0mm (bold) ? ? Refillable ? ? ? ? Recycology ? ? ? ?', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/71utunc-3RL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/71utunc-3RL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/818+iq8d9NL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71ue8XD0KJL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/51oK0rRY2dL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/919IqSi+P1L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/A1mFtsOKUXL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/91632t1Jp+L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/91r8xN-OW3L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81U+lFuefPL._AC_SL1500_.jpg\"]', '{"brand": "Pentel", "category": "Office Products", "dimensions": "6.1 x 3.15 x 1.15 inches"}', '[\"Featuring special ink formulation, these Pentel EnerGel pens combine the best of gel with the best of liquid. The smooth-flowing formula glides over paper without blots or smudges, so your notes are clear and easy to read when you\'re reviewing them.\",\"Quick-drying gel ink won\'t smear. Vivid, flowing ink dries quickly without blotting or smudging. Acid-free formula won\'t fade over time or affect the pH level of your paper.\",\"Soft rubber grip cushions your fingers. The beautiful chrome barrel is accented with a soothing rubber grip to alleviate hand stress and cramping.\",\"Pocket-proof clip prevents leakage. The tips on these retractable gel pens automatically retract when the pen is clipped to a pocket, notebook or folder.\",\"Refillable for continued use.\"]'),
(474, 2, 395, 'DocSafe Vinyl Record Storage Box with Lock,Fireproof?Water Resistant Record Organizer Storage for 100+ Single Records(12-inch),Collapsible Storage Crate with Lid&Handles for Valuable Album Collection', 'Introducing the ultimate storage solution for vinyl record collectors - our Fireproof and Waterproof Vinyl Record Storage Box. Designed with your needs in mind, this black storage box is not only fireproof and waterproof but also features a secure lock and a sturdy lid to keep your precious vinyl records safe and protected.With its collapsible design, this storage box can easily be folded down when not in use, saving you valuable space. The built-in handle ensures convenient portability, allowing you to take your vinyl collection with you wherever you go.The interior of the storage box is thoughtfully designed with mesh pockets and labeled windows, making it easy to organize and locate your favorite records. The included PP boards provide additional support and prevent your vinyl records from warping or bending.Safety is a top priority, which is why our storage box is equipped with reflective strips, ensuring visibility even in low light conditions. Whether you\'re a seasoned vinyl record collector or just starting your collection, this storage box is the perfect solution for storing and organizing your records.Invest in the best - our Fireproof and Waterproof Vinyl Record Storage Box. Protect your vinyl records from fire, water, dust, and any other potential damage. Get yours today and enjoy peace of mind knowing that your vinyl collection is safe and secure. SERVICE DocSafe provides 24 hours customer contact service, two-year for repairing, great quality and customer experience, committing to create professional fireproof products to users worldwide. FIREPROOF WATER-RESISTANT DUST-PROOF Combination Lock Protection Sturdy Handle Design Collapsible Why choose DocSafe Fireproof vinyl record storage? DocSafe manufactures fireproof vinyl record storage us