-0-0. To set your personal combination, follow these steps: Need to snap the zipper into the lock hole. 1.Put the dials at original number 0-0-0. 2.Press down the reset button (a)with a tool until hear the \"Click\" sound. 3.Set your combination by turning the dials(b),for example 8-8-8. 4.Push the button(c) towards to the direction of arrow and the reset button(a) will be back when you hear the \"Click\" sound. Now you have finished to set your personal combination.Please remember your personal combination by heart. You can repeat the above steps if you want to reset your password A good choice for office,home and travel Our original Intention: Accidents happen when we least expect, and there�s nothing more devastating than a fire that takes away valuable vinyl records.That�s why we developed the fireproof box-it\'s safe for fireproof storage, which is why we designed this product in the first place. Nothing is completely foolproof, but added protection is always a good idea. Fireproof does not mean it could support endless fire exposure, please keep any fire exposure to the minimum.Do not immerse or wash the box in liquidIf you have any questions about the use of the combination lock, please check the manual', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/81Ii4nQiRlL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/81Ii4nQiRlL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81Rb0mlkGBL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/7158WOq+VVL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61cHOAhszRL._AC_.jpg\",\"https://m.media-amazon.com/images/I/71JynlnvGwL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71e3e9PXGrL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81BmxLSblZL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/719oO5orUML._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71Ejp6bAbYL._AC_SL1500_.jpg\"]', '{"brand": "DocSafe", "category": "Office Pro