(498, 2, 416, 'The Original Little ELF Gift Wrap Cutter (2-Pack) | As seen on Shark Tank | Holiday Wrapping Paper Cutter', 'Little ELF is a patented device that is the most efficient, safe, and easy tool for cutting wrapping paper. Gift wrapping can be a challenge! Using the traditional and outdated method of cutting with scissors anyways leaves the paper either jagged, ripped, or crooked. This is frustrating! But now Little ELF is your answer. Gift Wrapping Made Fun and Easy ! Little ELF Gift Wrap Cutter finally makes cutting wrapping paper easy! This historically mundane task is now not only quick and easy but fun. Do you want to wrap better? Wrap with fun Using scissors is outdated. Little ELF has revolutionized the gift wrap industry by making it easier for people to cut wrapping paper. Now wrapping presents can be headache free. Slice with perfection Getting the perfect cut is now easy. Little ELF always cuts straight and will make you feel great. It\'s precision and patent pending design will make your holidays even better. Keep it neat Also Little ELF organizes your gift wrap. It keeps your rolls from unraveling or falling off the table. Overall, Little ELF will be a staple to your gift giving occasion. How to use the Easy, Lightweight, Fast Wrapping presents has always been a chore, but with Little ELF that is no more. Whether this for yourself, your friend, or your spouse everyone needs a little helper this holiday season. Cutting gift wrap can be impossible, but Little ELF makes it is now just few steps: Slide Little ELF over one end of the paper roll.Pull paper through the device opening.Measure the paper to the desired length.Gently push Little ELF away from you getting the amazing cut! Now your gift wrapping game as improved greatly!', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/71phf1qcVIL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/71phf1qcVIL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/