most efficient way to cut gift wrap.\",\"Keep it neat - Not only will the Little ELF make cutting gift wrap clean, quick and fun, the wrapping paper cutter also organizes gift wrap, keeping rolls from unraveling or falling off the table. Little ELF Gift Wrap Cutter is a gift wrapping supply staple for all gift giving occasions.\"]'),
