(513, 10, 427, 'Loctite Super Glue Professional Liquid, 20 Gram Bottle, 2 Pack - Clear Superglue for Plastic, Wood, Metal, Crafts, & Repair, Instant Glue Adhesive, Quick Dry', 'Loctite Super Glue Professional has proven superior performance over ordinary super glues for strong, invisible repairs. Specially formulated to fix any breaks around the home or office, this ethyl cyanoacrylate super glue works faster and holds stronger on more surfaces than ordinary adhesives thanks to a patented additive. The liquid formula works well on a variety of porous and non-porous surfaces for close-fitting repairs. Great for heavy-duty DIY projects, Loctite Super Glue Professional�s super strength formula can be used to repair figurines, costume jewelry, cameras, toys, metal car parts, wiper blades, rubber seals and O-rings. This unique liquid formula dries clear and colorless without clamping and resists moisture, most chemicals, and freezing temperatures. The pinpoint nozzle allows for precise application and features a clog-free pin cap to prevent dripping and oozing. Loctite Super Glue Professional sets in 15 � 30 seconds and bonds to a variety of substrates including: leather, cork, paper, cardboard, wood, chipboard, fabric, metal, ceramic, rubber and hard plastics such as acrylic, polycarbonate, polystyrene and PVC. Does not bond to Polyethylene (PE), polypropylene (PP), polytetrafluoroethylene (PTFE), silicone or foam rubber, polystyrene foams, glass, or pure bone china.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/819eib1GEKL._SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/819eib1GEKL._SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81Jluyj+haL._SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81ZbO+J6Q8L._SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81HDYSfkclL._SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71+sHmQEHIL._SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61l3C2OMPvL._SL1500_.jpg\",\"https: