(528, 1, 438, 'BlueParrott B450-XT Noise Cancelling Trucker Bluetooth Headset � Updated Design with Industry Leading Sound & Improved Comfort, Ideal for Anyone On The Go, Up to 24 Hours of Talk Time, Black', 'Our best-selling BlueParrott B450-XT has been upgraded to keep pace with the demands of life on the go. All the features of this wireless headset just say MORE. More talk time, more wireless range, more comfort and more advanced features to keep you comfortable and connected all day long. Walk and talk with no worries � the BlueParrott Bluetooth Headset has a considerably longer wireless range of up to 300 feet/100 meters from paired devices (wireless range needs a Class 1 device). Plus, you can wear your BlueParrott headset all day long. It features bigger, cushier ear cushions and a more comfortable, more durable padded headband. Have all day conversations with up to 24 plus hours of talk time on a single charge. Plus, with USB-C charging, it�s easy to streamline charging across your devices. Get more from your headset with easy firmware upgrades and feature selection using the BlueParrott App � with no need to connect to a computer. You can also personalize your experience with the BlueParrott Button, which allows for fast access to your favorite features such as mute, speed dial, Push-to-Talk, and more, so you can control your headset your way. Tough enough for life on the go, this BlueParrott headset features IP54-rated protection against dust and moisture. It�s the ideal retail, hospitality, field services, warehouse, and trucker headset.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/61LX0He46FL._AC_SL1400_.jpg', '[\"https://m.media-amazon.com/images/I/61LX0He46FL._AC_SL1400_.jpg\",\"https://m.media-amazon.com/images/I/719dkRllO8L._AC_SL1400_.jpg\",\"https://m.media-amazon.com/images/I/71MmH4-yMlL._AC_SL1400_.jpg\",\"https://m.media-amazon.com/images/I/71bygh2O7aL._AC_SL1400_.jpg\",\"https://m.media-amazon.com/images