ritish Pound, Japanese Yen, Swiss Franc, Chinese Yuan & Hong Kong Dollar. If used properly, the UV Pro Plus is nearly 100% effective.\",\"FRAUD DETECTION UV Light is great for authenticating passports, credit cards, traveler�s checks, drivers licenses & other official documents. Designed for Small to Large businesses, our instant verification system is perfect for catching counterfeit items in any fast paced retail environment. Catch the fraud without slowing the line. Perfect for restaurants & bars to security personnel, government agencies & transportation hubs whenever its critical to authenticate ID.\",\"STRONG, COMPACT, SIMPLE The compact size of the UV Pro ultraviolet flashlight makes it an ideal tool in high-volume venues that may lack the counter space required for other detection equipment. The UV Pro can easily fit into a cash register, an apron, pocket or on a lanyard. Quickly train staff to use the UV Pro flashlight, simply click the back to activate. Designed to also check for Pet stains, Cleanliness at home, in hotels and public spaces. Excellent for damage or leak detection.\"]'),
