(556, 2, 458, 'Oxford Spiral Notebook 6 Pack, 1 Subject, College Ruled Paper, 8 x 10-1/2 Inch, Color Assortment Design May Vary (65007)', 'TOPS 1-Subject Notebooks are a smart and economical way to sort and organize notes for every class. This six pack lets you instantly color-code your subjects. Each book is 3-hole punched to fit a standard binder. A sturdy snag-resistant coil keeps your pages secure and resists catching on backpacks, papers and clothing. Perforated sheets detach easily to keep your book looking neat and tidy no matter how many times you re-write. 8\" x 10-1/2\". College rule, 70 sheets. 6 Pack. Color assortments may vary. Choose Color Coding: pick a color for each class and coordinate your folders so you\'ll always have the right book & essentials at the bell Single Subject Mastery: there\'s no simpler way to keep study notes in order; one class, one subject, one book; easy and affordable single-subject spiral notebooks do the organizing for you Keep Only the Pages You Want: micro perforated sheets are designed so the notes you want stay, and the notes you don\'t detach easily without effort or fuss Not Just for School: you\'ll find a million uses for your 1-subject spiral notebooks; they\'re perfect for bullet journals, to-do-lists, shopping lists, planning and general notes for home or on the go.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/71fetydzOVL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/71fetydzOVL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71oVYP5iWoL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71mJV8MkYdL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71CLCV6qLcL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71ZoOH8fs9L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/713MjXXh-VL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71+8eHPfB6L._AC_SL1500_.jpg\"]', '{"brand": "Oxford", "category": "Office Products", "dimensions":