eously.\"]'),
(558, 2, 460, 'Alliance� Rubber Sterling� Rubber Bands, No. 64, 1 lb, Box Of 380', 'Promote a healthy latex-free environment at work or at home with Alliance Non-Latex Rubber Bands. Ideal for use by or around those with latex sensitivities, these rubber bands are made from a synthetic rubber compound that helps to prevent triggering latex allergy reactions. The bright orange color of these non-latex bands makes them easy to distinguish from regular bands. The soft stretch of the elastics is easy on your wrists to prevent the symptoms of carpal tunnel syndrome when doing repetitive actions, particularly in an office environment. The high rubber content makes these rubber bands strong and durable so that they can be re-used many times.Use these elastic bands wherever you would use normal rubber bands, such as for organization in offices, schools or at home. Safely bundle utensils in medical facilities or cover up equipment not in use by securing covers with these non-latex bands. They\'re also great for packed lunches and to keep produce and food secured. These rubber bands can be sterilized using an autoclave and irradiation so that they\'re safe and clean to use in medical facilities.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/71vmAI6SQRL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/71vmAI6SQRL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71DxPhhqVyL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71X1a-GVEEL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71MRi6he8+L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71eFmlM-QmL._AC_SL1500_.jpg\"]', '{"brand": "Alliance", "category": "Office Products", "dimensions": "3.5\\\"L x 0.25\\\"W"}', '[\"Ideal for hospitals, medical facilities and schools\",\"Provide excellent stretching strength and long-lasting durability.\",\"Made from synthetic rubber.\"]'),
