(563, 2, 86, 'Avery Carter\'s Foam Stamp Pad, 2.75 x 4.25 Inch, Black, 1 Pad (21381)', 'Carter\'s 2.75\" x 4.27\" foam stamp pads are pre-filled with bold black ink and are perfect ink pads for stamping. Made with a reliable foam pad, these stamp pads are perfect for everyday crafts and office work. Filled with a lasting permanent ink that can be used on paper, wood, fabric and more. ACMI AP-certified as non-toxic and confirming to ASTM D 4236, feel free to use this ink in schools, offices and homes while staying safe. The hinged lid snaps closed to help keep the ink fresh. The slim profile also makes it easy to keep these stamp pads stored away until needed. Once you\'ve used all of the ink in each pad, easily refill the stamp pad with Carter\'s Neat-Flo stamp pad inkers by just dabbing the ink into the pad. Whether you\'re stamping for crafts, scrapbooks, greeting cards or homework, Carter\'s stamp pads will make sure every one of your stamps are filled with color.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/71+BZz-wnxL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/71+BZz-wnxL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/616mWofZhGL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61aYcGEqk1L._AC_SL1500_.jpg\"]', '{"brand": "AVERY", "category": "Office Products", "dimensions": "5.13 x 3.5 x 0.75 inches"}', '[\"Pre-filled with rich, black ink that makes sure each of your stamps create a bold print\",\"Reliable foam pads are perfect for ink stamps for crafting, scrapbooking, card making, homework and more\",\"Easily refill stamp pads with Carter\'s Neat-Flo stamp pad inkers\",\"ACMI AP certified non-toxic ink is safe for use in schools, offices and homes\",\"Ideal ink pads for rubber stamps for arts & crafts, teachers, accountants, bank tellers and notary publics\"]'),
