(566, 2, 467, '2025 Desk Calendar, January 2025 to June 2026 - Large 17\" x 12\" Monthly Calendar with To-Do List and Notes for Home, Office or School', 'About this item [EXTENDED PLANNING PERIOD] -The 2025 desk calendar covers 18 months from January 2025 to June 2026, offering an extended planning period for your schedules, appointments and events. [IMPORTANT DATES COVERAGE] -Our calendar covers all important holidays and events, ensuring that you can plan ahead effectively. With its large size of 17*12 inches, this calendar provides ample writing space as well. [THOUGHTFUL AND FUNCTIONAL DESIGN] -The pages have tear cords for easy removal, a waterproof cover film, and protective corners to prevent folding and damage. [QUALITY THICK PAPER] -Crafted with thick paper, the calendar prevents ink bleed-through, keeping the surface neat and tidy for a clear and pleasant view. [DUAL PLACEMENT OPTIONS] -Designed for versatility, this calendar can be wall-mounted or placed on a desktop to suit your preferences and space needs. � See more product details', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/71ZyDo9D6BL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/71ZyDo9D6BL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71awi2wF+SL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71zjl6ee2jL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81Q9P8rNbTL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71OadfAveML._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71sk4iuxRSL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71KHH1MjKNL._AC_SL1500_.jpg\"]', '{"brand": "VALOME", "category": "Office Products", "dimensions": "12 x 12 x 17 inches"}', '[\"[EXTENDED PLANNING PERIOD] -The 2025 desk calendar covers 18 months from January 2025 to June 2026, offering an extended planning period for your schedules, appointments and events.\",\"[IMPORTANT DATES COVERAGE] -Our calendar covers all important holidays and events, ensuring that you can plan ahead effectively. With its large size of 17*12 inches, this calendar provides ample writing space as well.\",\"[THOUGHTFUL AND FUNCTIONAL DESIGN] -The pages have tear cords for easy removal, a waterproof cover film, and protective corners to prevent folding and damage.\",\"[QUALITY THICK PAPER] -Crafted with thick paper, the calendar prevents ink bleed-through, keeping the surface neat and tidy for a clear and pleasant view.\",\"[DUAL PLACEMENT OPTIONS] -Designed for versatility, this calendar can be wall-mounted or placed on a desktop to suit your preferences and space needs.\"]'),
(567, 2, 468, 'Ticonderoga Wood-Cased Pencils, Unsharpened, 2 HB Soft, Yellow, 24 Count', 'Ticonderoga has a tradition of fine quality writing instruments in the US for over 100 years. The exclusive graphite core features a proprietary formula focusing on graphite mined from carefully controlled sources to deliver extra smooth performance. Top-quality latex-free erasers remove marks completely without smudging. Premium wood harvested from responsibly managed sources provides smooth, even sharpening with minimal breakage. Teachers prefer Ticonderoga for its dependability and craftsmanship. When only the best will do, choose Ticonderoga brand pencils.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/61H-YUa+4rL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/61H-YUa+4rL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/51TMY91U93L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71YB+B9Uu7L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/51JuRTnT65L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81VgSgzBZ0L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71nRO56LFnL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81hYihyd3iL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/817zlV4vWEL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81NWGRR0YXL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81GRwiGj3NL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81a1EQb5DGL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81Sw-w4b3EL._AC_SL1500_.jpg\"]', '{"brand": "Ticonderoga", "category": "Office Products", "dimensions": "7.7 x 2.4 x 0.9 inches"}', '[\"EXCLUSIVE #2 GRAPHITE FORMULA Proprietary graphite formula mined from carefully controlled sources provides extra smooth performance; thick graphite core delivers broad consistent lines\",\"PREMIUM WOOD Harvested from responsibly managed forests, these pencils provide smooth, even sharpening with minimal breakage; Number 2 pencils are golden yellow lacquered for a coated matte finish\",\"LATEX-FREE ERASER Superior, latex-free eraser removes marks completely without smudging and is securely glued in the signature green & gold ferrules\",\"SAFE FOR KIDS PMA certified non-toxic so you have the assurance you need to focus on the task at hand\",\"TRUSTED BRAND Ticonderoga is part of the Dixon Ticonderoga family of products which includes Prang, Dixon, Pacon, Tru-Ray, UCreate, Fadeless, Classroom Keepers, Bordette, Creativity Street, Spectra, Strathmore, Canson, Daler-Rowney, Lyra, Das, Maimeri, Princeton Artist Brush, and more\"]'),
