(574, 2, 472, 'Zebra Pen F-301 Retractable Ballpoint Pen, Stainless Steel Barrel, Fine Point, 0.7mm, Black Ink, 4-Pack (Packaging May Vary)', 'Zebra Pen F-301 Retractable Ballpoint Pen is sleek, sophisticated and easy to sanitize. This hard-working metal pen brings industry-leading precision and stability to your writing. The refillable F-301 has a metal plunge, clip and cone for an executive look. Retractable ballpoint pen has black ink and a 0.7mm fine point tip. Corrosion resistant, stainless steel barrel is easier to sanitize than plastic. Shorter barrel slips easily into shirt pockets. Comfort grip matches barrel accents. Metal clip readily attaches to a notebook, planner, work bag or briefcase pocket. This 4-count pack of attractive pens is perfect for home, school or office. Clean and stylish, this trusted pen is suitable for boardrooms, courtrooms, classrooms, medical settings, offices and job sites. It�s the right pen for any job.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/619dK1ryefL._AC_SL1125_.jpg', '[\"https://m.media-amazon.com/images/I/619dK1ryefL._AC_SL1125_.jpg\",\"https://m.media-amazon.com/images/I/61OXykul+ZL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/41CktCQVumL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81Fj3gVtutL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71kgTmdksVL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/6139EKuFmuL._AC_SL1455_.jpg\"]', '{"brand": "Zebra Pen", "category": "Office Products", "dimensions": "3.68 x 4.49 x 7.68 inches"}', '[\"0.7mm fine point retractable ballpoint pen features a contemporary, stainless steel barrel that resists corrosion and is easier to sanitize than plastic\",\"Easy-glide ink brings top of the line writing performance to your everyday needs, like note-taking, document signing, filling out forms and making lists\",\"Durable stainless steel barrel resists corrosion and has a modern, attractive appearance with a non-slip grip for writing comfort and ease; Shorter length fits inside shirt pockets\",\"Convenient metal clip makes these instruments a fantastic grab and go option, attaching to your pocket, planner or briefcase pocket\",\"This 4-pack of sturdy ballpoint pens is refillable with Zebra Pen F-Refill; Built for boardrooms, courtrooms, medical settings, and personal use, the F-301 adds personal style to your work\"]'),
