(589, 2, 232, 'BIC White-Out Brand EZ Correct Correction Tape, 4 Count', 'Quickly correct typed or handwritten documents with BIC Wite-Out Brand EZ Correct Correction Tape. Made by America�s #1 Correction Brand*, this correction tape goes on dry, allowing you to make instant corrections with no mess and no waiting time. Dispensing the tape is easy: simply hold the dispenser with your thumb in the groove, position the tip flat on your paper, press down firmly, and gently move from left to right. Offering greater strength than paper-based tape, this film-based correction tape is more tear resistant to create tidy, inconspicuous corrections that last. The self-winding mechanism helps prevent the tape from loosening, so you can apply the tape smoothly and accurately. And thanks to its translucent body, the dispenser lets you see how much tape is remaining. This pack includes 4 dispensers with white correction tape. *Source: The NPD Group, Inc./Retail Tracking Service/U.S. Sales/Jan-Dec 2017.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/81GvOZbsJrS._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/81GvOZbsJrS._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71dVmcUaRsS._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71aZWfingXS._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71QtIJtqtpL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/717qzDIiKGL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81S+bP6j6QS._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71-uoYOD4TL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71lemxlL+mL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71z7lrV0DuL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/414+NnnzQHL._AC_.jpg\"]', '{"brand": "BIC", "category": "Office Products", "dimensions": "0.8 x 5.25 x 7.63 inches"}', '[\"Strong correction made by America�s Correction Brand* * Source The NPD Group, Inc./Retail Tracking Service/U.S. Actual Unit Sales Combined, Correction Fluid, Tape and Pen/Jan--Dec 2019\",\"Tape applies dry, so you can write over it instantly\",\"Film-based tape offers more strength than paper-based tape\",\"Compact translucent dispenser with soft rubber grip shows how much tape is remaining\",\"Each dispenser contains 39.3 feet of correction tape\"]'),
