(594, 3, 485, 'Type C Charger Fast Charging, 2 Pack USB C Android Phone Wall Charger Block & 6ft Charge Cable Cord, for Samsung Galaxy S8 / S9 / S10 Plus Active S10e, S20 / S21 Ultra Plus, Note 8 9 10, Pixel 3 etc', 'Compatibility List: ?Samsung Galaxy S22 Ultra 5G, S22 Plus 5G, S22 5G, S21 Ultra 5G, S21 Plus 5G, S21 FE, S21 5G, S20 Ultra 5G, S20 Plus 5G, S20 5G, S20 FE ?Samsung Galaxy S10, S10 Plus, S10e, S9, S9 Plus, S9 Active, S8, S8+, S8 Active ?Samsung Galaxy Note 20 Ultra 5G, Note 20 5G, Note 10 Plus 5G, Note 10, Note 9, Note 8 ?Samsung Galaxy A02s, A03s, A03, A3, A5, A6, A7, A8, A9, A10, A10E, A11, A12 ?Samsung Galaxy A20, A21, A21s, A22, A31, A32, A40, A41, A42, A50, A51, A52, A53, A60, A70, A70s, A71 5G, A72, A80, A90 ?Samsung Galaxy Z Fold 2/ Z Fold 3/ Z Fold 4/ Z Flip/ Z Flip 3/ Z Flip 4/ F52 ?Samsung Galaxy Tab A 8.0(2018), Tab A 10.1 (2019), Tab 10.5, Tab A 8.0 ?Google Pixel, Pixel 2, Pixel 3, Pixel XL ?LG G5, G6, G7, V20, V30 ThinQ Plus ?One Plus, HTC, ZTE Axon, Nexus 6p ?Other USB Type C Device INPUT: 100 - 240 VAC ; 50-60HZ 0.50A OUTPUT 9V/1.67A ; 5V/2.00A What is Adaptive Fast Charging This technology allows the smartphone to be charged with a faster speed, battery can charge faster up to 75% . Will this product charge other Android phones quickly? Yes. As long as your device supports Quick Charge QC2.0 & QC3.0, our wall charger block with Type-C cable will charge your device at a fast manner. What is the difference between Quick Charge (QC) and Adaptive Fast charging (ADC)? They are basically the same technology but brands marketed in different name. While Qualcomm named it Quick Charge, Samsung named it Adaptive Fast Charging. Safe Fast Charger & Sync Fast charger delivers up to output current of 15W, 75% faster than standard chargers, it also has the sync feature, most importantly, it is made for safe charging, it can intelligently recognize the battery type and status, will automatically stop charging when fully charged to prevent from short circuit, over-current, over-voltage, over-heating and over-charging. Perfect for Any Occasions These fasting charging kit is great for home, office, restaurant, tour, hotel etc. High Quality ABS Material Made of ABS material for the charger shell, shockproof and protect from over-heating & short-circuit Easy to Carry Compact classic design is portable to carry anywhere, slim and lightweight', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/61nYNJ7O1BL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/61nYNJ7O1BL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61LHCFI6VoL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81ZTTKM7wXL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71RAuKjtEUL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81xAMV-i+hL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/618hlczcd0L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61EAiP5G5ZL._AC_SL1500_.jpg\"]', '{"brand": "Cndons", "category": "Cell Phones & Accessories", "dimensions": "6.65 x 3.19 x 1.34 inches"}', '[\"Safeguard Protection - USB c Android chargers comes with premium built-in safeguards and intelligent IC identification technology to prevent against short circuit, over-current, over-voltage, over-heating and over-charging. It can intelligently recognize the battery type and status, will automatically stop charging when fully charged for a safety charging and long lifespan\",\"Quick Charge 3.0 Rapid Charging - Adaptive type c fast charger, enables your battery from zero to 50% in just 30 minutes, 75% faster than standard cell phone charger usb c\",\"Fast & Sync - USB c cell phone charger android kit charges Samsung phones and tablets with USB 2. 0 ports at max high speed of 480 Mbps. It also charge USB-C devices without the Fast Charging feature as well, with up to a 2 Amp charging rate. Besides, it also has data transfer feature for convenient usage(480Mbps)\",\"Wide Compatibility - Compatible AFC (Adaptive Fast Charging) Samsung Galaxy S21 Ultra, S21 Plus, S21, S20 Ultra, S20 Plus, S20, S20 FE, S10, S10e, S10+, S9, S9+, S9 Active, S8, S8+, S8 Active, Galaxy Note 20 Ultra , Note 20 5G, Note 10+ 5G, Note 10, Note 9, Note 8, Galaxy A90, A80, A71 5G, A70s, A52, A51, A20, Galaxy Z Fold2, Z Fold2 5G, Z Flip, Z Flip 5G, Fold, GOOGLE Pixel 1, 2, 3, 6, Pixel XL, LG G5, G6, G7, V20, V30 ThinQ Plus, HTC, ZTE Axon, Nexus 6p and other USB Type C Device\",\"Package List - 18-Month-Replacement & 24-hour service technical support. Package included 2-Pack android charger fast charging block & 2-Pack 6FT samsung charger fast charging cord\"]'),
