t neck or eye strain while charging your phone.(Please NOTICE that some Air Vent outlet not compatible)\",\"?Arms and Foot Auto Clamping Together?The car phone holder mount wireless charging\'s arms and foot will auto-opening after connecting to power, and will auto clamping firmly once place your phone inside, don\'t need to manually adjust the foot to clamp the phone.\",\"?Automatic Precise Alignment?This car phone mount is a built-in advanced sensor, just place your phone in after power on, it will intelligent identify and auto-adjusting the phone to the best charging area according to your phone model, no need to manually adjust the foot.\",\"?Case Friendly & FOD FUNCTION?This car mount wireless charger supports charging through phone cases up to 4mm thick.FOD foreign body detection prevents abnormal charging of equipment, please remove metal/magnetic objects, credit cards or pop holders before charging.\",\"?2 In 1 Design ?Combines the wireless charger & car mount, offers fast charging for your phone and saves you from messing with cables and cases while driving. Drivers will be safer and more comfortable with this phone holder charger!\"]'),
(602, 2, 86, 'Avery A-Z Tab Dividers for 3 Ring Binders, Customizable Table of Contents, Multicolor Tabs, 12 Sets (11125)', 'Organize your projects in seconds with this set of Avery Ready Index A-Z Dividers. Each tab is uniquely color coded and preprinted to present a professional look. Print customized section titles and images onto the table of contents sheet without worrying about inserts or labels. Whether you\'re hosting a meeting or creating binders for classes, these dividers are perfect for getting things sorted. 26 alphabet dividers are included with each sheet measuring 8-1/2\"x11\". The 3 ring binder holes are reinforced on both sides of the heavyweight sheet to prevent tearing. Each divider tab also includes additional reinforcement along the edge of the sheet to distribute stress and resist creasing. The table of contents sheet is also compatible with both laser and inkjet printers. This sheet can be printed in either portrait or landscape so that projects can be organized in any orientation. Just flip the sheet over to view the other layout. Check out the free templates for these dividers and try out the Avery Design & Print software today at avery.com/templates', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/81e3sflPCXL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/81e3sflPCXL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71XHB8Wa9WL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/613pRJmy2NL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71Wo09I96fL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81BDAqvn6+L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/716MNl-rs1L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71ijmLK-quL._AC_SL1500_.jpg\"]', '{"brand": "AVERY", "category": "Office Products", "dimensions": "9 x 11 x 0.28 inches"}', '[\"Organize tab dividers quickly with the printable table of contents sheet\",\"Easily add custom titles, graphics, and a logo to the table of contents page of your binder dividers with the free templates provided on avery.com/templates\",\"3 sets of A-Z dividers are paper with durable hole and tab reinforcements on both sides\",\"Flexible design works in either portrait or landscape orientation and is great for training manuals and project binders\",\"Multicolor alphabet divider tabs are preprinted and don\'t require labels or inserts\"]'),
(603, 4, 23, 'Alpine Corporation - 23\" Tall Outdoor Metallic Peacock Tail Spread Yard Statue � Vibrant Garden Sculpture for Patio, Lawn, or Entryway (Multicolor)', 'Add a splash of color and charm to your garden or patio with the Alpine Corporation 23\"\" Tall Outdoor Metallic Peacock Tail Spread Yard Statue. Designed to be a true statement piece, this beautifully detailed peacock features vibrant multicolor feathers and a lifelike design, making it an enchanting addition to any outdoor setting. Whether placed in your front yard, on your porch, or as an accent in your home, this statue will instantly enhance the ambiance of your space. Standing 23 inches tall, the peacock statue is made from 100% metal, ensuring durability and stability in various weather conditions. The sturdy construction and design ensure that this statue remains a prominent feature of your landscape for years to come. The rich, embossed details and electric colors of the peacock tail bring a touch of whimsy and elegance to your garden or patio, and the design captures the majesty and beauty of this stunning bird. Perfect for decorating your garden, lawn, entryway, or even indoors, this peacock statue creates a bold statement. Display one or multiple statues for a magical and lively garden display that will impress your guests and make your outdoor area stand out. Its vibrant colors not only add beauty but also bring a sense of joy and energy to your space. The Alpine Corporation Metallic Peacock Statue measures 32\"\"L x 12\"\"W x 23\"\"H, making it the ideal size for various outdoor or indoor areas. With its 1-year manufacturer�s warranty, you can enjoy the durability and quality of this piece without worry. Revamp your landscape and home d�cor with this striking, multicolored peacock statue and create a stunning focal point that will be the envy of your neighborhood.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/91of+kcRz+L._AC_SL1500_.jpg', '[\"https://