(626, 1, 49, 'JBL Clip 5 - Ultra-Portable, Waterproof & Dustproof Bluetooth Speaker, Big Pro Sound with Punchy bass, Integrated Carabiner, Up to 12 Hours of Play, Made in Part with Recycled Materials (Purple)', 'The JBL Clip 5 ultra-portable Bluetooth speaker is small enough to hold in one hand, but don\'t let the size fool you�it\'s big where it counts. A wide, fully integrated carabiner is big enough to clip to just about anything. The powerful driver and passive radiator deliver bigger, louder JBL Pro Sound and punchy bass. A single charge gives you up to 12 hours of playtime�and even more if Playtime Boost is turned on. Speaking of outside, it\'s IP67-certified waterproof and dustproof, so it\'s a natural to take on your next hike or camping trip. Pair two Clip 5s together for stereo sound, or instantly connect it with multiple JBL Auracast-enabled speakers for even bigger sound over more space. Plus it\'s available in a variety of colors, so you\'re sure to find one that fits your vibe. Every day is an adventure with the JBL Clip 5.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/71WgqkkKrKL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/71WgqkkKrKL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/714FQ-j-K1L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71veEzgvtCL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71P+cbMETqL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61urZ3YTNiL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61xG8rMBroL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/716d5lYwkwL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/614AvrAbzLL._AC_SL1500_.jpg\"]', '{"brand": "JBL", "category": "Electronics", "dimensions": "3.4\\\"D x 1.8\\\"W x 5.3\\\"H"}', '[\"Ultra-portable JBL Pro Sound Don\'t let its little size fool you. The JBL Clip 5 packs a serious musical punch, delivering big JBL Pro Sound with punchy bass. Your friends won\'t believe how much great JBL Pro Sound comes out of such a small speaker.\",\"Redesigned carabiner The redesigned and fully integrated carabiner has a much wider opening that makes it even more portable. You can attach the Clip 5 to everything from your backpack to your belt loop, and take your music with you all day, everywhere.\",\"Up to 12 hours of playtime plus 3 hours with Playtime Boost Don\'t sweat the small stuff�like charging your battery. JBL Clip 5 gives you up to 12 hours of playtime on a single charge. Tap Playtime Boost to add up to 3 more hours to your battery life.\",\"Waterproof and dustproof The JBL Clip 5\'s IP67 waterproof and dustproof rating ensures this portable speaker can handle almost any environment, from a poolside party to a seaside picnic.\",\"Multi-speaker connection by Auracast Want even bigger JBL Pro Sound? Pair two Clip 5s for stereo sound, or wirelessly connect multiple JBL Auracast-enabled speakers using Auracast for even bigger sound.\"]'),
