(628, 2, 506, 'Bubblefast! Brand FunPak Plant Based Biodegradable Packing Peanuts, 1.5 cu ft Bag, Compostable (Hearts-Rainbow)', 'Great for Baby Shower Gifts These heart-shaped packing peanuts are the perfect filling for a baby shower gift bag or box! Ideal for Dog Moms Sending a gift to a dog owner? Make sure to add in some bone-shaped filling! Perfectly Patriotic The star-shaped packing peanuts are a fun decoration for 4th of July parades and parties! Festive for Christmas Shaped like little Christmas trees, these packing peanuts are perfect for shipping Christmas gifts to your friends and family. Fun for Gender Reveal Parties Choose the pink hearts or the blue hearts and throw your friend a gender reveal party with these heart-shaped packing peanuts', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/71E7b-Ior2L._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/71E7b-Ior2L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61Ch-+lReLL._AC_.jpg\",\"https://m.media-amazon.com/images/I/81D4DjDQOfL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61HDdD6XSaL._AC_SL1280_.jpg\",\"https://m.media-amazon.com/images/I/61Mq4ljW7JL._AC_SL1287_.jpg\"]', '{"brand": "Bubblefast", "category": "Office Products", "dimensions": "18\\\"L x 13\\\"W"}', '[\"Pet, People and Planet friendly FunPak\'s decorative shapes making the unboxing experience memorable and fun.\",\"SAFE! FunPak is made from a patented, non-toxic plant-based formula that is completely safe for pets and people.\",\"COMPOSTABLE!FunPak is too cute not to reuse, but when you\'re done with it, you can rinse it down your sink, flush it down the toilet, throw it in your garden, use it to craft with your kids, or toss it in the trash.\",\"Within minutes FunPak compostable packing peanuts will break down and return to our earth.\",\"Safely leaves no toxic substances or pollutants in our soil or waterways.\"]'),
