(630, 4, 23, 'Alpine Corporation GIL838 Outdoor Floor 3-Tiered Soothing Polynesian Tiki Head Bowl Waterfall Fountain, 29\", Brown', 'Add a touch of island fun to your outdoor space with the Alpine Corporation Tiki Head Fountain. Guests will be serenaded by the cascading streams and will feel like they are in the middle of the beach in Hawaii next to a tiki bar! This outdoor fountain looks great in your garden, patio, deck, porch, or yard space. Enjoy the sound of trickling water that pours from rounded bowls sitting atop three levels of tiki totem heads. The polyresin, stone powder, and fiberglass construction is weather-proof, rust-resistant, and durable for years of quality use. The weight of the fountain and sturdy base allow it to stay upright in the strongest wind. LED lights in each of the 3 tiers illuminate your space, drawing attention to the relaxing water pools day or night for added ambiance. To use, simply plug into an outdoor outlet, fill upper level with water, and watch as the interior pump creates a lovely water flow. With a 2-year warranty, you can be confident in the quality of your purchase. Fountain measures 15\"L x 15\"W x 29\"H for use in yards of any size. Alpine Corporation is one of America\'s leading designers, importers, and distributors of superior quality home and garden decor products. Alpine Corporation\'s award winning in-house design team continuously develops new and innovative \"statement pieces\" for your home and garden. Your indoor and outdoor living spaces will be the envy of the neighborhood with our wide assortment of fresh, fashionable and contemporary products, from beautifully crafted solar garden stakes featuring patented motion and fiber optic lighting technology to beautiful fountains and delightful bird baths and feeders.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/81TN+uDNFKL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/81TN+uDNFKL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/91mn2Ywbn+L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81J4ZSOyVhL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/91ZG5hETIDL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81VY8LNTd5L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/91hXg2gUf6L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/91X00A+8ufL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81oYheOLalL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81i8mG1OUvL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/811Bv3rVDwL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/91yd9bvT7YL._AC_SL1500_.jpg\"]', '{"brand": "Alpine Corporation", "category": "Patio, Lawn & Garden", "dimensions": "15\\\"L x 15\\\"W x 29\\\"H"}', '[\"TIKI TOTEM FOUNTAIN Garden water fountain is the perfect addition to your outdoor decor, and features an interior pump that keeps the water flowing - just plug it in!\",\"RELAXING WATER FLOW Cascading water flows from each of the three tiki head tiers for a serene, island-inspired sound\",\"TROPICAL LOOK Tiki design adds a Polynesian look, while the integrated LED lights brighten up your space - day or night\",\"DURABLE Polyresin and stone powder construction is rust- and weather-resistant to keep your outdoor fountain looking new over time\",\"IDEAL SIZE Water fountain measures 15\"L x 15\"W x 29\"H the perfect size for your yard, and includes a two-year manufacturer\'s warranty from date of purchase\"]'),
(631, 13, 83, 'READYWISE - Emergency Food Supply Bucket, 120 Servings, MRE Meal Food Supply, Premade, Freeze Dried Survival Food for Hiking, Adventure & Camping Essentials, Individually Packaged, 25 Year Shelf Life', 'At ReadyWise Food, we lead the food industry when it comes to emergency preparedness. We work with organizations like the American Red Cross to make sure families are ready for the unexpected. This is why we created our unique line of emergency food rations and meals designed for use in natural disasters or for long-term shelf storage.Made from a combination of freeze-dried and dehydrated ingredients, each entr�e tastes great while also providing the calories and protein your body needs for survival. The food retains its original flavor, shape, color, and nutritional value while taking up less space, and our innovative process doesn�t require hot water to rehydrate the meal (though it is preferred). Even if the power is out or you�re stuck on the mountain overnight, all you need is one cup of water of any temperature to rehydrate and enjoy a filling entr�e. The rations are sealed using an ultra-high-barrier film, which is designed to provide optimum protection for oxygen- and moisture-sensitive products with long shelf-life requirements. That means your emergency rations can last up to 25 years. Each bucket contains 120 servings with 13 different meal options to choose from. Whether you�re stocking emergency preparedness supplies or looking for quality backpacking food, ReadyWise meals are easy, nutritious, and ready to go when you need them. Check out our entire selection of emergency, adventure, and everyday freeze-dried and dehydrated meals.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/712CxINA5BL._SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/712CxINA5BL._SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81ZdngMC8aL._SL1500_.jpg\",\"https://m.media-amazon.com/images/I/910mi8yKp5L._SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81aJcfz4CrL._SL1500_.jpg\",\"https://m.media-amazon.com/images/I/91I98-ahCBL._SL1500_.jpg\",\"https://m.media-amazon.com/images/I/91rhjjxaZZL._SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81CDEytzSLL._SL1500_.jpg\"]', '{"brand": "ReadyWise", "category": "Sports & Outdoors", "dimensions": "15 x 10 x 12 inches; 18.38 Pounds"}', '[\"UNPARALLELED EMERGENCY PREPAREDNESS Elevate your readiness with the ReadyWise Emergency MRE Meal Supply. This life-saving kit, packed in a convenient bucket, boasts 120 servings designed to sustain you for 13 days. When disaster strikes, you\'ll be equipped with the ultimate nutrient-packed solution.\",\"SAVOR THE FLAVOR Don\'t compromise on taste during emergencies. Our survival kit includes a delectable assortment of lunch and dinner options. Every dish is crafted from real ingredients, ensuring a gourmet experience even in dire circumstances. With a potential 1,800 calories per day, your energy levels will remain robust.\",\"25-YEAR SHELF LIFE Trust in longevity with each food item sealed in durable pouches. These provisions remain fresh for up to 25 years, offering enduring peace of mind. When hunger strikes, all it takes is a pouch, some water, a quick stir, and 15 minutes to savor a nourishing meal.\",\"DIVERSE CULINARY ADVENTURES Experience a delightful array of 13 different delicious meal options including hearty soup, pasta, tasty rice, and more. These culinary delights aren\'t just for emergencies � they also make for fantastic companions on backpacking and camping expeditions.\",\"READY FOR ANYTHING Beyond emergencies, ReadyWise shelf-stable food is your go-to solution for hiking, camping, and any adventure that beckons. With our easy-to-prepare meals, drinks, and snacks, you\'ll be well-equipped to tackle any situation that comes your way.\",\"CONVENIENCE IN A BUCKET Our Emergency Food Supply Bucket, is your compact companion for all scenarios. Whether you\'re safeguarding your pantry, embarking on a thrilling adventure, or facing an unforeseen crisis, this bucket ensures you\'re ready. It\'s not just food; it\'s peace of mind in a pail.\"]'),
(632, 6, 306, 'Benefiber Daily Prebiotic Fiber Supplement Powder for Digestive Health, Unflavored - 125 Servings (17.6 Ounces)', 'Benefiber Daily Prebiotic Fiber Supplement Powder is designed to strengthen and nourish the good bacteria, helping support your digestive health (1). A source of daily fiber, this unflavored powder contains the plant based fiber wheat dextrin to help nourish the good bacteria in your digestive system (1)(2). Sugar-free, gluten-free, taste-free and grit free, this clear fiber powder dissolves completely in foods and non-carbonated beverages like water, coffee or juice, so you can enjoy all the benefits of prebiotic fiber supplements in a variety of foods and beverages (3). For ages 12 and older, stir two teaspoons of Benefiber prebiotic fiber powder into four to eight ounces of a non-carbonated beverage or soft food three times daily. For children ages 6 to 11, use one teaspoon of this prebiotic powder three times daily. Benefiber makes taking fiber easier. (1) These statements have not been evaluated by the Food and Drug Administration. This product is not intended to diagnose, treat, cure or prevent any disease. (2) The wheat has been processed to allow this food to meet the Food and Drug Administration (FDA) requirements for gluten-free foods. (3) Not recommended for carbonated beverages. Use as directed.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/718p-AJ4jzL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/718p-AJ4jzL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81Ajrwi+eZL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/91AIf+yY+rL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81luKGx+CPL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81x-RLN4fkL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81hD6HHXKsL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/814s7Y-X2xL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81DfivkgiyL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61ApAhoJU4L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61kTj4uQRYL._AC_SL1500_.jpg\"]', '{"brand": "Benefiber", "category": "Health & Household", "dimensions": "4.28 x 4.28 x 7.63 inches; 1.34 Pounds"}', '[\"One 17.6-ounce bottle of unflavored Benefiber Daily Prebiotic Fiber Supplement Powder for Digestive Health (1)\",\"Prebiotic fiber supplement designed to help support gut health (1)\",\"Daily fiber powder that strengthens and nourishes good bacteria to support gut health (1) using wheat dextrin\",\"Unflavored fiber powder that dissolves clear and completely, allowing you to mix it into your favorite foods and non-carbonated beverages (3)\",\"Gluten-free, sugar-free, grit-free dietary prebiotic fiber supplement made with wheat dextrin and no artificial flavors (2)\",\"Stir two teaspoons into four to eight ounces of a non-carbonated beverage or soft food three times daily, for ages 12 years and older\",\"Use one teaspoon three times daily, for ages 6 years to 11 years\"]'),
(633, 2, 508, 'Tomorotec Desk Letter Tray Set, A4 Size Clear PET Stackable Document Organizer Office Desktop File Paper Holder Book Storage Rack Side Load Anti-Skid Stacking Support Convex Bottom (2X Landscape)', 'About this item ???2/4PCS Letter Trays?Set of 2/4 clear stackable desk organizer trays, dimensions: 9.6x12.4x3 inches (24.5x31.5x7.7 cm), approx. 445g. The A4 size transparent PET organizers are durable, sturdy, lightweight and wear resistant. The creative stackable design ensures a secure grip and allows multiple layers to be stacked on top of each other steadily. Use the letter trays individually or stacked and add additional tiers to maximize your desktop space and organize your workspace without cramping. ???Contemporary Style?This tray holder with clean lines and a simple shape is functional yet decorative. The solid and transparent tray allows you to distinguish the contents at a glance with unimpeded access to your items, ideal for daily use. It can easily be coordinated with existing office accessories and surrounding decorations. The organizer\'s simple design and sturdy construction make it an excellent addition to any office or home workspace. ???Stackable Design?The unit\'s modular design allows for stacking one over the other, offering valuable space-saving convenience. The grooved snaps on three sides of the bottom provide stable layered support without tilting or tipping. Convenient to stack and disassemble, so you can easily use any number of tiers and adjust the stack height as needed. No extra stacking support is required. ???Anti-Skid & Solid Craftmanship?The simple rectangular file tray features an open design for easy and convenient access to your daily essentials. Our document organizers are made of durable plastic with a multi-layer structure, and the clean, smooth surface is safe for home, office and school use. The anti-skid convex groove raises the bottom to prevent surface scratches and abrasions, increasing friction with the tabletop and making it more stable.q ???Versatile Organizer Set?The large-capacity storage boxes have ample storage space for paper, forms, notepads, worksheets, books, invoices, artwork, work orders and more. They can be used in drawers or cabinets, or on desks or shelves, suitable for various environments such as offices, hospitals, schools, test fields, etc. Our storage tray set is a perfect gift for anyone who is fully loaded with letters, files, documents, office supplies and doesn\'t have enough desktop space! � See more product details', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/71CR6gQzaEL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/71CR6gQzaEL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81zpen0bAqL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71NbO5bojdL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71zgRh+83nL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/710DI9izDpL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61Xc2nvHBSL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71jHJg-iZSL._AC_SL1500_.jpg\"]', '{"brand": "Tomorotec", "category": "Office Products", "dimensions": "12.5\\\"L x 9.8\\\"W x 3\\\"H"}', '[\"???2/4PCS Letter Trays?Set of 2/4 clear stackable desk organizer trays, dimensions 9.6x12.4x3 inches (24.5x31.5x7.7 cm), approx. 445g. The A4 size transparent PET organizers are durable, sturdy, lightweight and wear resistant. The creative stackable design ensures a secure grip and allows multiple layers to be stacked on top of each other steadily. Use the letter trays individually or stacked and add additional tiers to maximize your desktop space and organize your workspace without cramping.\",\"???Contemporary Style?This tray holder with clean lines and a simple shape is functional yet decorative. The solid and transparent tray allows you to distinguish the contents at a glance with unimpeded access to your items, ideal for daily use. It 