(659, 3, 527, 'PopSockets Phone Grip Compatible with MagSafe, Adapter Ring for MagSafe Included, Phone Holder, Wireless Charging Compatible - Horchata', 'Our little life changer: The new Circular PopGrip compatible with MagSafe is a wireless charging phone grip that enables phone grip functionality. Includes an adapter ring to give any phone without MagSafe capabilities the ability to use magnetic phone accessories. Attach the adapter ring to your Android/Pixel/Samsung/legacy iPhone (or any non-MagSafe case) to enable magnetic grip technology. Works on MOST cell phone cases. Not compatible with silicone, textured or anti-fingerprint coated cases. PopSockets PopGrip compatible with MagSafe allows you to kickstand your phone on-the-go, use your phone one-handed, and prevent phone drops. When you�re done, it collapses flat. You must have a MagSafe compatible case to securely attach our PopGrip to your phone or utilize the included Adapter Ring. It is compatible with PopSocket cases and mounts for MagSafe, wireless charging adapters, and non-Popsocket cases compatible with MagSafe.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/41c8FGkG0-L._AC_SL1000_.jpg', '[\"https://m.media-amazon.com/images/I/41c8FGkG0-L._AC_SL1000_.jpg\",\"https://m.media-amazon.com/images/I/41qQJRKhfgL._AC_SL1000_.jpg\",\"https://m.media-amazon.com/images/I/41nJN-YL0cL._AC_SL1000_.jpg\",\"https://m.media-amazon.com/images/I/413TJxYoilL._AC_SL1000_.jpg\",\"https://m.media-amazon.com/images/I/41Nxw+Z1+DL._AC_SL1000_.jpg\",\"https://m.media-amazon.com/images/I/61WfD3wd-AL._AC_SL1500_.jpg\"]', '{"brand": "PopSockets", "category": "Cell Phones & Accessories", "dimensions": "2.76 x 1.97 x 0.79 inches"}', '[\"Make it MagSafe Built-in magnets securely attach to iPhone 12Plus Magsafe cases and easily snaps on or off for wireless charging\",\"One Grip Fits All Upgrade your Android, Samsung, Google Pixel, Kindle, or legacy iPhone device using the included Magnetic Adapter Ring. Adapter Ring works on most cell phone cases. Not compatible with silicone, textured or anti-fingerprint coated cases.\",\"Wirelessly charge your phone by simply sliding off the magnetic round PopSocket and setting on a wireless charging pad (Adapter Ring not compatible for wireless charging capability)\",\"Better Together The magnetic Popsocket is compatible with our MagSafe ecosystem of grips, wallets, cases, mounts, and chargers\",\"New Shape, Same Strength The new MagSafe PopSocket comes with compact circular design for pocket ability and portability that is 40% stronger than standard Apple-compliant MagSafe\"]'),
(660, 2, 458, 'Oxford Index Cards, 3 x 5 Inches, White, Lined on Front, Blank on Back, Flashcards for School and Studying, Recipe Note Cards, 500 Count (5 Packs of 100) (40176)', 'Oxford Ruled Index Cards are a versatile study tool for students of all ages. 3x5 inch index cards to give students a break from screen time.�For preschool or elementary school learners, use markers, colored pencils or bright gel pens to make colorful flashcards for letters and numbers, math, spelling, vocabulary or sight words. Or, take field notes outdoors for a healthy interactive fresh air break. Laptop aside, recent research suggests taking notes by hand may be better for retention and recall. Start early and help students build good notetaking habits. Note�cards can help organize chapter notes, plan writing or research assignments, bring order to talking points, create study cards for the SAT, ACT, NCLEX, EMT or MCAT exams, or keep track of a growing to-do list. The ultimate life hack for successful study, kindergarten through college! White. Lined. 3\" x 5\". 500 Per pack.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/61CA2XNKQ8L._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/61CA2XNKQ8L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61HgncLyZbL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61nYSBnNNPL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71BrAJ-rPgL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81wHm9gH1WL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/91Jx19nAlML._AC_SL1500_.jpg\"]', '{"brand": "Oxford", "category": "Office Products", "dimensions": "5 x 3 x 3.75 inches"}', '[\"Ruled 3 x 5 index cards are the perfect study tool for students of all ages; ideal for flash cards, notes or to do lists; 500 per pack\",\"Classic 3x5 cards are a practical size for the whole household; ideal for elementary school flashcards or complex, higher level notes\",\"Standard weight index cards support pencil, ink pens, gel pens or highlighters; use lots of color for focused, effective notes\",\"Make Oxford index cards part of your strategy for better notetaking; studies suggest writing notes help you process and recall info better\",\"Stock up on 500 note card packs in white; perfect for students, teachers, and more\"]'),
(661, 2, 528, 'Metal Magnetic Book Shelf: Book Display Shelf 2 Pack Strong Adsorption with 2 Pen Containers, Durable Magnetic Shelves for Classroom, Movable Office File Book Holder, Fridge Shelf (White Mesh)', 'Full Magnet Covered Back to Keep Stable Load More Excellent Materials & Techniques It is more solid than other shelves of the same type, and it adds two bearing rods at the bottom, which is not easy to deform and more stable. This shelf grid design makes the overall weight lighter, the grid is dense, and it is not easy to drop items.  Convenient Magnetic Trays for Classroom Portable Tablet & Document Display Rack The Perfect Housewarming & School Gift.  Strong Magnetic Display Shelf Wide Use The back of the shelf adopts a whole rubber magnetic sheet with strong magnetic force and stable suction. Widely used, it can be adsorbed on any flat metal surface without drilling.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/71OdYpq61tL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/71OdYpq61tL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/91mywALFLQL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61KazbuLN9L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71luIB1wI1L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71DUxBUO2sL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71aORLJilpL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81Pss1MF6GL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71kfAZDd4iL._AC_SL1500_.jpg\"]', '{"brand": "DTUQYX", "category": "Office Products", "dimensions": "17\\\"D x 2.35\\\"W x 2.36\\\"H"}', '[\"Strong Adsorption Capacity Magnetic Shelves Our magnetic book shelves each feature a large magnetic rubber strip with strong magnetic attraction, ensuring safe holding and preventing accidental dropping. It can hold up to 10 lbs. The shelf kit comes with two lightweight pen holders to store small tools.\",\"Premium Material Holder The magnetic shelf is made of high-quality metal, the surface with matte spray painted, durable, anti-oxidation and rust, easy to clean. The frame adopts fine mesh design, which makes the weight of the shelf more lightweight, the diameter of the main load-bearing fence and the two load-bearing rods at the bottom both exceed 4.5mm, paired with a 2mm thick iron mesh. The pen holder is made of thick plastic, lightweight and has rounded edges.\",\"Suitable Size Magnetic Shelf for Whiteboard Each package contains 2 magnetic bookshelves. Dimensions 17 \"D x 2.36\" W x 2.36 \"H. And 2 magnetic pencil holders. Dimensions 4.7 \"H x 2.2\" W x 1.02 \"D. Shelves can better accommodate a variety of books, including larger picture books for children, etc. Because the shelf is made of all metal material, we do not recommend children to use it alone and it needs to be accompanied by adult supervision.\",\"Convenient Magnetic Trays for Classroom The magnetic design of this magnetic bookshelf eliminates the need to drill holes in walls or tables. Simply unwrap and start using the shelf on the White board immediately. It\'s very convenient. The pen holder is lightweight and slightly magnetic, suitable for carrying chalk and markers.\",\"Wide Use & Warming Gift This magnetic classroom shelf is not only suitable for books, but also for art, paintings, toys and photos; It can be used on any smooth metal surface, as magnetic organizer for refrigerator, magnetic trays, laundry organizers, document display shelves. These magnetic shelves are the perfect housewarming, school gift. If you have any questions or suggestions regarding the product, please contact us, we are dedicated to serving you 24 hours a day.\"]'),
(662, 7, 529, 'Sdstone Safe Box with Sensor Light,Hidden Safe Box with Key & Digital Lock for Home and Company. Electronic Security Safe Box Wall or Cabinet Fixed Design, 0.4 Cubic Feet', 'External Power Supply Here is an external power supply specially prepared for you. If your internal batteries have been dead and you lost the key too, you can connect the power to the safe from the outside by the external battery connection hole. Then you can input the code to unlock your safe. Numeric keyboard & LED Display Screen When the batteries are almost exhausted, the low battery light would light up. When you input the incorrect code, the warning light would light up. When you input the correct code or finish your reset successfully, the confirm light would light up.  LATEST INDUCTION LIGHT DESIGN The safe is equipped with an internal indicator light. When you open the safe, the indicator light will light up automatically. Protective pad Protect valuable items from scratches', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/51P9HUdsxML._AC_SL1200_.jpg', '[\"https://m.media-amazon.com/images/I/51P9HUdsxML._AC_SL1200_.jpg\",\"https://m.media-amazon.com/images/I/7121VGXSqeS._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61R3o80+5NL._AC_SL1200_.jpg\",\"https://m.media-amazon.com/images/I/81hXiE61WOS._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71H1Iwm5syS._AC_SL1200_.jpg\",\"https://m.media-amazon.com/images/I/61fL8XKOO2L._AC_SL1200_.jpg\",\"https://m.media-amazon.com/images/I/61aLeBaIAYS._AC_SL1200_.jpg\"]', '{"brand": "Sdstone", "category": "Tools & Home Improvement", "dimensions": "7.87\\\"D x 12.2\\\"W x 7\\\"H"}', '[\"[Latest Sensor Light Design] This money safe is equipped with an internal sensor light. When you use the numeric keypad to open the safe, the sensor light will light up immediately. So you can see the internal valuables clearly. When you close the door, the sensor light will go out. In addition, there i