(668, 14, 534, 'Classic Earth Hugg-A-Planet | The Original Soft & Huggable Planet Earth. 600 Places Labeled. Educational Toy for Kids 3+, Teens, Adults, Teachers and Parents.', 'About us Hugg-A-Planet is a family owned and operated business. We are celebrating our 40th year of making educational learning globes that inspire peace and a love for the planet. Since 1982, we have committed to one thing - developing great toys that belong in every home on earth Changing the world, for the better. We are the socially responsible toy company dedicated to changing the world one kids toy at a time. It is Hugg-A-Planets belief that in order to foster real progress in effecting positive change, we must start with the children. Cleaning is a breeze with our cotton filled, machine washable planet. You can relax knowing that if this gets dirty it can be easily cleaned! Educating and Engaging Perfect for homes, classrooms, dorm rooms, or nurseries - these beautiful, simple reference Globes are meant to inspire geo-learning. Best when paired with a more detailed world atlas. This amazing learning toy is designed to be fun, used as an educational resource, and hugged! Jumpstart curiosity in kids, toddlers, and teens of all ages with this fun and engaging toy. The Hugg-A-Planet plush globe offers educational and an interactive experience. Our products come vacuum sealed - and with just a few huggs, becomes inflated to its original shape. Then the learning can start Fun for all ages Hugg-A-Planet can be used in games, passing it around as a talking point, a comfortable pillow, and as a great educational learning toy. Whether you�re the parent, teacher, or the student, Hugg-A-Planet invites you to get curious. Fun for all ages Hugg-A-Planet can be used in games, passing it around as a talking point, a comfortable pillow, and as a great educational learning toy. Whether you�re the parent, teacher, or the student, Hugg-A-Planet invites you to get curious. Our Hugg-A-Planet has been on TV