(671, 4, 23, 'Alpine Corporation - 33\" Tall Outdoor Antique Jar Water Fountain with LED Lights, Vintage Light Waterfall � Relaxing Garden Fountain for Patio, Deck, or Yard (Turquoise)', 'Transform your outdoor space into a tranquil retreat with the Alpine Corporation Antique Jar Water Fountain. Standing 33 inches tall, this stunning garden fountain features a beautifully aged turquoise cracked jar design that exudes both vintage charm and modern elegance. The four cool white LED lights highlight the flowing water, creating a glowing, serene atmosphere in the evening hours. Perfect for any outdoor setting, this fountain brings a calming element to your garden, patio, porch, or yard. The gentle water flow, which trickles from the top of the jar, mimics the soothing sounds of a natural stream, adding peaceful ambiance to your outdoor living space. Whether you\'re looking to relax, meditate, or simply enjoy the sounds of flowing water, this fountain offers the perfect solution. The built-in 12V pump creates a smooth, consistent flow, and the 6-foot power cord makes it easy to place in a variety of locations. Made from durable fiberglass and cement, this fountain is both weather-resistant and rust-resistant, ensuring long-term durability despite exposure to the elements. The sturdy base keeps the fountain stable, even in windy conditions, and the construction resists fading, cracking, and damage from UV rays. This fountain is designed to look beautiful and perform reliably for years to come. With its ideal size of 15\"\"L x 15\"\"W x 33\"\"H, the fountain fits perfectly in most outdoor spaces, providing a striking visual accent without overwhelming the area. It�s easy to set up�simply plug it in, fill it with water, and watch as the soothing water flow transforms your garden into a peaceful sanctuary. Plus, with a 2-year manufacturer�s warranty, you can trust in the quality and durability of your purchase. Add a touch of elegance and tranquility to your outdoor decor with the Alpine Corporation Antique Jar Water Fountain with LED Lights. It�s a stunning and functional centerpiece that brings both beauty and relaxation to your garden, yard, or patio.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/61jHFnUKMOL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/61jHFnUKMOL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81LJY6LdJkL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81Czwdgi7UL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81v4CwHAlzL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81mNzI+QR3L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71nmrEjZQQL._AC_SL1500_.jpg\"]', '{"brand": "Alpine Corporation", "category": "Patio, Lawn & Garden", "dimensions": "15\\\"L x 15\\\"W x 33\\\"H"}', '[\"OUTDOOR FOUNTAIN WITH LED LIGHTS Enhance your outdoor space with the Alpine Corporation Antique Jar Water Fountain featuring built-in cool white LED lights. These lights beautifully illuminate the flowing water, creating a serene and calming atmosphere at night. This fountain is perfect for patios, gardens, decks, and yards, providing both visual appeal and peaceful sounds of nature with minimal effort�just plug it in and let the water flow.\",\"RELAXING WATER FLOW The water gently trickles from the top of the turquoise cracked jar, mimicking the soothing sounds of a natural stream or waterfall. This calming water flow creates a tranquil environment in your garden or patio, perfect for relaxation, meditation, or simply enjoying the peaceful ambiance of your outdoor setting.\",\"ANTIQUE TURQUOISE DESIGN The unique, turquoise cracked jar design gives this fountain a vintage yet modern look, making it a striking focal point in any outdoor area. Its timeless design complements a variety of outdoor decor styles, adding a pop of color and charm to your garden, yard, or deck. The antique look enhances the overall aesthetic of your landscape while offering a functional water feature.\",\"DURABLE CONSTRUCTION Constructed from a combination of fiberglass and cement, this outdoor water fountain is built to withstand the elements. It is both weather-resistant and rust-resistant, ensuring long-lasting durability and a beautiful appearance year after year. The sturdy base and well-balanced design provide stability, making this fountain a reliable addition to your outdoor decor.\",\"PERFECT SIZE & EASY SETUP Measuring 15\"L x 15\"W x 33\"H, this fountain is the perfect size to fit into a variety of outdoor spaces without overwhelming the area. Setting it up is easy�just plug it into a standard electrical outlet using the included 6-foot power cord, fill it with water, and let the 12V interior pump take care of the rest. The fountain also includes a 2-year manufacturer�s warranty, giving you confidence in your purchase.\"]'),
