(673, 2, 285, 'Duck Max Strength Clear Packing Tape Refills � 6 Rolls of Maximum Strength Heavy Duty Packaging Tape for Shipping & Moving, Strong Packing Tape for Boxes, 1.88 Inch x 54.6 Yards, Clear (241513)', 'MAX Strength Packaging Tape offers premium quality for all of your heavy-duty shipping, moving and storage needs. Stronger and more durable than ordinary tapes, this packaging tape is designed to seal even the heaviest boxes safely and securely to help prevent items inside from being damaged during delivery. It offers a discreet, professional seal and superior quality whether you\'re on the move or shipping boxes from the home or office. Its tough adhesion makes it perfect for protecting and storing your belongings all year-round.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/61IQ2zgvIdL._SL1350_.jpg', '[\"https://m.media-amazon.com/images/I/61IQ2zgvIdL._SL1350_.jpg\",\"https://m.media-amazon.com/images/I/61KTEyyF5tL._SL1200_.jpg\",\"https://m.media-amazon.com/images/I/61SuuOilRrL._SL1200_.jpg\",\"https://m.media-amazon.com/images/I/618qFL3oCPL._SL1200_.jpg\",\"https://m.media-amazon.com/images/I/51UWoDr8q6L._SL1200_.jpg\",\"https://m.media-amazon.com/images/I/51TvrXfaZPL._SL1200_.jpg\"]', '{"brand": "Duck", "category": "Office Products", "dimensions": "4.29 x 4.29 x 1.89 inches; 2.4 Pounds"}', '[\"HEAVY DUTY CLEAR TAPE Duck Max Strength packaging tape is 100x stronger than acrylic tapes based on ASTM D3654B; securely holds boxes up to 100 lb\",\"HOT MELT ADHESIVE TECHNOLOGY Packing tape features hot melt adhesive construction that creates an instant, quick stick to boxes for immediate and long-lasting hold\",\"RUGGED TAPE WITH STRONG ADHESION Designed for sealing the heaviest packages and boxes, Duck Max Strength packing tape provides strength and stick for any project in the home, office or warehouse\",\"PACKING TAPE REFILL Each pack contains 6, 3 in. core, clear, heavy-duty packaging tape refill rolls which fits most