d in place.\",\"High Quality Build-- Made from sturdy metal with a smooth, corrosion-resistant finish. The 4 sponge pads of drawer bottom prevent drawer damage and ensure stability.\",\"Customer Support-- This organizer saves time and keeps your workspace tidy. If you have any questions, feel free to reach out to us, and we�ll do everything we can to help you.\"]'),
(677, 3, 540, 'hohem iSteady V3 Gimbal Stabilizer for iPhone, 3-Axis Phone Gimbal, Magnetic AI Tracker, Built-in Extendable Rod & Tripod, Detachable Remote Control, Stabilizer for Travel, Vlog, TikTok, Black', 'hohem iSteady V3 Gimbal Stabilizer - Your Personal AI Videographer The video showcases the product in use.The video guides you through product setup.The video compares multiple products.The video shows the product being unpacked.   1 iSteady 8.0 Stabilization 2 Follow the Action 3 Hands-Free Control   1 Magnetic AI Tracker 2 8.07\" Built-in Tripod 3 Detachable Remote Control 4 Set AI Tracker Position   1 Upgraded Fill Light 2 Lasting Power 3 Versatile Orientation 4 Compact & Foldable hohem iSteady V3 Compatibility List', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/71p0GhuaCXL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/71p0GhuaCXL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81LIz9PEhqL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71gABTmtHTL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81iu6fNpl5L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81Tz09OFx7L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71GVBbnna2L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/710+OgUaZtL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81++ePD4w0L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71dTk3SFU7L._AC_SL1500_.jpg\"]', '{"brand": "hohem", "category": "Cell Phones & Accessories", "dimensions": "5 x 2.56 x 12.28 inches"}', '[\"[Magnetic AI Tracking, Effortless Shooting] The 2024 Upgraded Hohem iSteady V3 Gimbal features a magnetic AI tracker that enables smooth, app-free face and body tracking for stable shooting. The AI vision sensor can be activated or deactivated with specific gestures, keeping the subject in frame. This phone gimbal is perfect for travel bloggers capturing every moment with fluid motion and hand gesture controls\",\"[Ultra-Smooth 3-Axis Stabilization] Featuring the advanced iSteady 8.0 anti-shake system, the iSteady V3 gimbal offers incredibly smooth footage, ideal for athletes capturing dynamic activities. This phone stabilizer extended roll arm ensures wide-angle, unobstructed shots with enhanced movement angles, keeping the motor out of the frame for a seamless recording experience\",\"[Innovative Detachable Remote Controller] The first of its kind, our 3-axis stabilizer features a detachable remote controller allows quick storage and magnetic handle attachment for real-time charging. Enjoy effortless remote shooting with fingertip control, eliminating the need for assistance while capturing your travel moments\",\"[Extendable Rod & Tripod for Creative Angles] The gimbal stabilizer for smartphone comes equipped with an integrated extendable rod and tripod. The extendable rod can stretch up to 8 inches, allowing you to effortlessly capture flawless selfies, unique low-angle shots of pets, or simulate aerial perspectives\",\"[Magnetic Fill Light for Perfect Lighting] The iphone gimbal with magnetic fill light offers cold, warm, and natural light options, ensuring bright and beautiful shots even in dark environments. The iSteady V3 gimbal features a new side wheel design for smooth brightness adjustment from 4% to 100%, enhancing shooting efficiency. Perfect for night street photographers and vloggers needing consistent lighting\",\"[Long-lasting 13-Hour Battery] Enjoy extended shooting sessions with the 13-hour battery life. This hohem iSteady V3 stabilizer is perfect for long travels and full-day events, ensuring you never miss capturing important moments\",\"[Creative Shooting Modes with Hohem Joy App] Our smartphone gimbal,paired with the Hohem Joy app, offers multiple shooting modes including panorama, timelapse, and slow motion. Featuring Moment creative templates, it allows you to easily create cinematic masterpieces with just a lift of your hand\",\"[Portable and Foldable Design] Designed for portability, the compact and foldable hohem iSteady V3 gimbal fits in your pocket. Ideal for travel enthusiasts who need a lightweight, easy-to-carry stabilizer for spontaneous shooting on the go\"]'),
