(684, 2, 109, 'Paper Mate Clearpoint Mechanical Pencils 0.7mm, HB #2 Pencil Lead, 2 Pencils, School Supplies, Teacher Supplies, Drawing Pencils, Sketching Pencils, 1 Lead Refill Set, 2 Erasers', 'Product Description With the feel of a pen and the look and performance of a pencil, Paper Mate Clearpoint Mechanical Pencils are the clear choice for smooth, easy writing. These pencils feature a convenient side-click advance mechanism on the barrel that advances the lead with just a click for uninterrupted performance. The textured grip provides comfort and control during long writing sessions, while the jumbo twist-up eraser lets you easily correct mistakes without any smudges or tearing. Finally, a wide range of fashion barrels keeps writing fun! Use these Paper Mate mechanical pencils as drafting pencils for clean, accurate lines or stock up for your school supplies so you never have to worry about a broken pencil tip. From the Manufacturer Mechanical pencil features a centrally located click-advance button that lets you easily advance the lead without releasing your hold of the pencil. Soft grip is designed for added comfort and ease. Jumbo twist-up eraser is larger than standard erasers and advances easily. Mechanical pencil is retractable to protect pockets and purses from damage. Refillable.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/816F+ECV9lL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/816F+ECV9lL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81qUY4E0n1L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81Gzcw4zL-L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71GoTRBJIGL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/718E55vo8SL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81WJq-B156L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71+cPeR2sWL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71M+HwZtMqL._AC_SL1500_.jpg\"]', '{"brand": "Paper Mate", "category": "Office Products", "dimensions": "0.65 x 3.2 x 7.6 inches"}', '[\"Mechanical pencils create clear, precise lines every time\",\"Side lead advance lets you load lead without losing your grasp\",\"Range of colorful barrels add a dimension of fun\",\"Soft grip design adds comfort and ease\",\"Jumbo twist eraser makes erasing clean and easy\",\"Includes two 0.7mm mechanical pencils, 2 erasers, and 1 lead refill set\"]'),
(685, 2, 91, 'Canon PIXMA TS9520a � Wireless Home All-in-One Inkjet Printer', 'Designed for home use, the Canon PIXMA TS9520a All-in-One inkjet printer delivers high-quality printing and outstanding wireless connectivity in a compact size. The PIXMA TS9520a is easy to set up and maintain and offers great media versatility to print on a variety of media types and sizes, including photo paper, envelopes, borderless photos, banners and more. Use Poster Artist Online to create professional-posters, banners and signage. Produce crisp, colorful documents and photos quickly and cost-effectively with fast print speeds. Keep printing with a plain paper capacity of up to 100 sheets in the bottom cassette, 100 sheets in the rear tray and 20 sheets in the auto document feeder. Easily connect and print through high-speed USB or wirelessly from computers or mobile devices, and also print from your compatible mobile devices using the free Canon PRINT app and more. This comes with a 1-year limited warranty and is backed by Canon\'s Service and Support network.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/71K0jR27R-L._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/71K0jR27R-L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/712P05HedsL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81gKqIIPvvL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81XtWPgMGBL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81WV6wepiUL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81J3ABTHYJL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81VsHjTZTHL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81zyuay6MtL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/716wSIykeBL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71Qv1031QJL._AC_SL1500_.jpg\"]', '{"brand": "Canon", "category": "Office Products", "dimensions": "18.5\\\"D x 14.5\\\"W x 7.6\\\"H"}', '[\"ALL-IN-ONE Print, Copy, Scan fea