nd experience the joy of sharing your customized EQ with global audiophiles in \'EQ zone\'.\",\"[Upgrade your Playtime with the NC9 2024] The charging case not only serves up to 59H(ANC off) and 42H(ANC on) totally playtime after 2 hrs fully charge, and 14hrs(ANC off) and 10hrs(ANC on) playback for single use. It also displays the remain battery, ensuring it\'s still there when you need it most.\",\"[IPX8 Water Resistance] Keep the headsets with an active lifestyles, they can withstand sweat, rain, and even accidental splashes, making them perfect for outdoor activities.\",\"[Bluetooth 5.3 Technology] Simply activate the Bluetooth function with the strong signal, so that there is no disconnection in listening music within 15 meters. Enjoy low latency that keeps movies and games in sync.\"]'),
