B100 is waterproof and dustproof with an iP67 rating and a new UV coating, so you can take your tunes to go�whether it�s the pool, the beach, the shower, or camping.\",\"LONG BATTERY LIFE Up to 16 hours of battery life with indicator.\",\"BLUETOOTH Connect and stream music easily with Bluetooth.\",\"STEREO PAIR Add an extra speaker for stereo sound.\",\"HANDS FREE CALLING Built-in microphone with echo canceling technology for clear calls.\",\"USB TYPE-C PORT You can charge the XB100 with the USB Type-C port.\"]'),
(699, 2, 86, 'Avery Dividers for 3 Ring Binders, 8-Tab Binder Dividers, Plastic Binder Dividers, Insertable Big Tabs, Multicolor, 3 Sets (71901)', 'Easily organize school subject binders, recipe binders, office binders and more with Avery plastic page dividers for 3 ring binders. This pack includes 3 sets of 8-tab insertable dividers in a range of different colors for easy color coding at a glance. Each divider is made with a durable plastic material that will last longer than standard paper dividers and wipes clean with most non-abrasive household cleaners. The insertable Big Tab divider tabs are 50% larger than traditional divider tabs and provide extra space for text, logos and images. Each tab also includes an easy access slot to make it simpler to slide tab inserts in and out as well as an indented point to keep the inserts locked in place. A sheet of tab inserts are included that can be printed on with either a laser or inkjet printer and can be written on with pens, permanent markers and pencils. Visit the Avery site for free templates and tools to easily design and print custom tab inserts for any project whether it\'s for school, home or work.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/71y-u7qEMzL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/71y-u7qEMzL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71J90u9V77L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/815P5ZgOBNL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61s1pXxA3+L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61+fohWDIkL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61-PSTQcICL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61S5lB69LcL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/716tvYrMmDL._AC_SL1500_.jpg\"]', '{"brand": "AVERY", "category": "Office Products", "dimensions": "11 x 9 x 0.38 inches"}', '[\"Organize schoolwork, recipes and other important documents with Avery multicolored 3 ring binder dividers with tabs\",\"Built to last with durable plastic, each insertable plastic divider is designed to withstand everyday wear & tear and wipes clean with most non-abrasive household cleaners\",\"Display 50% more information with the wider Big Tab insertable tab design than with standard insertable divider tabs\",\"Each 3-ring binder divider tab features an easy access slot as well as a secure indent point to lock inserts in place\",\"Easily create custom recipe dividers, photo album dividers and subject dividers for 3 ring binders with free templates and software by visiting the Avery site\"]'),
(700, 4, 23, 'Alpine Corporation Submersible 4100 GPH Fountain Hurricane Pump for Large Fountains and Birdbaths Outdoor D�cor Accessory', 'Cost-saving, energy-efficient, and submersible, the Alpine Corporation Hurricane Pump is the perfect addition to your outdoor pond. This energy efficient pump reduces power consumption up to 70% compared to the standard pump. Ideal for heavy duty waterfalls or halter systems, this heavy-duty pump has the needed power to force large quantities of water through long or high pipe runs, or through restrictive UVC\'s and filters. Features an oil-free magnetic-driven, epoxy-protected ceramic shaft and a ceramic impeller to ensure a long life. Available in a variety of sizes, the Alpine Corporation Hurricane Pump pumps 4100 gallons per hour. With a 5-year warranty, you can be confident in the quality of your purchase. Alpine Corporation is one of America\'s leading designers, importers, and distributors of superior quality home and garden decor products. Alpine Corporation\'s award winning in-house design team continuously develops new and innovative \"statement pieces\" for your home and garden. Your indoor and outdoor living spaces will be the envy of the neighborhood with our wide assortment of fresh, fashionable and contemporary products, from beautifully crafted solar garden stakes featuring patented motion and fiber optic lighting technology to beautiful fountains and delightful bird baths and feeders.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/81cFf1raAsL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/81cFf1raAsL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71SqTab3KmL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/91sli0gPpdL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81wHvrk4faL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71N9n0G+xiL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71SqTab3KmL._AC_SL1500_.jpg\",\"https://m.m