(704, 2, 86, 'Avery Printable Shipping Labels with Sure Feed, 3-1/2\" x 5\", White, 400 Blank Mailing Labels for Laser Printers (5168)', 'UltraHold permanent adhesive sticks and stays securely on cardboard, envelopes, paper, glass or metal. Avery address labels won\'t lift, curl or fall off like other brands. Quickly and easily create your own personalized labels. Our TrueBlock technology lets you cover up everything underneath the 3-1/2\" x 5\" labels, so you can reuse boxes and block out markings and mistakes for a polished, professional appearance on the bright white labels. This pack of 400 shipping labels is fantastic for high-volume shipping and mailing jobs, as well as for creating custom labels for gift tags, crafting, party favors, beer & wine bottles and more. These address labels are optimized for laser printers so you can easily print lush colors and crystal clear text without worrying about printer jams or ink smudges. You can also effortlessly personalize your printable labels with logos, graphics or images using the free shipping labels template and designs on the Avery site.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/71D4lQ4-EhL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/71D4lQ4-EhL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81bK3fK4GDL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61nmeCKyJDL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61CZQJARaSL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71CuI-3+R6L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71b6mocMVxL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61MQ+auHxxL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81BsFWAEF8L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81vFX8Yht7L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71+E1upEw8L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/51yO4qPgYJL._AC_SL1500_.jpg\"]', '{"brand": "AVERY", "cat