(710, 3, 438, 'BlueParrott M300-XT SE Mono Wireless Bluetooth Headset � Improved Call Quality for Phones - Ideal for Mobile Workers & Delivery Drivers in High-Noise Environments, 80% Noise Cancellation - Black', 'Our BlueParrott M300-XT SE Bluetooth driving earpiece headset is designed for superior calls in high-noise environments. Featuring 80% noise cancellation with 2-mic tech, our earpiece for drivers provides 14 hours of talk time on a single charge for those who work long shifts. Our ultra lightweight earpiece weighs just 0.7 oz., making it an excellent option for those who work on the road delivering packages, food delivery drivers, taxi drivers, ride-share drivers, limo drivers, and anyone who drives for a living. In addition, our driving headset earpiece is reversible so that you can wear it on whichever side you prefer. With a wireless range of 300 feet (100 meters), our blue tooth headset for work ensures you can leave your phone in your vehicle as you\'re dropping off orders, ideal for local truckers, remote workers, or anyone on-the-go. Our hands-free call earpiece with mic provides IP54-rated protection against dust and water, making it a rugged and comfortable accessory for your work mobile phone. And while you\'re on the road, you can instantly mute calls, speed dial a preferred contact, or Push-to-Talk with your colleague using our customizable BlueParrott Button. Simply program it with your most-used function for instant access without taking your eyes off the road. The wireless earpiece pairs with up to 8 devices, with 2 simultaneous connections, and provides 420 hours of standby time.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/61o6A3Maq3L._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/61o6A3Maq3L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71YavI8xMDL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81xtYJ3d72L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81b2ji9o4rL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71NnYXhS-OL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81FM-nWUU5L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71ow5UARCUL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71sSN+uURQL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71oSV82TzIL._AC_SL1500_.jpg\"]', '{"brand": "BlueParrott", "category": "Cell Phones & Accessories", "dimensions": "2.4 x 1 x 4.4 inches"}', '[\"SUPERIOR NOISE CANCELLATION BlueParrott M300-XT SE Wireless Bluetooth headset features two noise-cancelling microphones that block 80% of background noise, making it perfect for calls, meetings, and as a delivery or taxi driver Bluetooth headset\",\"WALK AND TALK With a wireless range of 300ft/100m, this hands-free Bluetooth headset for driving keeps you mobile; The customizable BlueParrott Button lets you program your driving headset for instant access to frequently used functions\",\"STAY CONNECTED ALL DAY Enjoy up to 14 hours of talk time on a single charge with this wireless headset with mic for work; Mute calls, speed dial, or Push-to-Talk at the touch of a button, making it great for driving headsets\",\"ULTRA-LIGHT BUT DURABLE DESIGN At just 0.7oz, this ear piece for driving is our smallest and lightest headset yet. With IP54-rated protection, it�s a reliable choice for delivery drivers, rideshare drivers, and more\",\"IN THE BOX Includes 1x BlueParrott M300-XT SE Bluetooth headphones for driving, USB-C charging cable, 3 sizes of EarGels, Quick Start Guide, 1-Year Warranty, and Warning Leaflet; Headset weight 0.7oz (20g), Color Black\"]'),
(711, 3, 564, 'Foldable 3 in 1 Wireless Charging Station for Apple Compatible with Magsafe Charger Stand,Magnetic Wireless Charger Station for iPhone 16 15 14 13 12 Series,Airpods Pro,Apple Watch(Black)', 'The video showcases the product in use.The video guides you through product setup.The video compares multiple products.The video shows the product being unpacked.   1 Charge Faster 2 3-IN-1 3 Superior Safety 4 Stable/Stylish   1 Ultra Portable 2 Compact for Travel   1 In office 2 In Living Room 3 In Bedroom 4 Nightstand Mode Can this charging station be folded? Yes,the modules for the phone and watch can be folded down. But the main pad of the charging station is not foldable. Is this magnetic wireless charger suitable to use as a travel charger? Absolutely. This charging station\'s size in folded status is 5.9x2.9x1.2inch, just like iPhone 15 pro\'size. And it weighs about 300 grams,so compact and easy to carry. Does this charging station come with a USB-C wall charger? Yes, for the best charging experience, we recommend using the included 18W USB-C wall charger or a Power Delivery (PD) compatible wall charger with an output of 18W or higher. Is this 3-in-1 wireless charging station compatible with Android phones? And is it safe to use when it gets warm/hot? Not compatible. The 3-in-1 wireless charging station is designed for devices with magnetic wireless charging, available only for iPhone 12 and later models. Slight warming during wireless charging is normal, especially under heavy use. Can a phone case affect wireless charging? For the best wireless charging experience, we recommend using Apple\'s official magnetic phone cases. Avoid using cases thicker than 2.5 mm and non-magnetic cases, as they may affect charging efficiency.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/61E4p5fZqDL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/61E4p5fZqDL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61pPeVXI5GL.