iPhone with one hand without it tipping over. Ingenious structure design makes it won�t block your iPhone�s camera while charging.\",\"?Multi Intelligent Protection&Sleep Friendly? Our wireless charging station ensures a safe and secure charging experience. It�s equipped with intelligent protection technology,offer multiple protections, including over-voltage and over-current protection to protect your device�s battery health, temperature control to keep your device cool, and short-circuit protection for enhanced safety. The LED indicator light is weak while charging and won\'t disturb your sleep.\",\"?What You Get?UEQ 3-in-1 Magnetic Wireless Charger Stand*1, 18W USB-C charger*1, USB-C to C cable(3.3 ft/1m)*1, User Manual*1, and our friendly customer service. Our 3 in 1 wireless charging station is also an ideal gift for family and friends. Compatible with iPhone Apple charging station.\"]'),
(712, 6, 565, 'Boiron Oscillococcinum For Relief From Flu-Like Symptoms Of Body Aches, Headache, Fever, Chills, And Fatigue - 30 Count', 'The moment you feel achy or rundown, nip flu-like symptoms in the bud with Boiron Oscillococcinum. Clinical studies show that Oscillococcinum reduces the duration and severity of flu symptoms such as body aches, headache, fever, chills, and fatigue. These uses have not been evaluated by the Food and Drug Administration.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/71QbcP49A3L._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/71QbcP49A3L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81rf+u+1VAL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81lu8EX-4TL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71q3KqSEz9L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61ZI8qa-qvL._AC_SL1000_.jpg\",\"https://m.media-amazon.com/images/I/6155J4dgc1L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81kOe9e0qUL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81R5K-+cmYL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/91BBXKPlcOL._AC_SL1500_.jpg\"]', '{"brand": "Boiron", "category": "Health & Household", "dimensions": "4.76 x 2.39 x 4.33 inches; 1.6 ounces"}', '[\"HOMEOPATHIC FLU RELIEF Oscillococcinum works with your body to help temporarily relieve fatigue, headache, body aches, chills & fever. Safe for ages 2 & up, take at the first sign of flu-like symptoms.\",\"HOLISTIC SUPPORT Looking for homeopathic flu relief for the whole family? Oscillococcinum\'s sweet-tasting pellets dissolve quickly & easily under the tongue; no water, chewing, or swallowing required.\",\"SHORTEN YOUR SYMPTOMS Oscillo has been shown in clinical studies to help reduce both the duration & the severity of flu-like symptoms when taken at the onset. Non-drowsy, easy-to-take relief!\",\"HOMEOPATHIC MEDICINE uses highly diluted biological, botanical, or mineral substances to relieve symptoms. Our tablets, pellets, & topical treatments work with your body without the risk of contraindications, or known drug interactions.\",\"THE BOIRON PROMISE We believe there�s more than one way to feel better. Since 1932, we have been committed to providing quality medicines. As a world leader in homeopathy, our passion is your health. Our promise is your satisfaction.\"]'),
