(721, 8, 572, 'Umbra Woodrow, 2 Gallon Modern Wooden Trash Can Wastebasket or Recycling Bin for Home or Office, Dark Gray', 'If you�re looking for a small garbage can or bathroom wastebasket that�s not just functional, but has a contemporary style that is certain to compliment your decor, then look no further�Introducing Woodrow Trash Can by UmbraUnlike plastic garbage cans, Woodrow trashcan is made of real wood that�s been curved into a modern trash can shape. It features a natural wood interior and is available in a wide range of exterior finishes to suit any type of decor.Woodrow measures 11-inches tall with a 9-inch diameter and has a generous 2-gallon capacity; and the integrated handles allow for easy transport and disposal of its contents.What our customers on Amazon are saying about Woodrow Trash Can��Great product Wanted a woodgrain looking waste can for under my dressing table. It\'s not fancy, but it\'s perfect for my needs. I like the cutout for handles to make it easy to carry and empty the waste can.��Good size, well made, nice-looking.��Honestly, if I have a complaint about this product at all it\'s that it is too beautiful for trash.�For a neat and stylish place to stow your trash or recycling, order the Woodrow garbage can from Umbra today.About Umbra: A global product design company providing original, modern, casual, and functional design for the home.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/612tYPIWuCL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/612tYPIWuCL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81WMfgRQucL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/717XeDXU0aL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71MBXI38OLL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71Z6eMGA4iL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/718djAUzqRL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71C-oxsbNVL._AC_SL1500_.jpg\",\"https://m.m