(726, 2, 575, 'Rite In The Rain Weatherproof Top Spiral Notebook, 4\" x 6\", Green Cover, Universal Pattern, 3 Pack (No. 946-3)', 'This Is A 3 Pack Of Notepads: The Green 4\" X 6\" Top Spiral Notebook Is Small Enough To Fit Comfortably In Your Pocket And Tough Enough To Survive Any Of Mother Nature\'S Onslaughts. This Scrappy Pocket Notebook Will Survive Rain, Sweat, Mud, Snow, Oil, And Grease. The Non-Glare Green Paper Is Legible In Bright Sunlight. The Impact-Resistant Wire-O Binding Won\'T Lose Its Shape. The Polydura Cover Defends Your Notes From Scratches And Stains. Rite In The Rain All-Weather Writing Products Have Been Made In Tacoma Washington, Usa Since 1916. Recycle Rite In The Rain Paper With Standard Papers. Recycle The Entire Notebook Using Most Curbside Programs (Paper, Plastic, & Metal). Simply Separate The Wire-O Binding From The Cover Prior To Recycling For Easier Processing.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/61i-VP84M8L._AC_SL1200_.jpg', '[\"https://m.media-amazon.com/images/I/61i-VP84M8L._AC_SL1200_.jpg\",\"https://m.media-amazon.com/images/I/81tKqmKKAUL._AC_SL1000_.jpg\",\"https://m.media-amazon.com/images/I/817gGYN6YGL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81cCQVGO0sL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/91QUXpfh5lL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/91zc+DonTHL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81oyWq1R4jL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/91ern99a9fL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61osj-K-QQL._AC_SL1000_.jpg\",\"https://m.media-amazon.com/images/I/817gGYN6YGL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81cCQVGO0sL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/91QUXpfh5lL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/715uKzrQCpL._AC_SL1000_.jpg\",\"https://m.media-amazon.com/images/I/61dnak+i-rL._AC_SL1000_.jpg\"]', '{"brand": "Rite in the Rain", "category": "Office Products", "dimensions": "6 x 4 x 0.38 inches"}', '[\"Weatherproof Paper 100 Pages / 50 Sheets Per Pocket Notepad. All-Weather Paper Won�T Turn To Mush When Wet And Will Repel Water, Sweat, Grease, Mud, And Even Survive The Accidental Laundry Mishap. Make Sure Your Pocket Notebook Stays Right In The Rain\",\"Wire-O Binding Tough Impact-Resistant Wire-O Binding Won\'T Lose Its Shape In Your Back Pocket Or Backpack. Unlike A Standard Spiral Notebook, Wire-O Keeps Your Open Pages Aligned And Intact\",\"Write In The Rain When Wet, Use A Standard 2 Pencil Or An All-Weather Pen. Standard Ballpoints And Permanent Markers Will Work When Paper Is Dry. Water-Based Inks Will Bead Or Wash Off Rite In The Rain Paper\",\"Waterproof Notebook Cover Polydura Material Creates A Tough But Flexible Outer Shell. Whether You\'Re Needing A Hiking Journal, Outfitting Your Police Gear, Starting A Golf Journal, Or Just Keeping A Shower Notebook, The Polydura Cover Material Will Defend Your Field Notes From Scratches And Stains\"]'),
