at here! Our magnetic pad features a DOUBLE magnetic backing that becomes the main benefit instead of just a design afterthought.\",\"THICK, LUXURY PAPER When you can only find the darkest marker, you don�t want it ghosting through each page of your grocery list pad So we made sure each 6x9� sheet was thick 100gsm non-bleed paper for even the darkest pens. They�re glued in strong for heavy duty use.\",\"110 MOST COMMON FOODS Just pop a checkmark next to what you need to buy, for a fast and simple grocery list template. Extra spaces in each category let you add your own items as you need. It�s also satisfying� who doesn�t love checking things off!\",\"A YEAR OF PLANNING! With 60-Pages on this magnetic shopping list pad for fridge you have enough for a year! And because your weekly planner notepad arrives securely shrink wrapped with a solid 900gsm card backing - EVERY page is usable and never torn or bent. Also comes with our special Sweetzer & Orange 12-Month Money Back Guarantee. So, why not try it now!\"]'),
(729, 2, 577, 'Really Good Stuff 24PK Zaner-Bloser Self-Adhesive Vinyl Desktop Reference Nameplate with Letters, Numbers, Place Values-Traditional Manuscript Name Tags', 'Put Curricular Content Where Students Can Access It Easily - On Their Desktops! These durable helpers are easy to peel and stick on any desktop surface to stay put all year. Available in a variety of styles, Really Good Stuff Desktop Reference Nameplates will add a colorful touch of learning to your classroom. Made of strong vinyl, Really Good Stuff has the most durable desktop reference name tags on the market! Easy to peel and stick onto any surface, these desktop helpers will stay put all year long. What�s better? They easily wipe clean with a damp cloth, helping to keep them accessible for your students. Each manuscript student nameplate is full of bright colors and brings a pop of style and organization to every student�s desk. Measuring at 18� by 5� each, these are the perfect size for any classroom. A great tool for students to practice critical thinking, writing skills and math all in one place! This reference name tag features cursive letters at the bottom (closer to students\' work), a number line from -20 to +20, math-related information on fractions, decimals, percents, place values, and multiplication, and plenty of space for students to print their name.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/81MPoYpfUwL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/81MPoYpfUwL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71VEavqzKgL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71s-PbGxsbL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61HoDzAlumL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/614iow2PW-L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/713TOC7jniL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61nmKheMOGL._AC_SL1500_.jpg\"]', '{"brand": "Really Good Stuff", "category": "Office Products", "dimensions": "17.91 x 5.07 x 0.35 inches"}', '[\"MULTI-PURPOSE These desktop helpers are more than just a reference name tag; they feature essential learning tools at your student�s fingertips. Includes 24 desktop nameplates.\",\"DURABLE Most durable desktop herlper on the market! Made of vinyl, they are easy to peel and stick onto any surface and will stay put all year long. Easily wipes clean with a damp cloth.\",\"COLORFUL DESIGNS Each manuscript student nameplate is full of bright colors bringing a pop of style and organization to each desk. Measuring at 18� by 5�, these are the perfect size for your room.\",\"VERSITILE LEARNING More than a name plate, our desktop helpers feature cursive letters, number line, fractions, decimals, percents, place values, multiplication and plenty of space for students name.\",\"EASY TO USE With information neatly laid out, these desktop helpers ensure easy, at-a-glance use for all to enjoy. The self-adhesive backing lets you remove easily without damaging the desk.\"]'),
(730, 3, 578, 'iSYFIX Sim Card Adapter Nano Micro - Standard 4 in 1 Converter Kit with Steel Tray Eject Pin', 'The video showcases the product in use.The video guides you through product setup.The video compares multiple products.The video shows the product being unpacked. Will this interfere with the SD slot on the phone tray? If you are going from a nano sim to micro adapter and your phone uses micro sim, than yes it should fit your tray. Does it matter who the carrier is? It doesn\'t matter what carrier is, these are universal. Will it convert micro to nano? No, for that you need a SIM cutter. Does it work with tablets? It works with phones or tablets. No problem. Im looking for plastic holders not metal can you assist? This adapters are made of plastic.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/71oPow0Y6dL._AC_SL1200_.jpg', '[\"https://m.media-amazon.com/images/I/71oPow0Y6dL._AC_SL1200_.jpg\",\"https://m.media-amazon.com/images/I/81Fxg5S+FfL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/41MOGjIYF3L._AC_.jpg\",\"https://m.media-amazon.com/images/I/61HXgyx-NjL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81CeCi7QR0L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71-MzuuGTML._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61Lv2TXni9L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61sMXon0QbL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/51EjxAwALfL._AC_SL1500_.jpg\"]', '{"brand": "iSYFIX", "category": "Cell Phones & Accessories", "dimensions": "2 x 0.05 x 4.2 inches"}', '[\"THE iSYFIX Nano Sim Card Adapter Kit helps you to convert a NANO SIM CARD into a MICRO SIM or a STANDARD SIM CARD, and a MICRO SIM CARD into a STANDARD SIM CARD size for any cell phone or tablet.\",\"IT IS COMPLETELY REVERSIBLE, the nano to micro sim adapter is very handy to switch easily the sim card between different devices, cell phones or tablets.\",\"HIGH QUALITY MATERIALS and CNC carved to fit perfect. Fits all older phone models with normal or micro sim card devices. Compatible with all manufacturers.\",\"SUPER EASY INSTALLATION, only take seconds. No tools required. We advise to use your iSYFIX Nano Sim Adapter always with a manufacturer cut sim card and never insert it in your phone empty.\",\"INCLUDES 1 tray for Nano to Micro, 1 tray for Nano to Standard, 1 tray for Micro to Standard SIM card and 1 steel eject pin. 1 Year Manufacturer Guarantee.\"]'),
(731, 11, 579, 'KAER Gun Safes with 180-Degree Full Access Door and Removable Shelf for 2 Home Rifles and Pistols Digital Quick Access Electronic Firearm Safe with Pistol Rack and Ammunition Storage Shelves�', 'Introducting KAER 1320 Digital Gun Safe KAER 1320 digital gun cabinet is made of high quality cold rolled steel. A number of new designs are used that can enhance the experience of using the gun cabinet. It increases the storage space of the gun cabinet while ensuring convenience and safety. The newly added pistol rack is capable of storing four pistols (preferably at an angle to improve space utilization). Newly added ammunition storage shelf, better use of space behind the door. Upgraded LED light, the light can cover a larger area, to ensure that in the dark quickly and accurately get the guns you want to get. The safe is fully covered with protective fleece, which can effectively reduce the wear and tear of firearms.It have Intelligent Alarm System and can be opend up to 180-degree. More safer and more convenient to protect your firearms. We focus on providing customers with quality products. And update products in time according to market changes. If you have any questions or suggestions about our products, we will accept your questions and suggestions with the most sincere attitude. Package Include: 1 x Digital Gun Safe 1 x Instruction 2 x Backup Key 1 x Mounting Hardware Set Overall size: 52\"H x 9.85\"W x 8.66\"D Inter Dimensions: 51.77\"H x 9.65\"W x 6\"D Net Weight: 57.8lbs Lock Type: Digital Keypad-Hidden Keyhole Design. Bigger Deadbolts: With 7/8 inches thickness of 3 bigger steel locking bolts for home defense and security. Alarm Function Gun cabinet is equipped with an intelligent alarm system.Also equipped the vibration alarm function.Make sure your gun safer! Ammunition Storage Shelf You can store some ammunition to ensure that you can get your guns and ammunition at the same time in case of emergency. Pistol Rack Able to store 4 pistols, can be applied to the Glock series of pistols(Pistols need to be tilted). The pistol rack does not take up storage space and can also store ammunition or other valuables in the top shelf.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/81SHezLTi3L._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/81SHezLTi3L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71RYiwp7vBL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61s3DFKqXgL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61Xc2Za6QfL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71U03i-t2HL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71+0vfHip8L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71sfibznmGL._AC_SL1500_.jpg\"]', '{"brand": "KAER", "category": "Hunting & Fishing", "dimensions": "8.6\\\"D x 9.8\\\"W x 51\\\"H"}', '[\"?Dimensions?External dimensions (in) H52xW9.85xD8.66 Height from floor 46.88in. Rifle or shotgun up to 44.68 inches can be stored with the shelf. Long guns up to 51 inches can be stored without the shelf. The interior is fully wrapped in flannelette to prevent wear and tear on the gun.\",\"?Novel Convenient Design?At the top of the gun cabinet is a removable shelf, and there is a pistol rack that can hold four pistols. The pistol rack is removable, so if you don\'t need a pistol rack, you can store your other valuables on top. There are two ammunition boxes on the door to store ammunition for rifles and pistols. Equipped with upgraded LED lights, it has a greater lighting range in the dark.\",\"?Multifunctional Panel?Gun safe is equipped with a new digital panel with an external battery box design. Better response to emergencies, and makes the gun cabinet more beautiful. The keyhole is covered by the battery, which constitutes a hidden keyhole design. The gun safe requires 4 AAA batteries and the panel comes with an under-voltage alarm function, a red light comes on when the safe is opened using the digital code, which means the battery voltage is low and needs to be replaced.\",\"?Intelligent Alarm System?If the password is entered incorrectly 3 times in a row, it will enter the alarm state and the alarm will last for 50 seconds. Enter the correct password or remove the battery to exit the alarm mode. The gun cabinet is also equipped with a vibration alarm function, long press the \'\'#\'\' key for 5 seconds to turn on the vibration alarm function. The vibration alarm is automatically lifted after each correct unlocking and needs to be reset.\",\"?Easy to install?This gun safe comes already assembled and has pre-drilled holes for easy attachment to the floor or wall (or both) with attached bolts.Easy to install on the ground, closet, garage or anywhere else.\"]'),
