(739, 9, 585, 'Take OFF Luggage - Personal Item Rolling Suitcase 2.0, TSA Approved, Small Carry On, Under the Seat, Hard Case with Removable Wheels, Light Weight Bag, Airplane Travel Essential Accessories, 18x14x8', 'Discover an Exciting Travel with TAKE OFF Luggage Meet the Personal Item Suitcase 2.0 by TAKE OFF Luggage, a game-changer in travel convenience. This suitcase fits under the seat, avoiding additional carry-on fees. Engineered with durable materials and an organized interior, it offers ample space for your essentials. Whether it\'s a weekend getaway or a business trip, this under seat luggage with wheels is designed for maximum efficiency and style. Budget Airlines Charge for Carry-ons Say goodbye to extra costs and hello to convenience with our range of travel luggage with wheels, perfect for any journey. Experience hassle-free travel with TAKE OFF Luggage. Designed to turn your carry-on into a free personal item, our innovative suitcase helps you save on airline fees while maintaining style and durability. With sleek designs and robust construction, TAKE OFF Luggage ensures your travel essentials are secure and easily accessible. MAKING HISTORY We searched high and low for the right carry on luggage that was small enough to be labeled a personal item, but big enough to pack the right items comfortably. After testing under the seat luggages, and realizing they were too small. Then testing carry-on luggages and realizing they were too big. Our lightbulb moment came when we realized a carry-on without the wheels is the perfect size we are looking for. Personal Item Suitcase 2.0 Efficient Travel Companion Discover the \"Personal Item Suitcase 2.0 Take Off Luggage,\" designed for seamless travel. Compliant with airline regulations, it fits under seats while offering durability and ample space. Organize efficiently with its compartments and pockets. Carry comfortably with a handle or shoulder strap. Perfect for business or frequent travelers, it blends style with functionality, ensuring hassle-free journeys every time. Dual functionality as a personal item and carry-on suitcase. Durable materials and a secure locking mechanism. Multiple compartments including a padded laptop sleeve and zippered pockets. Expandable capacity with a zippered expansion option. Durability and Performance: Built to Last TAKE OFF Luggage\'s Personal Item Suitcase 2.0 is engineered for durability and top performance. Featuring a hardshell exterior and added bumpers for corner protection, this suitcase withstands the rigors of travel. Its ultra-durable design ensures long-lasting use, making it a reliable choice for frequent flyers. Whether you\'re navigating airports or enduring long journeys, our luggage provides superior protection and ease of transport. Innovative 360 Wheels and Secure TSA Lock Experience unparalleled maneuverability with TAKE OFF Luggage\'s 360� removable wheels. Our unique design allows for effortless mobility, whether you\'re strolling through airports or navigating busy streets. Additionally, our TSA-approved lock ensures your belongings remain secure throughout your journey. With easy-to-follow passcode instructions, you can travel with peace of mind, knowing your items are safe and easily accessible. Maximized Space and Organization The Personal Item Suitcase 2.0 by TAKE OFF Luggage offers exceptional space and organization. Featuring a dual-sided compartment and elastic straps, this suitcase maximizes storage while keeping your belongings neatly arranged. Perfect for packing efficiently, our design allows you to carry more without the bulk. Ideal for travelers who need ample space in a compact form, this suitcase is your go-to for both short and extended trips.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/71oknKGTCtL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/71oknKGTCtL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71cOAryWZGL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81kaD01JJxL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/817an7hlnOL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81GJhKdIszL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71Eih2v8fUL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81KIeHXziSL._AC_SL1500_.jpg\"]', '{"brand": "Take OFF Luggage", "category": "Clothing, Shoes & Jewelry", "dimensions": "13.5 x 7.5 x 17.5 inches"}', '[\"PERFECT AIRLINE PERSONAL ITEM This lightweight under-seat carry-on luggage fits 18x14x8 airline sizers and is ideal for personal item travel on budget airlines like Frontier and Spirit. Avoid overhead bins and extra baggage fees while enjoying the convenience of fitting under your airplane seat.\",\"REMOVABLE WHEELS Transform this carry-on suitcase into a personal item travel bag by detaching the wheels or leaving them on for seamless rolling through airports. This flexible design allows the suitcase to serve as both a travel bag or a compact carry-on for various airline requirements.\",\"SLEEK, MODERN DESIGN Compact yet spacious, our luggage features dual-sided interior storage with a zippered pouch. Keep your items separate, while the buckle closure ensures everything is neat and secure. Perfect for short trips, business travel, or longer ventures, giving you a flexible luggage option.\",\"LIGHTWEIGHT & DURABLE Crafted from lightweight yet highly durable materials, this suitcase offers hard-shell protection to keep your belongings safe. Perfect for air travel, it seamlessly combines functionality with a stylish, modern design.\",\"TSA-APPROVED LOCK Equipped with a TSA-approved, security lock to ensure security and privacy for your belongings. Keeping your items safe from unauthorized access while complying with airline security requirements. The perfect companion for any trip.\"]'),
