(741, 2, 292, 'ScanSnap iX1300 Compact Wireless or USB Double-Sided Color Document, Photo & Receipt Scanner with Auto Document Feeder and Manual Feeder for Mac or PC, Black', 'The ScanSnap iX1300 redefines personal productivity in a small but powerful package allowing users to accomplish more with a single one touch device. Incredibly compact, the iX1300 features an innovative design that was built to empower users with faster, more convenient, Wi-Fi-enabled scanning in an even smaller operating footprint that enables work in virtually any environment.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/71lVhxkjuLL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/71lVhxkjuLL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81Z0GYaDgxL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81A8xb1UHlL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81pYAa7XR9L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81HvK3KcDhL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71bXJ0CQAPL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/41vxuC+znwL._AC_SL1475_.jpg\"]', '{"brand": "ScanSnap", "category": "Office Products", "dimensions": "4.5 x 11.7 x 3.3 inches"}', '[\"FITS SMALL SPACES AND STAYS OUT OF THE WAY. Innovative space-saving design to free up desk space, even when it\'s being used\",\"SCAN DOCUMENTS, PHOTOS, CARDS, AND MORE. Handles a wide variety of document types, including thick items and plastic cards\",\"GREAT IMAGES EVERY TIME, NO EXPERIENCE REQUIRED. A single touch starts fast, up to 30ppm duplex scanning with automatic de-skew, color optimization, and blank page removal for outstanding results without driver setup\",\"SCAN WHERE YOU WANT, WHEN YOU WANT. Connect with USB or Wi-Fi. Send to Mac, PC, mobile devices, and cloud services. Scan to Chromebook using the mobile app. Can be used without a computer\",\"PHOTO AND DOCUMENT ORGANIZATION MADE EFFORTLESS. ScanSnap Home all-in-one software brings together all your favorite functions. Easily manage, edit, and use scanned data from documents, receipts, business cards, photos, and more\"]'),
