hed lined paper, specifically designed for the US market to fit seamlessly in standard binders and folders. Perfect alignment every time, while maintaining professional margins for clean organization. Also available in B5 and A5 sizes to match your diverse study needs\",\"Environmentally Responsible Kokuyo binder paper is Forest Stewardship Council (FSC) certified, which means they are made with renewable resources from third-party certified, sustainably managed forests\"]'),
