(755, 2, 47, 'Scotch Desktop Tape Dispenser, Black, 2.7 in. x 2.7 in. x 6.4 in., 1 Tape Dispenser', 'Product Description Scotch Classic Desktop Tape Dispenser is an economical tape dispenser with a weighted base that allows for one-hand dispensing of a wide variety of tapes, including Scotch Magic Tape. Made from 100% recycled plastic, this small tape dispenser is an environmentally-friendly choice compared to other dispensers on the market. Affordable and reliable, it�s a classic-style desk tape dispenser with a replaceable hub and non-skid base. The hub is 1 in. and holds up to 1 in. core tape that is up to 0.75 in. wide and 1,500 in. long. Tape not included. The best projects start with the No. 1 selling home and office tape (based on 2022 NPD data). From the Manufacturer In 1930, 3M engineer Richard Drew invented an attractive, moisture-proof material to help grocers and bakers seal up their packages. Over 70 years later, Scotch� tape boasts over 400 varieties sold under the Scotch� and 3M� brands.Now indispensible in homes and offices, Scotch� tapes offer specialty and general solutions for many projects--from crafts and gift-wrapping to mounting and everyday sealing.Scotch� Magic� Tape Frosty on the roll but invisible on paper, Scotch� Magic� Tape features the original matte-finish design for a strong hold and seamless look. This tape pulls off the roll and cuts smoothly, resisting splits and tears for a sturdy piece. Thanks to its gentle adhesive, you can stick then re-stick each piece as your project demands, then jot a helpful note with a pen or pencil on top when you\'re done.Ideal Use: All home and office needs and craft projects.Scotch� GiftWrap Tape Keep your presents secure and looking fabulous with Scotch� GiftWrap Tape. Featuring a unique satin finish, this tape pulls smoothly from the roll and disappears on most gift-wrap papers for a seamless close. The paper holds together, and your gift takes on a professional appearance.Ideal Use: Gift-wrapping.Scotch� MultiTask Tape For those everyday jobs, Scotch� MultiTask Tape features a strong, moisture-resistant material ideal for a wide range of taping tasks. Thanks to its high-quality performance and unique design with crystal clarity, it\'s easy to subtly add a strip to a project for a professional look and a secure hold.Ideal Use: General tasks around the home and office, including household mending and sealing.Scotch� Double-Sided Tape Versatile and convenient, Scotch� Double-Sided Tape offers a mess-free alternative to glue sticks for those light-duty attaching and mounting tasks. Featuring a two-sided adhesive, this tape comes in both a permanent and removable style so you can match the proper tape to the task. As a bonus, this tape is photo-friendly so you can keep your memories securely attached and looking good.Ideal Use: Craft projects, mounting, sealing, gift-wrapping, and decorating.Scotch� Removable Tape Scotch� Removable Tape features a unique adhesive that holds papers securely, while allowing you to remove or reposition each strip as needed. Because of its matte-finish, this tape adds a professional touch to layouts or posters. For those moments when you require a little explanation, jot a quick note on top with a pen or pencil.Ideal Use: General tasks around the home and office. Great for art, graphic design, or architectural layout projects.Scotch� Pop-Up Tape Offering handy pre- cut strips, Scotch� Pop-Up Tape puts convenience and organization at your fingertips. With several dispenser types to choose from, you can wear tape on your wrist, stick a tape disk to your desk, or use a mountable or portable dispenser where you need it most. The one-handed dispensing method allows you to work without pausing, so you can finish projects with ease and efficiency.Ideal Use: Gift-wrapping, desk, and home-office use.Scotch� Packaging TapeFor strapping, sealing, and protecting packages, nothing compares to Scotch� Packaging Tapes. Ideal for shipping and storing, each tape is tear- and split-resistant for high-quality containment.Scotch� ScissorsAn ideal tool for home, office, and school, Scotch� Scissors offer high-quality performance and comfortable grip. Featuring titanium-fused or stainless steel blades, each scissor is designed to cut smoothly and accurately.Scotch� Cutting ToolsScotch� Cutters offer a faster, safer way to make clean, straight cuts. Ideal for gift-wrapping, opening mail, or cutting coupons, these tools offer speed and convenience for today\'s Scotch� users.Post-it� NotesKeep organized with the conveniently compact Post-it� Notes. Featuring a gentle adhesive that won\'t mar the surface, Post-it� Notes offer a wide variety of colors and sizes to suit your noting needs.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/71sZR7JwktL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/71sZR7JwktL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81W68d1VxhL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81lBw2trXRL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81wgrUsaZFL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71hFzvwExIL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81T2fF-VDlL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81VBIdZWdQL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81aAnr-SJ+L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/91V8AH6D4aL._AC_SL1500_.jpg\"]', '{"brand": "Scotch", "category": "Office Products", "dimensions": "2.38 x 6.25 x 2.72 inches"}', '[\"Scotch C38 Desktop Tape Dispenser is made of 100% recycled plastic\"]'),
