(757, 1, 597, '[Auto Focus/4K Support] Projector with WiFi 6 and Bluetooth 5.2, 700ANSI Native 1080P Outdoor Movie Projector, WiMiUS P62 Auto 6D Keystone & 50% Zoom, Smart Home Projector for iOS/Android/TV Stick', 'WiMiUS Auto-Focus Projector with WiFi 6 Bluetooth 5.2 2025 Upgrade 700ANSI Lumen   1 Auto Focus &Auto Keystone 2 4P/6D Keystone Correction Specifications Light Source: LED Resolution: 1920 x1080P and 4K downscaling support Brightness: Upgrad 700 ANSI lumens Bluetooth: Bluetooth 5.2 Network: WIFI 6+5G/2.4G Smart Screen Adaption: Auto Focus & Auto Keystone Speaker: 2x6W Projection Size: 30-300 inches Zoom 50%-100% Size/Weight: 10.2*7.8*4 inches/5.3lb Ports: 2*USB,1*HDMI&1*HDMI ARC,1*AV,1*3.5mm Audio Out What\'s More Brightness/Contrast/Saturation/Sharpness can be adjusted while playing videos via HDMI&USB About Streaming Services 1) Due to copyright restrictions, most projectors, including the P62, do not support wireless mirroring of streaming services like Netflix, Hulu, and Disney directly from your phone. However, you can always use an HDMI connection with your laptop. 2) To access these services, we recommend using a TV Stick (not included, but less expensive) with our projector. This will provide a more seamless and versatile experience compared to an Android TV projector. About Dolby Sound Dolby Sound is not supported, please turn off any Dolby sound settings on your connected devices or Apps. Why choose P62 over others? In the world of 1080P projectors, we focus on simplicity and stability. Our user-friendly interface and system optimizations (8 updates per year) assure a consistently reliable performance. Why choose P62 over others? Take a look at our price history; we\'re not a fleeting \"New release\" that disappears within two month, nor do we engage in cost games with unrealistic fluctuations. Choose P62 for reliability you can count on.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/81NQH7EiI+L._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/81NQH7EiI+L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71JFE-0Vi8L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71-h+bTleqL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71SxbzW+L1L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/719M0ksJWzL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71d4b84a0JL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/6194uqCyRvL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61cNICp9NAL._AC_SL1500_.jpg\"]', '{"brand": "WiMiUS", "category": "Electronics", "dimensions": "10.2 x 7.8 x 4 inches"}', '[\"?[WiMiUS Market-Tested Leading Projector] WiMiUS\'s first video projector with auto-focus and auto-keystone correction, focused on core functionality upgrades. With a return rate lower than the industry average and the highest satisfaction rating within the brand, P62 projector ensures reliability and quality. It adopts auto-focus and 6D auto-keystone technology, say goodbye to troublesome manual adjustments. Enjoy a clear rectangular picture within 5 seconds of startup! The built-in displacement sensor continuously detects the projector\'s movement for seamless image clarity.\",\"?[Native 1080P & 700 ANSI & 200001 Contrast Ratio] P62 WiFi and Bluetooth projector features upgraded 700 ANSI lumens and a 20,0001 contrast ratio, delivering higher brightness and a wider color gamut. This results in a massive increase in color volume for vivid and detailed visuals. With native 1080P resolution and 4K video support, it restores full video quality and provides excellent shadow details. The P62 offers a true home theater experience and is ideal for outdoor movie nights, sports nights, or final-season nights. (Note Videos labeled as 4K will display at a native resolution of 1080P, commonly referred to as \"4K supported.\")\",\"?[The First Wi-Fi 6 Projector] P62 phone projector is equipped with Wi-Fi 6 technology, compatible with both 2.4GHz and 5GHz networks, offering a maximum rate of up to 9.6Gbps. Enjoy seamless screen casting with Wi-Fi 6 from, supporting AirPlay (iOS) and Miracast (Android & Windows). Relive family moments by sharing photos and videos on the big screen effortlessly. As a home projector, we also strive to minimize latency during gaming on devices like the Nintendo Switch or PS5.\",\"?[Upgrade Bluetooth 5.2 and Hi-Fi Built-in Speaker] Equipped with the latest Bluetooth 5.2 chip, the P62 supports a stable connection to various Bluetooth speakers, The built-in 12W stereo speakers delivering immersive and powerful sound. The latest firmware update (2024-09-29) enables HDMI ARC support on HDMI 2 port, simplifying soundbar connections without additional audio cables.\",\"?[4P/6D & 100%-50% Zoom & Low Noise for Versatile Projection Needs] In addition to auto screen adjustment, P62 offers features like manual correction, 50%-100% zoom, aspect ratios of 43 and 169, a sleep timer, and customizable brightness and contrast settings for personalized viewing. For productivity business, it supports Excel/Word/PPT playback via USB. It supports ceiling, tabletop, tripod, and wall mounting with 4*M5 screw holes at the bottom. Simply adding a TV stick(not included) transforms it into a smart projector, allowing you to enjoy streaming apps on a bigger screen.\",\"???[Worry-free Shopping Experience with Reliable After-Sales Service] No need to stress over lamp life, WIMIUS provides 24/7 after-sales customer support, a 2-YEAR money-back guarantee, 3-YEAR repair coverage, and lifetime technical support to ensure you\'re fully covered. Please refer to the included quick start guide to access detailed user manual. Feel free to reach out to us for further assistance�we�re here to help!\"]'),
(758, 2, 598, 'Royal Sovereign Electric Coin Sorter, Patented Anti-Jam Technology, 1 Row of Coin Counting (QS-1AC),Black, FOR Hold,Wrapping', 'Product Description The Royal Sovereign QS-1AC 1 Row Electric Coin Sorter is the perfect solution for fast, convenient, and simple automatic coin sorting. This coin sorter sorts at a rapid speed of up to 156 coins per minute. Also included is a large coin hopper capacity that can hold up to 200 coins for consumer coin counting convenience. The coins easily sort into preformed coin wrappers for easy transition to coin wrapping and rolling. The QS-1AC comes with Patented Anti-Jam technology to ensure precise internal sorting when counting coins and hassle-free operation. An additional convenient feature is an overflow tray that gathers loose change that spills over for easy clean up from your change counter! This coin sorter contains 1 row of coin tubes for each denomination as well as a quick and easy 1 button coin counting operation. From the Manufacturer Since 1986, Royal Sovereign has been a global leader in money management equipment including, bill counters, counterfeit detectors, our patented coin sorters, and cash accessories. Manufacturer Contact Information 2 Volvo Dr, Rockleigh, NJ 07647 See more', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/71n1hFX-ftL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/71n1hFX-ftL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61IkexaH-VL._AC_SL1100_.jpg\",\"https://m.media-amazon.com/images/I/61za8PzEZ9L._AC_SL1342_.jpg\",\"https://m.media-amazon.com/images/I/71Vh7ZXw8PL._AC_SL1500_.jpg\"]', '{"brand": "Royal Sovereign", "category": "Office Products", "dimensions": "7.2 x 9.7 x 9 inches"}', '[\"Fast Operation Coin Sorter Rapidly Sorts Up To 156 Coins Per Minute\",\"Large Capacity Coin Sorter Can Hold Up To 200 Coins For Consumer Counting Convenience. Count More Coins At Once\",\"Hassle-Free Operation Patented Anti-Jam Technology Allows For Precise Internal Sorting When Counting Coins\",\"Effortless Wrapping Qs-1Ac Comes With A Total Of 16 Coin Wrappers. 4 Per Denomination (4 Quarter Wrappers, 4 Penny Wrappers, 4 Nickel Wrappers, And 4 Dime Wrappers)\"]'),
