(776, 6, 611, 'Waterpik Aquarius Water Flosser Professional For Teeth, Gums, Braces, Dental Care, Electric Power With 10 Settings, 7 Tips For Multiple Users And Needs, ADA Accepted, White WP-660, Packaging May Vary', 'The Waterpik Aquarius water flosser features a compact, contemporary design and advanced water flossing technology for maximum performance. It comes with 7 flossing tips for a variety of dental needs and multiple users, a convenient one-minute timer with 30-second pacer to ensure thorough water flossing of all areas, and a removable water reservoir with 90+ seconds of flossing time. The special 360-degree rotating tip handle easily reaches your whole mouth, even back teeth. The Waterpik Aquarius water flosser removes up to 99.9% of plaque bacteria that causes gingivitis, cavities, and bad breath from treated areas and is clinically proven up to 2X as effective as string floss for removing bacterial plaque and improving gum health. Waterpik is the #1 water flosser brand recommended by dental professionals, and the Waterpik Aquarius water flosser is accepted by the American Dental Association (ADA) for safety and effectiveness. Backed by a 3-year manufacturer\'s limited warranty, see product manual for details.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/71PMB9ImQWL._SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/71PMB9ImQWL._SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71gmnzg0nJL._SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81pt0K+nLPL._SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71aRInGjypL._SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81v-fhlFNOL._SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71T-ny8aOVL._SL1500_.jpg\"]', '{"brand": "Waterpik", "category": "Health & Household", "dimensions": "3.8 x 4.7 x 10.3 inches; 1.46 Pounds"}', '[\"ADVANCED WATER FLOSSING Aquarius is a fully featured water flosser featuring enhanced pressure with 10 settings for a custom clean, massage mode for gum stimulation, plus a built-in timer/pacer pauses briefly at 30 secs and 1 min to track flossing time.\",\"EASY TO USE Features a large reservoir for 90+ seconds of use, no refilling required. Small maneuverable flossing wand makes it easy to floss all areas including back teeth and includes a convenient water on/off switch.\",\"DENTIST RECOMMENDED Waterpik is the #1 water flosser brand recommended by dental professionals and the first water flosser brand to earn the American Dental Association (ADA) Seal of Acceptance for safety and effectiveness.\",\"KEY FEATURES 7 tips for multiple family members and needs, 10 safe and effective pressure settings, removable 22 oz reservoir (top-rack dishwasher safe for easy cleaning), 90+ secs floss time, 360 tip rotation, 120VAC/60Hz for use in North America only.\",\"PROVEN EFFECTIVE Waterpik water flossers use PrecisionPulse technology to deliver a combination of water pressure and pulsations, removing up to 99.9 percent of plaque bacteria from treated areas that cause gingivitis, cavities, and bad breath.\",\"WARRANTY AND SUPPORT Backed by a 3-year limited manufacturer�s warranty, see manual for details. Waterpik�s Colorado support team is available to help with any product questions or needs.\"]'),
