(778, 5, 613, 'Escoda Perla Series 1430 Short Handle Round Artist Watercolor Brush, 12, White Toray Filament', 'The Escoda Series 1430 Perla Brushes are made from a custom blend of patterned white toray synthetic filaments containing all the attributes of natural sable hair. A perfect choice for the professional or seasoned watercolor artist, this brush retains its perfect point after much use and has top notch color retention & spring. Escoda brushes continue to be made by hand by the Escoda family as they were since 1933. This is a short handle size 12 round brush with bristles measuring a diameter of 6. 90mm and length of 27mm.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/61XcgZ2bO6L._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/61XcgZ2bO6L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/6166LQc5ZnL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71f7L6sGVHL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71Ilk2Y19mL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61yPHazsihL._AC_SL1500_.jpg\"]', '{"brand": "Escoda", "category": "Arts, Crafts & Sewing", "dimensions": "9 x 0.4 x 0.4 inches"}', '[\"SYNTHETIC WHITE TORAY FILAMENT ARTIST PAINT BRUSH - Perla brushes are made with white toray filament which is considered the softest synthetic fiber and ideal for watercolor painting\",\"SIZE 12 WATERCOLOR PAINT BRUSH - Pointed round with bristles measuring a diameter of 6. 9mm and length of 27mm\",\"SHORT HANDLE POINTED ROUND PAINT BRUSH - Designed for watercolor & acrylic painting\",\"TRIPLE CRIMP FERRULE - The patented triple crimp ferrule is unique to Escoda brushes and helps ensure a lifetime of use\",\"HANDMADE IN SPAIN - Each watercolor paintbrush is expertly crafted by artisan brush makers\"]'),
(779, 3, 614, 'XINBAOHONG Rechargeable Selfie Light, Clip Fill Light for Phone Laptop Tablet Portable Light for Video Conference Live Streaming Zoom Call Makeup Picture (Black)', 'A portable selfie light is perfect for a variety of application scenarios. Whether you\'re taking selfies, recording videos, attending virtual meetings, or simply need better lighting for your daily life, our clip on light has you covered. The clip-on design makes it easy to attach to your smartphone, tablet, laptop, or desktop computer, while the customizable lighting ensures you always look your best. Product Specifications Material:ABS Dimensions:4*3*0.67 inch LED Bulb Quantity: 80 pcs Charging Voltage: 5V/1A Built-in Battery: 2000mAh Charging Interface: Micro USB and Type-C Color Temperature: 3000K-6500K Color Rendering Index: CRI?90 Maximum Illuminance: 250 LUX/0.5m Package Contents 1* Selfie light 1* Instruction manual 1* Type-c charging cable. Color Temperature and Brightness This versatile all-in-one fill light offers daylight, white, and warm lighting modes, each of which can be dimmed or made brighter to meet your needs. When you are in a dark or unlit space, this halo light\'s adjustable lighting settings will enhance your image, reduce unflattering shadows, and allow you to look your best. Two Ways to Mount LED Selfie Light with Clip.Max.Clip Width 0.9in, the clamp utilizes high-class plastic material, incredibly stable, not easily falls down, widely applicable to various iPhone or android cellphone, iPad, tablet, laptop, ect. The photography light is equipped with the 1/4-inch screw that can be attached to a camera, tripod, microphone mount, light stand or other support using a universal cold shoe adapter on the bottom. Multiple Application Scenarios This video LED light is designed for multiple tasks that needs extra light source. You can use this video light for remote video conferences, online teaching/learning, video chat, live streaming, YouTube video shooting, TikTok, selfies, reading, makeup, handwork, night light, etc.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/61L02W60GvL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/61L02W60GvL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71xfdHmxz-L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71Yam2uVXSL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/811frW84B4L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71SaRFPYAnL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71CdZuazm8L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71s60+skmpL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/41abOE3eVeL._AC_.jpg\"]', '{"brand": "XINBAOHONG", "category": "Cell Phones & Accessories", "dimensions": "3 x 0.67 x 4 inches"}', '[\"?3 Light Modes & 10 Brightness Levels?The selfie light has 3 Light Modes(3000K-6500K), which are provided to meet your various usage needs, the high CRI rating of 90+ allows you to be charming in any situation, such as makeup lighting, selfies, video recording, video conference, vlog show, live streaming. Led selfie light for phone built-in 80 LED lighting beads to improve the quality of night. The fill light is softer, brighter not dazzling, and can protect your eyes well.\",\"?2000mAh Rechargeable Battery?The led selfie light built-in 2000mAh rechargeable battery and USB Type-C charging port. This cell phone fill light is easily charged by laptops, PCs, power banks, USB chargers, car chargers, etc. Allows you to use it everywhere. The camera light provides up to 3 hours of use at maximum brightness. Never worry about running out of power with this durable and reliable phone light clip.\",\"?Clip-on Design?Easy and secure attachment, our selfie light for phone easily clips onto your device without obstructing the camera or screen. With silicone padding inside, your device is protected from scratches, and the 180-degree adjustable angle offers the optimal lighting direction. There is a cold shoe mount with �\" thread embedded for cameras, tripods, selfie sticks, make it ideal for photography, video recording or traveling.\",\"?Lightweight and Portable?The lightweight and portable size of the cell phone fill light even allows you to carry it with you at night for outdoor live broadcasts/selfies without any burden. The extra storage pouch makes it easier to carry.\",\"?Wide Compatibility ?Tiktok light for phone, this selfie clip light is a perfect gift for selfie loving person, or someone that posts a lot of videos. Be suitable video conference lighting/video conferencing/remote working/zoom call lighting/self broadcasting and live streaming/vlog video/TikTok. Phone light with multiple shooting angles & high compatibility.\"]'),
(780, 1, 615, 'Open Ear Headphones with Mic, Bluetooth Headset with Microphone, Dual Connect Bluetooth 5.3 Headset with AI Noise Cancelling Mic & Mute Function, Wireless Headset for Work, Sports, Drive', 'Exercise & Enjoy Music  Comfortable Working All the Day The open-ear design ensures all day comfortable working. 29g Lightweight It\'s only 29g, near 1 ounce. Nor pressure for your ears, even wear all the day 24 hours. Wrap-around Titanium Memory Frame It\'s very skin friendly and flexible. Give you a good wearing experience. Compatible with Popular Meeting Software It suitable with all most of wide use meeting software like Skype, Zoom and so on.  1 Work & Comfortable 2 Lightweight 3 Titanium alloy memory 4 Wide Compatible  Bluetooth 5.3 Our bluetooth headset providing faster transfer speeds, more stable connections, and lower latency.  1 Drive & Noise Cancelling 2 Bluetooth 5.3  Connect Two Devices Simultaneously Open ear headphones suitable with most of bluetooth devices. It can connect two devices same time.  1 Online Meeting & Mute 2 Dual Connection How to pair our open ear headset with 2 devices simultaneously via Bluetooth? 1. Please press and hold MFB button for 3-5s to enter pairing mode, the LED indicator light will flash blue and red alternately, and you could hear \"Pairing\". 2. Please turn on the Bluetooth function of device A, search and connect [O3] in the Bluetooth device list. When you hear \"connected\" and the LED indicator turns blue and flashes slowly every 5s, it means the headset is connected to device A. 3. Please turn off the Bluetooth function of device A, when you hear \"Disconnected\", the LED indicator light will flash blue and red alternately, [O3] will re-enter the pairing mode. 4. Please turn on the Bluetooth function of device B, search and connect [O3] in the Bluetooth device list, when you hear \"connected\" and the LED indicator turns blue and flashes slowly every 5s, it means the headset B-device connected to device B. 5. Please turn on the Bluetooth function of device A, and click \"Connect\" [O3] in the Bluetooth device list. When you hear \"connected\" again, it means that the headset has been successfully connected to device A and device B at the same time. Note: When you listen to music on device A, and device B has an incoming call, just click the MFB button to answer the call (please check the manual for more details). When making a call with conference software, please check the sound settings of both the computer and the software to make sure [O3] is selected as the default output and input device (speaker/microphone)', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/51xJmGEDozL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/51xJmGEDozL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81rQAAlOgAL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71Jml9fW5KL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81UQDeMcsWL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/818otVtqZfL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71Ot4J8LJiL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81O7dvEWVBL._AC_SL1500_.jpg\"]', '{"brand": "Gixxted", "category": "Electronics", "dimensions": "5.79 x 5.67 x 2.13 inches"}', '[\"Open Ear Headphones Different with traditional design, our open ear bluetooth headphones won�t cover your ears very tight so can wear long time and still feel comfortable. The bluetooth headset with microphone also ensure your safety while driving, biking, hiking, and other outdoor activities\",\"Noise Canceling Microphone & Premium Sound Our noise canceling headphones with mic adopt environmental noise reduction technology, so caller can hear your voice cllearly without too much background noise. If you wear our bluetooth headset to enjoy music , it also can provides you a auditory feast\",\"Ultra Light & Comfortable This open-ear headset only weights 29g, The overall body material is very skin-friendly and smooth to make sure comfortable even wearing all day 24 hours. Compared with traditional headset, our bluetooth headset with microphone is particularly flexible, anti-fall.\",\"Connect Two Devices The bluetooth headset can pair with two devices at the same time. You can quickly switch to your calling device with one click , never miss important calls to improve your work efficiency\",\"Bluetooth 5.3 & Mute Function Our wireless headset with microphone adopts the latest Bluetooth 5.3 technology, which makes bluetooth connection quickly, efficiently and stably. The transmission range is up to 49 feet. One press to mute on, you can easily mute your voice during call, online meetings. Also can one press to mute off\",\"Easy to Use Our open ear headphones with microphone feature a multi-function button. One click to answer and end a call, double click to redial the last number. Long press 1-2s MFB to wake up voice assistant. Easy to adjust the volume and switch to the previous/next track. Note The MFB can only answer call on cell phones\"]'),
