(785, 2, 86, 'Avery Printable Greeting Cards with Envelopes, Half-Fold, 5.5\" x 8.5\", Matte White, 30 Blank Greeting Cards for Inkjet Printers (08316)', 'When it comes to special occasions, skip the impersonal texts and emails and�make it truly personal with Avery 8316 half-fold printable greeting cards with envelopes. Made from matte-coated 80 lbs / 216 gsm heavyweight cardstock, this pack of 30 blank white greeting cards comes pre-scored for hassle-free folding. Handwrite directly on the blank greeting cards and envelopes for one-of-a-kind creations or get crisp, smudge-free printing on both sides of the cards from your inkjet printer. Effortlessly create customized cards and custom invitations with your own text, art and photos, or use the free templates, designs and fonts from Avery Design & Print Online. Try it out today on the Avery website. Best of all, this pack of 5.5� x 8.5� blank printable cards comes with envelopes designed to perfectly fit with your cards. Great for creating custom anniversary cards, personalized birthday cards, wedding invitation cards, custom thank you cards and more. For expressing sweet sentiments or celebrating special occasions, nothing makes a warm and thoughtful gesture like an Avery greeting card.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/71kaU2Z+TYL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/71kaU2Z+TYL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71oJAWi4BeS._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71-p4gkPNlL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61xxKn1SaKS._AC_SL1108_.jpg\",\"https://m.media-amazon.com/images/I/71Fq6I2DXMS._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/41UfEvlNSgS._AC_.jpg\",\"https://m.media-amazon.com/images/I/81eUPNfIFXS._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61YS4xyMLaS._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/510QTYaY6FS._AC_.jpg\",\"https://m.media-amazon.com