(787, 4, 23, 'Alpine Corporation 3000 GPH Vortex Energy-Saving Pump for Ponds, Fountains, Waterfalls, and Water Circulation', 'Combine versatility and value with the Alpine Corporation Vortex Pump, a top pick for owners of ponds, fountains, waterfalls and hydroponic and irrigation systems. The energy-efficient Vortex impeller pumps 3000 gallons per hour with a lift height of 14.8\' and the ultra-quiet pump (30-40db) does not distract from the ambiance. The pump can be used in or out of the water and placed vertically or horizontally for ultimate flexibility. The included mesh bag prevents large debris from entering the pump during operation and the filter cage easily snaps off for hassle-free cleaning. It includes an adapter to accommodate hoses from 1.25\" - 1.5\" diameter, a 5 position nozzle and a 20 ft cord to accommodate multiple pond setups. The efficient pump filters out dust particles as small as 0.16\". The convenient carrying handle provides easy transport and the strong suction cup feet keep the pump stable wherever you place it. The pump features an IPX8 waterproof rating and is constructed from premium quality materials for long-lasting use. It measures 8\"L x 6\"W x 5\"H and includes a 5 year warranty. Alpine Corporation is one of America\'s leading designers, importers, and distributors of superior quality home and garden decor products. Alpine\'s award winning in-house design team continuously develops new and innovative \"statements pieces\" for your home and garden. Your outdoor living spaces will be the envy of the neighborhood with our wide assortment of fresh, fashionable and contemporary products, from beautifully crafted solar garden stakes featuring patented motion and fiber optic lighting technology to beautiful fountains and delightful bird baths and feeders.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/813jLi2q+1L._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/813jLi2q+1L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/817SCWMqy3L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71g1mZKortL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71Xa5wopklL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81V11tBXrhL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81YGtlLj9PL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81uSOFDlDnL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81BeEfpp6lL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71S6SZHrdrL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71iRsh5ahwL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71sYh2nSVEL._AC_SL1500_.jpg\"]', '{"brand": "Alpine Corporation", "category": "Patio, Lawn & Garden", "dimensions": "8\\\"L x 6\\\"W x 8\\\"H"}', '[\"ENERGY-EFFICIENT AND ULTRA-QUIET WITH HIGH LIFT Uses only 132 watts to keep energy usage to a minimum and the low-decibel (30-40db) Vortex has a lift height of 14.8\'\",\"VERSATILE MULTI-USE PUMP Use in or out of the water and place vertically or horizontally for ultimate flexibility for ponds, fountains, waterfalls, and hydroponic and irrigation systems.\",\"INCLUDES MESH BAG Mesh bag prevents larger debris from entering pump and snap-off filter cage allows for easy cleaning.\",\"CONVENIENT SET-UP Includes adapter for hoses 1.25\"-1.5\"D, 5-position nozzle, carrying handle, strong suction feet for enhanced stability and a 20 ft cord\",\"DURABLE DESIGN AND IDEAL SIZE The Vortex has an IPX8 waterproof rating, made with premium quality materials for long-lasting use, measures 8\"L x 6\" W x 5\"H and includes a 5 year manufacturer\'s warranty from date of purchase\"]'),
(788, 2, 620, 'Kensington Expert Wireless Presenter with Red Laser Pointer and Cursor Control (K72425AM)', 'Own what professionals use to take control of the room--and a laptop\'s cursor--with the Expert Wireless Presenter with Red Laser. Sometimes pointing just isn\'t enough. Easily toggle between presentation and cursor control modes. The wireless 2.4GHz receiver stores conveniently inside the remote, and since it\'s uniquely paired, you don�t have to worry about device interference. This is a class II laser product with 1mW power output.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/51NDWYnKtDL._AC_SL1000_.jpg', '[\"https://m.media-amazon.com/images/I/51NDWYnKtDL._AC_SL1000_.jpg\",\"https://m.media-amazon.com/images/I/61xaNo7ieaL._AC_SL1080_.jpg\"]', '{"brand": "Kensington", "category": "Office Products", "dimensions": "3 x 5.25 x 8.12 inches"}', '[\"Red laser pointer\",\"Two modes - switch instantly from presenter mode to cursor control mode\",\"Controls keynote and PowerPoint\",\"Compatible with windows 10, 8.1, 8, 7, Mac OS X\"]'),
