(791, 2, 371, 'Flash Furniture Chapman 36\" Round Multipurpose Conference Table, Business Meeting Table for Office and Conference Rooms, Cherry', 'Always be ready for your next meeting with the Flash Furniture Chapman 36\" Round Conference Table. This conference table creates a dedicated meeting space in your office so you don\'t need to worry about leaving your office or booking the only conference room for those one-on-one connections that you need to have with your staff on an ongoing basis. It comfortably seats up to 4 people and provides a separate meeting space from your workspace to allow you to focus on the meeting without the distraction of incoming emails and calls. In addition to office use, this multipurpose table also makes for a great addition to any classroom for parent-teacher conferences or small break room for employees to enjoy their lunch breaks. Constructed with a smooth stain-resistant cherry laminate top and sturdy cast iron x-base with adjustable floor glides, this durable meeting table will enhance any office or classroom setting with a sleek appearance while providing unobstructed leg room. The round conference table measures 35.5\" W x 35.5\" D x 30\" H to fit neatly even in smaller rooms, and assembly is quick and easy.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/71LpNDxV7QL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/71LpNDxV7QL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71jdpKNO4yL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71J3iwQqhJL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81fIRiLvEvL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81i+Cic9iYL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81y+EhXpMvL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71Ysy+1JqvL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81+RXCbgO0L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/9175k5isQ8L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/91IkTNKwvfL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81GrDMcuy2L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71nkRmFrZOL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81acxd-dorL._AC_SL1500_.jpg\"]', '{"brand": "Flash Furniture", "category": "Office Products", "dimensions": "35.5\\\"D x 35.5\\\"W x 30\\\"H"}', '[\"100% Particleboard\",\"36\" ROUND CONFERENCE TABLE Creates a dedicated meeting space in your office so you don\'t need to worry about leaving or booking a conference room for one-on-one connections that you need to have with your staff on an ongoing basis\",\"SEATS UP TO 4 PEOPLE Comfortably seats up to 4 people and provides a separate meeting space from your workspace to allow you to focus on the meeting without the distraction of incoming emails and calls\",\"VERSATILE USES In addition to the office, this multipurpose table also makes for a great addition to any classroom for parent-teacher conferences or small break room for employees to enjoy their lunch breaks\",\"DURABLE AND ATTRACTIVE Made with a smooth stain-resistant cherry laminate top and sturdy cast iron x-base with adjustable floor glides to enhance any setting with a sleek appearance while providing unobstructed leg room\",\"EASY TO ASSEMBLE Round conference table measures 35.5\" W x 35.5\" D x 30\" H to fit neatly even in smaller rooms, and assembly is quick and easy\"]'),
(792, 1, 623, 'Boean Bluetooth Headphones, Wireless Headphones with 16 Hours Playtime Bluetooth 5.3 Wireless Earbuds HD Deep Bass Stereo Sound Isolation IPX7 Waterproof Earphones for Workout Running Sports', 'The video showcases the product in use.The video guides you through product setup.The video compares multiple products.The video shows the product being unpacked. Ultra-long Playtime HiFi stereo are always with you during workout. No worry about battery capaticy  Perfect Fit Ergonomical design with adjustable ear hook and 4 sizes soft eartips(S/M/L), fit for all ear types. Sweatproof & Waterproof With Highly sealed shell and interior Nono-coating technology, can fend off heavy sweat and rain. Stable Connection Easy to connect, automatically pair once you connect to your device the first time. Supper Light Weight Boean bluetooth headphones feature 18.5g only no extra burden while you working out.  1 Flexible Ear hook 2 IPX7 Waterproof 3 Bluetooth 5.3 Technology 4 Light Weight Universally Competibility Widely competible with electronic devices, including smartphones, tablets, computers wieh IOS/Android/Windows system. Package Included: 1*wireless sport headphones 1*USB charging cable 1*Cable clip and 1*clothing clip 1*User guide 4 additional pairs eartips (Small/Mid/Large) How to Pair earbuds for the first time? 1.Open the headphone and check the red and blue LED light flash on earbuds. 2.Turn on the Bluetooth page on your cellphone or laptop and open the Bluetooth function. Select \"U18\" to connect the device. How to reset? 1.Make sure the headphone power on, press and hold \"+\", \"-\" button both for 5 second to reset headphone. 2.The red and blue both light on 3 times, when the headphone light off which means reset successfully. Are this bluetooth headphones compatible with Android or iOS? -Yes, this wireless earbuds are widely compatible with iOS/Android/Windows system or any other Bluetooth-enabled devices.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', '