l great to wear and will never fall out. Upgraded IPX7 waterproof rating, whether you\'re running, working out, or in the rain, you don\'t have to worry about water or moisture damaging your headphones. Not recommended for swimming.\"]'),
(793, 2, 624, 'DJOIS by Tarifold - Wall Mount Reference System - Durable Steel Wire Frames - Letter-Size - 5 Double-Sided Display Pockets - 10-Sheet Capacity - Made in France - PRO Series Model - Black', 'About this item ULTIMATE REFERENCE SYSTEM FOR THE WORKPLACE: Designed as a wall-mounted system, this reference unit is crafted to provide quick and easy access to documents, enhancing efficiency and productivity in the office or other dynamic work environments. IMPROVED VISUAL COMMUNICATION: Featuring pockets crafted from exclusive steel wire technology, this system enables quick document replacement. It is perfectly suited for TQM, 5S, KAIZEN, and most LEAN management processes. DURABLE DISPLAY POCKETS: Made from non-glare PVC and reinforced with metal pivots, these display pockets provide exceptional durability and resistance. They are built to withstand harsh conditions without splitting, cracking, or breaking 10-SHEET CAPACITY: Accommodating up to 10 sheets in letter-size format, this system is trusted by LEAN consultants, corporate advisers, and process engineers worldwide to provide easy access to important work-related documents. MADE TO MAKE: Djois by Tarifold enhances efficiency and productivity in all environments. As part of T3L Group, a leader in plastic and cardboard processing, we solve workspace challenges with innovative and durable solutions that bring a smile to your face. � See more product details', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/61-we1WQgEL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/61-we1WQgEL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81BHIz0M0nL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/91FTI0sgfmL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81FC84fHtdL._AC_SL1500_.jpg\"]', '{"brand": "Tarifold", "category": "Office Products", "dimensions": "17 x 16 x 13.75 inches"}', '[\"ULTIMATE REFERENCE SYSTEM FOR THE WORKPLACE Designed as a wall-mounted system, this reference unit is crafted to provide quick and easy access to documents, enhancing efficiency and productivity in the office or other dynamic work environments.\",\"IMPROVED VISUAL COMMUNICATION Featuring pockets crafted from exclusive steel wire technology, this system enables quick document replacement. It is perfectly suited for TQM, 5S, KAIZEN, and most LEAN management processes.\",\"DURABLE DISPLAY POCKETS Made from non-glare PVC and reinforced with metal pivots, these display pockets provide exceptional durability and resistance. They are built to withstand harsh conditions without splitting, cracking, or breaking\",\"10-SHEET CAPACITY Accommodating up to 10 sheets in letter-size format, this system is trusted by LEAN consultants, corporate advisers, and process engineers worldwide to provide easy access to important work-related documents.\",\"MADE TO MAKE Djois by Tarifold enhances efficiency and productivity in all environments. As part of T3L Group, a leader in plastic and cardboard processing, we solve workspace challenges with innovative and durable solutions that bring a smile to your face.\"]'),
