(796, 2, 626, 'NADAMOO Wireless Barcode Scanner Compatible with Bluetooth Function, 2.4G Wireless & Wired 3-in-1 Bar Code Scanner Portable USB CCD Reader, Work with iPhone iPad Android Windows Mac OS-Dark Blue', 'Our miniature potable Bur3076 barcode Scanner is a bluetooth barcode scanner with the latest CCD sensor provides leading scanning performance. High-quality code scanner guarantees that your business will show an impressive increase in productivity while your employees get more time to address other tasks of the same importance or more. . ** Compatible Operating System: _____________________ Compatible with Windows, Mac OS, Linux, Android, IOS. . ?? Note ?? Not fully compatible with software that has its own custom barcode scanner. > For example, the Square system has its customized barcode scanner to prevent users from using barcode scanners from other brands. Our barcode scaner can scan item barcode into search box of Square system and it will automatically search the item, but you have to manually click searched item to add it to the bill. Compatible with Bluetooth Function: > Simply press the scan button for 6-8 seconds to easily turn to Bluetooth mode. > Connect the scanner to your device via Bluetooth function. 2.4GHz Wireless Connection: > Connect the scanner to your device via the USB dongle. > Support Virtual COM mode on Windows. USB Wired Connection > Directly connect with computer via USB cable. > It can support transmit barcode data, You can also scan barcode while charging. Length of USB cable is 1m/3.28ft. Long Transmission Distance? _____________________ >>>>>> Compatible with Bluetooth Function: Connect the scanner to your device via Bluetooth function. The transmission distance in the obstacles environment is about 10m / 33ft. The tansmission in the environment without any obstacles can reach up to 50m / 164ft. >>>>> 2.4GHz Wireless Connection: Connect the scanner to your device via the USB adapter. The transmission distance in the obstacles environment is about 30m / 99ft. The tansmission in the environment without any obstacles can reach up to 100m / 328ft. _____________________ ***Note: Actual wireless transmission distance will vary as a result of building materials, physical objects and obstacles. The more obstacles, the shorter the transmission distance. Long-Lasting 1200mAh Battery Using a 1200mAh rechargeable battery, the scanner has a 12 hours of continuous scanning. It can work about two weeks in daily used after full charge. It takes 3 to 4 hours to full charge the scanner. _____________________ Proven CCD Scanning Performance You Can Trust With the international advanced CCD photoelectric conversion technology, using imaging technique to complete a variety of commonly used one-dimensional code reading from paper and screen. Advantage: ** Support screen code reading. If you need to read 1D barcodes off a screen, such as computer monitor, smartphone or tablet, or scan through glass surfaces, plastic shrink wrap, a CCD scanner is likely the way to go. ** CCD Scanners have no moving parts. Lasers have oscillating mirrors that are subject to wear and mechanical failure. ** CCD Scanners use LEDs for illumination. LEDs have about ten times the life of laser diodes. It can be used in different lighting environments and has strong applicability. Read faster and operate more efficiently. ** Support the reading of paper barcodes and anti-color barcodes; support the reading of non-standard barcodes such as printing distortion and wrinkle damage. Support remote online upgrade. _____________________ Compatible Barcode Types: UPC / EAN (include extra code), Code128, Code39, Code 39 Full ASCII, Codabar, industrial/Interleaved 2 of 5, Code93, MSI, Code11, ISBN/ISSN, etc. 2 Upload modes Instant Upload Mode: Read barcodes & upload barcode straight to the file you have opened Storage Mode: All scanned barcode will be stored directly into the bulit-in memory of the scanner. You can upload the data to your device in batch. Internal offline storage supports up to 100,000 barcodes. Bluetooth Pairing HID Mode?No driver and special software needed. The scanned barcode will type out in the cursor\'s position. SPP Mode?need to work with driver and serial software. The scanned information will only show up in serial software. BLE Mode: enable faster and simpler connection methods as well as use with other wearable smart devices. 3 Trigger Modes Key Trigger Mode: Scanning light is only on when press the trigger. Continuous Scan Mode: Scanning light is always on when the scanner is electrified. Scanning barcode without pressing any button. Auto-Sensing mode: Scanning light is off until a barcode presented in front of the scanner. Once the barcode is detected, the scanning light will turn on automatically to read the barcode. Scan Everywhere With a wrist strap and a long lanyard, convenient to carry around.Completely portable-convenient pocket size and weight make the scanner ideal for organizing and catalog your barcodes, no matter if you run a small business, a sales shop, or work in a warehouse.Size? Height : 4.7 in/ 12 cm Length: 1.8 in/ 4.5 cm Width: 0.8 in/ 2 cm Volume and Vibration Setting Volume Adjustment: You can freely adjust the beep volume level and beep tone level of the scanner as needed. Vibration Alert: When you need a quiet working environment, just turn the volume off and turning on the vibration which can help you to know the scanning situation without beep reminder. You can also choose to turn off the vibration reminder. More Custom Configuration Support adding prefix and suffix.Support deletign characters from the front/back.Support add keyboard keys (TAB, CR, etc.) to the scanning operation.Support enable or disable barcode type.Support change the capital/lower case. Decoding Rate?300 times/sResolution?3.3milPrint Contrast: >25%CPU: ARM 32-bit CortexDrop test :1.5m Bur3076-2D Bur3148 Bur3149 Bur3094 Bur3069 Bur3069-2D Add to Cart Add to Cart Add to Cart Add to