e dates and tasks. Your Smart Planner helps you keep track of all the important moments, stay focused and plan short and long-term goals. The Daily Planner helps you to stay on track and to faster hit your life goals, stay organized and focused. It\'s a planner carefully crafted to be the best daily planner and offer a cheat sheet to a seamless living. Ideal for increasing productivity in school life! The Academic planner is for students who are looking to maximize their academic experience, with day, week, and month calendar scheduler for optimal time blocking, grade tracking and class schedule. This planner will help you to keep your financial life organized, spend smartly and save money. Write down your financial goals on this planner, you can refer to them continuously throughout the year to keep track of your financial success! It\'s the perfect and luxurious planner for you to be free to do whatever you want! Its dot grid allows you to create your own layout for notes, observation, journaling, sketching and brainstorming ideas. Lasts 13 months 13 months 12 months 12 months 12 months Paper Quality no-bleed 120 gsm no-bleed 120 gsm no-bleed 120 gsm no-bleed 120 gsm no-bleed 120 gsm no-bleed 160 gsm Multiple cover colors options available ? ? ? ? ? ? Stickers ? ? ? Type Undated (start anytime) Dated - July 2022 Undated (start anytime) Undated (start anytime) Undated (start anytime) Dotter Journal Acid-free and vegan leather ? ? ? ? ? ? Size Small A5 (8.6\" x 5.7\") | Medium B5 (10\" x 7\")| Large A4 (11\" x 8.5\") A5 (8.6\" x 5.7\") A4 (11\" x 8.5\") A5 (8.6\" x 5.7\") A5 (8.6\" x 5.7\") A5 (8.6\" x 5.7\")', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/81cRlrU1Z0L._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/81cRlrU1Z0L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81Q-hUnDOeL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/91uhPL9Fj0L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/8145