(813, 5, 641, 'STUDIOSTONE CREATIVE DIY Arts & Crafts Carving Kit Kids Adults Elephant Sculpture Soapstone', 'Learn to sculpt a soapstone elephant! Soapstone carving is a safe, fun craft for kids who love to make and build. Finished sculptures are meaningful gifts for parents, grandparents, teachers, and friends! Discover the magic of soapstone sculpture Easy, Satisfying Activity This meditative, relaxing craft is fun and safe for kids and adults ages 8+. Everything is included so you can easily learn how to shape a soapstone elephant. Each Stone is Unique Natural color variations are revealed when soapstone is heated and waxed. Sculptures may range in color from green to brown. Natural Craft Kit Packaging is plastic free. Kits are made in Canada by local artists.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/71HQwfsJ4tL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/71HQwfsJ4tL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71g1gneVXtL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/51vwRLHwQGL._AC_.jpg\",\"https://m.media-amazon.com/images/I/51HSHcdL3YL._AC_SL1035_.jpg\",\"https://m.media-amazon.com/images/I/81j+4eTS5bL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71ZlMXxPDFL._AC_SL1500_.jpg\"]', '{"brand": "STUDIOSTONE CREATIVE", "category": "Arts, Crafts & Sewing", "dimensions": "8 x 6.2 x 2 inches"}', '[\"??ALL SUPPLIES INCLUDED Our craft kit contains all the tools you need to create your masterpiece a hand-cut Brazilian soapstone shape, a kid-safe carving file, two grades of sandpaper, polishing wax for a shiny finish, a buffing cloth, and step-by-step instructions. The finished life-like sculpture is approximately 1.5� x 3� x 1� (L x H x W).\",\"??NATURAL SOAPSTONE Named for its unique texture, these smooth, soft blocks of stone have been used as a carving medium for thousands of years. Soapstone is a natural stone with natural color variations. Colors range from a gorgeous green to a beautiful brown � no two pieces are alike!\",\"??CARVING TIPS Use the rasp to file the soapstone shape until your animal comes to life, then use the sandpaper to smooth away any file marks. Dip the soapstone sculpture in water to keep your art project mess free.\",\"??GREAT GIFT For adults, kids, teens, and everyone in between. Inspire a love of handmade DIY art for those interested in woodworking, carving, whittling, or simply crafting and creating! No prior experience is required � perfect for beginner and intermediate sculptors.\",\"??SAFE Carve comfortably knowing that all Studiostone Creative products are made with all-natural, non-toxic materials. Our kits are a safe hands-on learning activity that allows kids of all ages to discover their inner artist!\"]'),
