(824, 7, 649, 'Brightech Litespan - Bright LED Floor Reading Lamp for Over Chair Crafts and Reading, Estheticians\' Light for Lash Extensions, Adjustable Standing Lamp for Living Room, Bedroom, Office - Jet Black', 'BRIGHT AND EFFICIENT INDOOR LIGHTING FOR READING AND INDOOR HOBBIES HIGH BRIGHTNESS & HIGH CONTRAST LIGHT FOR READING BOOKS & CRAFTING - Need a lamp with high intensity light that also shows you fine color contrast for hobbies such as sewing, knitting and puzzles, or to read fine print? Look no further. The Litespan shines a bright 850-950 lumens - yet only draws 12W of electricity. NATURAL DAYLIGHT ESTHETICIAN\'S LAMP FOR EYELASH EXTENSIONS, MAKEUP & MORE BEAUTY SPA & SALON SERVICES - See your clients\' lashes very clearly and in high contrast/precision with the Brightech Litespan standing lamp\'s natural daylight color light (6000K color temperature). Get the lash extensions on just right, fast, so your next clients\' wait is shorter. DIMMABLE LED LIGHT SOURCE MODERN OFFICE FLOOR LAMP FOR YOUR DESK OR ARMCHAIR WITH ADJUSTABLE GOOSENECK - Carry out your work easily without installing expensive overhead lights. Adjust the gooseneck (aka the arm) to point the light right where you need it, e.g. on your desk. This amplifies the light perceived by your eye, as opposed to e.g. a bright ceiling-mounted light whose light is dispersed over the whole room. STURDY AND SAFE, USEFUL POLE LAMP FOR KIDS ROOMS: The Litespan�s weighted, high-stability base ensures that no one, including kids or pets will knock it over easily. The LEDs remain cool to the touch even after hours of use which avoids accidental brush-burns and overheating your space. The soft night light setting gives off an orange glow which will gently light your way in the dark to keep you safe at night. EASY OPERATION- A simple tap of the power button located just above the gooseneck is all it takes to turn your Litespan on. A one-second tap is all you need. To dim the lamp, hold down on the power button while the lamp is on and it will start to run through its brightness gradient. When you get to the desired level, just let go. The Litespan smart technology will remember your choice the next time that you turn it on so that you don�t have to readjust it each time you restart your project. The light switch also stays lit with a soft, amber glow to help you see where the lamp is in the dark. It makes a convenient night light. BUILT-IN LED BULB- Our Litespan lamps come equipped with an energy efficient LED bulb. It is built into the lamps head for sturdiness, so it can\'t be replaced, but with its 15-20 year lifespan, you won\'t need to replace it. It has 12 watts, 2,000 lumens, and a cool white color temperature of 6,000k. Because of the built-in dimmer, the Litespan cannot be operated by external remotes, smart devices, or dimmers. If you need a lamp with a warmer color temperature, take a look at our Litespan 2nd edition, which has three different color temperature settings, all of which are dimmable. PRODUCT SPECIFICATIONS- The Litespan weighs just over 10 pounds, but is easily portable and can be moved from place to place. Its height can be adjusting by varying the angle of the gooseneck, and can reach a height anywhere between 42 and 53 inches. The base measures 9 x 10 inches, while the head is 10 x 7 inches. The On/Off switch is conveniently located at the top of the gooseneck near the light. The lamp is plugin operated and works with 110v - 220v outlets; you would just need to use a plug adapter to use it outside of the US, as the plug is made to fit standard US AC outlets. Sky LED Torchiere LightView Pro LED Magnifying Glass Lightview Pro XL Magnifying Glass Contour Flex LED Floor Lamp Add to Cart Add to Cart Add to Cart Buying Options Customer Reviews 4.5 out of 5 stars 20,119 4.6 out of 5 stars 4,268 4.5 out of 5 stars 1,004 4.4 out of 5 stars 823 Price $59.99$59.99 $129.99$129.99 $154.99$154.99 � Wattage 30 watt 9 watts 9 watt 9 watt Height 63 inches 24 - 55 inches 24 - 55 inches 42 - 62 inches', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/71OfQ+c0ocL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/71OfQ+c0ocL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71Fm1fquYfL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61olIM6o6yL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71ldlJeSdrL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71E1ku1DXgL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61eG3vdR-+L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71PCq0cBXlL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71rBbJp-U9L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61kMFngBkFL._AC_SL1500_.jpg\"]', '{"brand": "Brightech", "category": "Tools & Home Improvement", "dimensions": "9\\\"D x 10.25\\\"W x 42\\\"H"}', '[\"Energy-saving LED Floor Lamp The simple style LED standing lamp has a service life of 20,000+ hours, with built-in high brightness and high contrast LEDs that show you fine color contrast for close work. This LED lamp shines a bright 850-950 lumens, only draws 12W of electricity, saving up to 80% of the electricity bill compared with traditional incandescent lamps.\",\"Modern Living Room Decor With Adjustable Gooseneck Unlike traditional floor lamps, this is a great floor reading lamp for over your chair, with its flexible and durable neck that allows you to rotate and bend it easily into various angles. You can twist the head of the standing lamp and place the light directly on your subject.\",\"Natural Daylight Esthetician\'s Lamp For Eyelash Extensions, Makeup, and Beauty, Spa and Salon Services See your clients\' lashes very clearly and in high contrast and precision with the Litespan standing lamp\'s natural daylight color light, 6000K color temperature.\",\"Sturdy And Safe, Useful Tall Lamp For Kids Rooms Brightech Litespan floor lamp designed with a weighted, high-stability base helps prevent it from being knocked over, even by kids or pets, The LEDs remain cool to the touch even after hours of use which avoids accidental brush-burns and overheating your space. The soft night light setting gives off an orange glow which will gently light your way in the dark to keep you safe at night.\",\"THE WARRANTY Unlike other brands, our floor lamps are built to last, and we stand behind that. That\'s why Brightech USA offers an industry-leading 3-year warranty covering defects, malfunctions, or sudden failures to your floor lamp when purchased through us. Our all-star US-based support team is standing by should you ever need support with this standing lamp.\"]'),
(825, 2, 650, 'Faber-Castell Classic Colored Pencils Tin Set, 48 Vibrant Colors In Sturdy Metal Case', 'Faber-castell\'s premium children\'s art products are recommended by art educators for their quality, innovation, safety and respect for the environment. 100% of our children pencils are produced with reforested wood that comes from the over 1 million seedlings that are planted each year! Faber-Castell pencils, crayons, pastels, markers and gift sets are products you can feel good about! Faber-Castell, established in 1761, is the worlds leading manufacturer of wood-cased pencils with a varied range of products for writing, drawing and creative design. This set includes 48 classic color pencils, PVC free eraser, 2 grip sketch pencils and a sharpener. Housed in a sturdy metal tin with removable trays.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/91+Ftr9+lsL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/91+Ftr9+lsL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61ykDA8wrbL._AC_SL1000_.jpg\",\"https://m.media-amazon.com/images/I/81VtjiJ2-cL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/814rQoaDJZL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/91f5uDPU-4L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71LevXPWsGL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81VAUhYijlL._AC_SL1500_.jpg\"]', '{"brand": "Faber-Castell", "category": "Office Products", "dimensions": "11.63 x 7.25 x 1.13 inches"}', '[\"48 VIBRANT COLORED PENCILS - Includes highly pigmented, easy to blend and flake resistant colors! This sketching set also features 2 sketch pencils, sharpener and a dust, PVC and latex free eraser, all in a metal storage tin\",\"MADE FROM REFORESTED WOOD - 100% of Faber-Castell colored and graphite pencils are produced with reforested wood from over 1 million seedlings planted each year\",\"BREAK RESISTANT LEADS Easy to sharpen and the leads won\'t fall out! Leads are glued alo