f details. Your photo and video quality will be greatly improved.\",\"?Stable and Save Space?Upgraded with double springs, the metal cantilever bracket provides more stable support, preventing slipping and ensuring durability. Compared to a desktop base, the C-clamp mounting solution helps to better utilize the limited desk space. And the cantilever stand can be easily retracted into a compact size, not only saving storage space but also making it highly portable.\",\"?Widely Compatible & After-sale Service?1/4 screws of the cantilever bracket can be connected to multiple devices. It can connect phone holder, webcam, digital cameras, circle light and GoPro. We offer a free 12-month after-sales service. Feel free to contact us anytime with any questions or concerns.\",\"?Product List?10\" Ring Light *1, Overhead Mount *1, Phone Holder *1, Remote *1, Ball Head *1, Gooseneck *1, Instruction Book*1.\"]'),
