gs, wrapping packages, hanging decorations or any arts and DIY crafts project\",\"Durability - Perfect 3mm thickness twine rope, strong but soft, you do not need to worry about any damage to the item due to the bundling and hanging\",\"Package - 100 meters?328 Feet?long, enough for many craft and gardening work. Packed on a roll, it is convenient to use and won\'t get tangled\"]'),
(836, 8, 23, 'Alpine Corporation 13\" Tall Indoor 4-Tier Cascading Tabletop Fountain with LED Lights, Gray', 'Enjoy the meditative sounds of nature indoors with the Alpine Corporation Cascading Tabletop Fountain! Take in the tranquil sounds of the water gently cascading over natural-looking gray stone in the comfort of your own home. This fountain is perfect for tabletops in your office, entryway, or out on your patio or yard. The polystone and fiberglass construction is weatherproof, rust-resistant, and durable for years of quality use. LED lights illuminate your space, drawing attention to the relaxing water pools day or night for added ambiance. To use, simply plug into an outdoor outlet, fill lower level with water, and watch as the interior pump creates a lovely water flow reminiscent of a lush rainforest. With a 1-year warranty, you can be confident in the quality of your purchase. Fountain measures 9\"L x 7\"W x 13\"H, perfect for tabletops. Alpine Corporation is one of America\'s leading designers, importers, and distributors of superior quality home and garden decor products. Alpine Corporation\'s award winning in-house design team continuously develops new and innovative \"statement pieces\" for your home and garden. Your indoor and outdoor living spaces will be the envy of the neighborhood with our wide assortment of fresh, fashionable and contemporary products, from beautifully crafted solar garden stakes featuring patented motion and fiber optic lighting technology to beautiful fountains and delightful bird baths and feeders.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/81wU4Xn35DL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/81wU4Xn35DL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81VH45+mB0L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81iP2j7NklL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81YHhUsmuqL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81c5Zww45WL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81qmnFbw8qL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81k1Mh-2oeL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81lOL6ZqGSL._AC_SL1500_.jpg\"]', '{"brand": "Alpine Corporation", "category": "Home & Kitchen", "dimensions": "9\\\"L x 7\\\"W x 13\\\"H"}', '[\"WATERFALL FOUNTAIN Tabletop water fountain is the perfect addition to your d�cor. Interior pump keeps the water flowing � just plug it in!\",\"RELAXING WATER FLOW Water cascades down to mimic the sounds of a real waterfall, adding peaceful ambiance to your home or yard\",\"NATURAL LOOK Realistic gray stone rock tower brings a touch of natural beauty to your space\",\"DURABLE Resin, stone powder, and fiberglass construction is rust- and weather-resistant to keep your outdoor fountain looking new over time\",\"IDEAL SIZE Water fountain measures 9\"L x 7\"W x 13\"H, the perfect size for your yard, and includes a one-year manufacturer\'s warranty from date of purchase\"]'),
