(839, 1, 1, 'Soundcore by Anker Space Q45 Adaptive Active Noise Cancelling Headphones, Reduce Noise by Up to 98%, 50H Playtime, App Control, LDAC Hi-Res Wireless Audio, Comfortable Fit, Clear Calls, Bluetooth 5.3', 'The video showcases the product in use.The video guides you through product setup.The video compares multiple products.The video shows the product being unpacked.  Upgraded Noise Cancelling The ultra-wide, 3-stage noise cancelling system targets and blocks out noises precisely. 2� Stronger Create personal space wherever you are, with soundcore\'s upgraded noise cancelling technology. Adaptive Noise Cancelling Space Q45\'s noise cancelling automatically adapts based on the noise from your surroundings. Adjustable Ambient Sound Use the app to choose from 5 levels of transparency and noise cancelling for ultimate customization.  1 Upgraded Noise Cancelling 2 Boosted Performance 3 Smarter Noise Cancelling 4 Enhanced Awareness  Ideal for Traveling Enjoy up to 50 hours of playtime in ANC mode and up to 65 hours in standard mode. Never Compromise on Sound Pioneering double-layer diaphragm drivers produce clear, bright sound with strong bass. Gold Standard of Sound LDAC transfers 3� more detail than standard Bluetooth codecs for a detail-rich listening experience. Personalized Listening Make Space Q45 yours with adjustable EQ, customizable controls, and more in the easy-to-use app. Crystal Clear Calls Be heard in crystal-clear clarity as two mics and an AI algorithm detect and amplify your voice.  1 50-Hour Playtime 2 Detail-Rich Sound 3 Hi-Res Wireless Sound 4 soundcore App 5 AI-Enhanced Calls Dual Connection Stay connected to two devices with Bluetooth 5.3 and multipoint connection. Instantly switch between music, calls, videos, and more on different devices hassle-free to save you time and effort. Product Dimensions Length: 161mm / 6.3in Height: 190mm / 7.5in Wide: 88mm / 3.5in Compare soundcore Headphones Space Q45 Add to Cart soundcore C40i Add to Cart Spac