 Up to 50 hours of playtime in noise cancelling mode will easily cover a vacation, an around-the-world flight, or weeks of commutes. In normal mode, you\'ll get up to 65 hours of listening, and if you run out of power mid-journey, a 5-minute fast charge gives you 4 hours of playtime. Tailored Noise Cancelling Response: Adaptive noise cancelling detects external noises around you and automatically adjusts to different tailored modes. It switches to maximum level on flights or trains, reduces wind noise when you\'re outdoors, and switches to a lower, comfortable level indoors. Highly-Detailed Sound: Experience sound with new levels of detail thanks to Space Q45 Bluetooth headphones\' innovative double-layer diaphragm drivers. Bass is extended for extra punch, vocals are rich, and treble is crisp�allowing every layer of the song to shine through. Hi-Res Wireless Sound: LDAC mode transmits up to 3� more data than standard Bluetooth codecs for a stunning high-resolution experience, even when using Space Q45 Bluetooth headphones in wireless mode. Secure and Well-Fitting: Space Q45 noise cancelling headphones are packed with comfort-enhancing details. The aluminum alloy hinges flex to fit the shape of your head, and the cushioned headband has a seamless sliding design for easy extension. To fit ears of different sizes, the ear cups have a wider diameter, plus bouncy-soft cushioning for hours and hours of comfort. soundcore App: Choose from 22 EQ presets, select a suitable level of noise cancelling and transparency, set volume level limits, customize the controls, and more. Customized Transparency: Space Q45 noise cancelling headphones also has Talk mode, allowing you to speak to people in your vicinity with ease, while the 5 levels of transparency in the app allow you to choose how much of your surroundings you let in. Multipoint Connection: Connect Space Q45 noise cancelling headphones to 2 devices at the same time�ideal for when you want to switch between listening to music, attending remote meetings, and making calls.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/71y9B19C5LL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/71y9B19C5LL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71cDgzWPbHL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61kvoNHCOBL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71zzo-KkQ+L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61sdGq5uqsL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71DLUjNgVCL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61nf42kFCkL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/51xECNh58HL._AC_SL1181_.jpg\"]', '{"brand": "Soundcore", "category": "Electronics", "dimensions": "6.34 x 3.46 x 7.44 inches"}', '[\"98% Less Noise for Your Journey The fully-upgraded noise cancelling system targets and blocks out a wider range of noises�from plane engines to crying babies. Enjoy personal space wherever you go with Space Q45 noise cancelling headphones.\",\"Make Every Space Your Own Whether you\'re indoors, outdoors, commuting, or on a flight, Space Q45\'s adaptive noise cancelling will automatically select a suitable level to match your location. Also, use the app to choose 1 of 5 noise cancelling levels.\",\"Ideal for Traveling 50 hours of playtime in noise cancelling mode will cover an around-the-world flight without needing to recharge. In normal mode, get up to 65 hours of playtime and if you are low on battery, charge for 5 minutes for 4 hours of playtime.\",\"Hear Every Detail The 40mm drivers have a pioneering double-layer diaphragm made from silk and ceramic materials to produce sound with intense bass and crisp treble. Space Q45 noise cancelling headphones also support LDAC for Hi-Res Audio Wireless sound.\",\"More Than Comfort Space Q45 noise cancelling headphones balance a refined design, ergonomic build, and comfort-enhancing details for a harmonious wearing experience.\"]'),
(840, 2, 222, 'Epson Expression Home XP-430 Wireless Color Photo Printer with Scanner and Copier, Amazon Dash Replenishment Ready', 'Everyday printing is a breeze with the compact, easy-to-use expression Home xp-430 Small-in-One printer. Featuring a hi-res 2.7\" Color LCD, the xp-430 makes setup and navigation a snap. Plus, a 100-sheet paper capacity means you\'ll reload paper less often, while individual inks allow you to replace only the color you need. Print from virtually anywhere, with or without a network ? even from your iPad, iPhone, Android tablet or smartphone. It� s a Complete wireless solution. You can easily scan and share photos on Facebook or popular cloud services with included software. And, a built-in card slot enables you to print photos PC-free. This Epson printer is designed for use with only genuine Epson-brand cartridges. Other brands of ink cartridges and ink supplies are not compatible and, even if described as Compatible, may not function properly or at all. Epson provides information about the design of the printer on the box and in many other locations and materials Included with the printer and on the website. Epson periodically provides firmware updates to address issues of security, performance, minor bug fixes and ensure the printer functions as designed. This printer was designed to work only with genuine Epson ink cartridges and some updates may affect the functionality of third party ink. Non-epson branded or Altered Epson cartridges that functioned prior to a firmware update may not continue to function.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/81cd5Nu5huL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/81cd5Nu5huL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81xVDIV7xzL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71UCj5q03bL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71Sf96MVmZL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81Q7-3IEr6L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71q7vnsN9QL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71esJ9XG7vL._AC_SL1500_.jpg\"]', '{"brand": "Epson", "category": "Office Products", "dimensions": "11.8 x 15.4 x 5.7 inches"}', '[\"This printer is designed for use with Epson cartridges only, not third party cartridges or ink. Cartridges described as Compatible, Remanufactured, refilled or refillable may not work properly or at all. See product description for more details.\",\"Easy setup and navigation � large, hi-res 2.7\" Color LCD to easily print, copy and scan.\",\"Complete wireless solution � easy iPad, iPhone, Android tablet and smartphone printing; Includes Wi-Fi Direct for network-free printing.\",\"Affordable individual ink cartridges � replace only the color you need.\",\"Easily adjust and Print photos � built-in memory card slot for PC-free photo printing; Includes tools for Red-eye removal, photo restoration and more.\",\"Reload paper less often � 100-sheet paper capacity.\",\"Never run out of ink again - printer features Amazon Dash Replenishment which, after activation, keeps track of your ink usage and orders more from Amazon when you are running low.\",\"Works with Alexa Ask Alexa to print your shopping list, to-do list, crosswords, coloring pages, and more. To set up, say �Alexa, discover my printer.� Alexa can also detect when ink or toner is running low and orders more when you need it. Save 10% on all ink or toner smart reorders. Restrictions may apply.\"]'),
(841, 2, 197, 'Hammermill Printer Paper, 20 lb Copy Paper, 8.5 x 14 - 1 Ream (500 Sheets) - 92 Bright, Made in the USA, 105015R', 'The Hammermill Paper 99.99. 000 sheets using Hammermill copy paper on your high-speed digital printer or we will replace your Hammermill paper purchase. We test more than 13.5 million sheets of paper every year to make sure that each sheet is consistent. Then we test our papers on all kinds of printer and copier equipment to ensure that our paper will work well for you, every time, on every machine. MAKE SURE IT�S ORIGINAL HAMMERMILL QUALITY: look for �Ships from and sold by Amazon� at the top of the page, under the product title. �It�s More Than Just Paper� to us and to millions of sustainable forestry workers across America, including American family tree farmers. Hammermill papers are made with renewable resources from certified sustainably managed forests. We want our business to last for generations and that means taking good care of our environment. This Hammermill copy paper is an economical paper for multipurpose print and copy use. It is available in 8.5 x 11 3-hole punched letter size paper, 8.5x14 legal size paper and 11x17 ledger size paper. Hammermill 20lb Copy is available in a single ream (500 sheets of paper) and in cases of paper-wrapped 5 reams (2,500 sheets) and 10 reams (5,000 sheets). Also available in Express Pack pallets, and truckloads. Choose from items listed at top of page in SIZE and STYLE NAME.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/51ayrtv+VGL._AC_SL1080_.jpg', '[\"https://m.media-amazon.com/images/I/51ayrtv+VGL._AC_SL1080_.jpg\",\"https://m.media-amazon.com/images/I/517VvXVlEvL._AC_SL1080_.jpg\",\"https://m.media-amazon.com/images/I/71YShQnkbFL._AC_SL1080_.jpg\",\"https://m.media-amazon.com/images/I/61kCTOFhSXL._AC_SL1080_.jpg\",\"https://m.media-amazon.com/images/I/71KG43ARBwL._AC_SL1080_.jpg\",\"https://m.media-amazon.com/images/I/616e-h2qKdL._AC_SL1080_.jpg\"