(845, 1, 660, 'SHOKZ OpenFit - Open-Ear True Wireless Bluetooth Headphones with Microphone, Earbuds with Earhooks, Sweat Resistant, Fast Charging, 28HRS Playtime, Compatible with iPhone & Android, Beige', 'OPENFIT The video showcases the product in use.The video guides you through product setup.The video compares multiple products.The video shows the product being unpacked.   1 Open-Ear Design 2 Ultra-Soft Silicone 3 Dolphin Arc Ear Hook 4 Light and Balanced Design   1 Powerful Bass Experience 2 Situational Awareness 3 Fit and Secure 4 AI Noise Cancellation 5 Long Battery Life   1 IP54 Water Resistance 2 Shokz App 3 Multipoint Pairing   1 What\'s in the box 2 Reduce Plastics 3 How to Wear 4 How to Control DO OPENFIT USE BONE CONDUCTION TECHNOLOGY No, they don�t. They are powered by DirectPitchTM technology, another technical method to open-ear listening. Shokz DirectPitchTM technology uses reverse sound waves to optimize the distance and angle between the sound source and the human ear. CAN OTHERS HEAR YOUR MUSIC OR CALLS? No, generally they can\'t. OpenFit uses DirectPitchTM technology, which amplifies sound pressure in directions toward the ear canal, and cancels sound and pressure in directions angled away from ear canal. This greatly reduces sound leakage. DO YOU NEED TO USE OPENFIT WITH AN APP? You can use OpenFit without an app. However, the Shokz App can help you customize your listening experiences. You can personalize your EQ modes, and button functions, access real-time power information, and update the firmware through the Shokz App. WHAT IS THE AVERAGE BATTERY LIFE OF OPENFIT? OpenFit provide up to 7 hours of listening on a single full charge. The charging case extends the earbuds to 28 hours of listening. The actual battery life depends on the volume, sound source, product features, use habits, and other factors. ARE OPENFIT WATER AND SWEAT RESISTANT? OpenFit earbuds are IP54 water-resistant. The earbuds are designed to be resistant against dust and drops of water but aren�t meant to be submerged under water. We don\'t recommend you wear them in heavy rain or wash them with running water.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/51q4I1tny0L._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/51q4I1tny0L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61gxxRz9rwL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61juF2xdmRL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/717GZuhY2GL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61ti1q9C14L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/51m7HNa4THL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/51TyE3GZ5WL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61NMDsf9diL._AC_SL1500_.jpg\"]', '{"brand": "SHOKZ", "category": "Electronics", "dimensions": "1.94 x 1.72 x 0.75 inches"}', '[\"Open-Ear Design for Ultimate Comfort - OpenFit continues the SHOKZ open-ear concept with a compact earbud design. The ergonomic design with ultra-soft silicone cushion provides you with an incredibly comfortable experience\",\"Incredible Audio Experience - DirectPitch technology by SHOKZ provides you premium audio quality while keeping your ears open\",\"Situational Awareness - Stay connected with your favorite audio & your surroundings at the same time\",\"Secure Fit - The ergonomic & flexible ear hook with balanced earbud weight design provides a soft & secure grip\",\"Up to 28 hours of listening with quick charge - 7 hours per charge & up to 28 hours of listening with the charging case. A 5-minute quick charge provides an hour of battery life. No more battery anxiety\"]'),
