(848, 2, 109, 'Paper Mate Flair Felt Tip Pens, Ultra Fine Point (0.4mm), Black, 12 Count, perfect for precise and expressive writing', 'Product Description These Paper Mate Flair Felt Tip Pens in bold black ink add a blast of fun to your writing. Equipped with ultra-fine felt tips (0.4mm), they produce clean and precise lines to keep your written work sharp. Made with water-based ink, they won\'t bleed through paper, ensuring your writing stays put. They are smear and fade-resistant, eliminating the bother of smudges. The metal-reinforced point prevents tip damage for extended usage. This pack includes 12 black Flair pens, perfect for all your writing needs. From the Manufacturer Felt-tip pen delivers ultra-fine, precise lines. Reinforced metal tip prevents tip from fraying. Quick-drying, water-based ink won\"t bleed through paper and is acid-free on paper.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/81oxFGyZq9L._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/81oxFGyZq9L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61Ecur7oDxL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71TmvQ6qndL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/41jx7xIZcoL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71yhvZtgzML._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81BSVBOFTML._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/A1cDuxX2tBL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/815EuKjbvcL._AC_SL1500_.jpg\"]', '{"brand": "Paper Mate", "category": "Office Products", "dimensions": "6.1 x 2.9 x 1 inches"}', '[\"Precise and Fun Bold black ink adds a blast of fun to all your writing\",\"Ultra-Fine Felt Tip 0.4mm tip produces clean and precise lines\",\"Superior Ink Water-based ink won�t bleed through paper\",\"Smear & Fade-Resistant Ensures your writing stays put and smudges become history\",\"Reinforced Point Metal-reinforced point prevents tip damage for longevity\",\"In