(849, 2, 663, 'Floortex� Ultimat� Polycarbonate Lipped Chair Mat for Carpets up to 1/2\" - 35\" x 47\"', 'Floortex� Cleartex Ultimat polycarbonate chair mats are the ultimate in quality and durability in floor protection and ergonomics. These high clarity chairmats for hard flooring are made from Floortex Original polycarbonate, which has double the impact strength of PVC and will not crack, curl, discolor or smell. The perfectly flat and hard surface provides easy glide movement of caster based chairs which can reduce leg fatigue and lower back strain. Ultimat is environmentally safe, free from Phthalates, PVC and toxic chemicals. An ideal choice for people with allergies. Eco-friendly manufacturing with 50% of our manufacturing site�s energy coming from on-site and external renewable sources. 100% recyclable. Our polycarbonate mats lie perfectly flat from delivery and can be used immediately.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/61GPT3zoUwL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/61GPT3zoUwL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/812-m3dDnQL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/812eCQFLLfL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71HZ5g89UVL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/91ndKtorJ3L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/810eNDjy0wL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81tSbyW1uBS._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61DSrmc1FLL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71GEB9ts8ML._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71DtnbNSm5L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61cdeAUWUCL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/710lKaJ6gdL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81JnNegIYhL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/817awGwIKfL._AC_SL1500_.jpg\"]', '{"brand": "Floortex