 like the Surface Slim Pen 2.\",\"???Double Magnets & Palm Rejection?Jvkzaen Surface pen is always ready to firmly attach to your Microsoft Surface tablets with 2 stronger built-in magnets. No fatigue on the wrist with 2 hands on the screen, and no breaking points when writing either. Jvkzaen Surface pen is always there and ready to jot down when inspiration strikes.\",\"???Type-C Charge &Smart Standby Surface Pen, No Panic?Enjoying Jvkzaen\'s leading Type-C charge and longer battery life,only 1hours of charging, 66 hours of use.Automatically turn in \"Sleep Mode\" if idle for 10 minutes to save power.\",\"???Wide Compatibility? Compatible with Surface Pro 11th Edition, Surface Pro 10?Surface Pro 9, Surface Pro 8, Surface Pro 7+, Surface Pro 7, Surface Pro 6, Surface Pro 5, Surface Pro 4, Surface Pro 3, Surface Duo/ Duo 2, Surface Pro X, Surface Go/Go 2/Go 3, Surface Book/Book 2/Book 3, Surface Studio 1st Gen, Surface Studio 2, Surface Studio 2+, Surface Laptop 1/Laptop 2/Laptop 3/Laptop 4/Laptop 5, Surface Laptop Studio. *Not compatible with Surface Laptop Go, Surface Laptop Go 2 and others touch screen computers.\",\"??PPT Remote Control?Easily pair your surface pen to your device via Bluetooth , once paired your surface stylus you can click the top button once to open Microsoft Whiteboard, double-clicking will open Snip & Sketch, and press and hold will open Sticky Notes. With the surface stylus as a PowerPoint remote control from across the office during a PowerPoint slide show, click the top button to advance to the next slide and press and hold the top button to return to the previous slide.\",\"???What�s in the Package??1x Surface pen, ?1x POM nib, ?1 x Type-c Charging adapter,?1x User manual, What\'s more,quick reply in (24 hours), worry-free (12-month) warranty, friendly customer service. If you have other questions, please feel free to contact us. Welcome to contact us.? *If your device screen protector is paper feel, it is recommended that you replace the