(869, 3, 676, 'Bluetooth Headset V5.3, Wireless Headset with ENC Noise Canceling Mic, 120Hrs Talk Single-Ear Bluetooth Earpiece, LED Display, IP7 Waterproof Hand-Free Earphone for Business/Trucker/Driver', 'The video showcases the product in use.The video guides you through product setup.The video compares multiple products.The video shows the product being unpacked.  HD rendering technology provides lossless sound quality, you can enjoy music anytime and anywhere. The advanced Bluetooth 5.3 chip makes signal transmission more stable and the Bluetooth range wider.  1 Dual ENC Microphone 2 Hi-Fi Stereo Bass 3 Bluetooth 5.3   IP7 Waterproof IP7 waterproof nano-coating effectively protects the earbuds from sweat or water, perfect for running and sports activities at the gym or outdoors. Fit and Lightweight The earphones are as light as feathers, so you won\'t feel any discomfort even if you wear them for hours. Typ-C Charing The Bluetooth earpiece can be used for 20 hours of talk time at a time and can be fully charged in just 1.5H. Fit for Both Ears The headset feature a rotatable earhook and microphone so the Bluetooth headset can be worn on the left or right ear.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/71twWADhGTL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/71twWADhGTL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71LuC4r6vzL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81p7n0jX+LL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71bMgHXd2gL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71D-EI5ew-L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71aNoWHxKGL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71P7pqkJYwL._AC_SL1500_.jpg\"]', '{"brand": "SKIUDCT", "category": "Cell Phones & Accessories", "dimensions": "5.87 x 2.99 x 1.26 inches"}', '[\"Bluetooth 5.3 and Fast Pairing The wireless headset are equipped with a Bluetooth 5.3 chip. Compared with Bluetooth 5.2, it not only provides a faster and more stable connection, but also maximizes low power consumption. Whether you\'re on a high-speed train or in a noisy airport lobby, you\'ll be guaranteed a smooth call and music experience. When you take the wireless earphones out of the charging box, it will automatically turn on and activate the search and connection functions of your phone.\",\"ENC Mic and HiFi Stereo Sound N19 wireless earbud is equipped with advanced ENC noise reduction technology, which can effectively filter surrounding noise. Whether you are dealing with emails or writing reports, it can create a quiet working environment for you and improve work efficiency. The 13mm dynamic driver provides you with a clearer and more realistic sound quality experience, reproducing every note and detail in the music, allowing you to enjoy the purity and dynamics of the music.\",\"Comfortable Fit Design The bluetooth earphone is ergonomically designed, equipped with rotating ear hooks and flip-up microphone, allowing you to easily switch between left and right ears. Equipped with three different sizes of earplugs, it can disperse pressure and ensure a comfortable fit, bringing you all-day comfort and reducing fatigue. Perfect for drivers and business professionals. With IP7 waterproof rating, it can effectively resist the intrusion of sweat, rain and other liquids.\",\"Ultra Long Battery Life The noise cancelling headset can provide up to 20h of uninterrupted talk time in just 1.5h of charging. The charging case that comes with a large-capacity battery extends the standby time to an impressive 120h, which overcomes the difficulty of battery shortage during business trips, driving, meetings. The LED display screen intuitively displays the power and connection status of the bluetooth earpiece, allowing you to know the power status of the headset at any time.\",\"Multi-function Control Bluetooth headset are equipped with smart buttons that can easily implement functions such as call answering/hanging up, volume adjustment, and music playback. The rationally designed key layout and easy-to-operate buttons allow you to easily operate the headset in busy work scenarios and improve work efficiency. The ear piece is compatible with most Bluetooth devices (iOS/Android/Windows), ensuring you get stable connection and high-quality sound on different devices.\"]'),
