NOLOGY SimpleSync pairs your Bose SoundLink Micro Bluetooth Speaker to compatible Bose products for sound that follows you from room to room. Away from your phone Press and hold the Bluetooth button on each device to sync their sound. Already got a group going Link by pressing the Action button to connect at a moment�s notice\"]'),
