High-Speed Charging Equipped with 20W PD fast charging, power up your for iPhone 13 from 20% to 70% in half an hour�that�s 3x faster compared to an original 5W charger. *The phone and power bank will heat up under fast charging which is a normal phenomenon.\",\"Mini Size 0.2 pounds and 3.03\"*1.38\"*0.96\" compact design, lipstick size allows you to take it in your pocket or purse everywhere, and travel not being tied by the bulky charger.\",\"18W PD Fast Recharging Fully charge this portable charger for only 1.5 hours with a 9V-2A charger. It will take 3 hours if you use a 5V-2A charger. (USB C adapter not included, the USB C port on the side is for input only.)\",\"5000mAh Capacity 5,000mAh battery capacity provides 0.65 charges for iPhone 13 Pro Max, 0.79 charges for iPhone 13, 0.9 charges for iPhone 12, 0.8 Charges for iPhone 11, 0.9 charges for iPhone XR, 6 charges for AirPods (2nd Generation).\",\"What You Get 5000mAh power bank *1, USB A to USB C cable*1 (in a small box), user manual*1, our 24-month support, and 7-day/24-h friendly customer service. If you have any problems, please contact us and we will solve them within 24 hrs.\"]'),
