(902, 2, 86, 'Avery File Folder Labels on 4\" x 6\" Sheets, Removable Adhesive, White, 2/3\" x 3-7/16\", 252 Labels (5230)', 'Quickly and easily make changes to your file folders with Avery Removable File Folder Labels. The removable adhesive allows labels to stick and stay in place, yet removes easily and cleanly when you need a change. Perfect for situations that only need a few labels at a time, the smaller 4� x 6� sheets come with 7 labels each, designed for fast and easy peeling. The removable file folder labels adheres firmly without lifting or curling from almost any smooth surface, including paper, cardboard, glass, plastic, metal and more. Write directly on the tab folder labels by hand or get a professional look by customizing your labels with free designs and templates on the Avery site. Simply adjust your laser or inkjet printer to fit the smaller 4� x 6� sheets and print at home with ease.�With our removable labels you can reuse your file folders again and again. This item comes with 36 sheets and a total of 252 white 2/3� x 3-7/16� labels.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/616OOsRTjsL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/616OOsRTjsL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81rTn+Ww1FL._AC_SL1500_.jpg\"]', '{"brand": "AVERY", "category": "Office Products", "dimensions": "4.59 x 7.19 x 0.58 inches"}', '[\"Reuse file folders again and again; the removable adhesive ensures file folder labels stick and stay yet remove cleanly and easily if needed\",\"Perfect for when you only need a few labels at a time, the 4\" x 6\" sheets contain 7 file folder labels for quick and efficient organization\",\"No more worrying about curling or falling off; white file folder labels adhere to smooth surfaces including paper, cardboard, plastic, wood, glass, metal and more\",\"Create handwritten file label stickers with ease or use your personal laser or inkjet printers for a more polished finish; not recommended for use with color laser printers\",\"Design and print custom labels with free templates on the Avery site for a more professional look\"]'),
(903, 2, 694, 'Samsill Contrast Stitch Faux-Leather Portfolio, Mini Size Business Interview Professional Padfolio, Includes 5 x 8 Inch Writing Pad, Black', 'Samsill\'s faux-leather mini Padfolio organizer makes an indispensable tool for home and office use. This sleek mini business portfolio for women and men features a minimalist design complete with soft, flexible leather-like covers enhanced with sewn edges for added durability. A small document pocket allows you to keep loose notes, resumes, business proposals, and other documents safe and neatly organized. Interior pockets accommodate your business and credit cards, ID cards, flash drives, etc. The 5 x 8 inch lined writing pad included in this pad holder allows you to quickly take notes while in a meeting, classroom, or any other setting where you need to jot down important information right away. The possibilities are endless!', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/71EMtdnQdlL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/71EMtdnQdlL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81MW3dgpflL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61Stja25wRL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71p5IDo60JL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/91fnybraXGL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81Fe51nAf+L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81wpsFNRfjL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71wjwWbjEBL._AC_SL1500_.jpg\"]', '{"brand": "Samsill", "category": "Office Products", "dimensions": "0.75 x 6.25 x 8.7 inches"}', '[\"Professional Portfolio This portfolio organizer is designed & manufactured for professional men and women. Its bonded faux-leather cover has the look & feel of genuine black leather. A must have padfolio for all working professionals\",\"Function Meets Design The minimalistic design creates a clutter-free and functional business portfolio. Includes a writing notepad and features a contrasting color scheme of the black exterior & cream stitching\",\"Compact Size Smaller mini size portfolio organizer is thin and sleek. Made to fit easily into most purses, bags, or briefcases when you\'re on the go. Great interview padfolio to hold paper documents or business cards\",\"Easy Paper Organization Organize letters, loose pages, IDs, envelopes, papers, documents and business cards with ease using interior pockets and compartments in this mini padfolio\",\"Convenient Storage This portfolio has an interior pocket that can be used to store a mini notebook and 5 x 8 inch documents. It can also be used as a tablet pocket for most tablets up to 7.9 inch size\"]'),
(904, 3, 695, 'Ailun Screen Protector Compatible for iPhone 11 / iPhone XR [6.1 Inch], 3 Pack Tempered Glass', 'Related Product iPhone 11/XR Add to Cart iPhone 11 Pro Add to Cart iPhone 11 Pro Max Add to Cart iPhone 11 Add to Cart iPhone 11/XR Add to Cart iPhone 11 Pro Add to Cart iPhone 11 Pro Max Buying Options Customer Reviews 4.5 out of 5 stars 572,524 4.6 out of 5 stars 16,083 4.6 out of 5 stars 16,083 4.6 out of 5 stars 16,083 4.5 out of 5 stars 18,940 4.5 out of 5 stars 13,229 4.5 out of 5 stars 13,229 Price $5.88$5.88 $6.89$6.89 $6.89$6.89 $6.89$6.89 $6.98$6.98 $7.89$7.89 � Brand Ailun Ailun Ailun Ailun Ailun Ailun Ailun Color Clear Clear Clear Clear Black Black Black Compatible Models iPhone 11/iPhone XR iPhone 11 Pro iPhone 11 Pro Max iPhone 11 iPhone 11/iPhone XR iPhone 11 Pro iPhone 11 Pro Max Display Size 6.1 inch 5.8 inch 6.5 inch 6.1 inch 6.1 inch 5.8 inch 6.5 inch Quantity 3 Pack 2+2 Pack 2+2 Pack 2+2 Pack 2 Pack 2+2 Pack 2+2 Pack Features Screen Protection Screen+Lens Protection Screen+Lens Protection Screen+Lens Protection Privacy Screen Protection Privacy Screen+Lens Protection Privacy Screen+Lens Protection The video showcases the product in use.The video guides you through product setup.The video compares multiple products.The video shows the product being unpacked. 1. The flexibility of the glass screen protector is the same as the plastic material, is it tempered glass or plastic? This screen protector is a real tempered glass. The plastic flexibility is the exact reason why we call it tempered glass screen protector. Tempered glass is a type of safety glass that is stronger than ordinary glass. 2. It cannot be seen from the appearance that it is glass or plastic. As a customer, what can we do to identify it? There is an easy, quick, cost-effective way to test it yourself, and it\'s very accurate. Most plastics have a melting point between 160 and 210 degrees Celsius, and glass materials are at least over 1400 degrees Celsius, so is there a lighter around? 3. Does it come with a cleaning wipe to use prior to placing on the phone? Yes, the package includes: 6*Guide Stickers, 3*Wet Wipe&3*Dry Wipe,3*Dust Absorber. 4. How can I remove bubbles? Use the kit in the package to clean the screen before placing the screen protector. If there are bubbles,try to gently press the bubbles with your finger or with a ruler,but the screen surface needs a thin cloth pad to avoid scratching the protector. 5. How can I remove a cracked glass screen protector? Lift the screen protector with the card from any corner of the screen protector, then hold the corner and remove slowly. (If you find CHIP or CRACK on the screen protector, for your safety, please wear gloves when removing the screen protector.)', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/81MZ5D1wHpL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/81MZ5D1wHpL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/713LD6xbHQL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81Y8IOtTvrL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81Xzo3AnD1L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71pf98FKK6L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81X2OoQEtaL._AC_SL1500_.jpg\"]', '{"brand": "Ailun", "category": "Cell Phones & Accessories", "dimensions": "6.5 x 3.54 x 0.5 inches"}', '[\"WORKS FOR iPhone 11/iPhone XR (2019/2018 release) 6.1 Inch display ,0.33mm tempered glass screen protector. Featuring maximum protection from scratches, scrapes, and bumps.[Not for iPhone 11 Pro/iPhone Xs/X 5.8 inch, iPhone 11 Pro Max/iPhone Xs Max 6.5 inch]\",\"Specialty Due to the rounded design of the iPhone 11/XR and to enhance compatibility with most cases, the Tempered glass does not cover the entire screen. HD ultra-clear 99.99% touch-screen accurate.\",\"hydrophobic and oleophobic screen coating protects against sweat and oil residue from fingerprints.\",\"It is 100% brand new,Precise laser cut tempered glass, exquisitely polished,2.5D rounded edges.\",\"Online video installation instruction can be found at the last image slot Easiest Installation - removing dust and aligning it properly before actual installation,enjoy your screen as if it wasn\'t there.\"]'),
(905, 10, 179, 'Gorilla Super Glue Pen, Cyanoacrylate Glue, Fast Setting, Precise Dispensing Pen Shaped Applicator, Clear, 5.5g (Pack of 1)', 'Our same strong and reliable Super Glue liquid formula, now in an intuitive pen-shaped applicator. Gorilla Super Glue Pen dispenses super glue in an uninterrupted line, providing maximum control while fitting comfortably in hand. Formulated for impact resistance and strength.Dries in 10-45 seconds, no clamping required. Anti clog cap helps keep glue from drying out.Bonds plastic*, wood, metal, ceramic, rubber, leather, paper and more! (*Not recommended for use on polyethylene or polypropylene plastic.)Directions:1. Protect work area from spills.2. Clean and dry surfaces to be bonded.3. To open, place blue cap onto top opening of pen. Turn cap clockwise until it no longer turns. The white base of the blue cap should not be visible when fully attached.4. Remove cap by turning counterclockwise to reveal nozzle.5. To dispense, press orange button. The harder you push, the more glue will dispense.6. Apply a small amount of Gorilla� Super Glue to one surface. Only one drop per sq. inch recommended. Set time can vary based on amount of glue and type of surface glued. Excess glue can cause delayed or failed bond.7. Press the two surfaces together for about 10-45 seconds. Wait 24 hours for full cure.8. After using, clean nozzle with a dry cloth and replace outer cap. Store in a cool, dry place away from children and animals.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/71jK0v2QbpL._SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/71jK0v2QbpL._SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81ngq7NQhaL._SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81oTGPxbT3L._SL1500_.jpg\",\"https://m.media-amazon.com/images/I/91az+LuZUYL._SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81E6YdxHZ9L._SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81xVCvXjT-L._SL1500_.jpg\"]', '{"brand": "Gorilla", "category": "Industrial & Scientific", "dimensions": "1.3 x 3.38 x 7.62 inches; 1.28 ounces"}', '[\"EASY APPLICATION & COMFORTABLE HOLD Dispenses super glue in an uninterrupted line, while applying little pressure\",\"IMPACT TOUGH Formulated for impact resistance and strength\",\"FAST-SETTING Dries in 10-45 seconds, no clamping required\",\"ANTI CLOG CAP Helps keep glue from drying out\",\"VERSATILE Bonds plastic*, wood, metal, ceramic, rubber, leather, paper and more!\"]'),
