(907, 3, 697, 'for iPhone 16 Pro Max Case with Card Holder & Kickstand & Slide Camera Lens Cover, Silicone Edge Protection Rugged Heavy Duty Phone Case Cover for iPhone 16 Pro Max 6.9\'\' 5G, Black', 'The video showcases the product in use.The video guides you through product setup.The video compares multiple products.The video shows the product being unpacked.     Is this case suitable for iPhone 16 Pro Max? Yes, our iPhone 16 Pro Max case is fully compatible with iPhone 16 Pro Max 6.9\'\' 5G 2024, not compatible for 16Pro/16/16Plus. How many cards will fit in this card holder ? Our iPhone 16 Pro Max wallet case can hold up to 3-5 cards and some cash (depending on their thickness). Does the iPhone 16 Pro Max Case have a stand? Our iPhone 16 Pro Max phone case comes with a hidden camera stand and card stand, which can be adjusted to 0-180� and in various ways. Does this iPhone 16 Pro Max Case support wireless charging? So sorry! Our multi-functional iPhone 16 Pro Max wallet phone case doesn\'t support wireless charging and RFID functions. Putting on camera lens protector will affect the opening and closing of the camera cover? Our iPhone 16 Pro Max case have a sliding lens cover to protect the phone\'s lens, so don\'t have to use additional lens protection film.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/71-Xsdcf7vL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/71-Xsdcf7vL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/718XNPtTyrL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71fd01r6ydL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71yAqTItbWL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71f4ucXQjaL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71ecEYEJbGL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71Wh0iIuDOL._AC_SL1500_.jpg\"]', '{"brand": "SSLOTSCASE", "category": "Cell Phones & Accessories", "dimensions": "7.01 x 3.54 x 0.94 inches"}', '[\"[Perfe