h 55 dB ultra-low noise level will give you a quiet and smooth shredding experience; It will quietly shred a large amount of paper for a long time without disturbing your work and rest\",\"Easy to Use & Jam Proof 3 button control (Power On, Forward, Reverse) and LED light indicators (Power On, Overheat, Overload, Bin Open, Bin Full); Overheating (Red Light On) and Overloading (Red Light Flashing) protection systems make it safer to use\",\"Professional Support BONSEN commercial paper shredder comes with professional customer service at all times; Please refer to the user manual and troubleshooting guide before use\"]'),
