(920, 1, 706, 'Skullcandy Hesh Evo Wireless Headphones with Charging Cable, 36 Hr Battery, Microphone, Works with iPhone Android and Bluetooth Devices - True Black', 'You don�t have to shell out hundreds of dollars for full, rich sound and wireless freedom. Hesh Evo� gives you all that and much more for far less than other so-called �premium� headphones. The 4th generation Hesh Evo combines a proven design with all the features you need and none that you don�t. All controls � call, track change, and volume � are right at your fingertips with easy-to-use tactile buttons. Don�t remember where you left your headphones? Don�t sweat it � Hesh Evo comes with Tile� finding technology built-in. Battery life is an impressive 22 hours. Even more impressive, Rapid Charge capability provides 3 hours of listening time on only 10 minutes of charge. Hesh Evo is travel-ready, too. It folds flat to fit perfectly into your bag. With included Line USB-C to C cable, you can get charged with universally accepted, ultra high quality, charging cable to get your headphones or other devices back to 100% as soon as possible.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/714rWTJzaEL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/714rWTJzaEL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/517VCMH33DL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61iWLbpar7L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61bXmZvCSOL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71SJ9m7u6PL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81KX7Hm2Y2L._AC_SL1500_.jpg\"]', '{"brand": "Skullcandy", "category": "Electronics", "dimensions": "8.07 x 4.33 x 10.83 inches"}', '[\"Supreme Audio - With powerful 40mm drivers and exceptional acoustics your favorite tunes will be crystal clear. For the affordable price of the Hesh Evo it reigns over the competition and provides the best sound quality in class.\",\"36 hours battery - Whether you\'re on the road and can\'t charge or you\'re on a 36 hour gaming session the Hesh Evo will have your back. Plus, use rapid charge and a quick 10 minute charge will give you 3 hours of listening.\",\"Sick Fit - Ames writes \'cushiony and plush. Has nice squish at the top of the headpiece and there\'s a lot of cushioning where it goes over your ears\' We couldn\'t have said it better. Don\'t forget the soft headband and noise isolating design.\",\"Never lost with Tile - With Tile tech, Skullcandy makes it super easy to track down either headphones and keep your gadgets safe. Download the Tile app and follow the instructions to activate.\",\"Includes a bonus Skullcandy charging cable\",\"Buy with Confidence - 1 year US warranty included\"]'),
(921, 4, 23, 'Alpine Corporation 25\" Tall Outdoor Ceramic Antique Pedestal Birdbath with 2 Bird Figurines, Turquoise', 'Beckon feathered friends to your yard with the Alpine Corporation Ceramic Antique Pedestal Birdbath with 2 Bird Figurines. Fill the bath with fresh water and enjoy watching all the birds congregate near your patio, garden, deck, yard, or pool! This high-quality birdbath features a gorgeous turquoise hue with an antique finish � great for adding a pop of color to your outdoor d�cor. It is perfect for pairing with a bird feeder to coax a variety of birds outside your window. The sturdy pedestal keeps the birdbath from tipping over while the ceramic construction withstands weather changes. Your yard will be the delight of humans and winged creatures alike! With a 1-year warranty, you can be confident in the quality of your purchase. Birdbath measures 19\"L x 16\"W x 25\"H for use in yards of any size. Alpine Corporation is one of America\'s leading designers, importers, and distributors of superior quality home and garden decor products. Alpine Corporation\'s award winning in-house design team continuously develops new and innovative \"statement pieces\" for your home and garden. Your indoor and outdoor living spaces will be the envy of the neighborhood with our wide assortment of fresh, fashionable and contemporary products, from beautifully crafted solar garden stakes featuring patented motion and fiber optic lighting technology to beautiful fountains and delightful bird baths and feeders.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/81vUanymcSL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/81vUanymcSL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/91ZSNitxeeL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81q8wzyVLnL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81Y-ad4ExnL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/91oPlNK2ByL._AC_SL1500_.jpg\",\"https://