eed to use chemical solution to wipe off the glue. 4.Cutting hard materials such as metals for long periods of time can affect blade life. Steps for Using Paper Cutter -1 1. The removable magnetic positioning ruler is used to locate the size to be cut and placed anywhere on the front of the base according to your own use requirements. Steps for Using Paper Cutter -2 2. Open the removable blade to the right and detach it from the safety latch that secures the blade. Steps for Using Paper Cutter -3 3. Position the ruler to locate the required size, put the paper, and flatten the paper by hand (to prevent the paper from deviating in the cutting process resulting in not cutting straight). Steps for Using Paper Cutter -4 4. Grab the upper blade cut down, cutting when the upper blade slightly stronger to the lower blade to increase the bite to achieve the effect of cutting off, cutting completed the upper blade lock to the safety latch inside. Steps for Using Paper Cutter -1 Steps for Using Paper Cutter -2 Steps for Using Paper Cutter -3 Steps for Using Paper Cutter -4 ZEQUAN Guillotine Paper Cutter, 12 Inch Cut Length Guillotine with 8 Sheet Ca... A3 Heavy Duty Paper Cutter, 17\";Guillotine Paper Cutter, High-Speed Steel Blad... ZEQUAN Paper Cutter 18 inch, Wrapping Paper Cutter 18\"; Cut Length Large Paper... ZEQUAN A3 Paper Cutter Slider Portable Trimmer - 18 Inch Paper Trimmer for Sc... ZEQUAN 9 Inch Laminator Machine, 10 in 1 A4 Cold Thermal Laminator Machine, 3... Add to Cart Add to Cart Add to Cart Add to Cart Add to Cart Price $20.99$20.99 $231.60$231.60 $29.99$29.99 $25.64$25.64 $34.99$34.99 material', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/71s4uU0G1iL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/71s4uU0G1iL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71hJ1lLimSL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/710FAzh0wbL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71kJW+tKSR