d locking mail drop box. From clinic to business to home, this secure drop box is a must have!\",\"DURABLE MATERIAL Made of cold rolled steel, this heavy duty metal lock box provides great protection for valuable and private items, including specimen, rents, keys, and cash. The edges are carefully designed and manufactured, so this over door dropbox cannot be pried open by force.\",\"FOR HOME AND BUSINESS Whether you are a property manager who needs a payment dropbox to collect rent, a lab technician who needs a specimen collection containers, or a renter who needs a secured mailbox without drilling your wall or door, this hanging door drop box is the perfect safe drop box you need!\",\"EASY AND QUICK SETUP We know it is frustrating and time consuming to cut a hole on your door or wall, which is why we designed a user friendly steel mailbox! Just hang the dropbox over your door, close it, and you can easily collect the items you need when you are away or outside of business hours.\",\"SMALL MAT INCLUDED This metal dropbox comes with a rubber mat that absorbs the shock of dropping objects, and also prevents the items from scratching the bottom of the over door drop box. In addition, the rubber mat can serve as a moisture resisting factor to keep the items from getting damped.\",\"RUBBER CUP ON THE BACK This specimen lockbox comes with little rubber circles on the back of the steel box, so the surface of your door can be protected from scratches and scrapes when adjusting the height of the medical dropbox, or when simply moving the specimen collection box.\"]'),
