(962, 2, 650, 'Faber-Castell Graphite Sketch Pencil Set - 6 Graphite Pencils (2H, HB, B, 2B, 4B, 6B), Drawing Pencils and Sketching Supplies', 'Bring your ideas from pencil to paper with Faber-Castell Graphite Pencils! Write, draw and sketch with versatile graphite leads ideal for adding detail, shading and writing. The Faber-Castell Graphite Sketch Pencil Set is ideal for the aspiring artist and art student. This artist quality graphite pencil set provides versatile and diverse drawing pencils that are ideal for sketching, graphic design, shading, urban sketching, mixed media art, dimension art and portraits. This is a complete sketching pencil set that includes 6 Faber-Castell graphite sketching pencils. Faber-Castell graphite pencils feature pre-sharpened, break-resistant leads that are glued the entire length of the pencil to ensure the lead will not fall out during use or sharpening. The break-resistant lead is a mixture of finely ground graphite and clay to ensure a smooth, balanced and easy laydown, perfect for shading! The graphite pencils are available in 6 degrees of hardness: 2H, HB, B, 2B, 4B, 6B. Since 1761, Faber-Castell has proudly created art and school supplies for kids, adults and professional artists alike. Elevate your skill and work by using the flexible and durable Faber-Castell graphite pencils that are ideal for the art student and aspiring artist.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/81yOYt658kL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/81yOYt658kL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/916rnDqiHrL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/91MQVO9PFrL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/91MB6nQszPL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/91LGRaWj5jL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/91CtDYBzaqL._AC_SL1500_.jpg\"]', '{"brand": "Faber-Castell", "category": "Office Products", "dimensions": "0.5 x 2.25 x 7.38 inches"}', '[\"VERSATILE GRAPHITE PENCILS - Faber-Castell graphite pencils are a diverse and versatile tool for artists and beginners alike! The ergonomic, hexagonal shape and smooth graphite is ideal for sketching, graphic design, and shading.\",\"SKETCHING PENCIL SET - Includes 6 artist quality Faber-Castell graphite pencils in various degrees of lead hardness 2H, HB, B, 2B, 4B, 6B. Made of finely ground graphite and clay, Faber pencils provide a smooth and balanced laydown for superior performance\",\"BREAK-RESISTANT LEAD - Faber-Castell graphite pencils feature a break-resistant lead that is glued the entire length of the pencil to ensure limitless drawing and easy sharpening\",\"MADE FROM REFORESTED WOOD - Faber-Castell graphite pencils are proudly manufactured with carbon neutral production and using reforested wood grown from FSC certified sustainable forestry. The CO2 emissions caused by the manufacturing process of this item are neutralized by certified projects.\",\"QUALITY SKETCHING SUPPLIES - Since 1761, Faber-Castell has proudly created art and school supplies for kids, adults and professional artists alike. Faber-Castell Sketch Pencil Set provides durable, flexible, and quality drawing supplies for the art student and aspiring artist\"]'),
(963, 2, 43, 'Mount-It! Keyboard Tray Under Desk with Adjustable Mouse Platform � Easy-Glide Sliding Keyboard Drawer Under Desk Slide Out � Ergonomic Under Desk Keyboard Shelf for Office, Gaming, and Workstations', 'Mount-It! Keyboard Drawer Under Desk With Mouse Platform, Easy-Glide Sliding Under-Counter Computer Keyboard Tray 21 Inch Wide, Black Maximize desk space and create a more efficient workspace simply by adding this under the desk sliding keyboard shelf to the mix. It has ample space for your keyboard and other office items if desired, as well as an attached mouse tray that mounts either on the left or right side of the keyboard tray. The pull out keyboard tray features a steel ball bearing track for a smooth and silent sliding action. Easily slide it out when in use and slide it back in when not in use to keep it hidden and out of the way. Install it at 3 different height levels to customize it to your height and positioning. This ergonomic setup allows you to keep your elbows bent at the optimal angle to reduce strain on your wrists and arms and to help prevent carpal tunnel. This tray is built with comfort in mind with its rounded off front edge, or waterfall edge as we call it, to keep your forearms and wrists comfortable while typing. It also features a sliding clamp on the keyboard tray surface to securely lock your keyboard in place. Product Features and Specifications Maximize your precious office space with this tray�s ability to slide in and out from under your desk 3 preset heights adjustable up to 1.25 inches Ball bearing track for a smooth sliding action Rounded edge for wrist and forearm comfort while typing Ample space sitting at 21 inches wide and 11.75 inches deep Sliding mouse tray can be mounted on the left or right side of the keyboard tray Easy installation lets you start feeling the difference right away', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/71g0hbyXbKL._AC_SL1500_.jpg', '[\"https://m.med