(966, 4, 23, 'Alpine Corporation 23\" Tall Outdoor Metal Bird Bath Stand D�cor Accessory, Black', 'Beckon feathered friends to your yard with the Alpine Corporation Bird Bath Stand. Place your favorite basin on the stand to immediately create an oasis for your favorite birds. This stand is made of durable iron with a stylish black finish and features rubber tips to securely hold the birdbath basin in place for years of quality use. It is also foldable for easy transportation or storage. It is perfect for pairing with a variety of birdbath bowls to coax a variety of birds outside your window during any season. Your yard will be the delight of humans and winged creatures alike! With a 1-year warranty, you can be confident in the quality of your purchase. Bird bath stand measures 18\"L x 18\"W x 23\"H for use in yards of any size. Alpine Corporation is one of America\'s leading designers, importers, and distributors of superior quality home and garden decor products. Alpine\'s award winning in-house design team continuously develops new and innovative \"statement pieces\" for your home and garden. Your outdoor living spaces will be the envy of the neighborhood with our wide assortment of fresh, fashionable and contemporary products, from beautifully crafted solar garden stakes featuring patented motion and fiber optic lighting technology to gorgeous glass and glow-in-the-dark birdbaths and feeders.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/61In293JbNL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/61In293JbNL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/715mySXvCqL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/91PpaDyJSfL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/819PZzMMojL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71MDeajNtjL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/A1-Y0wUQfHL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61PzkftdhIL._AC_SL