(967, 2, 477, 'Texas Instruments TI-36X Pro Engineering/Scientific Calculator | 9.7 Inch | Black.', 'Product Description Ideal for curricula in which graphing technology may not be permitted. Amazon.com Ideal for students at every level, from junior high school algebra to college calculus, the Texas Instruments TI36 packs a lot of punch in a small, inexpensive unit. This solar-powered calculator combines features for statistical analysis, Boolean logic operations, and unit conversions in one sleek package.Math students will appreciate TI36X\'s ability to perform fractional equations and calculate angle units (radians, grads, degrees) when performing trigonometric functions. Everyone will find the calculator\'s English/metric conversions helpful.The TI36Xs single-line LCD is a little difficult to read when the unit is lying on a desk, and users in need of graphing functions will have to look elsewhere. Overall, however, for a calculator in this price range, the TI36X provides enough power for most high-level math and science needs.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/51bthC5dcmL._AC_SL1200_.jpg', '[\"https://m.media-amazon.com/images/I/51bthC5dcmL._AC_SL1200_.jpg\",\"https://m.media-amazon.com/images/I/81nXXBaovUL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/51ydW3KF9cL._AC_SL1133_.jpg\",\"https://m.media-amazon.com/images/I/61ZGW4MABIL._AC_SL1000_.jpg\",\"https://m.media-amazon.com/images/I/61v+LZo5JAL._AC_SL1500_.jpg\"]', '{"brand": "Texas Instruments", "category": "Office Products", "dimensions": "9.76 x 6.77 x 0.1 inches"}', '[\"Ideal for curricula in which graphing technology may not be permitted.\",\"MultiView display shows multiple calculations at the same time on screen.\",\"MathPrint shows math expressions, symbols and stacked fractions as they appear in textbooks\",\"Ideal for high school through college Algebra 1 & 2, Geometry, Trigonometry, Statistics, Calculus, Biology, etc.\",\"Convert fractions, decimals and terms including Pi into alternate representations.\",\"Select degrees/radians, floating/fix, number format modes.\"]'),
(968, 2, 260, 'DURABLE Wall Mounted Reference System, 10 Double-Sided Panels, Letter-Size, Assorted Colors, SHERPA Design (554100)', 'The Sherpa Wall Reference System from Durable has with 10 glare-free sleeves with 20 viewing sides made of polypropylene. Its contemporary design includes rugged frames in assorted colors - two each in black, red, dark blue, green, and yellow. The Sherpa Reference System\'s wall bracket is specially angled to keep sleeves open. The system is easily expandable by adding multiple wall systems sided by side. Included are 10 letter size sleeves (20 viewing sides), 10 snap-on tabs, wall bracket, and wall mounting hardware. Also available with frames in light gray (DBL5541-10).', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/81-Y2VQZtBL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/81-Y2VQZtBL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/91p4x2lmKfL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/91HO26rvx8L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/91-WX1kg1PL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/91x5kgqsVgL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81XIJCIhvjL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81-EB07uSaL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/813VBxhNjjL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/816DyQIIxnL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/91yAqpg89KL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/91ZeiMCi3GL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/91kC-Eq-QtL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/91L-G9EsATL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/919UDmChlTL._AC_SL1500_.jpg\"]', '{"brand": "Durable", "category": "Office Products", "dimensions": "15.5 x 10.5 x 4 inches"}', '[\"FIND INFORMATION FAST provides easy access to information you need every day - 10 sleeves display up to 20 letter-si