(969, 3, 12, 'Belkin Portable Charger, Power Bank 10,000mAh, 23W w/Integrated Lightning Cable & USB-C Cable - iPhone Charger Battery Pack for Apple iPhone 16, 15, 14, Galaxy S25, Pixel 9, Travel Essentials - Black', 'The Belkin BoostCharge Plus Portable Charger Power Bank is the perfect way to charge your smartphones and tablets on-the-go. The BoostCharge 10k mAh portable charger features a built-in lightning cable (MFi) and USB-C cable so you can recharge your favorite devices without having to worry about separate cables. The convenience doesn�t stop there, because Belkin BoostCharge Plus also supports pass-through charging*, which allows you to charge both your power bank and connected device at the same time with up to 18W. With a super high capacity of 10,000 mAh, the battery pack can keep your devices charged all day. And you will always know when your power bank needs to be charged, with the onboard LED indicator light quickly and easily displaying the battery status of your portable charger. *Pass-through charging of the portable charger is supported when the power bank is above 25% charge. **Maximum?additional video playback hours calculated by comparing the?mAh?capacity of this power bank with the maximum video?playback hours achievable by the?iPhone?12?under normal conditions. Actual results will vary depending on differing?factors for?individual users. Specifications: Dimensions: 2.9� x 6.1� x 0.7� Weight: 0.5 lbs. Compatibility: Apple iPhone 16 Series, iPhone 15 Series, iPhone 14 Series, Samsung Galaxy S25 Series, Galaxy S24 Series, Galaxy S23 Series, Google Pixel, iPad Pro, Tablet, MacBook Pro, and more', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/51j3+v5AuNL._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/51j3+v5AuNL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61wUvUNnz+L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/61Smcz3FjdL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/image