(970, 5, 265, 'Westcott LetterCraft Stencil, Brush Font, 3-Inch Characters (SB3/15831)', 'Westcott LetterCraft Stencils are the perfect answer to great lettering. Perfect for home, school, or office, they are easy to use for posters, signs, reports, or anywhere stylish lettering is needed. Their smooth die-cut edges provide a sharp outline for tracing, and their non-glare blue plastic stencil guides make letter alignment a snap. Lettering Stencil Guides are available in Brush, Gothic, Helvetica, Stencil Roman, and Bold Italic typefaces. Westcott Drafting and Drawing Tools are some of the finest products of their kind for students and professionals. Our commitment to meticulous quality and cutting edge innovation in measurement and art materials has earned an unparalleled reputation.', '2025-03-13 09:10:45', '2025-03-13 09:10:45', 'https://m.media-amazon.com/images/I/81CKqxeP75L._AC_SL1500_.jpg', '[\"https://m.media-amazon.com/images/I/81CKqxeP75L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/91wvPqogGeL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/812axFa7PiL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/71CBKmUVq4L._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/81xEMAOHCVL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/91F4dlfeJyL._AC_SL1500_.jpg\",\"https://m.media-amazon.com/images/I/910NkLSC5KL._AC_SL1500_.jpg\"]', '{"brand": "Westcott", "category": "Arts, Crafts & Sewing", "dimensions": "4.75 x 0.25 x 10.25 inches"}', '[\"REUSABLE STENCILS Plastic stencils contains A-Z and various punctuation symbols; Simply wipe off and store away for future use\",\"CONVENIENT DESIGN with smooth die cut edges provide sharp outline tracing, makes your DIY projects easy\",\"EASY TO USE Transparent letter stencil allows you to see your work surface making alignment easy\",\"MULTI PURPOSE LetterCraft stencils are perfect for posters, signs, reports, or anywhere stylish lettering is needed\",\"MULTIPLE OPTIONS Fun collectible stencil