(975, 1, 736, 'Targus CityLite Laptop Briefcase Shoulder Messenger Bag for 15.6-Inch Laptop, Black (TBT053US)', 'The Targus Classic Slim Briefcase laptop bag is a thin, lightweight 15.6 inch laptop case equipped to store all of your essentials on the go. With dimensions of 16.25\"L x 4.5\"W x 12.25\"H and weighing 2 pounds, this smart briefcase is a great computer bag for laptops and fits laptops up to 15.6 inches. A slim laptop bag perfect for carrying everything you need and nothing you don\'t. Works great with devices and laptops below 16 inches. The large laptop bag has a spacious front pocket and includes smartly organized compartments to store your smartphone, pens, business cards, adapters, cords, and other accessories. Keep your devices easily accessible while you go through TSA checkpoints. The padded shoulder strap and luggage trolly strap sits conveniently on your rolling bag designed for women for work travel. Whether you\'re looking for a travel laptop bag or just a black laptop bag, this beautifully designed briefcase will give you confidence. Its professional look makes this laptop briefcase the perfect work bag for men and women. Constructed of durable polyester material, the case includes metal, contoured zipper pulls, comfortable padded handles and shoulder strap makes a comfortable laptop shoulder bag. Whether commuting between home and the office or traveling to meet clients, this laptop messenger bag will keep you organized with all the essentials. While you\'re looking for computer bags for laptops, notice the ergonomic shoulder strap adds comfort and a support. The large back slip pocket is great for storing files and documents and the ncluded trolley strap makes it easy to strap this case onto rolling luggage. If you\'re looking for a mens laptop bag for someone special or office bags for women, this slim briefcase is light and easy to carry anywhere you go. When you buy Targus products you\'re getting a quality laptop travel bag you\'ll love